(87, '901eed36-888c-4cc9-9683-811197e7d006', 1, 'Create', 'App\\Opportunity', 9, 'App\\Opportunity', 9, 'App\\Opportunity', 9, '', 'finished', '', '2020-03-19 13:37:11', '2020-03-19 13:37:11', NULL, '{\"name\":{\"ka\":\"Call for European School Summer Camp 2020 in Georgia\",\"en\":\"Call for European School Summer Camp 2020 in Georgia\"},\"description\":{\"ka\":\"LEPL \\u201eYouth Agency\\u201d of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.\\n\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.\\n\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.\\n\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.\\n\\nThe application deadline is Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia. \\n\\nYouth Agency has been implementing this project since 2018. Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community. \\n\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership\\u2019s \\u201c20 Deliverables for 2020\\u201d.\\n\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).\",\"en\":\"LEPL \\u201eYouth Agency\\u201d of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.\\n\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.\\n\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.\\n\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.\\n\\nThe application deadline is Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia. \\n\\nYouth Agency has been implementing this project since 2018. Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community. \\n\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership\\u2019s \\u201c20 Deliverables for 2020\\u201d.\\n\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).\"},\"date\":{\"ka\":\"April 16\",\"en\":\"April 16\"},\"address\":{\"ka\":\"\\u10d7\\u10d1\\u10d8\\u10da\\u10d8\\u10e1\\u10d8, \\u10d5\\u10d0\\u10df\\u10d0-\\u10e4\\u10e8\\u10d0\\u10d5\\u10d4\\u10da\\u10d0\\u10e1 \\u10d2\\u10d0\\u10db\\u10d6\\u10d8\\u10e0\\u10d8 N76\\u10d1\",\"en\":\"\\u10d7\\u10d1\\u10d8\\u10da\\u10d8\\u10e1\\u10d8, \\u10d5\\u10d0\\u10df\\u10d0-\\u10e4\\u10e8\\u10d0\\u10d5\\u10d4\\u10da\\u10d0\\u10e1 \\u10d2\\u10d0\\u10db\\u10d6\\u10d8\\u10e0\\u10d8 N76\\u10d1\"},\"phone\":\"599 423 004\",\"latitude\":\"41.723090\",\"longitude\":\"44.731563\",\"start_date\":\"2020-03-20 08:00:00\",\"end_date\":\"2020-04-16 08:00:00\",\"schedule_date\":\"2020-03-19 08:00:00\",\"order\":\"2\",\"fb_page\":\"https:\\/\\/www.facebook.com\\/events\\/2336261993141773\\/\",\"linkedin_page\":null,\"web_page\":\"fund@youthagency.gov.ge\",\"application_url\":\"https:\\/\\/docs.google.com\\/forms\\/d\\/e\\/1FAIpQLSdraER_wXYmFSjd_RzAhSvUjyhuqzzpmRA6KyrhGPtx7S_TkQ\\/viewform\",\"opportunity_status_id\":1,\"company_id\":1,\"updated_at\":\"2020-03-19 13:37:11\",\"created_at\":\"2020-03-19 13:37:11\",\"id\":9}'),
