 Eastern Neighbourhood region and one of the Eastern Partnership\\u2019s \\u201c20 Deliverables for 2020\\u201d.\\\\n\\\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).\\\", \\\"ka\\\": \\\"LEPL \\u201eYouth Agency\\u201d of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.\\\\n\\\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.\\\\n\\\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.\\\\n\\\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.\\\\n\\\\nThe application deadline is Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia. \\\\n\\\\nYouth Agency has been implementing this project since 2018. Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community. \\\\n\\\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership\\u2019s \\u201c20 Deliverables for 2020\\u201d.\\\\n\\\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).\\\"}\",\"address\":\"{\\\"en\\\": \\\"\\u10d7\\u10d1\\u10d8\\u10da\\u10d8\\u10e1\\u10d8, \\u10d5\\u10d0\\u10df\\u10d0-\\u10e4\\u10e8\\u10d0\\u10d5\\u10d4\\u10da\\u10d0\\u10e1 \\u10d2\\u10d0\\u10db\\u10d6\\u10d8\\u10e0\\u10d8 N76\\u10d1\\\", \\\"ka\\\": \\\"\\u10d7\\u10d1\\u10d8\\u10da\\u10d8\\u10e1\\u10d8, \\u10d5\\u10d0\\u10df\\u10d0-\\u10e4\\u10e8\\u10d0\\u10d5\\u10d4\\u10da\\u10d0\\u10e1 \\u10d2\\u10d0\\u10db\\u10d6\\u10d8\\u10e0\\u10d8 N76\\u10d1\\\"}\"}', '{\"date\":\"{\\\"en\\\":\\\"<p>April 16<\\\\\\/p>\\\",\\\"ka\\\":\\\"<p>April 16<\\\\\\/p>\\\"}\",\"description\":\"{\\\"en\\\":\\\"<p>LEPL &bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia. Young people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp. The summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region. The camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people. The application deadline is Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia. Youth Agency has been implementing this project since 2018. Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community. The establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;. DUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).<\\\\\\/p>\\\",\\\"ka\\\":\\\"<p>LEPL<\\\\\\/p>\\\\n\\\\n<p>&bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia. Young people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp. The summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region. The camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people. The application deadline is Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia. Youth Agency has been implementing this project since 2018. Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community. The establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;. DUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).<\\\\\\/p>\\\"}\",\"address\":\"{\\\"en\\\":\\\"<p>\\\\u10d7\\\\u10d1\\\\u10d8\\\\u10da\\\\u10d8\\\\u10e1\\\\u10d8, \\\\u10d5\\\\u10d0\\\\u10df\\\\u10d0-\\\\u10e4\\\\u10e8\\\\u10d0\\\\u10d5\\\\u10d4\\\\u10da\\\\u10d0\\\\u10e1 \\\\u10d2\\\\u10d0\\\\u10db\\\\u10d6\\\\u10d8\\\\u10e0\\\\u10d8 N76\\\\u10d1<\\\\\\/p>\\\",\\\"ka\\\":\\\"<p>\\\\u10d7\\\\u10d1\\\\u10d8\\\\u10da\\\\u10d8\\\\u10e1\\\\u10d8, \\\\u10d5\\\\u10d0\\\\u10df\\\\u10d0-\\\\u10e4\\\\u10e8\\\\u10d0\\\\u10d5\\\\u10d4\\\\u10da\\\\u10d0\\\\u10e1 \\\\u10d2\\\\u10d0\\\\u10db\\\\u10d6\\\\u10d8\\\\u10e0\\\\u10d8 N76\\\\u10d1<\\\\\\/p>\\\"}\"}'),
