(4, '{\"en\": \"ევროპის ახალგაზრდული ასოციაცია\", \"ka\": \"ევროპის ახალგაზრდული ასოციაცია\"}', 'eyaexchange@gmail.com', '599505270', '597111087', '4480526233', 1, '{\"en\": \"<p>საქართველო, ხულოს რაიონი, სოფ. ოქრუაშვილები, მე&ndash;5 I ჩიხი, N 4</p>\", \"ka\": \"<p>საქართველო, ხულოს რაიონი, სოფ. ოქრუაშვილები, მე&ndash;5 I ჩიხი, N 4</p>\"}', '$2y$10$BA4X3hx8j/EDodoUIlacZuAAZ.iwYEf0GOm/tejmHjTJ1LZuMRfOS', '{\"en\": \"<p>European Youth Association is international organization with the mission to promote the establishment of a modern, healthy, educated and perfect society. In order to meet this task the association has been implementing the educational a youth development programs. The aim of creating European Youth Association is to develop the youth working, volunteering in Georgia, promote solution of society&rsquo;s problems and improve the well - being of vulnerable population.The youth of European Youth Association , with the help of attracted volunteers, creates all the necessary conditions for rendering gratuitous benevolent assistance to the vulnerable people of all the different social levels of society; promotes the democratization process in Georgia by educating human rights in various regions and settlements of the country. Moreover, European Youth organization set a task to take serious measures for restoring the cleanness of environment, planting greenery in the city and drawing population&rsquo;s attention to existing ecological problems.</p>\", \"ka\": \"<p>European Youth Association aims to inform young people on European initiatives related to them.</p>\"}', 'https://www.facebook.com/europeanyouthassociationeya/', NULL, NULL, NULL, 'company_images/tXO3cNlIkOGlfyKLd79HwYCObvttC3gCWgMRTdmz.jpeg', 1, 0, 'eCbv1xx7NIJR4GNzjyDUIOqvDGwUpu2msAgGUta3GroNfXGHxlA2asKCCc8L', '2020-03-21 13:28:22', '2021-01-05 10:07:00', 'local', 'local', NULL, NULL, '0', '0', NULL),
