(25, '{\"en\": \".\", \"ka\": \"საზოგადოება \\\"ბილიკი\\\"\"}', 'societybiliki@gmail.com', '599534045', '595226278', '217889300', 1, '{\"en\": \"<p>.</p>\", \"ka\": \"<p>გორი, რუსთაველის ქ. #19/ა</p>\"}', '$2y$10$rKsol4LaDnZYJx.kudIW0.c/y0S5PXIwxJI6xoDZwPP03JGpBqNri', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>&quot;ბილიკი&quot; მუშაობს: სოციალურად დაუცველი ოჯახის ბავშვები, დევნილი ოჯახების შვილები, შიდა ქართლი სკოლების მოსწავლეები, სახელემწიფო ზრუნვის ქვეშ მყოფი ბავშვები;</p>\"}', 'https://www.facebook.com/societybiliki/', NULL, 'www.biliki.ge', NULL, 'company_images/RXanAvcw7EUybYi1aebEx7RlK3tJoyTzoIUwp6iu.jpeg', 1, 0, 'Vms2GoG9UErmhPFJLGyF4Qw3s6ayUL7meh5XMrc3I2DeM5GO5Z7dpxCHzf74', '2020-04-09 14:22:00', '2021-05-25 08:29:57', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(26, '{\"en\": \"For Bettre Future\", \"ka\": \"უკეთესი მომავლისათვის\"}', 'uketesimomavlisatvis@gmail.com', '599410250', '598316299', '205283281', 1, '{\"en\": \"<p>Georgia, Mtskheta-Mtianeti region 3318; Tserovani IDP&rsquo;s settlement str.11 cottage 1624/15</p>\", \"ka\": \"<p>საქართველო, მცხეთის რაიონი, 3318; წეროვნის დევნილთა დასახლება, ქ.11 კოტეჯი 1624/15</p>\"}', '$2y$10$T0sEk/.j.EM4feGylTKBKeZgW.2ggBcIWzWjBq/vKowpzbfyeu9Ne', '{\"en\": \"<p>The organization was established in 2009 In Tserovani IDP Settlement.</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Vision Statement</strong></p>\\r\\n\\r\\n<p>We believe that all people deserve strong civil society institutions based on active participation, freedom of speech, and corporate social responsibility</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p><strong>Mission Statement</strong></p>\\r\\n\\r\\n<p>Our mission is to strengthen Mtskheta-Mtianeti&rsquo;s civil society by supporting community members and local initiatives</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; In 2008, For Better Future joined the &ldquo;Coalition for IDP&rsquo;s Rights&rdquo; &nbsp;<a href=\\\"http://www.idp.ge/\\\">www.idp.ge</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2009, For Better Future has been member of the Civil Forum - Place For Peace <a href=\\\"http://www.civil-forum.org/\\\">www.civil-forum.org</a>&nbsp;&nbsp;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2012, For Better Future has been a member of the Regional Network of Civil Society Organizations &nbsp;&nbsp;<a href=\\\"http://www.cso.ge/\\\">http://www.cso.ge</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2012, For Better Future has been a member of the Gender Equality Network</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; From 2013-2015 and 2015-present, Peace Corps Volunteers have worked on For Better Future organization&rsquo;s team <a href=\\\"http://www.peacecorps.gov/\\\">http://www.peacecorps.gov</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2014 For Better Future is a hosting organization for EVS (European Voluntary Service). <a href=\\\"https://ec.europa.eu/programmes/erasmus-plus/opportunities-for-individuals/young-people/european-voluntary-service_en\\\">europa.eu</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2015 For Better Future has been a member of CSO Network working with&nbsp; war affected population-&nbsp; &ldquo;Movement &nbsp;for Wellbeing&rdquo; <a href=\\\"https://www.facebook.com/%E1%83%A5%E1%83%A1%E1%83%94%E1%83%9A%E1%83%98-%E1%83%9B%E1%83%9D%E1%83%AB%E1%83%A0%E1%83%90%E1%83%9D%E1%83%91%E1%83%90-%E1%83%99%E1%83%94%E1%83%97%E1%83%98%E1%83%9A%E1%83%93%E1%83%A6%E1%83%94%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1%E1%83%97%E1%83%95%E1%83%98%E1%83%A1-Network-Movement-for-Wellbeing-127458621030847/?fref=ts\\\">Network Movement for Wellbeing</a></p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2014 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a member of the Network of Social Enterprise Organizations of Georgia</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2016 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a co-founder of CSO &ldquo;Social <!--[if gte mso 9]><xml>\\r\\n <o:OLEObject Type=\\\"Embed\\\" ProgID=\\\"AcroExch.Document.DC\\\" ShapeID=\\\"_x0000_i1025\\\"\\r\\n  DrawAspect=\\\"Icon\\\" ObjectID=\\\"_1648542219\\\">\\r\\n </o:OLEObject>\\r\\n</xml><![endif]-->Enterprise Alliance&rdquo; &nbsp;&nbsp;of Georgia</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2016 For better Future&rsquo;s affiliated social enterprise &ldquo;Ikorta&rdquo; has been a member of &ldquo;Georgian Craft Association&rdquo;</p>\\r\\n\\r\\n<p>&nbsp;&nbsp; Since 2017, For Better Future signed the memorandum of cooperation together with the organization &ldquo;Interkultura&rdquo;- Republic of Macedonia and &ldquo;SV-Platform&rdquo; &ndash; from Ukraine. The purpose of the memorandum is to strengthen the cooperation and interconnection of the organizations in the economic, social, cultural, educational and scientific fields.</p>\\r\\n\\r\\n<p>&nbsp;</p>\\r\\n\\r\\n<p>Most of our organization&rsquo;s beneficiaries are IDPs from the 2008 conflict and they have limited communication with residents of the occupied territory. Therefore, the peacebuilding and conflict-resolution process for the South Ossetia region is a primary focus for our organization.&nbsp; We collaborate with international organizations and local nongovernmental organizations to promote confidence-building and dialogue techniques. Since 2009, our organization has actively participated in the Georgian-Ossetian negotiation process; bringing together civil society organizations from the Tskhinvali region and from Georgia to participate in dialogues on neutral territory. For Better Future also works with ethnic minorities in Georgia, including Ossetian people currently living in the occupied territory. One of organization&rsquo;s main priorities is to develop civil society organizations in Mtskheta-Mtianeti region and promote their affective and active civic participation.</p>\", \"ka\": \"<p>ორგანიზაცია 2009 წელს წეროვანის დევნილთა დასახლებაში შეიქმნა</p>\\r\\n\\r\\n<p><strong>ხედვა</strong></p>\\r\\n\\r\\n<p>ჩვენ გვსურს მცხეთა-მთიანეთის რეგიონში განვითარდეს ძლიერი სამოქალაქო საზოგადოება, რომელიც ეფუძნება მოქალაქეთა აქტიურობას, ინიციატივას, პასუხისმგებლობას და თავისუფლებას. გვინდა მოსახლეობა ერთვებოდეს ადგილობრივი გადაწყვეტილების მიღების პროცესებში, მოქმედებდნენ ძლიერი საინიციატივო ჯგუფები/ორგანიზაციები, ბიზნესი მოქმედებდეს მეტი სოციალური პასუხისმგებლობით და მეტი ადამიანი წარმატებით ეწეოდეს სამეწარმეო საქმიანობას.</p>\\r\\n\\r\\n<p><strong>მისია</strong></p>\\r\\n\\r\\n<p>ჩვენი მისიაა მცხეთა - მთიანეთის რეგიონში სამოქალაქო საზოგადოების გაძლიერების მიზნით შეასრულოს რესურს ცენტრის (ჰაბის) ფუნქცია და მხარი დაუჭიროს ადგილობრივ ინიციატივებსა და აქტორებს.</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2008 წლიდან ორგანიზაცია &bdquo;კოალიცია დევნილთა უფლებების&ldquo; წევრია. <a href=\\\"http://www.idp.ge\\\">www.idp.ge</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2009 წლიდან &bdquo;სამოქალაქო ფორუმის - მშვიდობის არეალის&ldquo; წევრი. <a href=\\\"http://www.civil-forum.org\\\">www.civil-forum.org</a>&nbsp;&nbsp;</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012 წლიდან სამოქალაქო საზოგადოების რეგიონალური ქსელის წევრი <a href=\\\"http://www.cso.ge\\\">http://www.cso.ge</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012 წლიდან ორგანიზაცია გენდერული&nbsp;&nbsp; გენდერული თანასწორობის ქსელის წევრია.</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2013 წლიდან ორგანიზაციაში მუშაობს მშვიდობის კორპუსის მოხალისე <a href=\\\"http://www.peacecorps.gov\\\">http://www.peacecorps.gov</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014 წლიდან ორგანიზაცია :უკეთესი მომავლისათვის არის EVS (ევროპელ მოხალისეთა სერვისის) მასპინძელი ორგანიზაცია. <a href=\\\"https://ec.europa.eu/programmes/erasmus-plus/opportunities-for-individuals/young-people/european-voluntary-service_en\\\">europa.eu</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2015 წლიდან ორგანიზაცია &bdquo;უკეთესი მომავლისათვის&ldquo; არის ომითა და კონფლიქტის შედეგად დაზარალებულთა უფლებებზე მომუშავე სამოქალაქო საზოგადროების ორგანიზაციების ქსელის წევრი ორგანიზაცია&nbsp; <a href=\\\"https://www.facebook.com/%E1%83%A5%E1%83%A1%E1%83%94%E1%83%9A%E1%83%98-%E1%83%9B%E1%83%9D%E1%83%AB%E1%83%A0%E1%83%90%E1%83%9D%E1%83%91%E1%83%90-%E1%83%99%E1%83%94%E1%83%97%E1%83%98%E1%83%9A%E1%83%93%E1%83%A6%E1%83%94%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1%E1%83%97%E1%83%95%E1%83%98%E1%83%A1-Network-Movement-for-Wellbeing-127458621030847/?fref=ts\\\">Network Movement for Wellbeing</a></p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014 წლიდან ორგანიზაციის &bdquo;უკეთესი მომავლისათვის&ldquo; შვილობილი სოციალური საწარმო იკორთა გახდა სოციალურ საწარმოთა ორგანიზაციების ქსელის წევრი ორგანიზაცია.</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016 წლიდან, ორგანიზაციის &bdquo;უკეთსი მომავლისათვის&ldquo; შვილობილი სოციალური საწარმო იკორთა გახდა &bdquo;სოციალურ საწარმოთა ალიანსის&quot; თანადამფუძნებელი ორგანიზაცია.</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016 წლიდან ორგანიზაციის &bdquo;უკეთესი მომავლისათვის&ldquo; შვილობილი სოციალური საწარმო იკორთა გახდა &bdquo;საქართველოს ტრადიციული რეწვის ასოციაციის&ldquo; წევრი</p>\\r\\n\\r\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017 წლიდან ორგანიზაციამ &bdquo;უკეთესი მომავლისათვის&ldquo; გააფორმა მემორანდუმი ორგანიზაციებთან - Interkultura (მაკედონიის რესპუბლიკა) და SV-Platform (უკრაინა). მემორანდუმის მიზანია ურთიერთთანამშრომლობის გაძლიერება ეკონომიკურ, სოციალურ, კულტურულ, საგანმანათლებლო და სამეცნიერო საკითხებში.</p>\\r\\n\\r\\n<p>ჩვენი ორგანიაციის ერთ&ndash;ერთი ძირითადი მიმართულებაა მონაწლეობა მივიღოთ საქართველოში არსებული კონფლიქტების მშვიდობიან მოგვარებაში ნდობის აღდგენისა და დიალოგის ხელშეწყობის გზით. ამ მიმართულებით ჩვენ აქტიურად ვთანამშრომლობთ, როგორც საერთაშორისო ასევე ადგილობრივ სამთავრობო და არასამთავრობო ორგანიზაციებთან.</p>\\r\\n\\r\\n<p>ჩვენი ორგანიზაცია თანამშრომლობს საქართველოში მცხოვრებ ეთნიკურ უმცირესობებთან, მათ შორის არაკონტროლირებად ტერიტორიაზე (ცხინვალის, ახალგორის&nbsp; რეგიონები) არსებულ სამოქალაქო საზოგადოების წარმომადგნლებთან.</p>\\r\\n\\r\\n<p>2009 წლიდან ჩვენი ორგანიზაცია აქტიურადაა ჩართული ქართულ&ndash;ოსური მოლაპარაკებების პროცესში, რომელიც სხვადასხვა პერიოდულობით ნეიტრალურ ტერიტორიაზე საქართველოსა და ცხინვალის რეგიონში არსებულ სამოქალაქო საზოგადოებას შორის მიმდინარეობს.</p>\\r\\n\\r\\n<p>ორგანიზაციის წევრთა უმრავლესობა 2008 წლის მოვლენების შედეგად ახალგორიდან იძულებით გადაადგილებული პირია. ამასთან ისინი ახერხებენ ახალგორში მიმოსვლას და მოსახლეობასთან თბილი ურთიერთობების შენარჩუნებას.</p>\"}', 'https://www.facebook.com/pg/ForBetterFutureNGO/about/', 'https://www.linkedin.com/in/nana-chkareuli-876a8996/', 'https://www.yfbf.org/', NULL, 'company_images/WihdzfLwfGxsHsgN6fQF6X66bZe7XWOOJ0ZitjlI.jpeg', 1, 0, '6gA6Qw19paAwudOJAtG8Ub0xjgfoG2ouX5Er9ekF3Atm9wuZRh4kXDXJlHkx', '2020-04-10 13:35:29', '2020-08-19 11:27:15', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(27, '{\"en\": \"Youth Association \\\"DRONI\\\"\", \"ka\": \"ახალგაზრდული ასოციაცია \\\"დრონი\\\"\"}', 'contact@droni.org', '574271127', '593737877', '404392180', 1, '{\"en\": \"<p>Kote Marjanishvili 24, VI Floor, 0102, Tbilisi, Georgia</p>\", \"ka\": \"<p>კოტე მარჯანიშვილის 24, VI სართული, 0102, თბილისი, საქართველო</p>\"}', '$2y$10$2jT.9An0kQGiZYCqCn97CegRL3i/Bm16L3ycOIrqRDZuHJyfkJ1z.', '{\"en\": \"<p>Droni was founded in 2003 and works in the field of education with different target groups. The organization is mainly focused on the Caucasus region and cooperates with different European organizations.</p>\", \"ka\": \"<p>დრონი დაარსდა 2003 წელს და მუშაობს განათლების სფეროში სხვადასხვა სამიზნე ჯგუფებთან.ორგანიზაცია ძირითადად ფოკუსირებულია კავკასიის რეგიონზე და თანამშრომლობს ევროპის სხვადასხვა ორგანიზაციებთან.</p>\"}', 'https://www.facebook.com/droniorg/', NULL, 'https://www.droni.org/', NULL, 'company_images/dQv2Qnmz9Shde5RhXVFvlyodYodTYBukworqk2Ft.png', 1, 0, 'l3tsaX53NG0JSWs1lZIiDD7zuZBmblcrqpzjgU8GXMPtDJo2bXqtacspw3pX', '2020-04-10 15:12:23', '2021-06-21 09:21:38', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(28, '{\"ka\": \"გერგარტი\"}', 'gergartinfo@gmail.com', '598505008', NULL, '441484699', 1, '{\"ka\": \"სოფ.გერგეტისუბანი, ყაზბეგი\"}', '$2y$10$0Z36d51JGTLvfZ8fRFpGE.2w4LB0aRO1VfWamjadbnpiT1irvkL9O', '{\"ka\": \"გერგარტი მუშაობს ახალგზარდებთან, იყენებს არაფორმალური განათლების მეთოდებს და გეგმავს და ახორციელებს სხვადასხვა ტიპის აქტივობებს: ტრენინგები, სემინარები, სასწავლო ბანაკები, საერთაშორისო პროექტები.\"}', 'https://www.facebook.com/GergArt.NGO/', NULL, NULL, NULL, 'company_images/bhfNUaeRB9b63MCyndehlVvb5zSJy2VmieENd9gp.jpeg', 1, 0, '1yWt1oi8R0h9i1KvG0GTyu4SKS6T0DfTtDGxa0iOfzDAouWYYU9k5cgG2M02', '2020-04-12 08:24:44', '2020-08-19 11:16:03', 'local', 'local', NULL, NULL, '0', '0', NULL),
(29, '{\"ka\": \"ასოციაცია \\\"ჰერა XXI\\\"\"}', 'moxalisehera@gmail.com', '568897224', '214 28 53', '204898780', 1, '{\"ka\": \"მის ქ. თბილისი გამსახურდიას გამზ llკვ შენობა 9 ბ2\"}', '$2y$10$oWfzZP9wbD4sj40e6CET0eLxGoXCOTk6/aM6lXvYvjmc1IQUp6sFy', '{\"ka\": \"ასოციაცია \\\"ჰერა XXI“ ხელს უწყობს ქვეყანაში მოხალისეთა მოძრაობის გაძლიერებას, სქესობრივი და რეპროდუქციული ჯანმრთელობის და უფლებების რეალიზებას.\"}', 'https://www.facebook.com/AssociationHeraXXI/?ref=br_tf&epa=SEARCH_BOX', NULL, 'http://hera-youth.ge', NULL, 'company_images/wrId0eM2t3hQ5u9cWq2GxNRpcaAdm58pyuG2nPNG.png', 1, 0, 'NLy4BwAaFGJ0k3q1TmUZijW2meMsKqw9fJaA9lMEQnU7XMIwz8TSz54N8RPu', '2020-04-13 09:07:55', '2020-08-19 11:16:03', 'local', 'local', NULL, NULL, '0', '0', NULL),
