(59, '{\"ka\": \"ზემო სვანეთის განვითარების ახალგაზრდული ორგანიზაცია\"}', 'info.sdyo@gmail.com', '599637994', '322118449', '435894980', 1, '{\"ka\": \"სოფელი ხაიში\"}', '$2y$10$QQAlqU0GhWvXoXdo9IDsY.fO2m9HzwQdG.tXOpqauizmcK/cXkBOW', '{\"ka\": \"ზემო სვანეთის განვითარების ახალგაზრდული ორგანიზაცია არის არაკომერციული, არამომგებიანი არასამთავრობო ორგანიზაცია, რომის პრიორიტეტია ზემო სვანეთის განვითარება ახალგაზრდების მაქსიმალური ჩართულობით და აქტიურობით. ზემოთ ხსენებული ახალგაზრდული ორგანიზაცია - YOOUSD, არის ზემო სვანეთის ახალგარდების  გაერთიანება, რომელიც ძირითადად ორიენტირებულია ზემო სვანეთში სოფლად მცხოვრები ახალგაზრდების გაძლიერებაზე.\"}', 'https://www.facebook.com/DevelopmentSvaneti', NULL, NULL, NULL, 'company_images/wnovFYjEQgwfqFcibEJFVy0YBz2lgHxirvmxdz6w.jpeg', 1, 0, 'YZxuZoh0iNdaMEwgUWEE0gdAjtckl1zjMVYa5f8ivYvBMwWeY3xu1ELrbXV1', '2020-07-24 19:23:18', '2021-04-05 21:21:53', 'local', 'local', NULL, '2020-06-28', '0', '0', '/storage/59__2021-02-0323:10:27__.png'),
(60, '{\"en\": \"Patriots - For Education\", \"ka\": \"პატრიოტები- განათლებისთვის\"}', 'patriotebifoundation@gmail.com', '599970277', '555101224', '436046348', 1, '{\"ka\": \"მცხეთის რაიონი, სოფელი მუხრანი\"}', '$2y$10$IRug.LvPY9YZOgCxZnz.RuWZCZjtt6QT7z7UXpYpW9U1LBsyAAdP.', '{\"ka\": \"ორგანიზაციის საქმიანობის ძირითადი სფერო   \\r\\n1. ბავშვებისა და ახლგაზრდების განათლებისა და განვითარების ხელშეწყობა; \\r\\n2. ზრდასრულთა განათლების და პროფესიული განვითარების ხელშეწყობა; \\r\\n3. მოქალაქეთა სამართლებრივი და კულტურული თვითშეგნების ამაღლება; \\r\\n4. პიროვნული განვითარების ხელშეწყობა, სპორტული, სამეცნიერო, შემოქმედებითი, კულტურული, ინტელექტუალური, გასართობი, ტურისტული ღონისძიებები\"}', NULL, NULL, NULL, NULL, '/storage/company_images/QiGfer60QVEnwk3bBAvbDEmqdADlewfyX09cPlRv.jpeg', 1, 0, '2aJuatFH2TgKd5k4K2t73wlxkc76jxjIiHSjNW7t3Elk3eqLHj76LtJj7msr', '2020-08-07 19:16:39', '2021-05-25 08:58:06', 'local', 'local', NULL, NULL, '0', '0', NULL),
(62, '{\"ka\": \"კოგნიტიო - Cognittio\"}', 'cognittio@gmail.com', '551109216', NULL, '422737872', 1, '{\"ka\": \"ადიგენი, თ.ერისთავის #60\"}', '$2y$10$upWs9F4cCgw6JVc4K4TOA.D.imbhMefK2.4DYY5bDhE6HcquSqXy.', '{\"ka\": \"არასამთავრობო ორგანიზაცია \\\"კოგნიტიო\\\" 2020 წლის თებერვალში დარეგისტრირდა. ორგანიზაციის მიზანია რეგიონში მცხოვრები ახალგაზრდების სამოქალაქო ცნობიერების ამაღლება და მათი აქტიურ ცხოვრებაში ჩართვა (სამოქალაქო აქტივიზმის გაძლიერება);  საზოგადოებაში სამართლებრივი ცნობიერების ამაღლება სამართლის, კონსტიტუციისა და კანონის უზენაესობის დასამკვიდრებლად.\"}', 'https://www.facebook.com/NGOcognittio', NULL, NULL, NULL, 'company_images/tCb7KXfo5j5jlRUVGZfisizPzymmwHmnX0Kus0Pe.png', 1, 0, 'j9u3nFTqA11QGfZwUwTYZgSxgNTgAQtvpbxQHNNumgQA0NYSSoc7JPHmixAp', '2020-08-14 12:14:31', '2020-08-19 11:16:03', 'local', 'local', NULL, NULL, '0', '0', NULL),
(63, '{\"en\": \"Cognitive Center of Georgia\", \"ka\": \"საქართველოს შემეცნებითი ცენტრი\"}', 'cognitivecenterofgeorgia@gmail.com', '571692121', '595025286', '400276367', 1, '{\"ka\": \"ქ. თბილისი დადიანის 261\"}', '$2y$10$sMNc9zZZvWAKlQNqIxIABehXJkDO3XqXVr6m7fEzmveQ0R1nqPm6O', '{\"en\": \"<p>The goal of the&nbsp;Cognitive Center of Georgia is to increase the quality of self-development and self-realization of young people through various cognitive activities for young people living in Georgia. Areas of activity are ecology, literature, law, creativity, healthcare.</p>\", \"ka\": \"<p>საქართველოს შემეცნებითი ცენტრის საქმიანობის მიზანია საქართველოში მცხოვრები ახალგაზრდებისთვის სხვადასხვა შემეცნებითი აქტივობების განხორციელების გზით გაზარდოს ახალგარდების თვითგანვითარებისა და თვითრეალიზების კოეფიციენტის ხარისხი. საქმიანობის მიმართულებებია ეკოლოგია, ლიტერატურა, სამართალი, შემოქმედება, ჯანდაცვა.</p>\"}', 'https://www.facebook.com/cognitivecenterofgeorgia/', NULL, NULL, NULL, 'company_images/lt3ZTnTgyElbT4KbTvWa6tAsZ556Z3B0Kt9NtNfw.png', 1, 0, '431IQx1itfpQUsemCO2fIvuMhG8NzWGOXoOXWLnAAqRIRRmA9dEgVoSZnGPJ', '2020-08-17 16:32:08', '2021-05-17 09:14:14', 'local', 'local', NULL, NULL, '0', '0', NULL),
(64, '{\"ka\": \"ახალციხის ზრდასრულთა განათლების ცენტრი\"}', 'aecakhaltsikhe@gmail.com', '+995598599571', '+995592048444', '424251990', 1, '{\"ka\": \"ქ.ახალციხე რუსთაველის ქუჩა #65\"}', '$2y$10$9JDfOL7XD8AVItEPIpIm9OHVvadBNEn28/76cjbCfawUp5faCWDCi', '{\"ka\": \"ახალციხის ზრდასრულთა განათლების ცენტრის მისიაა წაახალისოს მთელი სიცოცხლის მანძილზე სწავლების კონცეფცია და ხელი შეუწყოს პროფესიულ და პერსონალურ განვითარებას სამცხე ჯავახეთის მოსახლეობისათვის. ამ მიზნისათვის ახალციხის ზრდასრულთა განათლების ცენტრი უზრუნველყოფს ტრენინგებს, პროფესიული და პერსონალური განვითარების კურსებს მოსახლეობისათვის. ასევე ხელს უწყობს მოსახლეობაში სამოქალაქო ცნობიერების ამაღლებას.\"}', 'https://www.facebook.com/AECAkhaltsikhe/', NULL, NULL, NULL, 'images/default-avatar.png', 1, 0, 'JRCQ32bvnS1fILfVpldmNqSxhJ15bM1aRvC2n1pPHrn1blGMOU8xuAiS8ZVX', '2020-08-19 10:28:41', '2020-08-19 11:16:03', 'local', 'local', NULL, NULL, '0', '0', NULL),
(65, '{\"en\": \".\", \"ka\": \"საქართველოს მდგრადი განვითარების ასოციაცია\"}', 'Sustainabledevelopment.17@gmail.com', '+995555480515', NULL, '222222212', 1, '{\"en\": \"<p>.</p>\", \"ka\": \"<p>კოსტავას ქ #19</p>\"}', '$2y$10$kCg.Wb4NmBBdeLdswICWnOZZMP9k0lagxVwEG5tuKe/nLFsGiMNyq', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>&quot;საქართველოს მდგრადი განვითარების ასოციაცია&quot; დაფუძნდა 2018 წლის თებერვალში. ასოციაციის მიზანია გაეროს გეგმის &bdquo;ჩვენი სამყაროს ტრანსფორმაცია: მდგრადი განვითარების დღის წესრიგი 2030 წლისთვის&ldquo; 17 მიზნის შესრულება და საზოგადოების ინფორმირება და ჩართვა ზემოთხსენებული გეგმის განხორციელებაში. ასოციაცია, თავისი მიზნებიდან გამომდინარე, მოქმედებს საქართველოს მთელ ტერიტორიაზე, ასევე მის ფარგლებს გარეთ.</p>\"}', 'https://www.facebook.com/%E1%83%A1%E1%83%90%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%95%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A1-%E1%83%9B%E1%83%93%E1%83%92%E1%83%A0%E1%83%90%E1%83%93%E1%83%98-%E1%83%92%E1%83%90%E1%83%9C%E1%83%95%E1%83%98%E1%83%97%E1%83%90%E1%83%A0%E1%83%94%E1%83%91%E1%83%98%E1%83%A1-%E1%83%90%E1%83%A1%E1%83%9D%E1%83%AA%E1%83%98%E1%83%90%E1%83%AA%E1%83%98%E1%83%90-483411198354168/', NULL, NULL, NULL, 'company_images/xarQ3MTSsIpbYbhvgqv99lMNFBGQLQftzjXLv11J.png', 1, 0, 'f0jghcwmxIy1mWssKloLSB3lISSd3TTIEhTkK1UkiAhBlGOM3ykIjqIFlSrH', '2020-08-21 20:10:04', '2020-08-22 17:10:35', 'local', 'international', '{\"en\":null}', NULL, '0', '0', NULL),
(66, '{\"en\": \"Local Action Group Upper Svaneti\", \"ka\": \"ადგილობრივი განვითარების ჯგუფი ზემო სვანეთი\"}', 'lagmestia@gmail.com', '599806285', '598925080', '435894793', 1, '{\"en\": \"<p>.</p>\", \"ka\": \"<p>დაბა მესტია, ბორის კახიანის ქუჩა N 51</p>\"}', '$2y$10$fqbCA4JEv5DIFMhHb6mP4OI3XoN5T2IIrM6vRcIYLmdsqK9f6.wTm', '{\"en\": \"<p>LAG Upper Svaneti is an open civil platform that can include any individual living in Mestia municipality, regardless of their political affiliation. All members of the platform have the right to be involved in and informed about its activities.</p>\", \"ka\": \"<p>ზემო სვანეთის ლაგი არის ნებაყოფილობითი, დამოუკიდებელი,მიუკერძოებელი და დემოკრატიულ ღირებულებებზე დაფუძნებული, ცალკეული ფიზიკური და იურიდიული პირების საზოგადოებრივი გაერთიანება, რომლის საქმიანობა უკავშირდება მესტიის მუნიციპალიტეტის ადგილობრივი თემების მობილიზაციას, რათა ხელი შეუწყოს მათ შორის თანამშრომლობას და მათი შესაძლებლობების ზრდას ადგილობრი სტრატეგიის დანერგვისა და განხორციელების პროცესში</p>\"}', 'https://www.facebook.com/LAGMestia', NULL, NULL, NULL, 'company_images/S6cQN3A7YVfocmHUE903zeK4bsIMYZqp8FoVuj6t.png', 1, 0, 'QzUBmukDBVqNHOX0xFqo0Nj0TVDPzrSHSl0rbkbeF1hPmeSW7tsFkFKUOfgJ', '2020-08-22 13:47:23', '2020-08-22 17:10:02', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(67, '{\"en\": \"Tetritskaro Youth Center\", \"ka\": \"თეთრიწყაროს ახალგაზრდული ცენტრი\"}', 'tyctetritskaro@gmail.com', '598350931', '598588638', '430799978', 1, '{\"en\": \".\", \"ka\": \"თეთრიწყაროს რაიონი, რუსთაველის ქ. N27\"}', '$2y$10$aX604Ei0t7775PIgrXzwe.FKd91sxWO.E/i4QNGXhcrK1N8fj1Gj6', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ჩვენ გვსურს გვყავდეს აქტიური, ფართო ხედვის მქონე საზოგადოება. ამისათვის ვცდილობთ არაფორმალური განათლების ხელმისაწვდომობის გაზრდასა და ჯანსაღი ცხოვრების წესის დამკვიდრებას სხვადასხვა სახის კულტურულ-საგანმანათლებლო და სპორტული პროგრამების შეთავაზებით, მოხალისეობრივი საქმიანობის გააქტიურებით, მოსახლეობის სოციალურ-ეკონომიკური გაძლიერების ხელშეწყობითა და სექტორთა შორის თანამშრომლობის გზით.</p>\"}', 'https://www.facebook.com/tycgeorgia/', NULL, 'https://www.tycgeorgia.com/', NULL, 'company_images/zB9Un8VoBLiQpFi01VW9oUB3233l3mJxDQGUFvAM.jpeg', 1, 0, 'QATl4kQmNCk7da41uNkuaIL4rJ1H9n4wm2qqBdDrcvfmIWbthw8i9MVXKhS5', '2020-08-26 19:46:14', '2021-05-25 09:47:03', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(68, '{\"en\": \".\", \"ka\": \"ახალგაზრდული ასოციაცია \\\"მომავლისთვის\\\"\"}', 'youthorganizationforthefuture@gmail.com', '555537819', '591281991', '404543712', 1, '{\"en\": \".\", \"ka\": \"თბილისი, ტატიშვილის ქ.17\"}', '$2y$10$8UBQ4U1q/UCXKoUCoYSNF.AufQXMBmV4sXDy1yVFc35wr0FzJwPGa', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ახალგაზრდული ასოციაცია &quot;მომავლისთვის&quot; დაარსდა 2018 წელს ახალგაზრდების ინიციატივის საფუძველზე. დაარსებიდან დღემდე წარმატებით ახორციელებს - სადამხმარებლო, საგნამანათლებლო, საინფორმაციო და მოხალისეობრივ ამპანიებს. ორგანიზაციის სტრატეგიული მიზანია საზოგადოების ცნობიერების ამაღლება და ხელი შეუწყოს საზოგადოებაში ტოლერანტი, პროგესირებადი, თანაბარი და კონკურენტუნარიანი გარემოს ჩამოყალიბებას.</p>\"}', 'https://www.facebook.com/youthassociationforfuture', NULL, NULL, NULL, 'company_images/iALXZDITOi0G5ySS8FHUtVnz5aLX5fU4wXVkLeTI.jpeg', 1, 0, 'IEYDfhxLURIQc3iZOPdGHwfiWni4YctH7JPjmQZDRCJYlT7rdhWL4YlcjVaq', '2020-08-27 11:33:31', '2021-02-24 09:30:50', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
