(70, '{\"en\": \".\", \"ka\": \"ადამიანის უფლებათა სამართლის ლაბორატორია\"}', 'hrlawlab@gmail.com', '591227722', NULL, '412753667', 1, '{\"en\": \".\", \"ka\": \"თბილისი, თვადადებულის2\"}', '$2y$10$qZMy35J.2qAIrhUKMGk34eZCZDhtnwcgUv18XoWhHJH.QuPGsEmhC', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ორგანიზაცია დაარსდა ახალგაზრდებისა და მოქალაქეების სამართლებრივი ცნობიერების ამაღლების მიზნით. ორგანიზაციის მიზანს პრიორიტეტულად წარმოადგენს ბავშვის უფლებებზე მუშაობა და მათთვის ადვოკატირების უნარ-ჩვევების გამომუშავება, რათა თითეულმა მათგანმა დროულად და სწორი მიმართულებით შეძლოს საკუთარი უფლებების დაცვა.</p>\"}', NULL, NULL, NULL, NULL, 'company_images/I9yffSbQDEUHdqcar0exkudXH5nZHEYmKuyPWPsh.png', 1, 0, 'OXIni7wm9aFLpZbxLjq3Nq8aakZf6TxUluc7AvaUzVVJllmA3WLIlX5khOm7', '2020-08-30 21:16:36', '2021-02-24 09:31:24', 'local', 'local', '{\"en\":null}', NULL, '0', '0', NULL),
(71, '{\"ka\": \"Youuuth\"}', 'mariamvaqiashvili@gmail.com', NULL, NULL, '012355678', 1, '{\"ka\": \"მისამართიი\"}', '$2y$10$X7H5IfdeF1tSBSYh.nLiUetMG6y.rAEN24xA1aolhwsutr3FxT.XG', '{\"ka\": \"ლორემ იპსუმ ფანდი დისიდენტური მოიპარებდე მაღლიდან გადაადგილდეთ, დაეკიდა ფანტაზიის. მიხდი საეგებიო სიძე ინტელიგენციას გაეცინა ზოგიერთმა. სამკალად მათნი დამაწვინეთ ღრეჯას რაჭის ალერსია მაძიებელი ჩვენისთანისა. ნაომარმა უძლური მოახვიოს დამაწვინეთ, სიძე რელიგიურმა მუსიკოსს გაათავისუფლებს. ტვისტის ვისთვისაც სულიერიც თერთმეტ უძლური, დამაწვინეთ უწევდა დაგჭირდა მოჰყავდა იხედებიან წამომწყები, კვალმა შევიპარ\"}', NULL, NULL, NULL, NULL, 'company_images/ieTgxYph2wGENMmuXPkCAaGR96Qo1fMMRbI2Kvl6.jpeg', 0, 0, '0s50rz1SwOxKyhX9ekwpIJC6w3VXSMrCPgiaQYeTWJMNVgnyqZpWa1FayT47', '2020-11-06 19:16:59', '2020-11-06 19:16:59', 'local', 'local', NULL, '2021-11-18', '0', '0', NULL);
