(72, '{\"en\": \".\", \"ka\": \"ახალგაზრდული ორგანიზაცია - გამოწვევა\"}', 'thechallenge4youth@gmail.com', '+995598512902', '+995591449766', '424253284', 1, '{\"en\": \".\", \"ka\": \"ქ.ახალციხე, 9 აპრილის ქუჩა, 23/13\"}', '$2y$10$ASnEFbBMfrYGyP.oHCVkG.rN1Occ0IC4mlO/vSmlq7dHL3sRlmHp2', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ორგანიზაციის მიზანია ხელი შეუწყოს ახალგაზრდების სრულფასოვანი განვითარებისათვის შესაბამისი გარემოს შექმნას, სადაც ახალგაზრდები შეძლებენ საკუთარი პოტენციალის სრულად რეალიზებას და საზოგადოებრივი ცხოვრების ყველა სფეროში აქტიურად ჩართვას.</p><p><strong>ორგანიზაციის ამოცანებია:</strong></p><ul><li>ხელი შეუწყოს ახალგაზრდული საქმიანობის გაძლიერებას, ახალგაზრდული მუშაკების კვალიფიკაციის ამაღლებას, მათ მიერ საერთაშორისო გამოცდილების გაზიარებას;</li><li>იზრუნოს, რომ მოხდეს ახალგაზრდული საქმიანობის შედეგად მიღებული გამოცდილებისა და შედეგების აღიარება და ცნობა;&nbsp;</li><li>ხელი შეუწყოს ახალგაზრდების ჩართვას საერთაშორისო ახალგაზრდულ&nbsp; პროგრამებში;</li><li>ხელი შეუწყოს არაფორმალური განათლების პროგრამების შემუშავებასა და განხორციელებას.</li><li>იზრუნოს ახალგაზრდების პიროვნულ განვითარებაზე, სოციალური რისკების პრევენციასა და ინტეგრაციაზე,</li><li>ხეი შეუწყოს ახალგაზრდებს, რომ განუვითარდეთ კომპეტენციები - ცოდნა, უნარები და დამოკიდებულებები, რომლებიც აუცილებელია საზოგადოებრივ ცხოვრებაში სრულფასოვნად მონაწილეობისთვის და საკუთარი პოტენციალის მაქსიმალურად რეალიზებისთვის.</li></ul>\"}', NULL, NULL, NULL, NULL, '/storage/company_images/5Byk2F2fIu9blF7SXQBsnCxRWwj0ekF1EpiBAafi.png', 1, 0, 'x9fm9p6IvsSYW24wjoqaB6M7eNykk4PQGM6LmziYuhIsfLT4XwUlzfyIOBJx', '2020-11-11 12:34:51', '2021-02-24 09:31:57', 'local', 'international', '{\"en\":null}', '2018-01-31', '0', '0', NULL),
(73, '{\"en\": \".\", \"ka\": \"სოციალური ინოვაციების და მეწარმეობის ცენტრი SiNC\"}', 'info@sinc.org.ge', '514314000', '571871100', '405234875', 1, '{\"en\": \".\", \"ka\": \"ეგ. ნინოშვილის ქ. 55\"}', '$2y$10$GrmAZ/YstsQvIJS3mydVa.lkeLXPA5mtOjFsM2WHslyqe1lVxnhNu', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ორგანიზაციის ძირითადი მიმართულებაა სოციალური მეწარმეობის განვითარების ხელშეწყობა რეგიონში, კერძოდ, ქალების და ახალგაზრდების მხარდაჭერა დააფუძნონ სოციალური საწარმოები და განივითარონ საწარმოს მართვის უნარები. ორგანიზაცია ახორციელებს მენტორშიფის, ქოუჩინგის პროგრამებს, ატარებს ტრენინგებს, ორგანიზიბეას უწევს ბანაკებს და ა.შ.</p>\"}', 'https://www.facebook.com/SiNCgeorgia', NULL, 'sinc.org.ge', NULL, 'company_images/Tdl5kixlA55xaL1URZ3ykFd96cfI0ygash6XkB3i.jpeg', 1, 0, 'Qcfx0dTMeeyZL7JJTzWJ4PdzNhl1NFjOHhU3Z680JuLEC5eUXrRPlNvAadEU', '2020-12-09 08:28:41', '2021-02-24 09:32:11', 'local', 'local', '{\"en\":null}', '2017-10-27', '0', '0', '/storage/73__2020-12-0908:32:16__.png'),
