(89, '{\"ka\": \"სსიპ \\\"კულტურის, სპორტის და ახალგაზრდულ საქმეთა სააგენტო\\\"\"}', 'info@csya.ge', '599 56 65 17', '571 22 25 02', '205390254', 1, '{\"ka\": \"დ. უზნაძის 68\"}', '$2y$10$LzfV6DQ9/PVOy4Jz0hqoT.jXFz5MQbUTG78g3M4y07tvsMM53gWsO', '{\"ka\": \"აფხაზეთის განათლებისა და კულტურის სამინისტროს, სსიპ „კულტურის, სპორტის და ახალგაზრდულ საქმეთა სააგენტოს“ საქმიანობა მოიცავს სამ მნიშვნელოვან მიმართულებას ესენია: კულტურა, სპორტი და ახალგაზრდული სფერო. საზოგადოების ეს ერთ-ერთი ყველაზე მოწყვლადი სეგმენტი რთული გამოწვევების წინაშე დგას, სწორედ ამიტომ,  ჩვენი სააგენტო ორიენტირებულია აფხაზეთიდან დევნილი ახალგაზრდების მაქსიმალური ჩართულობის ხელშეწყობაზე\"}', NULL, NULL, 'Csya.ge', NULL, '/storage/company_images/ve6UZSIeWzDYMYkmTvHiSSy0iYqNHxqz6LD7EHfs.png', 1, 0, 'XjNZJ4YkLgM0zb9UuZ2EKtMzlNQnTYe19dNungtdKmIB3Dye98ezSHHGbb5B', '2021-03-22 15:27:16', '2021-03-26 13:27:18', 'local', 'local', NULL, '2019-12-25', '0', '0', NULL),
