(113, '{\"ka\": \"ალგეთის ახალგაზრდული ცენტრი ამბრელა\"}', 'algetiyouthcenter@gmail.com', '574081634', '571000660', '434177017', 1, '{\"ka\": \"სოფ ალგეთი მე-16 ქ, ნ 18\"}', '$2y$10$b3HcJqSLQW80TkP7BIYq7.anbFhZ8nwTeBfC/HWgNc/.9pKbdFBlG', '{\"ka\": \"ჩვენი მიზანია ახალგაზრდების ჩართულობით მათი და თემის პრობლემები განვითარება და ამას ვაკეთებთ ჩვენი სოფლის ახალგაზრდების სხვადასხვა კომპეტენციების განვითარებით; ძირითადი მიმართულება არის გარემოს დაცვა ადამიანის უფლებები და დემოკრატია; ამ მიზნის მისღწევად ვახორციელებთ ახალგაზრდებში 5 ძირითადი კომპეტენციის განვითარებას, დიალოგს ხელისუფელბასთან და სოფლების განვითარებაზე მიმართულ აქტივობებს;\"}', 'https://www.facebook.com/algetiyouthcenter/', NULL, NULL, NULL, 'company_images/H7jI8l24QowXcAwea1jKWtihyCPWC1SXZaxDNW4L.png', 1, 0, '5STlBrYC1aFS5Tjq7aFKWcA0oNCtEKPbqV7MRSKNwKxXirTQyOZbVfg06mX3', '2021-05-26 18:22:33', '2021-05-27 09:13:19', 'local', 'local', NULL, '2020-09-01', '0', '0', NULL),
