(122, '{\"ka\": \"ლაგოდეხის ახალგაზრდული ცენტრი ამბრელა\"}', 'youthcenter.lag@gmail.com', '592111800', NULL, '433107577', 1, '{\"ka\": \"ქალაქი ლაგოდეხი, კოლეჯი \\\"აისი\\\"\"}', '$2y$10$QFTFaCMjbK0H02ehCwDQMe/vYC4wWHwV2Is3rNUlzHAWjeSo.kugu', '{\"ka\": \"ლაგოდეხის ახალგაზრდული ცენტრი არის არასამთავრობო ორგანიზაცია, რომლის მიზანია ახალგაზრდებს შორის მოხალისეობრივი საქმიანობის პოპულარიზაცია არაფორმალური განათლების გზით. ორგანიზაციას აქვს 4 ძირითადი მიმართულება: გარემოს დაცვა, ადამიანის უფლებები, დემოკრატია, ჯანსაღი ცხოვრება. ამ ყველაფერთან ერთადორგანიზაცის წევრები აქტიურად მუშაობენ მუნიციპალიტეტის მაშტაბით ეთნიკური უმცირესობების ინტეგრაციის საკითხზე\"}', 'https://www.facebook.com/lagodekhiyouthcenter/', NULL, NULL, NULL, 'company_images/XpFDwBXEhCirwW70YtRm1jo7cRt5qkGzc9ZLeJv3.png', 1, 0, 'jFqYgUga1oPT8lSfsA7pxk8MylChIOmQqet9QB19gDs8MLakpLvHJ7TYu3FN', '2021-05-28 19:05:54', '2021-05-31 08:28:05', 'local', 'local', NULL, '2020-08-14', '0', '0', NULL),
(123, '{\"ka\": \"ა.(ა)ი.პ ლაგოდეხის კულტურის, სპორტისა და ახალგაზრდობის საქმეთა განვითარების ცენტრი\"}', 'tamazashvili.natia@gmail.com', '577975529', '577951294', '433105702', 1, '{\"ka\": \"ლაგოდეხი მ.კოსტავას #1\"}', '$2y$10$jpPTMBt/S4F8m49fLVo1Cugg1XQ1U8fFsqbO1J8xs8rAGbQo2vMxu', '{\"ka\": \"ცენტრი საქმიანობს ახალგაზრდობის, მოსწავლე-ახალგაზრდობის, კულტურისა და სპორტის მიმართულებით. ცენტის დაქვემდებარებაშია ლაგოდეხის ისტორიული მუზეუმი, საბავშვო, სახალხო დრამატული და თოჯინების სახალხო თეატრი, ბიბლიოთეკა. სამსახური გეგმავს და ახორციელებს მასობრივ ახალგაზრდულ, სპორტულ და კულტურულ ღონისძიებებს, ფესტივალებს, ლიტერატურულ-შემოქმედებით საღამოებს, არაფორმალურ განათლებას, მემკვიდრ. დაცვა-შენარჩუ\"}', 'https://www.facebook.com/%E1%83%9A%E1%83%90%E1%83%92%E1%83%9D%E1%83%93%E1%83%94%E1%83%AE%E1%83%98%E1%83%A1-%E1%83%99%E1%83%A3%E1%83%9A%E1%83%A2%E1%83%A3%E1%83%A0%E1%83%98%E1%83%A1-%E1%83%A1%E1%83%9E%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%98%E1%83%A1%E1%83%90-%E1%83%93%E1%83%90-%E1%83%90%E1%83%AE%E1%83%90%E1%83%9A%E1%83%92%E1%83%90%E1%83%96%E1%83%A0%E1%83%93%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1-%E1%83%A1%E1%83%90%E1%83%A5%E1%83%9B%E1%83%94%E1%83%97%E1%83%90-%E1%83%92%E1%83%90%E1%83%9C%E1%83%95%E1%83%98%E1%83%97%E1%83%90%E1%83%A0%E1%83%94%E1%83%91%E1%83%98%E1%83%A1-%E1%83%AA%E1%83%94%E1%83%9C%E1%83%A2%E1%83%A0%E1%83%98-184134802421804', NULL, NULL, NULL, 'company_images/ohMTUjYRY9v7DKY4mGnAZ1KAKiyZaL5KdxPDRIb3.png', 1, 0, '6z6e5c2jpIvZ2yskIsdn8CL08bMj4Rs5BdsV4sLiRdhf1lwDnqJvWXZ7FLFs', '2021-05-28 20:02:26', '2021-05-31 08:28:05', 'local', 'local', NULL, '2018-02-09', '0', '0', NULL),
(124, '{\"ka\": \"გავაძლიეროთ სოფლად ახალგაზრდები\"}', 'ekaterine.tsulukidze@gmail.com', '551099060', '551052552', '435891509', 1, '{\"ka\": \"სოფელი ფარი\"}', '$2y$10$vgoecX1C0xCh5iF1xY4jrOW82PvOw02hrAPXT/3RYJBoMlYafDZX.', '{\"ka\": \"ეწევა კვლევით, საგანმანათლებლო, კულტურულ და ეკონომიკურ საქმიანობას; აწყობს კონფერენციებს, სიმპოზიუმებს, დისკუსიებს, სემინარებს, გამოფენებსა და ასოციაციის საქმიანობასთან დაკავშირებულ სხვა ღონისძიებებს;                                                                                        \\r\\n ეწევა ახალგაზრდების  უფლებების პოპულარიზაციას და ხელს უწყობს მათ მიმართ პატივისცემის დამკვიდრებას\"}', 'https://www.facebook.com/sofladaxalgazrdoba', NULL, NULL, NULL, 'company_images/Z4AiBo0VGTHVgUBcN4OtIzEBxxaWIChvKx5hZTyE.jpeg', 1, 0, 'adP2OGQp9HC8BAr6vLuXJ4boolrMcbE6ybyu4LmFv4UtPYxdo6qhGXszb77t', '2021-05-29 17:09:48', '2021-05-31 08:28:05', 'local', 'local', NULL, '2013-08-08', '0', '0', NULL),
