(127, '{\"ka\": \"ბოლნისის მუნიციპალიტეტის მერია\"}', 'bolnisiyouth@gmail.com', '591400079', '579707273', '225393963', 1, '{\"ka\": \"სულხან-საბა ორბელიანის ქ.106\"}', '$2y$10$rhTGg.vfkteY79IULuAMT.Waa/tcSiuju1mXHJOVHmNp4xrNIZAzO', '{\"ka\": \"ბოლნისის მუნიციპალიტეტი ქვემო ქართლის ცენტრალურ ნაწილში მდებარეობს. 2014 წლის მონაცემებითა და 2018 წლის 1 იანვრის მდგომარეობით, ბოლნისის მუნიციპალიტეტის მოსახლეობა შეადგენს 55 590 კაცს. მუნიციპალიტეტში 49 დასახლებული პუნქტია. მუნიციპალიტეტს გააჩნია არჩევითი წარმომადგენლობითი (საკრებულო) და აღმასრულებელი მუნიციპალიტეტს გააჩნია არჩევითი წარმომადგენლობითი (საკრებულო) და აღმასრულებელი (მერი) ორგანოები\"}', 'https://www.facebook.com/bolnisimunicipalityofficial', NULL, 'http://bolnisi.gov.ge/', NULL, '/storage/company_images/127__2021-05-3111:07:17__.png', 1, 0, 'vKX0YUUBYt6UAiXPkldIBUSlI94hJc2svqdlakKatRXQlnLDzbBvEHQTyCat', '2021-05-31 10:29:48', '2021-05-31 12:02:33', 'local', 'local', NULL, '2017-11-16', '0', '0', NULL),
(128, '{\"ka\": \"ჩოხატაურის მუნიციპალიტეტის საკრებულო\"}', 'chokhatauri.sak@chokhatauri.gov.ge', '577957028', '579269595', '242008705', 1, '{\"ka\": \"დ.ჩოხატაური, წერეთლის N2\"}', '$2y$10$tAsbcC6RqaQMddMaWTo/eeeeqn5UaS22lrx.0TmOcuorAZqjXi7qy', '{\"ka\": \"ჩოხატაურის მუნიციპალიტეტის საკრებულო  არის ჩოხატაურის მუნიციპალიტეტის წარმომადგენლობითი ორგანო,  უფლებამოსილების შესაბამისად განსაზღვრავს მუნიციპალიტეტის განვითარების სტრატეგიასა და ძირითად მიმართულებებს,იღებს გადაწყვეტილებებს ადგილობრივი მნიშვნელობის საკითხებზე, აგრეთვე კანონით დადგენილ ფარფარგლებში კონტროლს უწევს ადგილობრივი თვითმმართველობის აღმასრულებელი ორგანოს საქმიანობას.\"}', 'https://www.facebook.com/chokh.sakrebulo', NULL, 'http://chokhatauri.ge/', NULL, 'company_images/uZVjd2Q6dLu40CFfrWXrpFYGwbM7mFokaptpDPIv.png', 1, 0, 'L8h1GFuOIt1Nfwgn9Jvbdbrci6FZiybgb68d1gKb0s2pcOOF1n4Q7XoJ06ck', '2021-05-31 10:51:14', '2021-05-31 12:02:33', 'local', 'local', NULL, '2006-11-29', '0', '0', NULL),
(129, '{\"ka\": \"ა(ა)იპ \\\"ქალაქ რუსთავის სახელოვნებო სპორტისა და ახალგაზრდობის ცენტრი\"}', 'cysrustavi@gmail.com', '599774142', '595085541', '416314090', 1, '{\"ka\": \"ფიროსმანის ქ.17\"}', '$2y$10$Z4x485I8o3.ywTqC7zLcBOzSMdG02J0PPviJgGsDPRivsuF.YGlh2', '{\"ka\": \"ცენტრის მიზანია რუსთაველი ახალგაზრდების ინტელექტუალური და ფიზიკური პოტენციალის გამოვლების და სრულყოფისთვის შესაბამისი პირობების შექმნა. კულტურული, სპორტული და ახალგაზრდული ღონისძიებების დაგეგმვა და განხორციელება\"}', 'https://www.facebook.com/CYSCENTRE', NULL, NULL, NULL, 'images/default-avatar.png', 1, 0, 'Wn6QGI2lrEppIW4h4fOh5xdbRWylDzdTFBwwtVVdc61TT6H3FLyBEnhP58qP', '2021-05-31 11:51:13', '2021-05-31 12:02:33', 'local', 'local', NULL, '2018-02-09', '0', '0', NULL),
(130, '{\"ka\": \",,ჩემი საქართველო თიანეთიდან იწყება\"}', 'tini.gianashvili@gmail.com', '599996264', NULL, '432385616', 1, '{\"ka\": \"დაბა თიანეთი, ვაჟა-ფშაველას ქუჩა, მეშვიდე შესახვევი, ბინა N3;\"}', '$2y$10$XxVtaX3qI7IVsgu.bveRce.KZ0roexvhaLHSqn5QqR.JQ0uNSQ.dO', '{\"ka\": \"დაარსების დღიდან, ორგანიზაცია მუშაობს არაფორმალური განათლებისა და ახალგაზრდული ინიციატივების კუთხით. ორგანიზაცია ასევე ხელს უწყობს ახალგაზრდებსა და მერიის შესაბამის სამსახურს შორის კომუნიკაციას, პერიოდულად, ახალგაზრდებს სთავაზობს სხვადასხვა აქტივობებსა თუ პროექტებს.\"}', NULL, NULL, NULL, NULL, 'company_images/oASsdSBzRDu2LbMyWZ1dNTO8Fh9Q6AFZ5UOZx6v4.jpeg', 1, 0, 'wb0M7llqc3TBCmk48wsM4G0mOjtOG6yBPFcfj3M3SahhjRUyJK06pz3P04fy', '2021-05-31 13:08:14', '2021-11-04 18:16:14', 'local', 'local', NULL, '2015-03-04', '0', '0', NULL),
