(132, '{\"ka\": \"ქალაქ ფოთის მუნიციპალიტეტის მერიის კულტურის, განათლების, ძეგლთა დაცვის, სპორტისა და ახალგაზრდულ საქმეთა სამსახური\"}', 'nonasilagava@gmail.com', '591417524', NULL, '010119710', 1, '{\"ka\": \"ბერდიანსკის 52\"}', '$2y$10$mCsfoOSA4ie6OouK99YqseLD.5/8ZmjGcuRk.fHykj7KQYLtTfSSK', '{\"ka\": \"ქალაქ ფოთის მუნიციპალიტეტის მერიის კულტურის, განათლების, ძეგლთა დაცვის, სპორტისა და ახალგაზრდულ საქმეთა სამსახური უზრუნველყოფს ქალაქ ფოთის მუნიციპალიტეტის  დაქვემდებარებაში არსებული კულტურის, განათლების, კულტურული მემკვიდრეობის, სასპორტო ინფრასტრუქტურის ობიექტების განვითარების კონცეფციებისა და პროგრამების მომზადებას, კულტურის, განათლების, სპორტისა და ახალგაზრდული პროგრამების მართვას.\"}', NULL, NULL, NULL, NULL, 'company_images/Sr53sn1szRAwYKj2lw3Q7Lq14lkx2ILvkv0GxLUG.jpeg', 1, 0, 'eHNbhfELxbbYq0tsUu7HzDEUGCf1B8LCGCrfmwQupfu69Yr04dUHcRhVmur8', '2021-05-31 19:15:55', '2021-06-07 11:46:29', 'local', 'local', NULL, '2004-05-31', '0', '0', NULL),
(133, '{\"ka\": \"სამეცნიერო-ინტელექტუალური კლუბი \\\"თაობათა დიალოგი\\\" (RICDOG)\"}', 'ricdog@live.com', '597176969', '571548484', '212904026', 1, '{\"ka\": \"კუპრაძის მე-14 შესახვევი, N12\"}', '$2y$10$0tnXWifBUxFc041Eo/vQhOXSksKDbr7xj9icoEp/dGhNPZv5rPEQO', '{\"ka\": \"ჩვენ გვსურს ისეთი სივრცის შექმნა, სადაც სხვადასხვა ასაკის მქონე ადამიანებს ექნებათ ჰარმონიული ურთიერთობა ერთმანეთთან. ჩვენი მისიაა შევებრძოლოთ თაობებს შორის არსებულ გაუცხოებას და მივმართოთ ჩვენი ძალისხმევა თაობებს შორის ცოდნის, უნარ-ჩვევებისა და გამოცდილების ურთიერთგაზიარებისკენ რაც ჩვენს საქმიანობებში მათი ერთობლივი მონაწილეობით მიიღწევა. ჩვენ მოვუწოდებთ ყველას აქტიურობისკენ ყველგან და ყოველთვის!\"}', 'https://www.facebook.com/ricdog.org', 'ricdog.org', 'www.ricdog.org', NULL, 'company_images/wFXXIEp0tS5OzSeHMmyioiLtlhjwH6dDOwwMBTVU.png', 1, 0, 'kPT85orQ2PUGCQbwCXW2IlMuxR0ZpR4xICUsBBSRYH85jL0BtVdSfM1HRpK2', '2021-05-31 20:00:57', '2021-06-11 08:31:45', 'local', 'local', NULL, '2005-11-23', '0', '0', '/storage/133__2021-05-3120:05:50__.png'),
(134, '{\"ka\": \"ბიტისი\"}', 'bitis.ge@gmail.com', '577607242', '577404109', '400237052', 1, '{\"ka\": \"გურამიშვილის გამზ. #15ა\"}', '$2y$10$LJYHUfnlpXZRp5yPWiFMmOF1rzx7lbEgF9QMOwloxaTvDJXPlCTYe', '{\"ka\": \"ბიტისი არის ახალგაზრდული ორგანიზაცია, რომელიც ეხმარება ახალგაზრდებს კომპეტენციების განვითარებაში.  ბიტიში ადგილობრივ დონეზე შექმნილია ახალგაზრდული კლუბები შემდეგ თემებზე - კარიერა, ეკოლოგია, ინგლისური, ლიტერატურა, ხელოვნება, ფეხბურთი და ლაშქრობა. საერთაშორისო დონეზე ბიტისი გთავაზობთ ახალგაზრდულ გაცვლით პროექტებს, ტრენინგ კურსებს და მოკე და გრძელვადიან მოხალისეობრივ შესაძლებლობებს.\"}', 'https://www.facebook.com/BitisiNGO/', 'https://www.instagram.com/bitisingo/', 'https://bitisingo.wordpress.com/', NULL, '/storage/company_images/134__2021-06-0119:16:13__.png', 1, 0, 'U08Q9D4y8i5AwO4Wjg1wHyou52TOdWC8UZwjAunLPTJIZsoJ7ipFivaETgN2', '2021-06-01 19:13:42', '2021-06-07 11:46:29', 'local', 'international', NULL, '2018-05-04', '0', '0', NULL),
(135, '{\"ka\": \"ახალგაზრდული ხედვა კახეთი\"}', 'youthvisionkakheti@gmail.com', '035 2720 03', '591 243420', '431433825', 1, '{\"ka\": \"ძმები პაპუაშვილები ქუჩა #13\"}', '$2y$10$KyUGsNg2T0.Lwe6ILLnqN.dSFjyhis5FD0MDqfmDa81mHP8Ljb8Wm', '{\"ka\": \"ახალგაზრდული ხედვა კახეთი 2017 წლიდან მუშაობს კახეთის მხარეში. ორგანიზაცია ხელს უწყობს რეგიონშ მცხოვრები ახალგაზრდების განვითარებას ახალგაზრდული კომპეტენციების ჩარჩო დოკუმენტის გათვალისწინებით. ეწევა საგანმანათლებლო–შემეცნებით საქმიანობას, აწყობს ტრენინგებს, კონფერენციებს,\\r\\nსემინარებსა და დისკუსიებს, ეხმარება მოზარდებს და ახალგაზრდებს და ხელს უწყობს მათი სოციალური უნარების გაძლიერებას.\"}', 'https://www.facebook.com/YouthVisionKakheti', NULL, NULL, NULL, 'company_images/OFJsYcyH00udfSXoHsPRQJprCZLnFLvUpKrKXdxC.jpeg', 1, 0, 'PffDRGgDZFVCvUKCkEXeOPNhUi6nZHgGvWl8rnovbKb0Z09uyTjYaAlK3Lsb', '2021-06-02 06:37:30', '2021-06-07 11:46:29', 'local', 'local', NULL, '2017-05-04', '0', '0', NULL),
