(142, '{\"ka\": \"ლტოლვილთა დანიის საბჭო (DRC)\"}', 'geo-drc@drc.ngo', '032 224 46 88', NULL, '212705508', 1, '{\"ka\": \"ფალიაშვილის 88\"}', '$2y$10$bQWXaj.xYo2dR9fSJuClSu36uGKZDP2kWVi7KJr6N1oIpyFPUaTaa', '{\"ka\": \"ლტოლვილთა დანიის საბჭო (ლდს) არის მსოფლიოში წამყვანი არაკომერციული,  უფლებებზე დაფუძნებული  ორგანიზაცია. მისი მიზანია დახმარება გავუწიოს ლტოლვილებს, იძულებით გადაადგილებულ პირებსა და მათ მასპინძელ თემებს იმისათვის, რომ იცხოვრონ ღირსეულად. ლტოლვილთა დანიის საბჭოს იცავს ადამიანის უფლებებსა და მათ სიცოცხლეს და კონფლიქტის შედეგად მოსახლეობას აძლევს პრობლემების გრძელვადიანი გადაჭრის შესაძლებლობებს.\"}', 'https://www.facebook.com/drcsouthcaucasus', NULL, NULL, NULL, 'company_images/oqEOb3oTuL7sPNSC5Fs7uGCqRM5MdkhtF0jLsOd9.jpeg', 1, 0, 'YaOuKn4tUG2sivOywgYUjLWfdElLDYboePvhW8u8EbkE3EWR03J7Dpb7ozdS', '2021-06-09 12:10:16', '2021-06-15 12:43:45', 'local', 'international', NULL, '2003-07-17', '0', '0', NULL),
