(149, '{\"ka\": \"სიღნაღის მუნიციპალიტეტი\"}', 'salome.kikilashvili.1@iliauni.edu.ge', '599361131', '577936779', '240417223', 1, '{\"ka\": \"აღმაშენებლის მოედანი 2\"}', '$2y$10$I2zKIVtcV3vdLS6xmRcGGO4vUXGWbCEMriTNjwLVdmjuzlrQ5gL6S', '{\"ka\": \"სიღნაღის მუნიციპალიტეტის მერიის კულტურის, განათლების,სპორტისა და ახალგაზრდულ საქმეთა სამსახური ახორციელებს სხვადასხვა კულტურულ,საგანმანათლებლო,სპორტულ და ახალგაზრდულ ღონისძიებებს. 2021 წლის მაისში შევიმუშავეთ და დავამტკიცეთ ახალგაზრდობის განვითარების სტრატეგია და სამოქმედო გეგმა 2021-2023.მისი მთავარი მიზანია ახალგაზრდობის ჩართულობით  ახალგაზრდული ეკოსისტემის შექმნა.\"}', 'https://www.facebook.com/%E1%83%A1%E1%83%98%E1%83%A6%E1%83%9C%E1%83%90%E1%83%A6%E1%83%98%E1%83%A1-%E1%83%9B%E1%83%A3%E1%83%9C%E1%83%98%E1%83%AA%E1%83%98%E1%83%9E%E1%83%90%E1%83%9A%E1%83%98%E1%83%A2%E1%83%94%E1%83%A2%E1%83%98-157323441128085', NULL, 'http://signagi.gov.ge/', NULL, 'company_images/lKQg2WkCChfpxj3dg7ELvAv0Hp3hzsk2TZ7UrWIe.jpeg', 1, 0, 'ImNTnH3zisbI7YLckAUJWeFld1MgK54OY34PrhECD8asTTFt09PpVgaakpb6', '2021-06-28 11:23:43', '2021-06-29 07:30:03', 'local', 'local', NULL, '2021-06-28', '0', '0', NULL),
(150, '{\"ka\": \"კრეატიული განვითარების ცენტრი\"}', 'teonadalak@gmail.com', '593197219', NULL, '400112365', 1, '{\"ka\": \"კელაპტრიშვილის ქუჩა\"}', '$2y$10$yjOSpIr0YsTfbErAzzgIuOiX4.ESUt7SHzbMyjSaK7qbNDiARUk1m', '{\"ka\": \"<p>კრეატიული განვითარების ცენტრი არის არასამთავრობო, არაკომერციული</p><p>ორგანიზაცია, რომელიც 2014 წლიდან აქტიურად მუშაობს როგორც საქართველოს</p><p>სამოქალაქო სექტორთან, ასევე სხვადასხვა საერთაშორისო პროექტზე. ცენტრის</p><p>მიზნებია:</p><p>- ახალგაზრდების გაძლიერება</p><p>- არაფორმალური განათლების ინოვაციური მიდგომების დანერგვა</p><p>- კონფლიქტების მოგვარება და მშვიდობის მართვა</p><p>- სოციალური ინოვაციების დანერგვა და განვითარება</p>\"}', 'https://www.facebook.com/komligeo', NULL, 'www.komli.ge', NULL, 'company_images/brWRygMP6eOPx6UV8ihqEQY5rKma9qx508fr0wbb.png', 1, 0, 'lMBOKTSIzGSqiKxizMJUfdTXv06G75aaMdMEdH4Kda3FrBNPMaWElNREVO6O', '2021-06-29 10:18:02', '2021-07-06 10:12:56', 'local', 'local', NULL, '2014-02-27', '0', '0', '/storage/150__2021-06-3008:44:59__.png'),
