(163, '{\"ka\": \"წარმატების გზა\"}', 'thewaytofair@gmail.com', '55131618', NULL, '405468747', 1, '{\"ka\": \"ფიროსმანის 32\"}', '$2y$10$xCu4wMcrXHQghVRf.hSvRerzyHcIyJEbhIKFgP5iomucJk4cwCRYC', '{\"ka\": \"შპს ორგანიზაცია \\\"წარმატების გზა\\\",არის არაფორმალური განათლებისთვის ორიენტირებული საგანმანათლებლო ორგანიზაცია,რომელიც ორიენტირებულია ახალგაზრდების და არამარტო ახალგაზრდების არამედ თითოეული დაინტერესებული პირის რომლებსაც სურთ ცოდნის გაღრმავება დახმარების ხელი გაუწოდოს და დაეხმაროს მათ,თავიანთი მიზნების განხორციელებაში.ორაგნიზაცია ატარებს როგრც ფასიანს,აგრეთვბე უფასო ტრენინგებს.იგეგმება ტრენინგებიც.\"}', 'https://www.facebook.com/%E1%83%AC%E1%83%90%E1%83%A0%E1%83%9B%E1%83%90%E1%83%A2%E1%83%94%E1%83%91%E1%83%98%E1%83%A1-%E1%83%92%E1%83%96%E1%83%90The-way-to-success-101943578790409/about/?ref=page_internal', NULL, NULL, NULL, 'company_images/TCAEYMmpu7Vx7fwruZCaPMyA2mAQWjWvgqWU3UyO.jpeg', 1, 0, 'inzmfZMFsmXBUrDWhvKRWwtA1AFbiv7X1dsQYHoPjQb7gpmEJBMi0WxsAX7W', '2021-07-29 18:06:57', '2021-09-14 10:29:31', 'local', 'local', NULL, '2021-06-29', '0', '0', NULL),
(164, '{\"ka\": \"ანტრეპრენერთა ასოციაცია\"}', 'info@entrepreneurs.ge', '599382295', NULL, '404941480', 1, '{\"ka\": \"თბილისი, ვაჟა ფშაველას 1/43,\"}', '$2y$10$ZM7tgWf1AgnpxqbXjb2s8e7BIRI4bZV6ZPHnqXeoiNWRtnE1R88la', '{\"ka\": \"ანტრეპრენ ასოციაცია არის არაკომერციული, წევრობაზე დაფუძნებული ორგანიზაცია, რომელიც დაარსდა 2012 წელს.\\r\\n\\r\\n➡ ასოციაცია მიზნად ისახავს ანტრეპრენერებისა და ინოვატორების საზოგადოების შექმნას და ინოვაციებზე ორიენტირებული მეწარმეების მხარდაჭერას სწავლების, მენტორობის, ნეთვორქინგის და  აქსელერაციის პროგრამების დანერგვის გზით;\"}', 'https://www.facebook.com/EntrepreneursGeorgia/', NULL, 'https://entrepreneurs.ge/', NULL, '/storage/company_images/164__2021-08-0312:03:12__.png', 1, 0, 'sFBCQcxrOaRtZTebBoq4kQPfVVLrn3zrjiCHCKKxxkIComvoA6ia9nfAM62k', '2021-08-03 12:02:21', '2022-02-22 16:49:09', 'local', 'local', NULL, '2012-04-18', '0', '0', '/storage/164__2021-08-0314:24:24__.png'),
(165, '{\"ka\": \"ახალგაზრდები საზოგადოების უფლებებისთვის - Youth For Society Rights\"}', 'YFSR.organisation@gmail.com', NULL, NULL, '417898127', 1, '{\"ka\": \"გორის რაიონი სოფელი ოთარშენი\"}', '$2y$10$n7bRxv.Yo758V3pRItasXOM34NmfAZj/qqKPkSxr7QmP1dxg1ET12', '{\"ka\": \"<p>არასამთავრობო ორგანიზაცია ახალგაზრდები საზოგადოების უფლებებისთვის დაარსდა 2021 წელს, გორში, თუმცა ორგანიზაცია თავის საქმიანობას ახორციელებს საქართველოს ყველა რეგიონში ჰიბრიდული ფორმატით - როგორც ფიზკურ სივრცეში, ასევე დისტანციურად.</p><p>ორგანიზაციის საქმიანობის მიზნებია:</p><p>• მოქალაქეებში სამართლებრივი ცნობიერების ამაღლება და მათთვის იურიდიული დახმარების გაწევა, მათ შორის მოწყვლადი ჯგუფების ადვოკატირება, მათი საზოგადოებაში ინტეგრაციის მიზნით;</p><p>• კვლევების, სემინარების, კონფერენციების, სიმპოზიუმებისა და ტრენინგების ჩატარება, ასევე სამეცნიერო, საგანმანათლებლო და საინფორმაციო საქმიანობის განხორციელება;</p><p>• საქართველოს დემოკრატიული განვითარების, ინკლუზიური და ტოლერანტული საზოგადოების ჩამოყალიბების ხელშეწყობა და ამ გზით კანონის უზენაესობის განმტკიცება;</p><p>• საქველმოქმედო საქმიანობა.</p><p>ორგანიზაციის დაარსებიდან დღემდე, სამართლებრივი ცნობიერების ამაღლების მიზნით არა ერთი მნიშვნელოვანი პროექტი განხორციელდა, რომელშიც მონაწილეობა მიიღეს როგორც პრაქტიკოსმა იურისტებმა, ასევე სხვადასხვა უმაღლესი სასწავლო დაწესებულების იურიდიული ფაკულტეტისა სტუდენტებმა, სკოლის მოსწავლეებმა და სამართლით დაინტერესებულმა სხვა პირებმა.</p>\"}', 'https://www.facebook.com/YouthForSocietyRights', NULL, NULL, NULL, '/storage/company_images/165__2021-08-1422:53:28__.png', 1, 0, 'zuTQCnkgXqlAACY3oMonLwjmAtSrRxaOIKZfSPutVJYZIzvLXkXqUq9czmdS', '2021-08-14 22:50:58', '2021-09-14 10:29:31', 'local', 'local', NULL, '2021-07-12', '0', '0', NULL),
(166, '{\"ka\": \"UNCOY16\"}', 'mariam.avakovi.1@iliauni.edu.ge', '995598449774', NULL, '111111111', 1, NULL, '$2y$10$PaJ1YJvgdJxAU4WR8LewAOeuFE8vZLfk7yqknrYfa6Soc3D8XGXWW', '{\"ka\": \"გაეროს კლიმატის ცვლილების ახალგაზრდობის მე-13 კონფერენცია (COY) არის ღონისძიება YOUNGO– ს - გაეროს კლიმატის ცვლილების ჩარჩო კონვენციის ოფიციალური ახალგაზრდული ოლქის (UNFCCC) დროშის ქვეშ. კონფერენცია ტარდება გაეროს კლიმატის ცვლილების ყოველწლიური კონფერენციის წინ, რომელიც ასევე ცნობილია როგორც მხარეთა კონფერენცია (COP)\"}', 'https://www.facebook.com/coy16glasgow', 'https://www.linkedin.com/company/coy16glasgow/about/', 'https://ukcoy16.org/what-is-coy', NULL, 'company_images/zc3mfRcyzbpNJdrbXOOVpXPEvTR97a8C8d0a2vqV.jpeg', 1, 0, 'D6d2SBV1JZvHbcNKgB7nqNWkAfgnD4IFjT4UugO1MCfmgFUROCujbDOmNKr1', '2021-08-19 12:23:57', '2021-09-14 10:29:31', 'local', 'international', NULL, '2021-08-19', '0', '0', NULL),
(167, '{\"ka\": \"Scientific Cyber Library\"}', 'infocyberlib@gmail.com', '551747507', NULL, '429653421', 1, '{\"ka\": \"ვანი\"}', '$2y$10$ofAjhwsNhYRoYSW3e69y0egVXTbMeeFylSCjt6DEs8YeILmCzOo5i', '{\"ka\": \"სამეცნიერო კიბერ ბიბლიოთეკა თავისივე სახსრებით, ქმნის სახელმწიფოებრივ მნიშვნელოვან რესურს, ჩვენს უმთავრეს მიმართულებას წარმოადგენს საზოგადოების ინფორმირებულობა და დახმარება თანამდროვე კიბერ და ინფორმაციული შეტევების მიმართულებით, ამ დროისთვის შექმნილი გვაქვს სამეცნიერო ნაშრომები, ბუკლეტები, წიგნები, სტატიები ვიდეო სასწავლო გაკვთილები და ინოვაციური პლათფორმა რომელიც მნიშვნელოვანი დასაყრდენი გახდება\"}', 'https://www.facebook.com/ScientificCyberLibrary', NULL, 'https://cyberlibrary.net/', NULL, '/storage/company_images/167__2021-10-1817:17:49__.png', 1, 0, 'LHrl1ryJRCNY5cYfGVYmMeUviigctYNXI0FqzuebnZdKK4zWkLSLSwA1n9iV', '2021-10-18 17:06:03', '2022-01-26 11:58:08', 'local', 'local', NULL, '2019-12-18', '0', '0', NULL),
(168, '{\"ka\": \"გარემოს დაცვითი ეკოლოგიური ასოციაცია დეა\"}', 'gvancamalania@gmail.com', '598402575', '598289595', '239869344', 1, '{\"ka\": \"რუსთაველის მე-2 ჩიხი 4\"}', '$2y$10$ck8MSBSdsIVklU69L8uGb.T2BXUl2RA2expAmu42vJJQTz6Ov3QDy', '{\"ka\": \"<p><strong>გარემოს დაცვითი ორგანიზაცია ,,დეა\' დაფუძნებულია 2004 წელს და დაფუძნების დღიდან აქტიურად არის ჩართული ქვეყანაში მიმდინარე სამოქალაქო პროცესებში, საგანმანათლებლო - კულტურულ ღონიძიებებში , გარემოსდაცვით აქციებსა და პროექტებში . მისი მიზანია არაფორმალური განათლების მეშვეობით ცნობიერება აუმაღლოს &nbsp;ახალგაზრდებს , ქალებში ,მეწარმე ქალებს, საჯარო თუ კერძო სექტორს წარმომადგენლებს შემდეგ თემებზე : &nbsp;გარემოს დაცვა , ადამიანის უფლებების, &nbsp;ახალგაზრდული საქმიანობა, გენდერული თანასწორობა .გარემოს დაცვითი ეკოლოგიური ასოციაცია ,,დეა\\\" მიზნად ისახავს სამოქალქო &nbsp;განათლების და სამოქალაქო აქტივიზმის გაძლიერების ხელშეწყობას , ახალგაზრდბში არაფორმალური განათლების პოპულარიზაციით.</strong></p>\"}', 'https://www.facebook.com/Environmental-Ecological-Association-DEA-518836804960336', NULL, 'https://goo.gl/LHxhQm', NULL, '/storage/company_images/168__2021-10-2117:25:55__.png', 1, 0, 'bH09oAcBT9R73680XLPagFmCU51V8XY6EwMpwPYutkGmU98PZbplAU3NVyD8', '2021-10-19 09:16:18', '2022-01-26 11:57:43', 'local', 'local', NULL, '2004-04-04', '0', '0', NULL),
(169, '{\"ka\": \"კავკასიის ახალგაზრდული კავშირი\"}', 'giorgiazariashvili@gmail.com', '555755977', '555755977', '406086676', 1, '{\"ka\": \"ტაშკენთის პირველი შესახვევი N9\"}', '$2y$10$KVC6ydnsJOGrql9Sf7L1AO115tKGUe3QkhJQ6baWS3zt3MlHgqPXG', '{\"ka\": \"ორგანიზაციის ხედვა \\r\\nსაზოგადოება, რომელშიც ახალგაზრდებს აქვთ თანაბარი წვდომა განათლებაზე და შესაძლებლობა, მოახდინონ საკუთარი პოტენციალის რეალიზება\\r\\n\\r\\nორგანიზაციის მისია ჩვენი ახალგაზრდული ორგანიზაციის 2021-2025 წლების მისიია მოდერნიზებული საგანმანათლებლო სივრცის შექმნა საქართველოში, რომელიც პასუხობს თანამედროვე გამოწვევებს და ხელს უწყობს ძლიერი სამოქალაქო საზოგადოების ჩამოყალიბებას.\"}', 'https://www.facebook.com/CaucasusYouthNexus', NULL, 'www.caynex.ge', NULL, 'company_images/TInzMIB1OzYX2oVygf8kAOPHTdQ08qfKvujzrEsZ.png', 1, 0, 'FSrX3HVUU9pqp3vsU3NiJZp4sJrK7gIS73g2K9oyVGDiSW9h7DfOWuF3tYQf', '2021-10-29 10:36:22', '2022-01-26 11:56:51', 'local', 'international', NULL, '2013-02-17', '0', '0', NULL),
(170, '{\"ka\": \"ფორსეტი\"}', 'info@forset.ge', '599186887', '599186887', '406210130', 1, '{\"ka\": \"Online\"}', '$2y$10$9dPSZWsc66.kvybxOKeJCu9JABZqC7GWdAC0Fy40Mu2waC9TOm17e', '{\"ka\": \"ფორსეტი კრეატიული ორგანიზაციაა, რომელიც მონაცემების, დიზაინისა და ტექნოლოგიების დახმარებით, მნიშვნელოვან სოციალურ თემებზე საზოგადოების ცნობიერების ამაღლებას ისახავს მიზნად.  ჰაკათონების, ფესტივალებისა და სასწავლო პროგრამების ორგანიზებით ახალგაზრდებს, ჟურნალისტებს, აქტივისტებსა და საჯარო მოხელეებს ასწავლის მონაცემთა გამოყენებას უკეთესი კომუნიკაციისთვის და ქმნის ინოვაციურ ტექნოლოგიურ ხელსაწყოებს.\"}', 'https://www.facebook.com/ForSet.ge', 'https://www.linkedin.com/company/forset-georgia/', 'https://www.forset.ge/', NULL, '/storage/company_images/170__2021-12-0212:38:19__.png', 1, 0, 'CB78sQvJnwWPU59leg1WP89OiMILtxM8kiaiRvTLIClirNzUh6c6fjwrrKNE', '2021-12-02 12:29:52', '2022-01-26 11:57:19', 'local', 'local', NULL, '2017-05-10', '0', '0', '/storage/170__2021-12-0213:38:01__.png'),
