(8, '{\"en\": null, \"ka\": \"მილიონიანი ფონდი საგრანტო კონკურსისთვის\"}', '{\"en\": null, \"ka\": \"<p>სსიპ - ახალგაზდობის სააგენტო, ახალგაზრდული ორგანიზაციების მიერ შემუშავებული პროექტების დაფინანსების მიზნით, აცხადებს საგრანტო კონკურსს.&nbsp;</p><p>საკონკურსო წინადადებები მიიღება 2020 წლის 24 თებერვლიდან 10 აპრილის 18:00 საათის ჩათვლით.&nbsp;<br><br>საგრანტო კონკურსის მიმდინარეობის პერიოდში სააგენტომ განახორციელა რეგიონალური კამპანია ათივე რეგიონის 11 მუნიციპალიტეტში, რომლის ფარგლებშიც შეხვედრები ჩატარდება რეგიონალურ ახალგაზრდულ ორგანიზაციებთან და ახალგაზრდებთან.&nbsp;&nbsp;<br><br>საგრანტო კონკურსით დაინტერესებული პირებისთვის საკონსულტაციო დრო გამოიყოფა სააგენტოს ფეისბუქის გვერდზე პირდაპირი ჩართვის მეშვეობით და განიხილება ყველა შემოსული კითხვა.<br><br>ასევე, დაინტერესებულ პირებს შეეძლებათ კომუნიკაცია სააგენტოს შესაბამის სტრუქურულ ერთეულთან ელექტრონული ფოსტის საშუალებით.&nbsp;</p><p>დაფინანსების სრული ოდენობა მოიცავს 1 150 000 ლარს და გულისხმობს ორი თემატური მიმართულების ფარგლებში დაფინანსებულ პროექტებს.&nbsp;<br><br>I თემატური მიმართულების ძირითად მიზანს წარმოადგენს თითოეულ რეგიონში გრძელვადიანი და განმეორებადი შედეგების მომტანი ახალგაზრდული მდგრადი პლატფორმების შექმნა, რომლებიც არაფორმალური განათლების გზით უზრუნველყოფენ ახალგაზრდების კომპეტენციების ზრდას.&nbsp;<br><br>ახალგაზრდული ორგანიზაციების, კონკრეტულ რეგიონში მცხოვრები ახალგაზრდების, ადგილობრივ ხელისუფლებასთან და სხვა დაინტერესებულ მხარეებს შორის თანამშრომლობის და ურთიერთობის ხელშეწყობას. მხარს დაუჭერს ახალგაზრდულ ინიციატივებს და უზრუნველყოფს მათ ჩართულობას ადგილობრივ საზოგადოებრივ, ეკონომიკურ თუ კულტურულ ცხოვრებაში და სხვადასხვა ახალგაზრდულ პროექტებში.&nbsp;<br><br>თემატურ მიმართულებაზე გათვალისწინებული დაფინანსების საერთო ოდენობა: 900 000 – 00 ლარი; თითოეულ რეგიონზე გათვალისწინებული დაფინანსების საერთო ოდენობა შეადგენს 90 000 - 00 ლარს. საგრანტო კონკურსის ფარგლებში, თითოეულ რეგიონზე გათვალისწინებულია მაქსიმუმ სამი საგრანტო პროექტის დაფინანსება.&nbsp;<br><br>თანხის მოცულობა, რომლის მოთხოვნაც შესაძლებელია ერთი საგრანტო პროექტის დასაფინანსებლად: მინიმალური თანხა - 30 000 -00 ლარი. მაქსიმალური თანხა - 90 000 – 00 ლარი; საგრანტო პროექტის განხორციელების ვადა არ უნდა აღემატებოდეს 6 თვეს და გულისხმობს დაფინანსების მოთხოვნას 30 000 ლარიდან - 60 000 ლარის ფარგლებში. 61 000 ლარიდან - 90 000 ლარის მოთხოვნის შემთხვევაში საგრანტო პროექტის ვადა არ უნდა აღემატებოდეს 10 თვეს.&nbsp;<br><br>ზემოაღნიშნულ ორივე შემთხვევაში პროექტით გათვალისწინებული ვადის ამოწურვის შემდეგ (6 და 10 თვე), საგრანტო კონკურსის პირობების შესაბამისად შექმნილი პლატფორმა უნდა განაგრძობდეს ფუნქციონირებას, მდგრადი და განმეორებადი შედეგების უზრუნველყოფის გათვალისწინებით გრძელვადიან პერსპექტივაში. განმცხადებელი ორგანიზაცია, საგრანტო კონკურსში დაფინანსების მოპოვების შემთხვევაში, ვალდებულია ჩაერთოს II თემატური მიმართულების ფარგლებში გამარჯვებული ორგანიზაციის მიერ ახალგაზრდული ორგანიზაციების გადამზადება/გაძლიერების განსახორციელებელ აქტივობებში.&nbsp;<br><br>საგრანტო პროექტის წარმოდგენის უფლება აქვს:&nbsp;<br><br>● რეგიონში რეგისტრირებულ ახალგაზრდულ ორგანიზაციას; ახალგაზრდული ორგანიზაცია არის საქართველოს კანონმდებლობის შესაბამისად შექმნილი არასამეწარმეო (არაკომერციული) იურიდიული პირი, რომლის სადამფუძნებლო დოკუმენტაციით განსაზღვრულია, რომ ორგანიზაციის საქმიანობის ძირითად სფეროს წარმოადგენს ახალგაზრდების განვითარებასთან დაკავშირებული საკითხები.&nbsp;<br><br>● იდეის მქონე საინიციატივო ჯგუფს, რომელიც ელექტრონულ აპლიკაციაში რეგისტრირდება, როგორც ფიზიკური პირი პირადი ნომრით. აღნიშნული დაშვება ქვეყანაში განვითარებული მოვლენების გამო გაკეთდა, ვინაიდან ორგანიზაციის დარეგისტრირება პრობლემურია მონაწილეობის მსურველთათვის, თუმცა იმ შემთხვევაში თუ წარმოდგენილი პროექტი შესარჩევ ეტაპებს წარმატებით გაივლის, ბოლო ეტაპზე საინიციატივო ჯგუფს მაინც მოუწევს ახალგაზრდულ ორგანიზაციად დარეგისტრირება.&nbsp;&nbsp;<br><br>● რეგიონში რეგისტრირებულ ახალგაზრდულ ორგანიზაციას, რომელიც ქმნის კონსორციუმს (კონსორციუმი გულისხმობს ახალგაზრდულ და საქართველოში რეგისტრირებულ სხვა არასამთავრობო ორგანიზაციებს, რომლებიც აერთიანებენ თავიანთ რესურსებს და ახდენენ აქტივობების კოორდინაციას საერთო მიზნის მისაღწევად). საგრანტო პროექტის წარმომდგენი, წამყვანი ორგანიზაცია და სააგენტოსთან ანგარიშვალდებული/პასუხისმგებელია რეგიონში რეგისტრირებული ახალგაზრდული ორგანიზაცია. განმცხადებელმა კონკრეტულად უნდა გაწეროს საგრანტო პროექტსა და სამოქმედო გეგმაში თითოეული ორგანიზაციის მიერ შესასრულებელი აქტივობები/ღონისძიებები წარმოდგენილი ბიუჯეტის შესაბამისად, სადაც სააგენტოსგან მოთხოვნილი ბიუჯეტის 50% გაწერილი იქნება განმცხადებელი ორგანიზაციის მიერ განსახორციელებელ აქტივობებზე.&nbsp;<br><br>● კონკრეტულ რეგიონში რეგისტრირებული რამდენიმე ახალგაზრდული ორგანიზაციის მიერ შექმნილი კონსორციუმის მიერ შემუშავებული საგრანტო პროექტი, რომლის წარმომდგენი, შესრულებაზე პასუხისმგებელი, წამყვანი და სააგენტოსთან ანგარიშვალდებულია ერთ-ერთი მათგანი. განმცხადებელმა კონკრეტულად უნდა გაწეროს საგრანტო პროექტსა და სამოქმედო გეგმაში თითოეული ორგანიზაციის მიერ შესასრულებელი აქტივობები/ღონისძიებები წარმოდგენილი ბიუჯეტის შესაბამისად, სადაც სააგენტოსგან მოთხოვნილი ბიუჯეტის 50% გაწერილი იქნება განმცხადებელი ორგანიზაციის მიერ განსახორციელებელ აქტივობებზე. II თემატური მიმართულება გულისხმობს, რეგიონებში რეგისტრირებული ორგანიზაციების მოძიებას, ორგანიზაციული განვითარებისთვის საჭირო უნარების შეძენის მიზნით შესაბამისი სწავლების ჩატარებას, რომელიც მოიცავს საპროექტო განაცხადის გაწერას, სამუშაო გეგმის - პროექტის ფარგლებში განსახორციელებელი ღონისძიებების/აქტივობების დროში გაწერას, ბიუჯეტის შედგენას, დონორი ორგანიზაციების მოძიებას და სხვა საჭირო უნარებს.&nbsp;<br><br>● თემატურ მიმართულებაზე გათვალისწინებული დაფინანსების მოცულობა - 250 000 ლარი;&nbsp;<br><br>● საგრანტო პროექტის განხორციელების ვადა არ უნდა აღემატებოდეს 10 თვეს;&nbsp;<br><br>● საგრანტო პროექტის განხორციელება შეუძლია საქართველოში რეგისტრირებულ ახალგაზრდულ ქოლგა ორგანიზაციას. ახალგაზრდული ქოლგა ორგანიზაცია - აერთიანებს საქართველოში რეგისტრირებულ ახალგაზრდულ ორგანიზაციებს, ადვოკატირებას უწევს ახალგაზრდულ პოლიტიკას და აჟღერებს ახალგაზრდული ორგანიზაციების საჭიროებებს და ინტერესებს, ხელს უწყობს როგორც წევრი, ასევე ახლადშექმნილი ახალგაზრდული ორგანიზაციების გაძლიერებასა და მათ მონაწილეობას სხვადასხვა ადგილობრივ და საერთაშორისო აქტივობებში. განმცხადებელ ქოლგა ორგანიზაციას რეგიონების მასშტაბით უნდა ყავდეს ჯამში მინიმუმ 10 (ათი) წევრი ორგანიზაცია.&nbsp;<br><br>● საგრანტო პროექტისა და ბიუჯეტის შედგენისას განმცხადებელმა არაუმეტეს 50 000 ლარი საკუთარი ორგანიზაციული გაძლიერებისთვის უნდა გაითვალისწინოს, დაასაბუთოს საჭიროება და შესაბამისი ჩასატარებელი აქტივობები. ხოლო, დარჩენილი 200 000 ლარი გამოიყენოს საგრანტო კონკურსის I თემატური მიმართულების ფარგლებში დაფინანსებული რეგიონების ახალგაზრდული ორგანიზაციების გასაძლიერებლად. შესაძლებელია, გარდა ზემოაღნიშნულისა, გადამზადება/გაძლიერების პროექტში ჩართოს საკუთარი რესურსით მოძიებული სხვა რეგიონალური ორგანიზაცია/ორგანიზაციები.&nbsp;<br><br>შენიშვნა: საგრანტო კონკურსის დასრულების ვადის ცვლილების გამო, სასურველია პროექტის დაწყების ვადად განსაზღვროთ მიმდინარე წლის ივლისის თვე. სამოქმედო გეგმის შესაბამის გრაფაში პირველი ეტაპის დაფინანსების დახურვის ვადად (ფინანსური და ნარატიული ანგარიშების ჩაბარება) განსაზღვროთ 2020 წლის ნოემბრის თვე.<br><br>საგრანტო კონკურსის შესახებ დამატებითი კითხვებისთვის შეგიძლიათ დაგვიკავშირდეთ: <a href=\\\"mailto:fund@youthagency.gov.ge\\\">fund@youthagency.gov.ge</a>&nbsp;<br><br>საგრანტო კონკურსის პირობების შინაარსობრივ ნაწილთან დაკავშირებით:<br>ავთანდილ ხანთაძე - 599 423 004;&nbsp;<br><br>ფინანსურ ნაწილთან დაკავშირებით:<br>გიორგი ლილუაშვილი: 551 360 522</p>\"}', '{\"en\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი&nbsp;N: 76ბ</p>\", \"ka\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი&nbsp;N: 76ბ</p>\"}', '41.723090', '44.731563', '599423004', '2020-02-24', '2020-04-10', '2020-02-14', 1, NULL, 'utFFqQTfwAKOPH1LiQdaVccUybCzxO09F0OBFftN.jpeg', 1, 'https://www.facebook.com/events/2336261993141773/', NULL, 'fund@youthagency.gov.ge', '2020-02-14 12:41:42', '2020-11-06 20:27:31', 'http://fondi.gov.ge/grant_app/login.php', 'opportunity_files/2fSSQtd2FgSl1xoc12DAtjUEZBVpFvB5yryPJjjR.xlsx', 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(9, '{\"en\": \"Call for European School Summer Camp 2020 in Georgia\", \"ka\": \"Call for European School Summer Camp 2020 in Georgia\"}', '{\"en\": \"<p>LEPL &bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.<br />\\n<br />\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.<br />\\n<br />\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.<br />\\n<br />\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.<br />\\n<br />\\nThe application deadline is <strong>Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia</strong>.<br />\\n<br />\\nYouth Agency has been implementing this project since 2018.Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community.<br />\\n<br />\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;.<br />\\n<br />\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).</p>\", \"ka\": \"<p>LEPL &bdquo;Youth Agency&rdquo; of Georgia, is pleased to announce the Call for European School Summer Camp 2020 in Georgia. The project is supported by the European Union and is the part of the initiative establishing the Eastern Partnership European School in Georgia.<br />\\n<br />\\nYoung people from the EU and its six Eastern Partner countries (Armenia, Azerbaijan, Belarus, Georgia, the Republic of Moldova and Ukraine) are invited to apply for the European School Summer Camp 2020, which will take place in Georgia from 15 to 30 August. Participants should be aged between 14 and 18 at the time of applying for the camp.<br />\\n<br />\\nThe summer camp will gather up to 100 young people to participate in various interactive and educational activities. These activities will aim to highlight European civil values and foster cooperation, multi-cultural understanding and tolerance among young people in the Eastern Partnership region.<br />\\n<br />\\nThe camp will serve as a preparatory phase for potential students of the Eastern Partnership European School and for other interested young people.<br />\\n<br />\\nThe application deadline is <strong>Thursday, April 16, 2020 (00:00 GMT+4) Time in Georgia</strong>.<br />\\n<br />\\nYouth Agency has been implementing this project since 2018.Thousands of outstanding candidates are applying annually to the camp. Project has already hosted 200 young representatives from 15 countries. These youngsters became peer educators and leaders in their community.<br />\\n<br />\\nThe establishment of the Eastern Partnership European School is part of the broader regional effort to address the needs of youth, focusing on secondary education. It is a flagship project of the European Commission in the Eastern Neighbourhood region and one of the Eastern Partnership&rsquo;s &ldquo;20 Deliverables for 2020&rdquo;.<br />\\n<br />\\nDUE TO THE CORONAVIRUS DISEASE 2019 (COVID-19), SOME CHANGES MAY OCCUR (cancellation of the call, the camp, or the change with the camp dates).</p>\"}', '{\"en\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი N76ბ</p>\", \"ka\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი N76ბ</p>\"}', '41.723090', '44.731563', '+995 599 877 114', '2020-03-20', '2020-04-16', '2020-03-19', 1, NULL, 'c320lOFRoL7VLqyP0PAc8wNx0hNW2GH4EVzntHXm.jpeg', 2, 'https://www.facebook.com/events/2336261993141773/', NULL, 'eapsummercamp2020@gmail.com', '2020-03-19 13:37:11', '2020-04-07 10:15:17', 'https://docs.google.com/forms/d/e/1FAIpQLSdraER_wXYmFSjd_RzAhSvUjyhuqzzpmRA6KyrhGPtx7S_TkQ/viewform', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(11, '{\"en\": \"a\", \"ka\": \"გახდი „ახალგაზრდული მრჩეველთა საბჭოს“ წევრი\"}', '{\"en\": \"<p>a</p>\", \"ka\": \"<p dir=\\\"ltr\\\">&quot;ევროპის საბჭოს&quot; რეკომენდაციით შექმნილი &bdquo;ახალგაზრდული მრჩეველთა საბჭოსთვის&ldquo; კანდიდატების მიღება დაიწყო საქართველოს მასშტაბით.</p>\\n\\n<p dir=\\\"ltr\\\">&bdquo;ახალგაზრდულ მრჩეველთა საბჭოს&ldquo; წევრობის მსურველთათვის ღია კონკურსი 2020 წლის 13&nbsp;მაისს დაწყება და 1 ივნისის 18:00&ndash;საათზე დასრულდება.</p>\\n\\n<p dir=\\\"ltr\\\">ახალგაზრდობის სააგენტო, ახალგაზრდული სფეროს ეკოსისტემას ქმნის და სამწლიანი რეფორმის ერთ&ndash;ერთ საკვანძო საკითხად &bdquo;მონაწილეობრივ ახალგაზრდულ პოლიტიკას&ldquo; (Meaningful Youth Participation) გამოყოფს.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">ვინაიდან ახალგაზრდები და ახალგაზრდული ოგრანიზაციები სფეროს ის უმთავრესი ნაწილი არიან, რომელთა მონაწილეობის გარეშე სფეროს ეკოსისტემის შექმნა წარმოუდგენელია, სააგენტომ აირჩა გეზი, რომ მისი გადაწყვეტილებები იყოს მონაწილეობრივი.</p>\\n\\n<p dir=\\\"ltr\\\">ახალგაზრდობის მონაწილეობრივი პოლიტიკა გულისხმობს&nbsp; ახალგაზრდების ჩართვას, როგორც ადგილობრივ, ისე ეროვნულ დონეზე, იმ&nbsp; გადაწყვეტილებების მიღებაში, რომლებიც მათ ეხებათ. ნამდვილი მონაწილეობა (meaningful) ნიშნავს, რომ ახალგაზრდები ჩართულები არიან ისეთი ფორმით, რომ გავლენა მოახდინონ ამ გადაწყვეტილებებზე.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">აღნიშნული მიმართულების გასავითარებლად, სააგენტოს ინიციატივით, ევროპის საბჭოს რეკომენდაციით, &bdquo;ახალგაზრდული მრჩეველთა საბჭო&ldquo; იქმნება, რომელიც ახალაზრდობას საშუალებას მისცემს უშუალოდ ჩაერთონ გადაწყვეტილების მიღების პროცესში.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">&nbsp;&bdquo;ახალგაზრდულ მრჩეველთა საბჭოს&ldquo; კონცეფცია, მოწვეული ექსპერტების ჩართულობით ევროპის საბჭოს &ldquo;Advisory Council on Youth&ldquo; მოდელით შეიქმნა.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">&bdquo;ახლგაზრდული მრჩეველთა საბჭო&ldquo; არის სრულიად მოხალისეობრივი, მიზნად ისახავს უშუალოდ და მხოლოდ სააგენტოს საქმიანობაში ახალგაზრდების ინტერესების გათვალისწინებას.&nbsp;&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">საბჭოს დანიშნულებაა კონსულტაცია გაუწიოს&nbsp; ახალგაზრდობის სააგენტოს ახალგაზრდობასთან დაკავშირებულ ყველა საკითხზე, დაამყაროს თანამშრომლობა და კოორდინაცია ახალგაზრდულ სექტორში სამთავრობო და არასამთავრობო სექტორს შორის.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">საბჭო საქართველოს რეგიონების და თბილისის ახალგაზრდული ორგანიზაციების 22 ახალგაზრდა (18&ndash;29 წელი) წარმომადგენლისა და საქართველოს ახალგაზრდული ორგანიზაციების ქოლგა ორგანიზაციის ერთი ახალგაზრდა წარმომადგენლისაგან დაკომპლექტდება.</p>\\n\\n<p dir=\\\"ltr\\\">წევრების შერჩევაში სააგენტოსთან ერთად მონაწილეობას იღებს საერთაშორისო ორგანიზაციებით დაკომპლექტებული კომისია.</p>\\n\\n<p dir=\\\"ltr\\\">საბჭოს დაკომპლექტების შემდეგ, მისი შემადგენლობიდან შეიქმნება 6 წევრიანი ბიურო, რომელიც საბჭოს საქმიანობას გაუწევს კოორდინაციას.</p>\\n\\n<p dir=\\\"ltr\\\">საბჭოს წევრები გაერთიანდებიან თემატურ სამუშაო ჯგუფებში, რომლებიც ახალგაზრდობის სააგენტოს პრიორიტეტების, მოსალოდნელი შედეგების დადგენისა და ახალგაზრდული პოლიტიკის სტანდარტების შემუშავების მიზნით იმუშავებენ. (&bdquo;მრჩეველთა საბჭოს&ldquo; სამუშაო აღწერილობა სრულად იხილეთ &bdquo;ჩამოსატვირთ ფაილებში&ldquo;)</p>\\n\\n<p dir=\\\"ltr\\\">საბჭოს 22 წევრი, ახალგაზრდული ორგანიზაციებიდან აირჩევა ღია კონკურსის წესით, 1 მონაწილეს კი საქართველოს ახალგაზრდული ორგანიზაციების&nbsp; ქოლგა ორგანიზაცია წარადგენს.</p>\\n\\n<p dir=\\\"ltr\\\">&nbsp;&bdquo;ახალგაზრდული მრჩეველთა საბჭოს&ldquo; წევრების შერჩევის კრიტერიუმებია:</p>\\n\\n<ul dir=\\\"ltr\\\">\\n\\t<li>&bull; ასაკი: 18-29 წელი;</li>\\n\\t<li>&bull; ქართული ენის ცოდნა;</li>\\n\\t<li>&bull; წარმოადგენდეს საქართველოში რეგისტრირებულ, მოქმედ ადგილობრივ ან რეგიონულ&nbsp; ახალგაზრდულ ორგანიზაციას;</li>\\n\\t<li>&bull; ორგანიზაციის გამოცდილება სახელმწიფო ახალგაზრდული პოლიტიკით განსაზღვრულ&nbsp;პრიორიტეტებზე მუშაობის მიმართულებით;</li>\\n\\t<li>&bull; კანდიდატის ახალგაზრდულ საკითხებზე მუშაობის გამოცდილება;</li>\\n\\t<li>&bull; კანდიდატის ცოდნა ახალგაზრდული პოლიტიკის, ახალგაზრდების პრობლემების დაგამოწვევების შესახებ;</li>\\n\\t<li>&bull;&nbsp; მოტივაცია და შესაძლებლობა მონაწილეობა მიიღოს საბჭოს შეხვედრებში და&nbsp;წვლილი შეიტანოს მის საქმიანობაში, მათ შორის მოსაზრებების და წინადადებების შემუშავებაში.</li>\\n</ul>\\n\\n<p>გარდა ზემოაღნიშნულისა, მრჩეველთა საბჭოს წევრების შერჩევის პროცესში გათვალისწინებული იქნება ბალანსი გენდერული, ორგანიზაციის მუშაობის გეოგრაფიული არეალის და ორგანიზაციის/კანდიდატის თემატური ექსპერტიზის თვალსაზრისით.</p>\\n\\n<p dir=\\\"ltr\\\">წევრების შერჩევაში სააგენტოსთან ერთად მონაწილეობას იღებს საერთაშორისო ორგანიზაციებით დაკომპლექტებული კომისია.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">შერჩევა განხორციელდება ორ ეტაპად: &nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">პირველ ეტაპზე განხორციელდება მიღებული აპლიკაციების და დოკუმენტაციის განხილვა და შესაბამისობის შეფასება დადგენილ კრიტერიუმებთან.&nbsp;</p>\\n\\n<p dir=\\\"ltr\\\">მეორე ეტაპზე ჩატარდება ინტერვიუ მხოლოდ პირველ ეტაპზე შერჩეულ კანდიდატებთან.&nbsp;</p>\"}', '{\"en\": \"<p>a</p>\", \"ka\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი N: 76ბ</p>\"}', '414324.9', '444353.7', '+995595083682', '2020-05-13', '2020-06-01', '2020-05-13', 1, NULL, 'kWCrIY3myH7mkik0z8y2BHRdod7oh0leQ7aq0zET.jpeg', NULL, 'https://www.facebook.com/youthagency2019/', NULL, 'm.kobakhidze@youthagency.gov.ge', '2020-05-13 06:45:13', '2020-05-18 14:10:17', 'https://zfrmz.com/wI73wPB3V0CAFOdoyxB4', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(12, '{\"en\": null, \"ka\": \"ჩაერთე ახალგაზრდების საჭიროებების კვლევაში\"}', '{\"en\": null, \"ka\": \"<p>ახალგაზრდობის სააგენტო, ახალგაზრდების საჭიროებების, ინტერესებისა და დამოკიდებულებებისშესწავლის მიზნით კვლევას იწყებს. აღნიშნული სააგენტოს სამწლიანი რეფორმის ერთ–ერთი მიმართულების, „მუნიციპალური ახალგაზრდული პოლიტიკის,“ ფარგლებში ხორციელდება და მოიცავს&nbsp;10&nbsp;რეგიონის საპილოტე მუნიციპალიტეტებს. კვლევის შედეგები საფუძვლად დაედება ადგილზე ახალგაზრდული პოლიტიკის დოკუმენტისა და სამოქმედო გეგმის შემუშავებას, ვინაიდან პოლიტიკის შექმნისას მტკიცებულებები მნიშვნელოვანი ინსტრუმენტია.&nbsp;</p><p><strong>კვლევის ფოკუსს წარმოადგენს:</strong></p><ul><li><strong>ახალგაზრდების პრობლემები და გამოწვევები;</strong></li><li><strong>ახალგაზრდების საჭიროებები;</strong></li><li><strong>ახალგაზრდების შესაძლებლობები;</strong></li></ul><p><strong>კვლევა შეეხება ახალგაზრდების უფლებებთან წვდომას, დასაქმებას, განათლებას, მონაწილეობას, ცხოვრების სტილს, ჯანმრთელობას და სხვა მომიჯნავე საკითხებს.</strong></p><p>კვლევა მოიცავს სამაგიდე, რაოდენობრივ და თვისებრივ კომპონენტებს და ისეთ მეთოდოლოგიებს, როგორიცაა დისკრუსის კვლევა, შედარებითი ანალიზი, ფოკუს ჯგუფები, სატელეფონო ჩაღრმავებული ინტერვიუები და ა.შ.</p><p>ამ ეტაპზე მიმდინარეობს რაოდენობრივი კვლევა ონლაინ-გამოკითხვის მეშვეობით. კვლევის ეს ნაწილი 10 ივნისს დაიწყო და 29 ივნისს დასრულდება, მონაწილეობა შეუძლიათ ახალგაზრდებს (14–29 წელი) რომლებიც წარმოადგენენ საქართველოს რეგიონებს.</p><p>კვლევის შესახებ დეტალური ინფორმაცია და კითხვარი იხილეთ ბმულზე:&nbsp;&nbsp; <a href=\\\"https://bit.ly/3cQzNxh\\\">https://bit.ly/3cQzNxh</a></p><p>აღსანიშნავია ის ფაქტი, რომ სააგენტოსთან ერთად კვლევის პროცესში, როგორც&nbsp;&nbsp;კოორდინაციის, ისე აღსრულების ნაწილში, ჩართულები არიან ადგილობრივი თვითმმართველობის ახალგაზრდული სამსახურების წარმომადგენლები, რომლებმაც რეფორმის ფარგლებში, სააგენტოს მიერ ორგანიზებული, „მუნიციპალურ ახალგაზრდულ მუშაკად“ გადამზადების ოთხეტაპიანი პროგრამის პირველი ნაბიჯი უკვე გაიარეს.&nbsp;&nbsp;მათ საქმიანობის წარმატებით განხორციელებაში, სტრასბურგის ევროპის ახალგაზრდულ ცენტრში ხუთდღიან ტრენინგზე მიღებული გამოცდილებაც გაუმყარებთ, სადაც ისინი მიმდინარე წლის მარტის თვეში სააგენტოს წარდგენით იმყოფებოდნენ.</p><p>რეფორმის „მუნიციპალური ახალგაზრდული პოლიტიკის“ ფარგლებში განხორციელებული აქტივობები:</p><ul><li>სამიზნე მუნიციპალიტეტების შესარჩევად, სააგენტო 10-ვე რეგიონის 64–ვე მუნიციპალიტეტს ეწვია, ადგილზე გაეცნო ახალგაზრდულ სფეროში არსებულ საჭიროებებს, გაითვალისწინა მათი გამოწვევები და სფეროს ექსპერტების რეკომენდაციები რის საფუძველზეც საპილოტედ 10 რეგიონის 11 მუნიციპალიტეტი შეირჩა, (ქობულეთი, ოზურგეთი, ონი, ზუგდიდი, მესტია, ქუთაისი, გორი, თიანეთი, დმანისი, სიღნაღი და ახალციხე)&nbsp;<a href=\\\"https://bit.ly/2MTMcGh\\\">https://bit.ly/2MTMcGh</a></li><li>შერჩეულ მუნიციპალიტეტების მერებთან ურთიერთთანამშრომლობის მემორანდუმი გაფორმდა:&nbsp;<a href=\\\"https://bit.ly/2Yos0BE\\\">https://bit.ly/2Yos0BE</a>;</li><li>საპილოტე მუნიციპალიტეტების თანამშრომლების „მუნიციპალურ ახალგაზრდულ მუშაკებად“ დიტანციურად გადამზადების პირველი ეტაპი განხორციელდა:&nbsp;<a href=\\\"https://bit.ly/3cXfmyC\\\">https://bit.ly/3cXfmyC</a>;</li><li>იხილეთ ტრენინგის მიმდინარეობა:&nbsp;<a href=\\\"https://bit.ly/3cTgLXe\\\">https://bit.ly/3cTgLXe</a>;</li></ul>\"}', '{\"en\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი N: 76ბ</p>\", \"ka\": \"<p>თბილისი, ვაჟა-ფშაველას გამზირი N: 76ბ</p>\"}', '41.723641', '44.731612', NULL, '2020-06-10', '2020-06-29', '2020-06-10', 1, NULL, 'LAM9VKSno8nEUwnSSkWbIYWR62OGibyVAORpFcqH.png', 1, NULL, NULL, NULL, '2020-06-15 07:59:14', '2020-11-06 20:27:10', 'https://bit.ly/youthresearch20', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(16, '{\"en\": \"We together, We CAN\", \"ka\": \"ჩვენ ერთად, ჩვენ შეგვიძლია\"}', '{\"en\": \"<p>ტრენინგი მიზნად ისახავს მხარი დაუჭიროს ახალგაზრდების ცოდნის და უნარების გაუმჯობესებას დისკრიმინაციის და სიძულვილის ენის წინააღმდეგ მოქმედებისთვის ონლაინ და მათ თემში.</p>\", \"ka\": \"<p>ტრენინგი მიზნად ისახავს მხარი დაუჭიროს ახალგაზრდების ცოდნის და უნარების გაუმჯობესებას დისკრიმინაციის და სიძულვილის ენის წინააღმდეგ მოქმედებისთვის ონლაინ და მათ თემში.</p>\\n\\n<p>ტრენინგში მონაწილეობის მიღება შეუძლიათ ქვემო ქართლში, სამცხე-ჯავახეთში აჭარასა და პანკისის ხეობაში მცხოვრებ ახალგაზრდებს.</p>\\n\\n<p>ტრენინგის შესახებ დეტალური ინფორმაცია გთხოვთ იხილოთ თანდართუი დოკუმენტის სახით.&nbsp;</p>\\n\\n<p>წარმატებებს გისურვებთ!</p>\"}', '{\"en\": \"<p>ონლაინ</p>\", \"ka\": \"<p>ონლაინ</p>\"}', NULL, NULL, '577606077', '2020-07-27', '2020-08-09', '2020-07-14', 35, NULL, 'Eiur9PSN9gkQu8yZkl3UbJINHeGmGqzNSEytBkZi.png', NULL, NULL, NULL, NULL, '2020-07-14 10:45:41', '2020-07-15 07:02:54', 'https://bit.ly/wetogetherwecan', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(17, '{\"en\": \".\", \"ka\": \"რეგისტრაცია სტუდენტებისთვის ჩარტერულ რეისზე ბერლინში\"}', '{\"en\": \"<p>&nbsp;.</p>\", \"ka\": \"<p>⭕️&nbsp;თუ ხარ:&nbsp;</p>\\r\\n\\r\\n<p>☑️&nbsp;საქართველოს მოქალაქე&nbsp;<br />\\r\\n☑️&nbsp;მოქმედი სტუდენტი საქართველოში<br />\\r\\n☑️&nbsp;გაქვს სამუშაო მოწვევა / კონტრაქტი გერმანიაში&nbsp;</p>\\r\\n\\r\\n<p>👉&nbsp;შეგიძლია ისარგებლო სახელმწიფოსგან დაშვებული ჩარტერული რეისით, თბილისი&ndash;ბერლინი&ndash;თბილისი.</p>\\r\\n\\r\\n<p>📍&nbsp;ფრენა: 25 ივლისი&nbsp;</p>\\r\\n\\r\\n<p>საქართველოს მთავრობის მიერ დადგენილი სუბსიდირებული ბილეთების ფასი არაუმეტეს 199 ევროსი.</p>\\r\\n\\r\\n<p>👇&nbsp;დაინტერესების შემთხვევაში, 20 ივლისამდე, შეავსე მოცემული სარეგისტრაციო ფორმა სრულად:&nbsp;<br />\\r\\n<a href=\\\"https://youthagency2019.typeform.com/to/jX9jl7M0\\\" rel=\\\"noopener nofollow\\\" target=\\\"_blank\\\">https://youthagency2019.typeform.com/to/jX9jl7M0</a></p>\\r\\n\\r\\n<p>📞დეტალებზე დაგვიკავშირდი: 032 2 30 51 65 / 032 2 30 51 7</p>\"}', '{\"en\": \"<p>&nbsp;.</p>\", \"ka\": \"<p>&nbsp;ვაჟა-ფშაველას გამზირი №76 ბ</p>\"}', NULL, NULL, '032 2 30 51 65 / 032 2 30 51 70', '2020-07-17', '2020-07-20', '2020-07-17', 1, NULL, 'hQ9iGyNpJec70AXpBztHH2hR2ZZsZlee2AmWThEl.jpeg', NULL, NULL, NULL, NULL, '2020-07-17 11:23:06', '2020-07-17 13:38:30', 'https://youthagency2019.typeform.com/to/jX9jl7M0', NULL, NULL, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
