(20, '{\"en\": \"..\", \"ka\": \"გახდი ახალგაზრდული მუშაკი-ეს პროფესიაა!\"}', '{\"en\": \"<p>&nbsp;.</p>\", \"ka\": \"<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">საქართველოში,&nbsp;პირველი, სახელმწიფოსაგან აღიარებული &bdquo;ახაგაზრდული მუშაკის&ldquo; მოსამზადებელი განათლების ხარისხის გავითარების ეროვნული ცენტრის&nbsp;(EQE.G) მიერ აკრედიტირებული პროგამა შეიქმნა, რომელიც პირველ ეტაპზე, არაფორმალური განათლების მიმწოდებელ, არსებულ პრაქტიკოს ახალგაზრუდლ მუშაკებს გადაამზადებს, აუმაღლებს მათ კვალიფიკაციას, განუვითარებს მრავალმხრივ შესაძლებლობებს. აღნიშნული პროგრამა &nbsp;ევროპულ სტანდარტებს შეესაბამება და ხელს უწყობს ახალგაზრდული მუშაკების ახალგაზრდებთან ეფექტურ მუშაობას და მათთვის საჭირო კომპეტებციების გადაცემას.</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">ახალგაზრდული საქმიანობის მეთოდოლოგია ეფუძნება ევროკავშირის ქვეყნების წარმატებულ გამოცდილებას, რომლითაც ევროკავშირის ქვეყნები ბოლო ათწლეულებია ხელმძღვანელობენ, როგორც ახალგაზრდებისთვის არაფორმალური განათლების მიწოდების საუკეთესო თანამედროვე მოდელი.</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">პროფესიულ ახალგაზრდულ საქმიანობას &bdquo;ახალგარზდული მუშაკი&ldquo; ახორციელებს, რომელიც არაფორმალური განათლების გზით ახალგაზრდებს ევროკავშირის მიერ აღიარებულ 8 საკვანძო კომპეტენციას გადასცემს და ასევე იმ&nbsp; უნარებისა და დამოკიდებულებების განვითარებაში ეხმარება, რომლებიც აუცილებელია საზოგადოებრივ ცხოვრებაში სრულფასოვნად მონაწილეობისთვის და საკუთარი პოტენციალის მაქსიმალურად რეალიზებისთვის.</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">&bdquo;ახალგაზრდული მუშაკის პროფესიონალიზაცია და ინსტიტუციონალიზაცია&ldquo;, სააგენოს სამწლიანი რეფორმის მთავარი მიმართულებაა და ამასთან საქართველოს ევროკავშირთან ასოცირების ხელშეკრულებით აღებული ვალდებულების ნაწილია.</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">&bdquo;პროფესიული ახაგაზრდული საქმიანობის&ldquo; რეფორმა ითვალისწინებს:</span></span></span></span></p>\\n\\n<ul style=\\\"margin-left:40px\\\">\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">საქართველოში ახალგაზრდული მუშაკის აღიარებულ პროფესიად ჩამოყალიბებას;</span></span></span></span></li>\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">პრაქტიკოსი ახალგაზრდული მუშაკების პროფესიულ გადამზდებასა და&nbsp;</span></span></span></span></li>\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">ხარისხზე ორიენტირებული ახალგაზრდული საქმიანობის არეალის გაფართოებას მთელი ქვეყნის მასშტაბით.</span></span></span></span></li>\\n</ul>\\n\\n<p><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">ახალგაზრდული მუშაკის მომზადების პირველ სახელმწიფოსაგან აღიარებულ სასერტიფიკატო პროგრამაზე კანდიდატების მიღება 30 ივლისიდან დაიწყო და 16 აგვისტოს ჩათვლით გაგრძელდება.&nbsp;</span></span></strong></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">აღნიშნულ კურსზე სააგენტო პირველ ეტაპზე იწვევს პრაქტიკოს ახალგაზრდულ მუშაკებს საქართველოს ათივე რეგიონში.</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">შერჩევის კრიტერიუმებია:</span></span></strong></span></span></p>\\n\\n<ul style=\\\"margin-left:40px\\\">\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">ასაკი: 21 +</span></span></span></span></li>\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">განათლება: პროფესიული ან/და უმაღლესი განათლება.</span></span></span></span></li>\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">გამოცდილება: ბავშვებსა და/ან ახალგაზრდებთან მუშაობის&nbsp; გამოცდილება (რომელშიც იგულისხმება არაფორმალური შეხვედრების, სპორტული, შემეცნებითი, კულტურული, სამოქალაქო და სხვა აქტივობების დაგეგმვა-განხორციელება);</span></span></span></span></li>\\n\\t<li style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">მაღალი მოტივაცია</span></span></span></span></li>\\n</ul>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">კურსის ხანგრძლივობა : 6 თვე.</span></span></strong></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">პროგრამაში მონაწილეობის მისაღებად შეირჩევა 30 პრაქტიკოსი ახალგაზრდული მუშაკი</span></span></span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">კურსზე ჩარიცხული პრაქტიკოსი კანდიდატები, რომლებიც წარმატებით დაასრულებენ გადამზადების 6</span></span>&nbsp;&nbsp;<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">თვიან</span></span>&nbsp;&nbsp;<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Sylfaen,serif\\\">პროგრამას სახელმწიფოსაგან აღიარებულ სერტიფიკატს მიიღებენ.</span></span>&nbsp;&nbsp;</span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">საკონტაქტო პირი: დეა აბულაძე &nbsp;</span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">youthwork4youth@gmail.com &nbsp;</span></span></p>\\n\\n<p style=\\\"text-align:start\\\"><span style=\\\"font-size:medium\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">599 22 63 92</span></span></p>\"}', '{\"en\": \"<p>&nbsp;.</p>\", \"ka\": \"<p>თბილისი,&nbsp; ვაჟა-ფშაველას გამზირი №76 ბ</p>\"}', NULL, NULL, '599226392', '2020-07-30', '2020-08-17', '2020-07-29', 1, NULL, 'dhrLSKrsq2CxrHHpg05YDWUFY0tWfbg37fGQCysi.jpeg', NULL, NULL, NULL, NULL, '2020-07-29 17:56:28', '2020-11-06 17:06:28', 'https://docs.google.com/forms/d/e/1FAIpQLSdRABexO8FvNsRrqNIKkfEAMD91HIpMFwAxZuOaahDzWMU6Pw/viewform', NULL, NULL, 0, 'youthwork4youth@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(22, '{\"en\": null, \"ka\": \"თემის ლიდერი\"}', '{\"en\": null, \"ka\": \"ტრენინგი მიზნად ისახავს მხარი დაუჭიროს ახალგაზრდების ცოდნის და უნარების გაუმჯობესებას, სათემო ახალგაზრდული ინიციატივებსა და ადგლობრივ დონეზე გადაწყვეტილების მიღების პროცესში ახალგაზრდების ჩართულობის გაზრდას.\\r\\n\\r\\nტრენინგისთვის საქართველოს მასშტაბით შეირჩევა 25 ახალგაზრდა. მონაწილეობა შეუძლია 14 წლიდან 21 წლამდე ახალგაზრდებს.\\r\\n\\r\\nპროექტის შესახებ დეტალური ინფორმაცია იხილეთ თანდართულ დოკუმენტში.\"}', '{\"en\": \"ონლაინ\", \"ka\": \"ონლაინ\"}', NULL, NULL, NULL, '2020-08-21', '2020-08-27', '2020-08-21', 62, NULL, '3QRuD5gVYHp0cBao4AyqrNwqlckjSAn6MGVkPJql.jpeg', NULL, 'facebook.com/ngocognittio', NULL, NULL, '2020-08-21 13:30:24', '2020-08-21 13:30:24', NULL, NULL, NULL, 0, 'cognittio@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(23, '{\"en\": \"Alter-School\", \"ka\": \"Alter-სკოლა\"}', '{\"en\": \"<p>საქართველოს შემეცნებითი ცენტრი ახალი პროექტის &quot;Alter-სკოლა&quot; საფუძველს უყრის ახალი თაობის კომპეტენტურობასა და თვითრეალიზებას. პროექტის მიზანია საქართველოს მასშტაბით 14-19 წლამდე ახალგაზრდებისთვის შექმნას სივრცე, სადაც ისინი არაფორმალური განათლების ფარგლებში მიიღებენ ცოდნებს ჯანსაღი ცხოვრების წესის შესახებ და აიმაღლებენ ლიდერობის, გუნდურად მუშაობის და კომუნიკაციის უნარებს. მონაწილეები გაივლიან SRHR ტრენერთან ერთად სექსუალური და რეპროდუქციული ჯანმრთელობისა და უფლებების შესახებ სესიებს. ჩაერთვებიან თემატურ დებატებში, მოაწყობენ დისკუსიებს და მიიღებენ მონაწილეობას ვიქტორინაში. Alter-სკოლის მეთოდოლოგია ეფუძნება მსოფლიო ჯანდაცვის ორგანიზაციის გაიდლაინებს, ევროკავშირი წევრი ქვეყნების წარმატებულ გამოცდილებებს, რომლითაც ისინი ათწლეულებია ხელმძღვანელობენ. ეს სივრცე არაფორმალური განათლების მეშვეობით ახალგაზრდებს იმ კომპეტენციების ამაღლებაში დაეხმარება, რომლებიც აუცილებელია საზოგადოებრივ ცხოვრებაში სრულყოფილად ჩართვისთვის და საკუთარი შესაძლებლობების რეალიზებისთვის. სკოლის ხანგრძლივობაა 3 თვე. პროგრამაში მონაწილეობის მისაღებად შეირჩევა სულ 30 მონაწილე. სკოლის დასრულების შემდეგ გაიცემა სერთიფიკატები. შეირჩევიან საქართველოში მცხოვრები 14-19 წლამდე დაინტერესებული ახალგაზრდები, გასაუბრების საფუძველზე. განაცხადების მიღება დაიწყო დღეს 22 აგვისტოს და იწარმოება 1-ლ სექტემბრამდე. პროექტის &quot;Alter-სკოლა&quot;ფინანსური მხარდამჭერია &quot;ქალთა ფონდი საქართველოში&quot;.</p>\", \"ka\": \"<p>საქართველოს შემეცნებითი ცენტრი ახალი პროექტის &quot;Alter-სკოლა&quot; საფუძველს უყრის ახალი თაობის კომპეტენტურობასა და თვითრეალიზებას. პროექტის მიზანია საქართველოს მასშტაბით 14-19 წლამდე ახალგაზრდებისთვის შექმნას სივრცე, სადაც ისინი არაფორმალური განათლების ფარგლებში მიიღებენ ცოდნებს ჯანსაღი ცხოვრების წესის შესახებ და აიმაღლებენ ლიდერობის, გუნდურად მუშაობის და კომუნიკაციის უნარებს. მონაწილეები გაივლიან SRHR ტრენერთან ერთად სექსუალური და რეპროდუქციული ჯანმრთელობისა და უფლებების შესახებ სესიებს. ჩაერთვებიან თემატურ დებატებში, მოაწყობენ დისკუსიებს და მიიღებენ მონაწილეობას ვიქტორინაში. Alter-სკოლის მეთოდოლოგია ეფუძნება მსოფლიო ჯანდაცვის ორგანიზაციის გაიდლაინებს, ევროკავშირი წევრი ქვეყნების წარმატებულ გამოცდილებებს, რომლითაც ისინი ათწლეულებია ხელმძღვანელობენ. ეს სივრცე არაფორმალური განათლების მეშვეობით ახალგაზრდებს იმ კომპეტენციების ამაღლებაში დაეხმარება, რომლებიც აუცილებელია საზოგადოებრივ ცხოვრებაში სრულყოფილად ჩართვისთვის და საკუთარი შესაძლებლობების რეალიზებისთვის. სკოლის ხანგრძლივობაა 3 თვე. პროგრამაში მონაწილეობის მისაღებად შეირჩევა სულ 30 მონაწილე. სკოლის დასრულების შემდეგ გაიცემა სერთიფიკატები. შეირჩევიან საქართველოში მცხოვრები 14-19 წლამდე დაინტერესებული ახალგაზრდები, გასაუბრების საფუძველზე. განაცხადების მიღება დაიწყო დღეს 22 აგვისტოს და იწარმოება 1-ლ სექტემბრამდე. პროექტის &quot;Alter-სკოლა&quot;ფინანსური მხარდამჭერია &quot;ქალთა ფონდი საქართველოში&quot;.</p>\"}', '{\"en\": \"<p>თბილისი</p>\", \"ka\": \"<p>თბილისი</p>\"}', NULL, NULL, '595025286', '2020-08-22', '2020-09-01', '2020-08-22', 63, NULL, '7ppPiK8ZA7ObOTfzHBwoHvgfPPgY6y8wctYrUYLk.jpeg', NULL, 'https://www.facebook.com/cognitivecenterofgeorgia/', NULL, NULL, '2020-08-22 13:12:04', '2020-11-06 19:59:54', NULL, NULL, NULL, 0, 'cognitivecenterofgeorgia@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(24, '{\"en\": \"ერთად საკუთარი თავისთვის\", \"ka\": \"ერთად საკუთარი თავისთვის\"}', '{\"en\": \"<p>საქართველოს შემეცნებითი ცენტრი იწყებს მსურველთა მიღებას საქართველოს ყველა წერტილიდან! რას გულისხმობს ახალი პროექტი? განვითარებას, წინსვლას და საკუთარი შესაძლებლობების რეალიზებას! იქმნება სამთვიანი პროგრამა, რომელიც მიზანმიმართულია ახალგაზრდების გაძლიერებისკენ და საზოგადოებრივ ცხოვრებაში აქტიურად ჩართვისკენ. ახალგაზრდები დაკომპლექტდებიან ინტერესების მიხედვით: &quot;სტარტაპი და ინოვაცია&quot; - წევრები ისწავლიან იდეის გენერირებას და მის გაფილტვრას, პროექტად ქცევას, ბიზნესის დაწყების პირველ საფეხურებს და შექმნიან სხვადასხვა პროტოტიპებს. &quot;სოციალური მედია და ტოპ ბლოგინგი&quot; - ისწავლიან სოც. მედიის ეთიკას და საკუთარ მუნიციპალიტეტების საჭიროებებზე შექმნიან ბლოგებს. &quot;საჯარო გამოსვლა და აუდიტორიის მართვა&quot; - ისწავლიან თემის მომზადებას, აუდიტორიის მართვას და ჩაატარებენ სასურველ თემებზე შეხვედრებს&quot; &quot;ლიდერობა, გუნდში მუშაობა და მოხალისეობა&quot; - ისწავლიან კომუნიკაციის წესებს და საქმის გადანაწილებას და მოხალისეობრივად ჩაატარებენ სხვადასხვა აქტივობებს. პროგრამის ძირითადი პრინციპი ეფუძნება იმას რომ მონაწილეებმა შესრულებული საქმიანობის შედეგად მიიღონ უკუკავშირი, გაითვალისწინონ და განვითარდნენ ერთად საკუთარი თავისთვის. მაშინ როდესაც საოცრად დიდია კონკურენცია, შენ უნდა იყო მზად დასაქმდე ან თავად შექმნა სამუშაო ადგილი. ამისთვის კი საჭიროა გქონდეს გამბედაობა, პასუხისმგებლობის გრძნობა, გუნდში მუშაობის და კრიტიკული ანალიზის უნარი, იყო კომუნიკაბელური და მოქნილი. ამ უნარებს კი განვითარება და ზოგიერთს სწავლაც კი სჭირდება. მონაწილეები შეირჩევიან გასაუბრებით. უპირატესობა მიენიჭებათ ახალგაზრდებს რეგიონებიდან.</p>\", \"ka\": \"<p>საქართველოს შემეცნებითი ცენტრი იწყებს მსურველთა მიღებას საქართველოს ყველა წერტილიდან! რას გულისხმობს ახალი პროექტი? განვითარებას, წინსვლას და საკუთარი შესაძლებლობების რეალიზებას! იქმნება სამთვიანი პროგრამა, რომელიც მიზანმიმართულია ახალგაზრდების გაძლიერებისკენ და საზოგადოებრივ ცხოვრებაში აქტიურად ჩართვისკენ. ახალგაზრდები დაკომპლექტდებიან ინტერესების მიხედვით: &quot;სტარტაპი და ინოვაცია&quot; - წევრები ისწავლიან იდეის გენერირებას და მის გაფილტვრას, პროექტად ქცევას, ბიზნესის დაწყების პირველ საფეხურებს და შექმნიან სხვადასხვა პროტოტიპებს. &quot;სოციალური მედია და ტოპ ბლოგინგი&quot; - ისწავლიან სოც. მედიის ეთიკას და საკუთარ მუნიციპალიტეტების საჭიროებებზე შექმნიან ბლოგებს. &quot;საჯარო გამოსვლა და აუდიტორიის მართვა&quot; - ისწავლიან თემის მომზადებას, აუდიტორიის მართვას და ჩაატარებენ სასურველ თემებზე შეხვედრებს&quot; &quot;ლიდერობა, გუნდში მუშაობა და მოხალისეობა&quot; - ისწავლიან კომუნიკაციის წესებს და საქმის გადანაწილებას და მოხალისეობრივად ჩაატარებენ სხვადასხვა აქტივობებს. პროგრამის ძირითადი პრინციპი ეფუძნება იმას რომ მონაწილეებმა შესრულებული საქმიანობის შედეგად მიიღონ უკუკავშირი, გაითვალისწინონ და განვითარდნენ ერთად საკუთარი თავისთვის. მაშინ როდესაც საოცრად დიდია კონკურენცია, შენ უნდა იყო მზად დასაქმდე ან თავად შექმნა სამუშაო ადგილი. ამისთვის კი საჭიროა გქონდეს გამბედაობა, პასუხისმგებლობის გრძნობა, გუნდში მუშაობის და კრიტიკული ანალიზის უნარი, იყო კომუნიკაბელური და მოქნილი. ამ უნარებს კი განვითარება და ზოგიერთს სწავლაც კი სჭირდება. მონაწილეები შეირჩევიან გასაუბრებით. უპირატესობა მიენიჭებათ ახალგაზრდებს რეგიონებიდან.</p>\"}', '{\"en\": \"<p>თბილისი</p>\", \"ka\": \"<p>თბილისი</p>\"}', NULL, NULL, '595025286', '2020-08-24', '2020-08-29', '2020-08-29', 63, NULL, 'gYtsXKMv4cseoGpYmYsyryGzVYMgT3xPhFgrZ02h.jpeg', NULL, 'https://www.facebook.com/cognitivecenterofgeorgia/', NULL, NULL, '2020-08-24 13:11:06', '2020-11-06 19:55:57', 'https://docs.google.com/forms/d/e/1FAIpQLSfs7pldjCswc9dj4uMaT40UjwyZJB_ozub8qLKZG4Tu8n6dPQ/viewform', NULL, NULL, 0, 'cognitivecenterofgeorgia@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(26, '{\"en\": \"National Council of Youth Organizations of Georgia\", \"ka\": \"საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალური საბჭო\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p><strong>საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ</strong> დაიწყო ახალგაზრდობის სააგენტოს მიერ დაფინანსებული პროექტი <strong>&ldquo;ახალგაზრდობა მნიშვნელოვანია&rdquo;</strong> რომლის მიზანია წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში.</p>\\r\\n\\r\\n<p>პროექტის ფარგლებში გადამზადდება 30 ახალგაზრდული ორგანიზაციის წარმომადგენელი, რისთვისაც ვიწყებთ ტრენერთა შესარჩვევ კონკურსს!</p>\\r\\n\\r\\n<p>ტრენერები შეირჩევიან ღია კონკურსით ონლაინ აპლიკაციის საფუძველზე, მეორე ეტაპზე კი განხორციელდება გასაუბრება. შეირჩევა 5 ტრენერი - 3 ძირითადი ტრენერი და 2 ფასილიტატორი.</p>\\r\\n\\r\\n<p>დეტალური ინფორმაცია გთხოვთ იხილოთ მიბმულ დოკუმენტში.</p>\"}', '{\"en\": \"<p>ვაჟა ფშაველა გამზ. 76ბ</p>\", \"ka\": \"<p>ვაჟა ფშაველა გამზ. 76ბ</p>\"}', NULL, NULL, NULL, '2020-08-27', '2020-09-07', '2020-08-27', 17, NULL, 'woV8dYEMBQDVbRGPvzwpDjGMUo9Vz5pyS15pXRTa.png', NULL, 'https://www.facebook.com/NCYOG', NULL, NULL, '2020-08-27 10:26:39', '2020-08-27 13:13:36', NULL, NULL, NULL, 0, 'youthmatters.ncyog@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(27, '{\"en\": \"Call for Researcher\", \"ka\": \"კვლევის ექსპერტის შესარჩევი კონკურსი\"}', '{\"en\": \"<p>საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ დაიწყო ახალგაზრდობის სააგენტოს მიერ დაფინანსებული პროექტი &ldquo;ახალგაზრდობა მნიშვნელოვანია&rdquo; რომლის მიზანია წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში. Პროექტის ერთ-ერთი ამოცანაა: - საქართველოში რეგისტრირებული ახალგაზრდული ორგანიზაციების სტრუქტურის, მუშაობის სისტემის, სამოქმედო გეგმის, არსებული რესურსებისა და საჭიროებების შესახებ კვლევა; Შესაბამისად გვესაჭიროება კვლევის ექსპერტი, რომელიც პროექტის ფარგლებში განახორციელებს ახალგაზრდული არასამთავრობო სექტორის მმართველობისა და სტრუქტურის სისტემის კვლევას. Სამუშაოს ხანგრძლივობა: 15 სექტემბერი - 15 ნოემბერი. დეტალური ინფორმაციისთვის გთხოვთ გადმოტვირთოთ მიმაგრებული დოკუმენტები.</p>\", \"ka\": \"<p>საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ დაიწყო ახალგაზრდობის სააგენტოს მიერ დაფინანსებული პროექტი &ldquo;ახალგაზრდობა მნიშვნელოვანია&rdquo; რომლის მიზანია წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში. Პროექტის ერთ-ერთი ამოცანაა: - საქართველოში რეგისტრირებული ახალგაზრდული ორგანიზაციების სტრუქტურის, მუშაობის სისტემის, სამოქმედო გეგმის, არსებული რესურსებისა და საჭიროებების შესახებ კვლევა; Შესაბამისად გვესაჭიროება კვლევის ექსპერტი, რომელიც პროექტის ფარგლებში განახორციელებს ახალგაზრდული არასამთავრობო სექტორის მმართველობისა და სტრუქტურის სისტემის კვლევას. Სამუშაოს ხანგრძლივობა: 15 სექტემბერი - 15 ნოემბერი. დეტალური ინფორმაციისთვის გთხოვთ გადმოტვირთოთ მიმაგრებული დოკუმენტები.</p>\"}', '{\"en\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\", \"ka\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\"}', NULL, NULL, NULL, '2020-08-31', '2020-09-11', '2020-08-31', 17, NULL, '88wdEw2uReqNgK7mMrh6efoMmnSX8fQ1vQeAqO29.png', NULL, 'https://www.facebook.com/NCYOG/', NULL, NULL, '2020-08-31 08:00:52', '2020-11-06 19:47:00', NULL, NULL, NULL, 0, 'youthmatters.ncyog@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0);
INSERT INTO `opportunities` (`id`, `name`, `description`, `address`, `latitude`, `longitude`, `phone`, `start_date`, `end_date`, `schedule_date`, `company_id`, `user_id`, `image`, `order`, `fb_page`, `linkedin_page`, `web_page`, `created_at`, `updated_at`, `application_url`, `file`, `query_id`, `query_sent`, `email`, `min_age`, `max_age`, `is_virtual`, `vitual_link`, `live_translation_link`, `is_draft`, `draft_token`, `inactive`) VALUES
(28, '{\"en\": \"ახალგაზრდული ორგანიზაციების შესარჩევი კონკურსი\", \"ka\": \"ახალგაზრდული ორგანიზაციების შესარჩევი კონკურსი\"}', '{\"en\": \"<p>საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ დაიწყო ახალგაზრდული ორგანიზაციების განაცხადების მიღება პროექტში ,,ახალგაზრდობა მნიშვნელოვანია&rsquo;&rsquo; მონაწილეობისთვის! &nbsp;პროექტის მიზანია, წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში. ,,ახალგაზრდობა მნიშვნელოვანია&rsquo;&rsquo; აერთიანებს 90 მონაწილეს,რომელსაც წარმოადგენს საქართველოში მოქმედი 30 ახალგაზრდული ორგანიზაცია. აპლიკაციის ბმულები: 1. პროექტის მენეჯერები - shorturl.at/syBW4 2. პროექტის მმართველი გუნდის წევრების აპლიკაცია: shorturl.at/asHSW 3. ახალგაზრდული მუშაკების აპლიკაცია: shorturl.at/jouwT პროექტი დაფინანსებულია სსიპ ახალგაზრდობის სააგენტოს მიერ, მილიონიანი ფონდის საგრანტო კონკურსის ll თემატური მიმართულების ფარგლებში, რომელიც მიზნად ისახავს საქართველოში არსებული ახალგაზრდული ორგანიზაციების გაძლიერებას და განვითარების ხელშეწყობას. დაწვრილებითი ინფორმაციის მისაღებად გადმოტვირტეთ მიბმული დოკუმენტები.</p>\", \"ka\": \"<p>საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ დაიწყო ახალგაზრდული ორგანიზაციების განაცხადების მიღება პროექტში ,,ახალგაზრდობა მნიშვნელოვანია&rsquo;&rsquo; მონაწილეობისთვის! &nbsp;პროექტის მიზანია, წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში. ,,ახალგაზრდობა მნიშვნელოვანია&rsquo;&rsquo; აერთიანებს 90 მონაწილეს,რომელსაც წარმოადგენს საქართველოში მოქმედი 30 ახალგაზრდული ორგანიზაცია. აპლიკაციის ბმულები: 1. პროექტის მენეჯერები - shorturl.at/syBW4 2. პროექტის მმართველი გუნდის წევრების აპლიკაცია: shorturl.at/asHSW 3. ახალგაზრდული მუშაკების აპლიკაცია: shorturl.at/jouwT პროექტი დაფინანსებულია სსიპ ახალგაზრდობის სააგენტოს მიერ, მილიონიანი ფონდის საგრანტო კონკურსის ll თემატური მიმართულების ფარგლებში, რომელიც მიზნად ისახავს საქართველოში არსებული ახალგაზრდული ორგანიზაციების გაძლიერებას და განვითარების ხელშეწყობას. დაწვრილებითი ინფორმაციის მისაღებად გადმოტვირტეთ მიბმული დოკუმენტები.</p>\"}', '{\"en\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\", \"ka\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\"}', NULL, NULL, '593199333', '2020-10-06', '2020-10-15', '2020-10-06', 17, NULL, 'GLbhIXv2S9XNH83XcEscHXKBDoraqvk95VX1ZKRL.jpeg', NULL, 'www.facebook.com/NCYOG', NULL, NULL, '2020-10-06 17:05:52', '2020-11-06 19:45:57', NULL, NULL, NULL, 0, 'youthmatters.ncyog@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(29, '{\"en\": null, \"ka\": \"სახელმწიფო ახალგაზრდული სტრატეგია\"}', '{\"en\": null, \"ka\": \"<p>✊ სახელმწიფო ახალგაზრდული სტრატეგია, რომელიც განსაზღვრავს, თუ როგორ უნდა განვითარდეს საქართველოში ახალგაზრდული სფერო მომავალი 5 წლის მანძილზე, იქმნება მონაწილეობრივად, ახალგაზრდების ჩართულობით. ახლა შენი ჯერია! 👉 გადადი ბმულზე, https://bit.ly/2IaYQ4p გაეცანი სტრატეგიის დოკუმენტის ხედვის, მიზნებისა და ამოცანების ამ ეტაპზე არსებულ ვერსიას და გაგვიზიარე საკუთარი მოსაზრებები. 👌რეკომენდაციები, შეგიძლია გამოგზავნო შენთვის მისაღები ფორმით, ანონიმურად, საკუთარი სახელით ან მეილის დახმარებით: info@youthagency.gov.ge 🤓 რეკომენდაციის გაზიარება 15 ოქტომბრის ჩათვლით შეგეძლება.</p>\"}', '{\"en\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\", \"ka\": \"<p>ვაჟა-ფშაველას გამზირი 76ბ</p>\"}', NULL, NULL, NULL, '2020-10-10', '2020-10-15', '2020-10-11', 1, NULL, 'sbJMB1MWzVdC6ZVdSswr5LP0nyFBsNquvsGnKXLf.jpeg', NULL, NULL, NULL, NULL, '2020-10-11 11:03:27', '2020-11-06 20:26:54', 'https://bit.ly/2IaYQ4p', NULL, 1, 0, 'info@youthagency.gov.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
