(35, '{\"en\": null, \"ka\": \"ClimateLaunchpad 2021\"}', '{\"en\": null, \"ka\": \"<p>ყოველწლიური ბანაკი ინოვაციური იდეების გამოსავლენად გარემოს დაცვის და ეკო მეგობრული პროდუქტების წარმოების მიმართულებით</p>\"}', '{\"en\": \"ეგ. ნინოშვილის ქ.55\", \"ka\": \"ეგ. ნინოშვილის ქ.55\"}', NULL, NULL, '571871100', '2021-02-15', '2021-11-15', '2020-12-09', 73, NULL, NULL, NULL, 'https://www.facebook.com/SiNCgeorgia', NULL, 'sinc.org.ge', '2020-12-09 10:20:24', '2020-12-09 10:27:56', NULL, NULL, 1, 0, 'info@sinc.org.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
