(38, '{\"en\": null, \"ka\": \"ღია კონკურსი „გაეროში საქართველოს ახალგაზრდობის წარმომადგენელის შესარჩევად\"}', '{\"en\": null, \"ka\": \"<blockquote><h2><strong>ღია კონკურსი „გაეროში საქართველოს ახალგაზრდობის წარმომადგენელის შესარჩევად</strong></h2></blockquote><p>თუ ხარ 18 წლიდან 25 წლამდე ახალგაზრდა, გაქვს სურვილი საქართველოს ახალგაზრდების ხმა გააჟღერო გაეროში, ჩვენ გეძებთ შენ!</p><p>ახალგაზრდობის სააგენტო 25 იანვარს, „გაეროში საქართველოს ახალგაზრდობის წარმომადგენლის“ შესარჩევად ღია კონკურსს აცხადებს საქართველოს მასშტაბით. სააგენტო პროექტს წელს, გაეროს საქართველოს ოფისთან პარტნიორობით ახორციელებს.</p><p>პროექტის მიზანია ქვვეყნის მასშტაბით ახალგაზრდობის ხმის გაჟღერება გაეროში, ახალგაზრდების ინფორმირებულობის გაზრდა გაეროს მდგრადი განვითარების მიზნებისა და&nbsp; გაეროში მიმდინარე სხვა საერთაშორისო პროცესების შესახებ. პროექტი იძლევა პერსონალური და პროფესიული განვითარებისთვის ძალიან კარგ შანსს იმ ახალგაზრდებისთვის, რომლებიც დაინტერესებული არიან&nbsp; საერთაშორისო ურთიერთობებით და ახალგაზრდობის საკითხებით, სურთ განავითარონ მათ ირგვლივ ახალაგზრდული სფერო და გააჟღერონ ახალგაზრდების ხმა გაეროში.</p><p>აღნიშნული პროექტი გაეროს ერთ-ერთი წარმატებული ინიციატივაა, რომელსაც 1981 წელს ჩაეყარა საფუძველი. საქართველო პროექტში 2012 წლიდან მონაწილეობს და იგი სრულად ფინანსდება ახალგაზრდობის სააგენტოს&nbsp;მიერ.</p><p><strong>ვის შეუძლია მონაწილეობის მიღება?</strong></p><ol><li>18–25 წლის საქართველოს მოქალაქეს (კონკურსის დასრულებამდე 25 წლის);</li><li>თავისუფლად ფლობს ქართულ და ინგლისურ ენას (წერილობით და ზეპირსიტყვიერს);</li><li>იცნობს საქართველოს ახალგაზრდული პოლიტიკის დოკუმენტს, 2020–2030 წლებისთვის საქართველოს ახალგაზრდული პოლიტიკის კონცეფციას, გაეროს მდგრადი განვითარების მიზნებს;</li><li>ინფორმირებულია საქართველოში მიმდინარე ახალგაზრდებთან დაკავშირებულ პროცესებზე (ახალგაზრდობის სააგენტოს,&nbsp; საქართველოში გაეროს წარმოდგენილი სააგენტოების საქმიანობას, ახალგაზრდებთან მომუშავე ორგანიზაციების საქმიანობას);</li></ol><p>&nbsp;</p><p><strong>კონკურსი მოიცავს სამ ეტაპს:</strong></p><p><strong>I ეტაპი განაცხადების მიღება&nbsp;</strong>- პირველ ეტაპზე კანდიდანტმა უნდა წარმოადგინოს&nbsp;</p><p>სივი (CV), პირადობის დამადასტურებელი დოკუმენტი;<i>&nbsp;</i>&nbsp;</p><p>სამოქმედო გეგმა/ბიუჯეტი შესაბამისობაში უნდა მოდიოდეს წარმომადგენლის ფუნქცია-მოვალეობებთან და უნდა მოიცავდეს დეტალურად გაწერილ აქტივობებს 20000 ლარზე გაწერილი ბიუჯეტით. ფუნქცია მოვალეობები იხილეთ თანდართულ <a href=\\\"https://youthplatform.gov.ge/storage/37/%E1%83%92%E1%83%90%E1%83%94%E1%83%A0%E1%83%9D%E1%83%A8%E1%83%98-%E1%83%A1%E1%83%90%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%95%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A1-%E1%83%90%E1%83%AE%E1%83%90%E1%83%9A%E1%83%92%E1%83%90%E1%83%96%E1%83%A0%E1%83%93%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1-%E1%83%AC%E1%83%90%E1%83%A0%E1%83%9B%E1%83%9D%E1%83%9B%E1%83%90%E1%83%93%E1%83%92%E1%83%94%E1%83%9C%E1%83%94%E1%83%9A%E1%83%98%E1%83%A1-%E1%83%A4%E1%83%A3%E1%83%9C%E1%83%A5%E1%83%AA%E1%83%98%E1%83%90---%E1%83%9B%E1%83%9D%E1%83%95%E1%83%90%E1%83%9A%E1%83%94%E1%83%9D%E1%83%91%E1%83%94%E1%83%91%E1%83%98.pdf\\\">დოკუმენტში</a>. &nbsp;(<i>აღნიშნული დოკუმენტები წარმოდგენილი უნდა იყოს ინგლისურ ენაზე)</i></p><p>ესსე თემაზე: “What does Sustainable Development mean to you? How can it be persued and achieved?” (<i>სიტყვათა რაოდენობა-მაქსიმუმ 500 სიტყვა, შრიფტის ზომა-11; ფონტი - Sylfaen, ხაზებს შორის დაშორება 1).</i></p><p><strong>II ეტაპი გასაუბრება&nbsp;</strong>- მეორე ეტაპზე გადასული კანდიდატები გაივლიან კომისიასთან გასაუბრებას. გასაუბრება ჩატარდება ინგლისურ ენაზე. (გასაუბრებები ტარდება ონლაინ რეჟიმში)</p><p><strong>III&nbsp; ეტაპი საჯარო გამოსვლა -&nbsp;</strong>&nbsp;გასაუბრების შედეგად შერჩეული საუკეთესო კანდიდატები სიტყვით გამოვლენ (ინგლისურ ენაზე) ახალგაზრდობის სააგენტოს მიერ გამართულ საჯარო ღონისძიებაზე. (ღონისძიება გაიმართება ჰიბრიდულ რეჟიმში)</p><p><i><strong>გამარჯვებული კანდიდატი გამოვლინდება 2021 წლის მარტის დასაწყისში.</strong>&nbsp; გაეროში საქართველოს ახალგაზრდების წარმომადგენლის მანდატი ერთწლიანია.</i></p><p><strong>კანდიდატები შეფასდებიან&nbsp; სამივე ეტაპზე ქულათა სისტემით;</strong></p><p>კონკურსის გავლის შემდეგ, შერჩეული წარმომადგენელი მთელი ქვეყნის მასშტაბით შეხვედრებს ატარებს და ახალგაზრდებთან გადის კონსულტაციებს, ინფორმაციას აწვდის მდგრადი განვითარების მიზნების წესრიგისა და საქართველოსთვის მისი აქტუალობის შესახებ. მოგვიანებით, კანდიდატი მიემგზავრება გაეროს სათაო ოფისში (ნიუ იორკი, აშშ), სადაც როგორც საქართველოს დელეგაციის სრულუფლებიანი წევრი, მონაწილეობას იღებს გენერალური ასამბლეის მესამე კომიტეტის ღონისძიებებში და საკომიტეტო მოსმენებში, სიტყვით გამოდის ამავე კომიტეტის სხდომაზე და მონაწილეობს ახალგაზრდობის შესახებ დადგენილების შემუშავებაში.&nbsp;</p><p>მონაწილეობის მსურველებმა მოთხოვნილი დოკუმენტები უნდა გამოგზავნოთ შემდეგ ელ ფოსტაზე:&nbsp;<a href=\\\"mailto:info@youthagency.gov.ge\\\">info@youthagency.gov.ge</a> განაცხადების მიღების ბოლო ვადაა 14 თებერვალი 23:00 საათი.</p><p>ეწვიეთ ახალგაზრდობის სააგენტოს facebook გვერდს:&nbsp;<a href=\\\"https://www.facebook.com/YouthAgencyGeorgia\\\">https://www.facebook.com/YouthAgencyGeorgia</a></p><p>საინტერესო ბმულები პროექტთან დაკავშირებით:&nbsp;</p><ul><li><a href=\\\"https://www.facebook.com/UNYDGeorgia/ \\\">https://www.facebook.com/UNYDGeorgia/&nbsp;</a></li><li><a href=\\\"https://www.youtube.com/user/unyouthdelegatege/videos\\\">https://www.youtube.com/user/unyouthdelegatege/videos</a></li></ul><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": \"ვაჟა-ფშაველას 76\", \"ka\": \"ვაჟა-ფშაველას 76\"}', NULL, NULL, NULL, '2021-01-25', '2021-02-10', '2021-01-25', 1, NULL, '38__2021-01-2514:32:15.png', NULL, NULL, NULL, NULL, '2021-01-25 13:19:41', '2021-02-11 08:55:08', NULL, NULL, 1, 0, 'info@youthagency.gov.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
