(44, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-02-18', '2021-02-18', '2021-02-18', 81, NULL, NULL, NULL, '', '', '', '2021-02-18 08:16:00', '2021-02-18 08:16:00', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(45, '{\"en\": null, \"ka\": \"სამოქალაქო საზოგადოების ფორუმის საგრანტო კონკურსი\"}', '{\"en\": null, \"ka\": \"<p><i><strong>&nbsp;</strong></i><strong>❗️ </strong><i><strong>ღონისძიება არ ეკუთვნის “ახალგაზრდობის პლატფორმას”</strong></i></p><p><strong>✔️</strong><i><strong>გთხოვთ, დამატებითი ინფორმაციისთვის ეწვიოთ მითითებულ ბმულს: </strong></i><a href=\\\"https://bit.ly/3pEcxZD\\\"><i><strong>https://bit.ly/3pEcxZD</strong></i></a><i><strong> &nbsp; &nbsp; &nbsp;&nbsp;</strong></i><strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></p><p><strong>❓ </strong><i><strong>კითხვების შემთხვევაში მიმართეთ ბმულში მითითებულ საკონტაქტო მისამართზე.</strong></i></p><p>&nbsp;</p><p>🟣 სამოქალაქო&nbsp;საზოგადოების&nbsp;ფორუმის&nbsp;წევრი&nbsp;ორგანიზაციებისთვის&nbsp;გამოცხადდა&nbsp;კონკურსი&nbsp;(ფინანსური დახმარება მესამე მხარეებს),&nbsp;რომელიც&nbsp;ითვალისწინებს&nbsp;წევრებს&nbsp;შორის&nbsp;კავშირების&nbsp;გაძლიერებას. წლიური გრანტების განხორციელების პერიოდია:&nbsp;<strong> 4-8 თვე (15 აპრილი და 15 დეკემბერი).</strong></p><p>🌎 საპროექტო განაცხადი მიიღება ინგლისურ ენაზე (რუსულ ენაზე განაცხადი მიიღება იმ შემთხვევაში თუ შედეგები ასევე წარმოდგენილია ინგლისურ ენაზე).</p><p>✔️ გთხოვთ გაითვალისწინოთ, რომ აღნიშნული კონკურსი გამოცხადებულია მხოლოდ სამოქალაქო საზოგადოების ფორუმის წევრი ორგანიზაციებისთვის.</p><p><strong>განაცხადები მიიღება 2021 წლის 14 მარტის ჩათვლით, 23.59 ბრიუსელი (ცენტრალური ევროპის დრო).</strong></p><p><strong>🌐 კონკურსის შესახებ უფრო დეტალური ინფორმაციისთვის, ეწვიეთ სამოქალაქო საზოგადოების ფორუმის ვებგვერდს: </strong><a href=\\\"https://bit.ly/3pEcxZD\\\"><i><strong>https://bit.ly/3pEcxZD</strong></i></a><i><strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></i><strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ❓</strong><i><strong> </strong></i><strong>ასევე დამატებითი კითხვების არსებობის&nbsp; შემთხვევაში, გთხოვთ დაუკავშირდეთ, სამოქალაქო საზოგადოების ფორუმის სამდივნოს ადვოკატირების მენეჯერს, ვერა რიხაკოვას:&nbsp;</strong><a href=\\\"mailto:vera.rihackova@eap-csf.eu\\\"><strong>vera.rihackova@eap-csf.eu</strong></a><strong>. &nbsp;&nbsp;</strong></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-02-19', '2021-03-14', '2021-02-23', 81, NULL, '45__2021-02-1911:55:09.png', NULL, NULL, NULL, 'https://eap-csf.eu', '2021-02-19 11:22:09', '2021-02-24 09:33:35', NULL, NULL, 1, 0, 'vera.rihackova@eap-csf.eu', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
