(50, '{\"en\": \"\", \"ka\": \"დებატ-კლუბის მეორე სეზონი\"}', '{\"en\": \"\", \"ka\": \"<p>&nbsp;</p><p>საქართველოს შემეცნებითი ცენტრი აცხადებს 14-18წლამდე მონაწილეების მიღებას დებატ-კლუბის მეორე სეზონისთვის.</p><p>დებატები წარიმართება ბრიტანული საპარლამენტო სტილის ფორმატით.</p><p>დებატ-კლუბი მოიცავს ფორმატის შესწავლასა და ამ ცოდნის პრაქტიკაში გამოყენებას.</p><p>კლუბი დაგეხმარებათ:</p><p>შეისწავლოთ ბრიტანული საპარლამენტო სტილით დებატის ფორმატი სრულყოფილად და გადმოიტანოთ ეს ცოდნა პრაქტიკაში;</p><p>გაიუმჯობესოთ მოსმენის კულტურა;</p><p>განივითაროთ კრიტიკული აზროვნების უნარი;</p><p>დახვეწოთ არგუმენტირებული მსჯელობის უნარი;</p><p>დახვეწოთ საჯარო გამოსვლების ხელოვნება.</p><p>შერჩეული აპლიკანტი ავტომატურად აცხადებს თანხმობას, რომ დაესწრება პროექტით გათვალისწინებულ თითოეულ შეხვედრასა და მონაწილეობას მიიღებს მისთვის სავალდებულო ყველა ტურნირში.</p><p>სავალდებულოა ფორმატის შემსწავლელ ტრენინგზე დასწრება.</p><p>აპლიკაციის შევსების ბოლო დღეა 12 მარტი.</p><p>შერჩეულ აპლიკანტებს დავუკავშირდებით 15 მარტამდე.</p><p>გაცნობითი შეხვედრა შედგება 16 მარტს.</p><p>პროექტი გაგრძელდება ერთი თვის განმავლობაში და მოიცავს 5 შესარჩევ დებატს, მეოთხედფინალს, ნახევარფინალს და ფინალს.</p><p>ჩატარდება ონლაინ!</p><p>გამოვლინდება გამარჯვებული წყვილი და 3 ტოპ-სპიკერი.</p><p>დამატებითი კითხვების შემთხვევაში მიმართეთ ორგანიზატორებს:</p><p>მარი ხაჟომია - 592-12-88-70; mariamkhazhomia60@gmail.com</p><p>ელენე ლაზარიაშვილი - 598-80-28-83; elenelazariashvili4@gmail.com</p><p>პოსტერი მომზადებულია მოხალისეთა მიერ</p><p>მონაწილეობის მისაღებად კი შეავსეთ სააპლიკაციო ფორმა</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-03-02', '2021-03-12', '2021-03-02', 63, NULL, NULL, NULL, '', '', '', '2021-03-02 11:04:27', '2021-03-02 11:08:08', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
(51, '{\"en\": null, \"ka\": \"ტრენინგ კურსი ციფრული ახალგაზრდული მუშაკების მომზადებისათვის\"}', '{\"en\": null, \"ka\": \"<p><a href=\\\"https://www.facebook.com/SuramiYouthHouse\\\">სურამის ახალგაზრდული სახლი</a> აცხადებს შიდა ქართლში მცხოვრები/მომუშავე <strong>ახალგაზრდული მუშაკების გადასამზადებელი კურსის ღია კონკურსს</strong>. კონკურსის ფარგლებში შეირჩევა ორი 18 მონაწილისგან შემდგარი ჯგუფი, რომლებიც გადამზადდებიან <a href=\\\"https://www.facebook.com/YouthWorkersAssociationGeorgia\\\">საქართველოს ახალგაზრდულ მუშაკთა ასოციაციის</a> მიერ მომზადებული პროგრამით. გადამზადების პროგრამა შედგება რეზიდენციული ტიპის სასწავლო კურსისგან, პრაქტიკის ფაზისა და მენტორინგისგან. რეზიდენციული ტიპის სასწავლო კურსს მონაწილეები გაივლიან სურამის ტრეინინგ ცენტრში, ორ ნაკადად, სხვადასხვა თარიღებში (<strong>22 მარტი - 28 მარტი</strong> და <strong>29 მარტი - 04 აპრილი</strong>).</p><p>მონაწილეებისთვის პროგრამის განხორციელება დაიწყება ექვს დღიანი რეზიდენციული ტიპის ტრენინგ კურსით, გაგრძელდება ორ თვიანი პრაქტიკის ფაზით, რომლის ფარგლებშიც მონაწილე ახალგაზრდულ მუშაკებს მოუწევთ აქტიურად იმუშაონ მათ ბენეფიციარ ახალგაზრდებთან ამ პროცესებში კი, ნებისმიერ დროს ექნებათ შესაძლებლობა მიიღონ მენტორისგან (ტრენერისგან) რეკომენდაციები და რჩევები, რათა პროცესი წარმატებით წარმართონ. გადამზადების კურსი მოიცავს შემდეგ მსხვილ შინაარსობრივ თემებს:</p><ul><li>ახალგაზრდული საქმიანობისა და არაფორმალური განათლების ფუნქცია, როლი და ღირებულებები;</li><li>ახალგაზრდული საქმიანობის განვითარების ტენდენციები საქართველოში და ევროპის საბჭოს ქვეყნებში;</li><li>მოზარდებისა და ახალგაზრდების ასაკობრივი თავისებურებები და მათი გათვალისწინება ახალგაზდებთან მუშაობის პროცესში;</li><li>ახალგაზრდების საჭიროებებისა და ინტერესების იდენტიფიცირების მნიშვნელობა, მეთოდები და ხელსაწყოები;</li><li>გამოცდილებაზე დაფუძნებული სწავლების პრინციპი, მნიშვნელობა და მისი გამოყენების პრაქტიკული ასპექტები;</li><li>ახალგაზრდული მუშაკის როლი, ფუნქციები და ლიმიტები;</li><li>ახალგაზრდების მოზიდვა, მოტივირება და ჩართვა;</li><li>ინტერაქტიული სასწავლო მეთოდები და მათი გამოყენება მონაწილეთა სწავლის სტილებისა და სპეციალური საჭიროებების შესაბამისად;</li></ul><p>ტრეინინგ კურსში მონაწილეობის მსურველებმა შეავსეთ <a href=\\\"https://forms.gle/jcUVXunt5uPBcv526\\\">აპლიკაცია</a> ან დაგვიკავშირდით ელ ფოსტის საშუალებით <a href=\\\"mailto:info@digitalyouthwork.ge\\\">info@digitalyouthwork.ge</a>. აპლიკაციების მიღება იწარმოებს <strong>12 მარტის ჩათვლით</strong>. გისურვებთ წარმატებას!</p><p><i>აღნიშნული ტრეინინგ კურსი ხორციელდება </i><a href=\\\"https://www.facebook.com/SuramiYouthHouse\\\"><i>სურამის ახალგაზრდული სახლისა</i></a><i> და </i><a href=\\\"https://www.facebook.com/YouthWorkersAssociationGeorgia\\\"><i>საქართველოს ახალგაზრდულ მუშაკთა ასოციაციის</i></a><i> მჭიდრო თანამშრომლობითა და </i><a href=\\\"https://www.facebook.com/YouthAgencyGeorgia\\\"><i>ახალგაზრდობის სააგენტოს</i></a><i>დაფინანსებით.</i></p><p><i><strong>* ტრეინინგ კურსი ჩატარდება საქართველოს მთავრობის მიერ პანდემიური მდგომარეობიდან გამომდინარე დადგენილი რეკომენდაციების გათვალისწინებით.</strong></i></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-03-22', '2021-03-27', '2021-03-08', 86, NULL, '51__2021-03-0806:36:56.png', NULL, NULL, NULL, 'digitalyouthwork.ge', '2021-03-08 06:30:40', '2021-03-08 06:36:57', 'https://docs.google.com/forms/d/e/1FAIpQLSc1L3XfPCIC4lstfgStKfkoXe3VVrOUBlC4uFdX730721FzmQ/viewform', NULL, 1, 0, 'info@digitalyouthwork.ge', 18, NULL, 0, NULL, NULL, 0, NULL, 0),
