(53, '{\"en\": null, \"ka\": \"სისხლის სამართლის იმიტირებული პროცესი\"}', '{\"en\": null, \"ka\": \"<p><strong>ყურადღება!</strong></p><ul><li>თუ ხარ 16-დან 19 &nbsp;წლის ჩათვლით ახალგაზრდა და გაინტერესებს სამართალი, მაშინ ეს შესაძლებლობა შენთვისაა!</li><li>ახალგაზრდა ლიდერების საერთაშორისო აკადემია აცხადებს მიღებას სისხლის სამართლის იმიტირებულ პროცესში მონაწილეობისთვის.</li><li>შერჩეულ მონაწილეებს პროცესის გამართვამდე ჩაუტარდებათ პროფესიული ტრენინგი, სადაც დასწრება სავალდებულოა;</li></ul><p><strong>თარიღები: &nbsp;</strong></p><ul><li>15 მარტი- აპლიკაციების მიღების დასრულება;</li><li>18 მარტი - პროფესიული ტრენინგი;</li><li>21 მარტი - იმიტირებული პროცესი ( l ჯგუფი);</li><li>28 მარტი- იმიტირებული პროცესი (ll ჯგუფი);</li></ul><p>&nbsp;</p><p>- მონაწილეებს გადაეცემათ პროექტში მონაწილეობის დამადასტურებელი ელექტრონული სერტიფიკატი;</p><p>- პროექტში მონაწილეობა უფასოა;</p><p>- იმიტირებული პროცესი ჩატარდება ონლაინ- &nbsp;Google Meet და ZOOM პლატფორმების დახმარებით;</p><p>- ადგილები შეზღუდულია!</p><p>&nbsp;</p><figure class=\\\"image\\\"><img src=\\\"https://youthplatform.gov.ge/storage/ck/Hjly7RPyO1HCBgSjmoG4K51duzzowBmD0ArIRi3j.jpeg\\\"></figure><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-03-13', '2021-03-15', '2021-03-15', 87, NULL, '53__2021-03-1420:53:10.png', NULL, 'https://www.facebook.com/InternationalAcademyYoungLeaders', NULL, NULL, '2021-03-14 20:26:10', '2021-03-14 21:24:03', 'https://docs.google.com/forms/d/e/1FAIpQLSeLTcAvnIKSTj1ADqPQLhAWhXqUI9mDahyvnVQ-9lyFosyFNQ/viewform?fbclid=IwAR323KFKtUj1eASCE4W9fkR-QX2wluqdjYl4S_xxUP68NKLkw29CoJ0Sc5Q', NULL, 1, 0, 'YLIA.info.contact@gmail.com', 16, 19, 1, NULL, NULL, 0, NULL, 0),
