(57, '{\"en\": null, \"ka\": \"თანასწორ-განმანათლებელთა შერჩევა\"}', '{\"en\": null, \"ka\": \"<p>ასოციაცია ‘’ჰერა XXI’’ აცხადებს თანასწორ-განმანათლებელთა 2021 წლის ნაკადის მიღებას.</p><p>თანასწორ-განმანათლებლები გაივლიან თემატურ საინფორმაციო-საგანმანათლებლო სესიებს, რაც მიზნად ისახავს ახალგაზრდებში სექსუალური და რეპროდუქციული განათლების შესახებ ცნობიერების ამაღლებას, ადვოკატირებასა, ლიდერული უნარ-ჩვევების განვითარებას.</p><p>თემატური საინფორმაციო-საგანმანათლებლო სესიების გავლის შემდეგ შეირჩევიან<br>ტრენერთა ტრენინგის (TOT) მონაწილეები.</p><p>ტრენერთა ტრენინგის(TOT) წარმატებით გავლის შემდეგ თანასწორ-განმანათლებლებს საშუალება ექნებათ მიღებული ცოდნა და გამოცდილება თანატოლებს თავიანთ თემში გაუზიარონ.</p><p>პროგრამაში მონაწილეობა შეუძლიათ 15-25 წლის ასაკის ახალგაზრდებს, რომლებიც ასოციაცია \\\"ჰერა XXI-ის\\\" მოხალისეთა ბაზაზე არიან რეგისტრურებულნი.</p><p>თუ ჯერ კიდევ არ ხარ ჩვენი მოხალისე, დარეგისტრირდი და მიიღე შესაძლებლობა გახდე თანასწორ-განმანათლებელი - <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3vBKdvc%3Ffbclid%3DIwAR32V1ejR9fSBMO6IYrSIFLkAAyUWCr6yW_U-GuSwVl2FmyShJZlzfIS9IQ&amp;h=AT00dMaeU-NKmvvzngixjRc2DXouo9l4QJEQ5vchrrJ-H4dRWF1N2fl-MltsEGijEcIQHHDYGn6ZEiGBkAzEHu5MN8cWRvrunSEwsUr2mujX7mermL80TMFYpUo-JvtGaJgR&amp;__tn__=q&amp;c[0]=AT0Zk69lM4E2rqd_3gplvoPeQJQ6V3vethsKUcPgu1NfP78HnIyOEj7H6JFFsDI76jxA6SrW4zyakQzDgKS4lewrywjSW1FWVkVkxnieeeJ8P5dAKIhT2HSekbPfw0axFh8J1_Z6k2Gs10xAqx4KfQ14-DjKIIbA7Fgifh9wK1L-2U16\\\">https://bit.ly/3vBKdvc</a> .</p><p>თანასწორ-განმანათლებლობის პროექტში მონაწილეობის მსურველებმა, გთხოვთ, განაცხადის ფორმა შეავსეთ არაუგვიანეს 31 მარტისა მოცემულ ბმულზე.<br><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F2Qix5Lu%3Ffbclid%3DIwAR1L3SS1J37awg3G5E03SoERHkj-cXO3ROATq_YgO_S7rZS3d48fjwiSulg&amp;h=AT1lmLogidF8r6zIsKgSgN3QAo9eNhgD75SdmXFDOdXvUYZU0ndub4kXpKfU-_1cJ9eoNh486gnsbo9-MxhI2mb2aiR1--XS2V7RVIfj6aQjyXmgDppe7PDoCC7iVPKWnN-m&amp;__tn__=q&amp;c[0]=AT0Zk69lM4E2rqd_3gplvoPeQJQ6V3vethsKUcPgu1NfP78HnIyOEj7H6JFFsDI76