(61, '{\"en\": null, \"ka\": \"ტრეინინგი - ახალგაზრდები და პოლიტიკური ჩართულობა\"}', '{\"en\": null, \"ka\": \"<p>ჰრა, აირა და ათინათი აცხადებენ აპლიკაციების მიღებას ტრენინგზე \\\"ახალგაზრდები და პოლიტიკური ჩართულობა\\\"</p><p><strong>პროექტის თარიღები:</strong> 15-17 მაისი ონლაინ / 11-13 ივნისი რუსთავის საერთაშორისო სკაუტური ცენტრი</p><p><strong>სამიზნე მუნიციპალიტეტები:</strong> ამბროლაური, ბაღდათი, საჩხერე, დუშეთი, ხობი, სენაკი, თეთრიწყარო, გარდაბანი, ჩოხატაური</p><p><strong>აპლიკაციების მიღების ბოლო ვადა:</strong> 12 მაისი 2021</p><p>ტრეინინგის შესახებ დეტალური ინფორმაცია იხილეთ <a href=\\\"https://www.canva.com/design/DAEa_74j3C4/bFBFXXesGTPEugYXgHuRoQ/view?utm_content=DAEa_74j3C4&amp;utm_campaign=designshare&amp;utm_medium=link&amp;utm_source=sharebutton\\\">ინფო-პაკში</a>.</p><p>თუ ხარ ახალგაზრდა და გსურს, ხელი შეუწყო სხვა ახალგაზრდების საზოგადოებრივ ცხოვრებაში გააქტიურებას, შეავსე&nbsp;<a href=\\\"https://forms.gle/gSH4v8AqTdhwC4EU8\\\">აპლიკაცია</a>!</p><p>პროექტი ხორციელდება გაეროს განვითარების პროგრამის (UNDP), დანიის საგარეო საქმეთა სამინისტროსა და საქართველოს მთავრობის&nbsp;მხარდაჭერით.</p>\"}', '{\"en\": \"<p>International Scout Centre Rustavi ISCR - 9 Meliton Balanchivadze Street, Rustavi</p>\", \"ka\": \"<p>International Scout Centre Rustavi ISCR - 9 Meliton Balanchivadze Street, Rustavi</p>\"}', NULL, NULL, NULL, '2021-05-15', '2021-05-17', '2021-04-13', 35, NULL, 'TNjNvPbpNoKvGoXmBoIUiIOdOeqORmQF3D4OyhKt.png', NULL, 'https://www.facebook.com/HRAssoc/', NULL, 'http://hra.ge/', '2021-04-13 13:03:12', '2021-05-09 19:09:29', 'https://forms.gle/gSH4v8AqTdhwC4EU8', NULL, 1, 0, 'davit.mgeladze@hreyn.net', 18, 30, 0, NULL, NULL, 0, NULL, 0),
