(65, '{\"en\": null, \"ka\": \"მონაწილეების მიღება ახალგაზრდულ სამშვიდობო პროექტში\"}', '{\"en\": null, \"ka\": \"<figure class=\\\"table\\\"><table><tbody><tr><td><strong>სამოქალაქო ფორუმი</strong>\\\" UNDP-სა და გაერთიანებული სამეფოს ფონდის მდგრადი მშვიდობისთვის (COBERM-ის დამატებითი ფინანსური მექანიზმი) თანამშრომლობით და მხარდაჭერით აცხადებს მონაწილეების მიღებას ქართულ-ოსურ სამშვიდობო პროექტში - ContactZINE.<br><br>პროექტის მიზანია ხელი შეუწყოს ქართულ-ოსურ საზოგადოებებს შორის ნდობის აღდგენასა და მშვიდობის მშენებლობას.<br><br>მოწვეული მენტორების დახმარებით პროექტის მონაწილეები თავად შეიმუშავებენ ContactZINE-ს კონტენტს. ContactZINE არის ციფრული ჟურნალი. პროექტის ფარგლებში დაგეგმილია მისი სამი თემატური გამოცემა და ფინალური მანიფესტი. თემატური სფეროებია: გენდერული თანასწორობა, კლიმატის ცვლილება და ურბანიზაცია/ურბანული განვითარება.<br><br>პროექტის ამოცანებია:<br><br>** ქართველი და ოსი ახალგაზრდების დაახლოვება და თანამშრომლობის პირობების შექმნა;<br>** ქართველ და ოს ახალგაზრდებს შორის ტექნიკური და ციფრული უნარების განვითარების ხელშეწყობა, კერძოდ წერის, სოციალური მედიის მართვისა და მენეჯმენტის მიმართულებით.<br><br>პროექტის მონაწილეები:<br><br>** გაივლიან ტრენინგებს მედია წიგნიერებასა და კომუნიკაციაში;<br>** გაიღრმავებენ ტექნიკურ და ციფრულ უნარებს, მათ შორის სტატიების წერის, გრაფიკული დიზიანისა და სოციალური მედიის მართვის მიმართულებით.<br>** 2021 წლის შემოდგომას გაემგზავრებიან სასწავლო ვიზიტით საზღვარგარეთ ოს თანატოლებთან ერთად.<br><br>პროექტში მონაწილეობა შეუძლიათ 16 წლიდან 29 წლამდე ახალგაზრდებს, რომლებიც დაინტერესებულები არიან მშვიდობისა და ნდობის აღდგენის საკითხებით და აქვთ შესაბამისი გამოცდილება.<br><br>პროექტი დაიწყება 2021 წლის აპრილს და დამთავრდება 2022 წლის იანვარს.<br>პროექტში მონაწილეობა უფასოა.<br>პროექტში მონაწილეობის მისაღებად განაცხადები მიიღება 25 აპრილის 18:00 საათამდე.<br>მონაწილეები შეირჩევა განაცხადებისა და გასაუბრების შედეგად. მონაწილეებმა სასურველია იცოდნენ ინგლისური და/ან რუსული ენა.<br><br>პროექტში მონაწილეობის მისაღებად შეავსეთ <a href=\\\"https://cforum.ge/application-form/\\\">სააპლიკაციო ფორმა</a> მითითებულ ბმულზე -არაუგვიანეს <strong>25 აპრილის 18:00 საათისა</strong>.<br><br>ონლაინ საინფორმაციო შეხვედრა გაიმართება <strong>19 აპრილს, 19:00 საათზე</strong>. საინფორმაციო შეხვედრაზე დასწრების მსურველები, გთხოვთ, დაგვიკავშირდეთ მეილზე - <a href=\\\"mailto:civilforumorg@gmail.com?subject=\\\">civilforumorg@gmail.com</a><br><br>პროექტის დასრულების შემდეგ გაიცემა ორენოვანი სერტიფიკატი.<br><br>დამატებითი ინფორმაციისათვის მოგვმართეთ:<br><br>ელ.ფოსტა - <a href=\\\"mailto:civilforumorg@gmail.com?subject=\\\">civilforumorg@gmail.com</a><br>მობილური - +995 568 99 28 95; +995 597 76 95 16<br>ვებსაიტი: <a href=\\\"http://www.cforum.ge/\\\">http://www.Cforum.ge</a><br><br>FB- www.facebook.com/CivilforumCF</td></tr></tbody></table></figure><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-04-19', '2021-04-25', '2021-04-19', 94, NULL, '65__2021-04-2014:05:35.png', NULL, 'https://www.facebook.com/CivilforumCF', NULL, 'www.cforum,ge', '2021-04-20 13:54:43', '2021-04-20 14:26:12', 'https://cforum.ge/application-form/', NULL, 1, 0, 'civilforumorg@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
