(74, '{\"en\": null, \"ka\": \"წევრების მიღება - \\\"We 4 Education • ჩვენ განათლებისთვის\\\"\"}', '{\"en\": null, \"ka\": \"<p>🔷 არასამთავრობო ორგანიზაცია - \\\"We 4 Education • ჩვენ განათლებისთვის\\\" აცხადებს წევრების მიღებას საქართველოს მასშტაბით!&nbsp;</p><p>🔷 უნარ-ჩვევები:&nbsp;</p><p>** ანალიტიკური აზროვნების უნარი</p><p>&nbsp;** პასუხისმგებლობის მაღალი გრძნობა&nbsp;</p><p>** ორგანიზებულობა&nbsp;</p><p>** პუნქტუალურობა&nbsp;</p><p>** მიზანდასახულობა&nbsp;</p><p>** გუნდური და ინდივიდუალური მუშაობის უნარი&nbsp;</p><p>** კრეატიულობა&nbsp;</p><p>🔷ორგანიზაციის წევრობა არ არის ანაზღაურებადი.&nbsp;</p><p>🔷 დაინტერესებულმა პირებმა გთხოვთ შეავსოთ კითხვარი. განაცხადის მიღების ბოლო ვადა - 1 ივნისი.&nbsp;</p><p>🔶 წევრების შერჩევა მოხდება ორ ეტაპად: 1.განცხადებების გადარჩევა 2.ონლაინ გასაუბრება&nbsp;</p><p>🔷 რეგისტრაცია შეგიძლიათ გაიაროთ აქ&nbsp;</p><p>👇🏻 https://docs.google.com/forms/d/1Y1FLkfQYrPv-CehCjSfWgZ6i34aDAL06jrb_94jihu4/edit&nbsp;</p><p>🔶 კომისია გადაწყვეტილებას მიიღებს ქულათა სისტემის საფუძველზე, განაცხადების მიღების ვადის ამოწურვიდან ორი კვირის განმავლობაში.&nbsp;</p><p>🔷 კანდიდატებთან დაკავშირება მოხდება დადებითი/უარყოფითი პასუხის შემთხვევაში.&nbsp;</p><p>გისურვებთ წარმატებებს!</p>\"}', '{\"en\": null}', NULL, NULL, '551290405', '2021-05-14', '2021-05-31', '2021-05-15', 96, NULL, '74__2021-05-1512:10:17.png', NULL, 'https://www.facebook.com/we4education', 'https://ge.linkedin.com/company/we4education', NULL, '2021-05-15 11:32:49', '2021-05-15 12:10:18', 'https://docs.google.com/forms/d/1Y1FLkfQYrPv-CehCjSfWgZ6i34aDAL06jrb_94jihu4/edit', NULL, 1, 0, 'info.we4e@gmail.com', 15, NULL, 1, NULL, NULL, 0, NULL, 0),
