(79, '{\"en\": null, \"ka\": \"ახალგაზრდული ორგანიზაციების მდგომარეობა საქართველოში\"}', '{\"en\": null, \"ka\": \"<h2>ახალგაზრდული ორგანიზაციების მდგომარეობა საქართველოში</h2><p>კვლევის ანგარიში</p><p>კვლევა მომზადდა საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალური საბჭოს დაკვეთით პროექტის - „ახალგაზრდობა მნიშვნელოვანია“ ფარგლებში. პროექტი დაფინანსებულია სსიპ ახალგაზრდობის სააგენტოს განვითარების ფონდის მიერ.</p><p>ახალგაზრდული ორგანიზაციები მნიშვნელოვან როლს ასრულებენ როგორც ახალგაზრდების, ასევე, მთლიანად საზოგადოების განვითარების პროცესში.</p><p>ახალგაზრდული ორგანიზაციები ქმნიან ახალგაზრდებისთვის მნიშვნელოვანი საკითხების ადვოკატირების ეფექტიან პლატფორმას, ხელს უწყობენ ახალგაზრდებში საკვანძო უნარ-ჩვევების განვითარებას, ინფორმაციის გავრცელებას, აქტიურ მოქალაქეობასა და მონაწილეობას, უზრუნველყოფენ ახალგაზრდული საქმიანობის და არაფორმალური განათლების სერვისის მიწოდებას. ახალგაზრდული ორგანიზაციების საშუალებით ახალგაზრდებს შესაძლებლობა აქვთ ჩამოაყალიბონ ფართო და მრავალფეროვანი სოციალური კავშირები, დაამყარონ პარტნიორული ურთიერთობები სხვადასხვა ორგანიზაციასთან და ჯგუფთან, რაც, საბოლოო ჯამში, ხელს უწყობს ახალგაზრდების განვითარებას და მათ კეთილდღეობას.</p><p>გამომდინარე იქიდან, რომ ახალგაზრდულ ორგანიზაციებს მნიშვნელოვანი როლი და ფუნქცია აკისრიათ, აუცილებელია ახალგაზრდული ორგანიზაციების შესაძლებლობებისა და საჭიროებების შესწავლა. სწორედ ამ მიზნით, საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალური საბჭოს ინიციატივით, ახალგაზრდობის სააგენტოს მიერ დაფინანსებული პროექტის - „ახალგაზრდობა მნიშვნელოვანია“ ფარგლებში, ხორციელდება საქართველოში რეგისტრირებული ახალგაზრდული ორგანიზაციების მდგომარეობის შესახებ კვლევა, რომლის ფოკუსს წარმოადგენს:</p><p>-საქართველოში რეგისტრირებული ახალგაზრდული ორგანიზაციების არსებული რესურსების, სტრუქტურისა და მუშაობის სისტემის მოკლვევა;</p><p>-საქართველოში რეგისტრირებული ახალგაზრდული ორგანიზაციების გამოწვევებისა და საჭიროებების იდენტიფიცირება.</p><p>დეტალურად კვლევის ანგარიში შეგიძლიათ იხილოთ მიბმულ დოკუმენტში.&nbsp;</p>\"}', '{\"en\": \"სახელმძღვანელო\", \"ka\": \"სახელმძღვანელო\"}', NULL, NULL, NULL, '2021-05-17', '2021-07-31', '2021-05-17', 17, NULL, '79__2021-05-1713:24:22.png', NULL, 'https://www.facebook.com/NCYOG', NULL, 'www.youthcouncil.ge', '2021-05-17 13:12:39', '2021-05-17 14:02:15', NULL, NULL, 1, 0, 'info@youthcouncil.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(83, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-05-17', '2021-05-17', '2021-05-17', 17, NULL, NULL, NULL, '', '', '', '2021-05-17 13:57:13', '2021-05-17 13:57:13', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(84, '{\"en\": \".\", \"ka\": \"Workshop ახალგაზრდული ორგანიზაციებისთვის და ახალგაზრდა ინიციატორებისთვის\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>&bdquo;ახალგაზრდები საზოგადოებრივი ინტერესებისთვის&ldquo; აცხადებს მიღებას, ორ დღიან Workshop-ში მონაწილეობისთვის, რომელიც ჩატარდება 22-23 მაისს, ქ.ბათუმში.</p>\\n\\n<p>Workshop-ში მონაწილეობა შეუძლიათ ქ. ბათუმის მასშტაბით, ახალ რეგისტრირებულ ახალგაზრდულ ორგანიზაციებს, საინიციატივო ჯგუფებს და ახალგაზრდებს, რომლებსაც სურთ არასამთავრობო სექტორში მოღვაწეობა.Workshop-ის ფარგლებში მონაწილეები :</p>\\n\\n<ul>\\n\\t<li>გაეცნობიან არასამთავრობო სექტორის მუშაობის სტრუქტურას;</li>\\n\\t<li>გაეცნობიან სტრატეგიის დოკუმენტის ჩარჩოს;</li>\\n\\t<li>გაეცნობიან ციფრულ ხელსაწყოებს, რომლის გამოყენებასაც შეძლებენ სამუშაო პროცესში;</li>\\n\\t<li>მიიღებენ პრაქტიკულ რჩევებს და რეკომენდაციებს დონორებთან ურთიერთობის და დაფინანსების მოპოვებისთვის;</li>\\n</ul>\\n\\n<p>Workshop-ში მონაწილეობისთვის, გთხოვთ შეავსოთ მოცემული სააპლიკაციო ფორმა 18 მაისის ჩათვლით .</p>\\n\\n<p><a href=\\\"https://forms.gle/Rm32ZXTekfWtDjPC9?fbclid=IwAR0IksPT1QJBp_DPgir78Qkcq8Z3st-3GjVGeZVq989aJraI1kpKckiP09g\\\">https://forms.gle/Rm32ZXTekfWtDjPC9</a></p>\"}', '{\"en\": \"<p>ს.ზუბალაშვილის #11</p>\", \"ka\": \"<p>ს.ზუბალაშვილის #11</p>\"}', NULL, NULL, '591057850', '2021-05-05', '2021-05-18', '2021-05-17', 99, NULL, '84__2021-05-1719:46:41.png', NULL, NULL, NULL, NULL, '2021-05-17 19:27:39', '2021-05-25 10:08:40', 'https://forms.gle/Rm32ZXTekfWtDjPC9', NULL, 1, 0, 'merinamgaladze929@gmail.com', 15, 29, 0, NULL, NULL, 0, NULL, 0),
(85, '{\"en\": null, \"ka\": \"მოხალისეობა და მოხალისეობრივი კულტურა\"}', '{\"en\": null, \"ka\": \"<p><i><strong>არასამთავრობო ორგანიზაცია \\\"გადასხვაფერდი\\\" პროექტ „ახალგაზრდობა მნიშვნელოვანიას“ ფარგლებში, 20 მაისს 15:00 საათზე, დაბა შუახევში, გიწვევთ ტრენინგზე თემაზე \\\"მოხალისეობა და მოხალისეობრივი კულტურა\\\", რომელსაც ჩაატარებს “საქართველოს წითელი ჯვრის საზოგადოების” ბათუმის წარმომადგენლობა.</strong></i></p><p><i><strong>ტრენინგის ბოლოს გაიმართება დასუფთავების აქცია და მონაწილეები დავასუფთავებთ დაბა შუახევის ცენტრალური ნაწილის მიმდებარე ტერიტორიას.</strong></i></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-20', '2021-05-20', '2021-05-19', 97, NULL, '85__2021-05-1905:43:54.png', NULL, NULL, NULL, NULL, '2021-05-19 05:38:54', '2021-05-19 05:43:54', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(86, '{\"en\": \".\", \"ka\": \"კვირეული ქალთა გაძლიერებისთვის\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ა(ა)იპ „მირაბალდები“ 19-25 მაისს მოწვეულ მენტორთან, ნინო ცაავასთან ერთად შეხვედრათა ციკლს გამართავს. „კვირეული ქალთა გაძლიერებისთვის“ მიზნად ისახავს ქალთა გაძლიერების ხელშეწყობას, ქალთა უფლებების დაცვას, საზოგადოების ცნობიერების ამაღლებას ქალის როლის შესახებ.</p><p>შეგახსენებთ, რომ ა(ა)იპ ,,მირაბალდები\\\" არის არასამთავრობო ორგანიზაცია, რომლის მთავარ მიზნებს წარმოადგენს: ქალთა მიმართ ან/და ოჯახში ძალადობისა და მასთან ბრძოლის ხერხებზე საზოგადოების ცნობიერების ამაღლება; ძალადობის მსხვერპლთა დაცვა და მხარდაჭერა.</p><p>აღსანიშნავია, რომ მიზნების განსახორციელებლად ორგანიზაცია აქტიურად ახორციელებს სხვადასხვა სოციალურ კამპანიებს, ატარებს საინფორმაციო შეხვედრებს, რომელთა შორისაცაა „კვირეული ქალთა გაძლიერებისთვის“.<br>ეს სასარგებლო შეხვედრები საჯარო იქნება. შესაბამისად, ნებისმიერ დაინტერესებულ პირს მიეცემა დასწრების შესაძლებლობა.</p><p>კვირეულზე მონაწილე სპიკერები:</p><p>1. ირინა ბათიაშვილი - მითები ასაკოვან ქალებზე<br>2. ნინო ეფხოშვილი - ქალი და მომავლის ორგანიზაციები<br>3. ანა ცანავა - ქალთა ეკონომიკური გაძლიერება საქართველოში: შესაძლებლობები და გამოწვევები<br>4. ნინო გელენიძე - ქალები და ლიდერობა<br>5. მარინა კურტანიძე - ქალების ჩართულობა ღვინის ბიზნესში: პირადი გამოცდილების გაზიარება<br>6. დიმიტრი ცქიტიშვილი - ქალების მონაწილეობა საზოგადოებრივ-პოლიტიკურ პროცესებში<br>7. ნინო კალანდია - ქალის ცხოვრებაში არსებული სირთულეები: სტიგმებით მოცული საზოგადოება<br>8. დათო ლიკლიკაძე - გენდერული თანასწორობა საქართველოში<br>9. ანუკა ნაკაშიძე - გენდერული სტერეოტიპები საქართველოში<br>10. ლუიზა მუთოშვილი - ფემინიზმი<br>11. რაისა ლიპარტელიანი - გენდერული თანასწორობა და ქალთა შრომითი უფლებები<br>12. ია ნიორაძე - ქალი მენეჯერი: პირადი გამოცდილების გაზიარება<br>13. სოფო ბადიაშვილი - ქალის როლი თანამედროვე საზოგადოებაში: პირადი გამოცდილების გაზიარება<br>14. თიკა რუხაძე - ქალის როლი საზოგადოებრივ ცხოვრებაში<br>15. ანა მდივანი - ქალი, როგორც მედიის წარმომადგენელი<br>16. ეკა ლალიაშვილი - ქალის როლი თანამედროვე საზოგადოებაში: პირადი გამოცდილების გაზიარება<br>17. მარიამ ხუროშვილი - როგორ აძლიერებენ ქალებს EaP ფარგლებში<br>18. თინათინ ჯაფარიძე - ქალების როლი უსაფრთხოების სექტორში<br>19. ნინო გოგოხია - 22 წლის პაიკი გაეროში: პირადი გამოცდილების გაზიარება<br>20. ნანა გოგოხია - ქალი, როგორც ლიდერი<br>21. ია იმერლიშვილი - მეწარმე ქალები: პირადი გამოცდილების გაზიარება<br>22. მარიამ მიროტაძე - ქალები ღვინის ბიზნესში: პირადი გამოცდილების გაზიარება<br>23. რუსუდან გოცირიძე - ქალის სახე და როლი თანამედროვე ცხოვრებაში<br>24. ზაალ ჩხეიძე - ზოგიერთი სტერეოტიპი და ქალი, როგორც მთხრობელი<br>25. ნათია კობერიძე - ქალთა ეკონომიკური გაძლიერების მნიშვნელობა<br>26. თეა ადუაშვილი - ქალების ჩართულობა ბიზნესში: პირადი გამოცდილების გაზიარება<br>27. თამარ კანაშვილი - ქალების როლი თანამედროვე საზოგადოებაში<br>28. ბაია აბულაძე - ქალები მეწარმეობაში: პირადი გამოცდილების გაზიარება<br>29. ხათუნა კეთილაძე - როგორ დავაღწიოთ თავი მოძალადეს<br>30. ნინო ელბაქიძე- ქალთა პოლიტიკური მონაწილეობა<br>31. თეა მახათელაშვილი - ქალები ღვინის ბიზნესში: პირადი გამოცდილების გაზიარება<br>32. ქეთო ნინიძე - ქალები ღვინის ბიზნესში: პირადი გამოცდილების გაზიარება<br>33. ლელა აქიაშვილი - გენდერული თანასწორობა და ქალთა უფლებები<br>34. თამარ ლილუაშვილი - ქალის როლი დიპლომატიაში<br>35. ელენე ჯანელიძე - ქალი უფლებადამცველები საქართველოსა და მსოფლიოში-დაბრკოლებები და გამოწვევები<br>36. ზაირა ჯიბლაძე - ქალები ღვინის ბიზნესში: პირადი გამოცდილების გაზიარება</p><p>---------------------------------------<br>აქვე გვინდა გაცნობოთ, რომ „კვირეული ქალთა გაძლიერებისთვის“ და „მირაბალდების“ მთავარ პროექტის „განათლება ძალადობის წინააღმდეგ“ ფარგლებში, გორის ოჯახში ძალადობის მსხვერპლთა სახელმწიფო თავშესაფარში სახელობის ანა (ოლღა) სოლოღაშვილის სამკითხველო სივრცე ეწყობა. აღნიშნულის განსახორციელებლად გვჭირდება საზოგადოების თანადგომა. სურვილის შემთხვევაში თანხა შეგიძლიათ ჩარიცხოთ შემდეგ რეკვიზიტებზე:</p><p>რეკვიზიტები: ა(ა)იპ ,,მირაბალდები’’<br>საიდ. კოდი: 404561318<br>ბანკისკოდი: BAGAGE22<br>ა/ა GE43BG0000000101303538</p><p>---------------------------------------<br>NNLE \\\"Mirabaldebi\\\" is holding a series of meetings with the invited mentor, Nino Tsaava, on May 19-25. \\\"Women\'s Empowerment Week\\\" aims to promote women\'s empowerment, protect women\'s rights, and raise public awareness of the role of women.</p><p>We would like to remind you that NNLE \\\"Mirabaldebi\\\" is a non-governmental organization, whose main goals are: to raise public awareness about violence against women and ways to combat it; to protect and support victims of violence.<br>As a matter of fact in order to achieve its goals, the organization actively carries out various social campaigns, holds information meetings, including \\\"Week for the Empowerment of Women\\\".<br>These helpful meetings will be public. Additionally, any interested person will be given the opportunity to attend.</p><p>Speakers participating in the week:</p><p>1. Irina Batiashvili - Myths about older women<br>2. Nino Efkhoshvili - Women and Future Organizations<br>3. Ana Tsanava - Women\'s Economic Empowerment in Georgia: Opportunities and Challenges<br>4. Nino Gelenidze - Women and Leadership<br>5. Marina Kurtanidze – women’s involvement in wine business: sharing personal experience<br>6. Dimitri Tskitishvili - Women\'s participation in socio-political processes<br>7. Nino Kalandia - Difficulties in a woman\'s life: a stigmatized society<br>8. Dato Liklikadze - Gender Equality in Georgia<br>9. Anuka Nakashidze - Gender Stereotypes in Georgia<br>10. Luiza Mutoshvili - Feminism<br>11. Raisa Liparteliani - Gender Equality and Women\'s Labor Rights<br>12. Ia Nioradze - Female Manager: Sharing personal experience<br>13. Sopho Badiashvili - The Role of Women in Modern Society: Sharing Personal Experiences<br>14. Tika Rukhadze - The role of women in public life<br>15. Anna Secretary - Woman as a media representative<br>16. Eka Laliashvili - The Role of Women in Modern Society: Sharing Personal Experiences<br>17. Mariam Khuroshvili - How women are empowered within the EaP<br>18. Tinatin Japaridze - The role of women in the security sector<br>19. Nino Gogokhia - 22-year-old Pike at the UN: Sharing personal experiences<br>20. Nana Gogokhia - Woman as a leader<br>21. Ia Imerlishvili - Women Entrepreneurs: Sharing Personal Experience<br>22. Mariam Mirotadze - Women in the Wine Business: Sharing Personal Experiences<br>23. Rusudan Gotsiridze - The face and role of a woman in modern life<br>24. Zaal Chkheidze - Some stereotypes and women as narrators<br>25. Natia Koberidze - The Importance of Women\'s Economic Empowerment<br>26. Tea Aduashvili - Women\'s Involvement in Business: Sharing Personal Experiences<br>27. Tamar Kanashvili - The role of women in modern society<br>28. Baia Abuladze - Women in Entrepreneurship: Sharing Personal Experiences<br>29. Nino Elbakidze- women’s political participation<br>30. Khatuna Ketiladze - How to get rid of the abuser<br>31. Tea Makhatelashvili - Women in the Wine Business: Sharing Personal Experiences<br>32. Keto Ninidze - Women in the Wine Business: Sharing Personal Experiences<br>33. Lela Akiashvili - Gender Equality and Women\'s Rights<br>34. Tamar Liluashvili - The role of women in diplomacy<br>35. Elene Janelidze - Women Human Rights Defenders in Georgia and the World - Obstacles and Challenges<br>36. Zaira Jibladze - Women in the Wine Business: Sharing Personal Experiences</p><p>-----------------------------------------<br>We would also like to inform you that within the framework of the \\\"Week for Women\'s Empowerment\\\" and \\\"Mirabaldebi\\\"’s main project \\\"Education against Violence\\\", a reading space named after Ana (Olga) Sologashvili is being organized at the Gori State Shelter for Victims of Domestic Violence. For doing this, we need the support of the public. If you wish, you can transfer the amount to the following details:</p><p>Details: NNLE \\\"Mirabaldebi\\\"<br>Said. Code: 404561318<br>Bank Code: BAGAGE22<br>A / A GE43BG0000000101303538</p>\"}', 