(87, '{\"en\": null, \"ka\": \"საჯარო ლექციების ციკლი - 1. შეხვედრა ქალ პოლიციელთან- ნანა ხალითბა\"}', '{\"en\": null, \"ka\": \"<p>📣იწყება საჯარო ლექციათა ციკლი! &nbsp;</p><p>👉 პროექტის \\\"პროფესია, ქალი და სტერეოტიპები\\\" ფარგლებში სხვადასხვა პროფესიის წარმატებული ძლიერი ქალები გაგიზიარებენ თავიანთ გამოცდილებას, პროფესიებში &nbsp;არსებულ შესაძლებლობებს - საფრთხეებს, იმ გამოწვევებს რასაც ქალები აწყდებიან აღნიშნული პროფესიების არჩევის შემთხვევაში. &nbsp;მათთან ერთად მიმოიხილავთ არსებულ სტერეოტიპებს. &nbsp; &nbsp;</p><p>👩‍💼 პროექტის პირველი მოწვეული სპიკერია პოლიციელი - უბნის ინსპექტორ-გამომძიებელი ქალბატონი - ნანა ხალითბა.</p><p>🙏 დასწრება შეგიძლიათ ყველა დაინტერესებულ პირს. დასასწრებად გთხოვთ გაირეთ რეგისტრაცია. &nbsp;</p><p>მონაწილეებს საშუალება გექნებათ დაუსვათ კითხვები, სპიკერებთან ერთან განიხილოთ ქალებისთვის მიუღებელ, სტერეოტიპულად აღქმულ პროფესიებში არსებულ ბარიერები და ერთად მოიფიქროთ, როგორ შეიძლება პროფესიული სტერეოტიპების ნგრევა. &nbsp;</p><p>პირველი ლექცია ჩატარდება 25 მაისს 21:00 საათზე ონლაინ, პლატფორმა ზუმის საშუალებით. ლინკი გამოგეგზავნებათ მითითებულ ელ.ფოსტაზე. &nbsp;</p><p>კითხვების შემთხვევაში დაგვიკავშირდით:</p><p>youthdevelopmentn@gmail.com</p><p>558698098</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '558698098', '2021-05-22', '2021-05-25', '2021-05-22', 102, NULL, '87__2021-05-2219:16:22.png', NULL, 'https://www.facebook.com/ydn2021', NULL, NULL, '2021-05-22 19:13:10', '2021-05-22 19:22:14', 'https://forms.gle/mwJJCgZ4r7uEyLcG8', NULL, 1, 0, 'youthdevelopmentn@gmail.com', NULL, NULL, 1, 'რეგისტრაციის შემდგომ მიიღებთ ელ. ფოსტის საშუალებით', NULL, 0, NULL, 0),
