(89, '{\"en\": null, \"ka\": \"გახდი Cognitive Center of Georgia -ს ახალგაზრდული გუნდის წევრი\"}', '{\"en\": null, \"ka\": \"<p>©️ - CCG &nbsp;- Cognitive Center of Georgia - საქართველოს შემეცნებითი ცენტრი აცხადებს აქტიური წევრების მიღებას ორგანიზაციაში. ახალგაზრდების მონაწილეობა გადაწყვეტილებების მიღბის პროცესში ძალიან მნიშვნელოვანია ახალგაზრდული სფეროს და ქვეყნის განვითარებაში.</p><p>©️ - CCG - Cognitive Center of Georgia -ს მიზანია ახალგაზრდული ინიციატივების მხარდაჭერა, ახალგაზრდების განვითარებისთვის ხელშეწყობა და პოტენციალის რეალიზებაში მხარდაჭერა.</p><p>©️ - ახალგაზრდები შეირჩევიან საქართველოს სხვადასხვა რეგიონიდან და ჩამოყალიბდებიან გუნდებად, თითო გუნდში 5 - 10 ახალგაზრდა, რომელთა ფუნქციაც იქნება</p><p>🤩 ორგანიზაციაში სხვადასხვა აქტივობის ინიცირება და განხორციელების ხელშეწყობა;</p><p>არ გვაქვს ასაკობრივი შეზღუდვა!</p><p>არ გვაქვს ტერიტორიული შეზღუდვა! &nbsp;</p><p>მიეცი გასაქანი შენს იდეებს, მიიღე მონაწილეობა აქტივობების განხორციელებაში, ორგანიზაციის პრიორიტეტების დასახვაში, შენს რეგიონში ახალგაზრდული სფეროს განვითარებაში!</p><p>რეგისტრაციის ბოლო ვადა 10 ივნისი</p><p>&nbsp;</p><p>რეგისტრაციისთვის გადადით ბმულზე&nbsp;</p><p>https://docs.google.com/forms/d/e/1FAIpQLSfBTAAF8McWwARKPrLQbcDIvpBBR63bX-GoEOlwYDVv4e_-VA/viewform</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '595025286', '2021-05-21', '2021-06-10', '2021-05-24', 63, NULL, '89__2021-05-2407:54:29.png', NULL, 'https://www.facebook.com/cognitivecenterofgeorgia', NULL, 'ccgeorgia.ge', '2021-05-24 07:44:03', '2021-05-24 07:54:30', 'გახდი Cognitive Center of Georgia -ს ახალგაზრდული გუნდის წევრი', NULL, 1, 0, 'cognitivecenterofgeorgia@gmail.com', 14, 29, 1, 'https://us02web.zoom.us/j/8792449236', NULL, 0, NULL, 0),
(90, '{\"en\": null, \"ka\": \"დებატების ჩემპიონატი\"}', '{\"en\": null, \"ka\": \"<p>📣 მოგესალმებით! არასამთავრებო ორგანიზაცია «DM GROUP” იწყებს მონაწილეების მიღებას დებატების ჩემპიონატზე!</p><p>-----------------------------------</p><p>🔵 ეს პროექტი ხელს უწყობს მონაწილეებში მსჯელობის და კრიტიკული აზროვნების განვითარებას. &nbsp;ავარჯიშებს მონაწილეებს აზრების მწყობრად გამოხატვასა და დასკვნების გამოტანაში.</p><p>--------------------------------</p><p>&nbsp;</p><p>წარმოგიდგენთ მცირედს, იმ უდიდესი მიზნებიდან რომელსაც ეს პროექტი ახალგაზრების განვითარებისთვის ისახავს:</p><p>&nbsp;</p><p>✅საკუთარი აზრის ჩამოყალიბებისა და დასაბუთების, მისი სწორად და მტკიცედ დაცვის &nbsp;უნარ-ჩვევების განვითარება</p><p>&nbsp;</p><p>✅კრიტიკული აზროვნების უნარ-ჩვევების განვითარება;</p><p>&nbsp;</p><p>✅ არგუმენტებული კამათის ხელოვნება;</p><p>&nbsp;</p><p>✅ სხვადასხვა მხარეების თვალსაზრისის გაცნობა რომელებიც მონაწილეებს დაეხმარება საკუთარი აზრის ჩამოყალიბებაში;</p><p>&nbsp;</p><p>✅რაც ყველაზე მთავარია გაიცნოთ ახალი ადამიანები, გაიჩინოთ მეგობარები და ისწავლოთ გუნდური მუშაობა</p><p>&nbsp;</p><p>--------------------------------</p><p>&nbsp;</p><p>ახლა კი დეტალურად მინდა მოგიყვეთ დებატების ჩემპიონატის შესახებ.</p><p>&nbsp;</p><p>🔴 მოაწილეობის მიღება არის უფასო და &nbsp;ჩატარდება ონლაინ ფორმატში. რაც ყველას, მათ შორის რეგიონში მცხოვრებ ახალგაზრდებსაც &nbsp;მისცემს საშუალებას გამოავლინონ საკუთარი შესაძლებლობები</p><p>&nbsp;</p><p>🔵რეგისტრაციის ვადები</p><p>23-28 მაისი.</p><p>🔵 ჩემპიონატი ტარდება კარლ პოპერის ფორმატის მიხედვით.</p><p>🔵 ჩემპიონატზე დარეგისტრირების შემდეგ გასაუბრებით აირჩევა 24 საუკეთესო მონაწილე რომლებიც მიიღებენ მონაწილეობას დებატებში.</p><p>ისინი გაიყოფიან ორ ძირითად მხარედ და ეყოლებათ მენტორები</p><p>&nbsp;</p><p>👥გუნდი N1 - მენტორი -ლუკა გაფრინდაშვილი</p><p>&nbsp;</p><p>👥გუნდი &nbsp;N2 - მენტორი - ნინა ჩაჩხიანი</p><p>&nbsp;</p><p>🔵1 ივნისს ჩატარდება თეორიული გაკვეთილები, სადაც დეტალურად გაეცნობით დებატების პრინციპს, გაიგებთ თამაშის წესებს &nbsp;და მიიღებთ პასუხებს ნებისმიერ კითხვაზე</p><p>&nbsp;</p><p>🔵 2 ივნისი იქნება პრაქტიკული &nbsp;დღე &nbsp;სადაც მენტორები თავის გუნდებში ჩაატარებენ თამაშგარე, შიდა დებატებს.</p><p>&nbsp;</p><p>‼️‼️უშუალოდ დებატები ჩატარდება 4-6 ივნისს.</p><p>&nbsp;</p><p>4 ივნისს მოაწილეების შერკინებიდან გამოვლინდება 2 გამარჯვებული გუნდი რომელიც იასპარეზებს 6 ივნისს.</p><p>&nbsp;</p><p>🎓 საბოლოოდ კი ყველა მონაწილეს გადაეცემა &nbsp;სერთიფიკატი.</p><p>მოგებულ გუნდს კი ჩემპიონატში გამარჯვების აღმნიშვნელი სერთიფიკატები. ამასთან &nbsp;ერთად მსაჯების გადაწყვეტილებით გამოვლინდებიან საუკეთესო სპიკერები რომლებსაც ასევე გადავცემთ სერთიფიკატებს.</p><p>&nbsp;</p><p>რეგისტრაცია შეგიძლიათ გაიაროთ აქ: https://docs.google.com/forms/d/1IBm9Dd8NdwmEKtXWzouQ_7zql7dJsPgiuLbDN-mgOtI/edit</p><p>&nbsp;</p><p>მეგობრებო, წარმატების მიღწევაა არასდროსაა გვიანი.</p><p>&nbsp;</p><p>🔴გაბედეთ მიზნებისთვის ბრძოლა!❤️</p><p>&nbsp;</p><p>,, DM GROUP\\\" გისურვებთ წარმატებებს! ✨</p><p>&nbsp;</p><p>#DMgroup</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-04', '2021-06-06', '2021-05-24', 103, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-24 09:01:58', '2021-05-24 09:14:23', 'https://docs.google.com/forms/d/1IDd8NdwmEKtXWzouQ_7zql7dJsPgiuLbDN-mgOtI/edit', NULL, 1, 0, NULL, 14, NULL, 0, NULL, NULL, 1, NULL, 0),
