(95, '{\"en\": \".\", \"ka\": \"ფოტო კონკურსი თემაზე: ,,პანდემია და ახალგაზრდები“.\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>ასოციაცია ,,ათინათის“ პროექტი ,,ახალგაზრდების ჩართულობა და განვითარება“ აცხადებს ფოტო კონკურსს თემაზე: ,,პანდემია და ახალგაზრდები“.<br>კონკურსის ფარგლებში, თქვენ შეგიძლიათ გამოაგზვანოთ თქვენს მიერ გადაღებული ფოტოები, გამოაჩინოთ საკუთარი შესაძლებლობები და ფანტაზია.</p><p>კონკურსის პირობები:</p><p>1. ფოტოების თემატიკა შეზღუდული არ არის;</p><p>2. კონკურსში მონაწილე ნამუშევარზე საავტორო უფლებები უნდა ეკუთვნოდეს კონკურსანტს; მონაწილე, რომელიც შემჩნეული იქნება საავტორო უფლებების დარღვევაში, წინასწარი გაფრთხილების გარეშე მოიხსნება კონკურსიდან;</p><p>3. კონკურსში მონაწილეობა შეუძლია პროექტის ,,ახალგაზრდების ჩართულობა და განვითარება\\\" პარტნიორი სკოლის მოსწავლეებს/კლუბის წევრებს;</p><p>4. ნამუშევრის გამოგზავნისას მიუთითეთ თქვენი სახელი /გვარი და თქვენი საკონტაქტო ნომერი. (სურვილის შემთხვევაში შეგიძლიათ მიუთითოთ ფოტოს დასახელება, გადაღების ადგილი);</p><p>5. ფოტოების გამოგზავნის ბოლო ვადაა 27 მაისი, 18:00 საათი;</p><p>კონკურსში გამარჯვებულებს გამოავლენს სპეციალური ჟიური. გამარჯვებულები დაჯილდოვდებიან პრიზებითა და სერტიფიკატებით.</p><p>კონკურსის ვადები:</p><p>გამოცხადების თარიღი: 18 მაისი</p><p>ფოტოების მიღების ბოლო ვადა: 27 მაისი,18:00 საათი.</p><p>გამარჯვებულები გამოვლინდებიან: 30 მაისს.</p><p>ნამუშევრები გამოაგზავნეთ შემდეგ ელ.მისამართზე:</p><p>s.zhvania@atinati.org ; s.guguchia@atinati.org; ან მოიტანეთ ასოციაცია ,,ათინათის“ ოფისში. მის: ქ.ზუგდიდი, რუსთაველის # 94.&nbsp;</p>\"}', '{\"en\": \"<p>ზუგდიდი, რუსთაველის #94</p>\", \"ka\": \"<p>ზუგდიდი, რუსთაველის #94</p>\"}', NULL, NULL, '551558989', '2021-05-24', '2021-05-31', '2021-05-24', 19, NULL, '95__2021-05-2410:27:05.png', NULL, 'https://www.facebook.com/atinati.ge/photos/a.10150835463455274/10165267431675274', NULL, 'atinati.org', '2021-05-24 10:18:51', '2021-05-24 11:18:03', NULL, NULL, 1, 0, 'rusiko.kalichava@gmail.com', 0, 0, 0, NULL, NULL, 0, NULL, 0),
