(106, '{\"en\": \".\", \"ka\": \"რა შეიძლება ვისწავლოთ საქართველოს დემოკრატიული რესპუბლიკისგან?\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>29 მაისს, შაბათს 15 საათზე</p>\\n\\n<p>გვეწვევა კავკასიის უნივერსიტეტის ლექტორი, ირაკლი ირემაძე, რომელიც გაგვესაუბრება შემდეგ საკითხებზე:</p>\\n\\n<p><img alt=\\\"✔\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/2714.png\\\" style=\\\"height:16px; width:16px\\\" />&nbsp;დემოკრატიული რესპუბლიკის მშენებლობის პროცესი;<br />\\n<img alt=\\\"✔\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/2714.png\\\" style=\\\"height:16px; width:16px\\\" />&nbsp;როგორ იყვნენ ჩარტულნი ამ პროცესში რელიგიური და ეთნიკური უმცირესობები, ქალები და ახალგაზრდები;<br />\\n<img alt=\\\"✔\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/2714.png\\\" style=\\\"height:16px; width:16px\\\" />&nbsp;რა მოიტანა 1918 წლის 26-მა მაისმა.</p>\\n\\n<p>გვექნება შეკითხვების დასმის შესაძლებლობაც&nbsp;<img alt=\\\"😊\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/1f60a.png\\\" style=\\\"height:16px; width:16px\\\" /><br />\\n<img alt=\\\"🚶‍♀\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta9/1.5/16/1f6b6_200d_2640.png\\\" style=\\\"height:16px; width:16px\\\" /><img alt=\\\"🚶‍♂\\\" src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tab/1.5/16/1f6b6_200d_2642.png\\\" style=\\\"height:16px; width:16px\\\" />&nbsp;ამიტომ, შემოგვიერთდით საინტერესო და მნიშვნელოვან შეხვედრაზე&nbsp;</p>\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>რუსთაველის ქუჩა #27, თეთრიწყარო</p>\"}', NULL, NULL, NULL, '2021-05-29', '2021-05-30', '2021-05-25', 67, NULL, 'T1l1p7wdlFFU2w9dDslKXKgBKlSlFfaoEBMshvwZ.jpeg', NULL, 'https://www.facebook.com/events/199363748701872', NULL, NULL, '2021-05-25 09:47:17', '2021-05-25 11:45:37', NULL, NULL, 1, 1, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 1),
