(108, '{\"en\": null, \"ka\": \"პროექტი - იაზროვნე ჩარჩოებს გარეთ\"}', '{\"en\": null, \"ka\": \"<p>📣ვიწყებთ ყველაზე მასშტაბურ, საინტერესო და კრეატიულ პროექტს -🌟 ,,აზროვნება ჩარჩოებს გარეთ”🌟</p><p>&nbsp;</p><p>✔️პროექტის მიმდინარეობა</p><p>26 - 30 მაისი.</p><p>&nbsp;</p><p>➡️ სამუშაო თემები:</p><p>&nbsp;</p><p>🟡 რა არის კრეატივი?</p><p>🟠 რას ნიშნავს იყო კრეატიული?</p><p>🔴 კრეატიული აზროვნება</p><p>🟢 აზროვნების მეთოდები</p><p>🔵 როგორ ვაქციოთ კრეატივი შემოსავლის წყაროდ?</p><p>&nbsp;</p><p>✅ მონაწილეები იმუშავებენ სხვადასხვა სახის დავალებებზე, &nbsp;როგორც ჯგუფურად, ასევე ინდივიდუალურად, წარადგენენ იდეებს და პროექტის განმავლობაში შესრულებულ ნაშრომებს.</p><p>&nbsp;</p><p>🎁და რაც ყველაზე მთავარია, ეს ყველაფერი, სრულიად უფასოდ!</p><p>&nbsp;</p><p>➡️ პროექტში მონაწილეობა შეუძლიათ 13-18 წლამდე ახალგაზრდებს.</p><p>&nbsp;</p><p>👩‍💼 &nbsp;შეხვედრებს გაუძღვება:</p><p>⭕️ &nbsp;სოფო ხარებავა -</p><p>,, გზა მომავლისკენ\\\" დამფუძნებელი/ &nbsp; კრეატივისა და იდეების გენერირების პროექტის ,, როგორ შევქმნათ ინოვაციური პროდუქტი\\\" კურსდამთავრებული.</p><p>&nbsp;</p><p>მონაწილეობის მისაღებად აუცილებელია სრულად შეავსოთ სააპლიკაციო ფორმა👇</p><p>🔗https://cutt.ly/Kb4PbDU</p><p>&nbsp;</p><p>💡 რეგისტრაციის ბოლო ვადაა 2021 წლის 25 მაისი , 20:00 საათი.&nbsp;</p><p>&nbsp;</p><p>📃 პროექტის ბოლოს მონაწილეებს გადაეცემათ მონაწილეობის დამადასტურებელი სერტიფიკატი, ასევე გამოვლინდება პროექტის &nbsp;საუკეთესო &nbsp;მონაწილე.</p><p>&nbsp;</p><p>📲 &nbsp;დამატებითი ინფორმაციისთვის დაგვიკავშირდით:</p><p>📨 &nbsp;Gmomavlisken@gmail.com</p><p>📞 598 54 35 37</p><p>&nbsp;</p><p>,,გზა მომავლისკენ” გისურვებთ წარმატებებს! 💜</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-26', '2021-06-03', '2021-05-25', 76, NULL, '108__2021-05-2510:49:25.png', NULL, NULL, NULL, NULL, '2021-05-25 10:39:01', '2021-05-27 06:24:03', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
