(117, '{\"en\": null, \"ka\": \"გახდი IADE-ის ახალგაზრდული გუნდის წევრი\"}', '{\"en\": null, \"ka\": \"<p>IADE • International Agency for Development and Education -ის გუნდი აცხადებს აქტიური წევრების მიღებას ორგანიზაციაში. თქვენ წინ გელით დაუვიწყარი დღეები, ინოვაციური პროექტები და რაც მთავარია მეგობრული გარემო.</p><p>მონაწილეობრივი ახალგაზრდული პოლიტიკა IADE • International Agency for Development and Education-ის ერთ–ერთი ძირითადი მიმართულებაა. ვინაიდან, ახალგაზრდები და ახალგაზრდული ორგანიზაციები ბუნებრივია, ახალგაზრდული სფეროს უმთავრესი ნაწილი არიან და მათი მონაწილეობის მიღება საქმიანობაში მნიშვენლოვანია.</p><p>IADE • International Agency for Development and Education -ში წევრობა არის სრულიად მოხალისეობრივი. მისი ფუნქციაა, ახალგაზრდების ინტერესების გათვალისწინება უშუალოდ და მხოლოდ IADE • International Agency for Development and Education -ის საქმიანობაში.</p><p>რა არის აქტიური წევრების მოვალეობა?</p><p>პროექტების ორგანიზაციულ მხარეზე ზრუნვა</p><p>პროექტების პოპულარიზაცია</p><p>უნივერსიტეტებთან კავშირის დამყარება</p><p>კონსულტაცია გაუწიოს IADE • International Agency for Development and Educationს ახალგაზრდობასთან დაკავშირებულ ყველა საკითხზე;</p><p>პროაქტიულად დასახოს პრიორიტეტები, მოახდინოს ახალი, რელევანტური იდეების გენერირება და მათი ინიცირება ორგანიზაციასთან;</p><p>დაამყაროს თანამშრომლობა და კოორდინაცია ახალგაზრდულ სექტორში სამთავრობო და არასამთავრობო სექტორს შორის.</p><p>გუნდი 10 ახალგაზრდა წევრისგან დაკომპლექტდება,</p><p>წევრების შერჩევაში, სააგენტოსთან ერთად, მონაწილეობას იღებს საერთაშორისო ორგანიზაციებით დაკომპლექტებული კომისია.</p><p>თუ ხარ ახალგაზრდა (18–29 წელი) და გინდა გახდე IADE • International Agency for Development and Education -ის გუნდის წევრი, მიიღო მონაწილეობა პრიორიტეტების დასახვაში, გადაწყვეტილებების მიღებასა და ახალგაზრდული სფეროს განვითარებაში, დარეგისტრირდი &nbsp;<a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fdocs.google.com%2Fforms%2Fd%2Fe%2F1FAIpQLSfbo9wPb95yu_x3TrIlJKzMDpMsmw3HDo4w-yFzLwHgFzhB-g%2Fviewform%3Fvc%3D0%26c%3D0%26w%3D