(125, '{\"en\": \".\", \"ka\": \"ციფრული სააგენტო\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>,,ნიკოს ეზო\'\' არის ახალგაზრუდლი &nbsp;ორგანიზაცია და სოციალური საწარმო, რომელიც მდებარეობს სამეგრელოში, ხობის რაიონ სოფელ ხეთაში. 1 ივნისიდან ვიწყებთ ციფრული სააგენტოს გუნდის ფორმირებას. შევარჩევთ ადგილობრივ მოტივირებულ კადრებს და გავატარებთ 2 თვიან ინტენსიურ გადამზადების ციკლს შემდეგი მიმართულებებში: გრაფიკული დიზაინი, ფოტო/ვიდეოგრაფია, სოციალური მედიის მენეჯმენტი. სულ შეირჩევა 15 კანდიდატი. სექტემბრიდან ეს გუნდი, რა თქმა უნდა მენტორებთან ერთად მოემსახურება ხობი- ზუგდიდი რაიონის მეწარმეებს. დავეხმარებით მათი პროდუქტის თუ სერვისის ციფრულ არხებში განთავსებაში.</p><p>პირველი ივნისიდან დაიწყება საინფორმაციო კამპანია. განაცხადის მიღებაზე ინფორმაციაც დაიდება პირველი ივნისიდან.</p>\"}', '{\"en\": \"<p>ხობის რაიონი სოფელი ხეთა</p>\", \"ka\": \"<p>ხობის რაიონი სოფელი ხეთა</p>\"}', NULL, NULL, '514008686', '2021-06-01', '2021-09-01', '2021-05-28', 69, NULL, '125__2021-05-2707:57:31.png', NULL, NULL, NULL, NULL, '2021-05-27 07:37:51', '2021-05-27 09:21:04', NULL, NULL, 1, 0, 'nika.badzaghua@gmail.com', 16, NULL, 0, NULL, NULL, 0, NULL, 0),
