(128, '{\"en\": null, \"ka\": \"საერთაშორისო პროექტებსა და ღონისძიებებში მონაწილეობის მხარდაჭერა\"}', '{\"en\": null, \"ka\": \"<p>თუ ხარ ახალგაზრდა, მოტივირებული, სიახლეების მაძიებელი და გსურს მონაწილეობა მიიღო კონფერენციაში, ფორუმსა თუ საბანაკე ტიპის აქტივობაში საზღვარგარეთ, ახალგაზრდობის რეგიონული ცენტრი დააფინანსებს შენი ავია ბილეთისა და საწევროს გადასახადს.</p><p>&nbsp;კონფერენციების და ფორუმების&nbsp; თემატიკა შეზღუდული არ არის.</p><p><strong>კონკურსში მონაწილეობის კრიტერიუმები:</strong></p><p>● 14 -დან 29 წლამდე აჭარის ა.რ. ადმინისტრაციულ ტერიტორიაზე რეგისტრირებული საქართველოს მოქალაქე;</p><p>● ან/და აჭარის ა.რ. ადმინისტრაციულ ტერიტორიაზე არსებული აკრედიტირებული უმაღლესი, ზოგადასაგანმანათლებლო და პროფესიული სასწავლებლების სტუდენტი და მოსწავლე.&nbsp;</p><p><strong>*შენიშვნა</strong></p><p>● ავია ბილეთები ანაზღაურდება ერთჯერადი გასაცემელის სახით, არაუმეტეს 1300 ლარისა. იმ შემთხვევაში, თუ ბილეთის ფასი აღემატება აღნიშნულ თანხას, განსხვავება უნდა დაფაროს აპლიკანტმა.</p><p>● ასევე, საჭიროების შემთხვევაში ანაზღაურდება საწევროს თანხა, არაუმეტს 1700 ლარისა. იმ შემთხვევაში, თუ საწევროს ფასი აღემატება აღნიშნულ თანხას, განსხვავება უნდა დაფაროს აპლიკანტმა.</p><p>დამატებითი ინფორმაციისა და რეგისტრაციისთვის ეწვიეთ ბმულს: &nbsp;https://www.yrc.ge/event/5eed050dec14a00017d2a148</p><p>კითხვების შემთხვევაში მოგვმართეთ Facebook გვერდზე:</p><figure class=\\\"media\\\"><oembed url=\\\"https://www.facebook.com/youthregionalcenter\\\"></oembed></figure>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-02-15', '2021-12-12', '2021-05-27', 114, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-27 08:31:58', '2021-05-27 08:39:11', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
