(130, '{\"en\": null, \"ka\": \"საზღვარგარეთ სტაჟირება\"}', '{\"en\": null, \"ka\": \"<p><strong>გაემგზავრე მსოფლიოს სხვადასხვა კუთხეში საერთაშორისო გამოცდილების მიღების მიზნით!</strong></p><p>საზღვარგარეთ სტაჟირება გულისხმობს ახალგაზრდების გაგზავნას მსოფლიოს სხვადასხვა ქვეყანაში საერთაშორისო გამოცდილების მიღების მიზნით, მოხალისეობრივ სტაჟირებაზე, სამეწარმეო და კარიერული განვითარების მიმართულებით სხვადასხვა კომპანიებში, სადაც ისინი აიმაღლებენ კვალიფიკაციას და ექნებათ ანაზღაურების მიღების შესაძლებლობა.<br>ღონისძიება ხორციელდება ორგანიზაცია AIESEC (აისეკ) საქართველოსთან თანამშრომლობით.&nbsp;</p><p>სტაჟირება გრძელდება 1-3 თვემდე.</p><p>მონაწილეთა შერჩევა ხორციელდება შემდეგნაირად-ცენტრის მიერ შერჩეული საუკეთესო შედეგების მქონე ახალგაზრების მონაცემები განთავსდება აისეკის საერთაშორისო პლატფორმაზე, რის შედეგადაც, მონაწილეები უნდა მოერგონ მიმღები ქვეყნის/ორგანიიზაციის მოთხოვნებსა და ინტერესებს.</p><p><strong>კონკურსში მონაწილეობის კრიტერიუმები:</strong><br><br>➢ ღონისძიებაში მონაწილეობა შეუძლიათ აჭარის ა.რ. ადმინისტრაციულ ტერიტორიაზე რეგისტრირებულ 18 -დან 29 წლამდე ახალგაზრდებს.<br>➢მონაწილეების შერჩევა მოხდება ცენტრის მიერ შექმნილი კომისიის მიერ, მონაწილეების უცხო ენისა და თეორიული ცოდნის, აგრეთვე სამოტივაციო წერილისა და გასაუბრების საფუძველზე.</p><p>&nbsp;<strong>შენიშვნა</strong></p><p><i>*ღონისძიების ფარგლებში დაფინანსდება 20-მდე ახალგაზრდის საწევროს თანხა (არაუმეტეს 750 ლარისა), რაც შეეხება ავია ბილეთების ანაზღაურებას,იმ შემთხვევაში თუ ბილეთის ფასი აღემატება აღნიშნულ თანხას, განსხვავება უნდა დაფაროს აპლიკანტმა. ავია ბილეთის ასანაზღაურებლად, მონაწილემ უნდა წარმოადგინოს&nbsp;გამგზავრების შემდეგ, ელექტრონული ბილეთი;</i></p><p><i>&nbsp;მიმღებ ქვეყანაში ახალგაზრდების განთავსებაზე, კვებასა და კვალიფიკაციის ამაღლებაზე იზრუნებს AIESEC (აისეკი) საქართველო.</i></p><p><i>*გამგზავრებამდე მონაწილე ვალდებულია წინასწარ სახელმწიფოს მიერ დადგენილი წესების შესაბამისად გაიაროს კოვიდ ტესტირება და წარმოადგინოს შედეგები.</i></p><p>დამატებითი ინფორაციისა და რეგისტრაციისთვის ეწვიეთ ბმულს: https://www.yrc.ge/event/5e28238ca96dbf001719e18a</p><p>კითხვების შემთხვევაში მოგვმართეთ Facebook გვერდზე:&nbsp;</p><figure class=\\\"media\\\"><oembed url=\\\"https://www.facebook.com/youthregionalcenter\\\"></oembed></figure>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-02-24', '2021-10-15', '2021-05-27', 114, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-27 08:42:29', '2021-05-27 08:44:14', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(131, '{\"en\": \"\", \"ka\": \"კარიერული განვითარების მხარდაჭერა\"}', '{\"en\": \"\", \"ka\": \"<p>ახალგაზრდობის რეგიონული ცენტრი აჭარის რეგიონში მცხოვრები ახალგაზრდებისთვის კარიერული განვითარების ხელშეწყობის &nbsp;პროგრამას ახორციელებს.</p><p>ღონისძიების&nbsp; ფარგლებში აჭარის ტერიტორიაზე მოქმედ ორგანიზაციებში ახალგაზრდები გაივლიან ანაზღაურებად სტაჟირებას &nbsp;6 თვემდე ვადით. აღნიშნული პროგრამა&nbsp; &nbsp;ახალგაზრდებს შესაძლებლობას აძლევს&nbsp; სამუშაო გამოცდილებასთან ერთად მიიღონ ფინანსური სარგებელი.</p><p><i>*ცენტრის მიერ კონკურსის შედეგად შერჩეული აპლიკანტები გაივლიან გასაუბრებას დამსაქმებელთან.</i></p><p><i><strong>მონაწილე აპლიკანტი უნდა იყოს:</strong></i></p><p>● 20 - დან 29 წლის ჩათვლით;</p><p>● აჭარის ა.რ. ადმინისტრაციულ ტერიტორიაზე რეგისტრირებული საქართველოს მოქალაქე</p><p>● აჭარის ა.რ. ადმინისტრაციულ ტერიტორიაზე მოქმედი უმაღლესი ან პროფესიული სასწავლებლის სტუდენტი.</p><p>ინფორმაცია მონაწილეობისა და მიმდინარე ვაკანსიების შესახებ იხილეთ აქ:https://www.yrc.ge/event/60487a79ba0b270017c739a9</p><p>კითხვების შემთხვევაში მოგვმართეთ Facebook გვერდზე:&nbsp;</p><figure class=\\\"media\\\"><oembed url=\\\"https://www.facebook.com/youthregionalcenter\\\"></oembed></figure>\"}', '{\"en\": \"\"}', '', '', '', '2021-03-10', '2021-10-31', '2021-05-27', 114, NULL, NULL, NULL, '', '', '', '2021-05-27 08:44:23', '2021-05-27 08:47:21', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
(132, '{\"en\": \"\", \"ka\": \"ახალგაზრდა გამომგონებელთა და მეცნიერთა მხარდაჭერა\"}', '{\"en\": \"\", \"ka\": \"<p>ახალგაზრდობის რეგიონული ცენტრი ბათუმის ტექნო პარკთან ერთად ახალგაზრდა მეცნიერ-გამომგონებელთა ხელშეწყობის მიზნით ინოვაციურ პროექტს იწყებს.</p><p>აღნიშნული პროგრამა შექმნილია იმ ადამიანებისთვის, რომელთაც სჭირდებათ იდეის რეალიზება ან არსებული საქმიანობის განვითარება ამ მიმართულებით. მათ შესაძლებლობა ეძლევათ მოიპოვონ თავიანთ საჭიროებებზე მორგებული საქონლის თუ მომსახურების დაფინანსება 5000 ლარის ოდენობით!</p><p><i><strong>მონაწილეობის მიღება შეუძლიათ:</strong></i></p><p>&nbsp;· &nbsp;18-დან 29 წლის ჩათვლით აჭარის ა/რ &nbsp;ადმინისტრაციულ&nbsp; ტერიტორიაზე&nbsp; რეგისტრირებულ საქართველოს&nbsp; მოქალაქეებს და &nbsp;აჭარის&nbsp; ავტონომიური&nbsp; რესპუბლიკის ტერიტორიაზე&nbsp; არსებულ აკრედიტირებულ უმაღლეს, ზოგადსაგანმანათლებლო და პროფესიული&nbsp; სასწავლებლების სტუდენტებს. &nbsp;</p><p>&nbsp;· &nbsp;აპლიკანტებს, რომლების დარეგისტრირებულნი არიან ან დარეგისტრირდებიან სსიპ ახალგაზრდობის რეგიონული ცენტრის ელექტრონულ პლატფორმაზე;</p><p>&nbsp;· &nbsp;აპლიკანტებს, რომლებიც სრულყოფილად შეავსებენ სპეციალური საპროექტო განაცხადის ელექტრონულ ფორმას&nbsp;(დანართი N1), წინააღმდეგ შემთხვევაში განაცხადი არ განიხილება;</p><p>დამატებითი ინფორაციისა და რეგისტრაციისთვის ეწვიეთ ბმულს: https://www.yrc.ge/event/60a64140a9c4b00015824c10</p><p>კითხვების შემთხვევაში მოგვმართეთ Facebook გვერდზე:&nbsp;</p><figure class=\\\"media\\\"><oembed url=\\\"https://www.facebook.com/youthregionalcenter\\\"></oembed></figure>\"}', '{\"en\": \"\"}', '', '', '', '2021-05-21', '2021-06-21', '2021-05-27', 114, NULL, NULL, NULL, '', '', '', '2021-05-27 08:47:27', '2021-05-27 08:48:37', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0);
