(135, '{\"en\": null, \"ka\": \"THINK GREEN - KEEP IT CLEAN!\"}', '{\"en\": null, \"ka\": \"<p>For English scroll down</p><p>გვაქვს იდეა რომ შევიკრიბოთ თბილისის ზღვაზე, Gino Paradise - თან, დავპატიჟოთ მეგობრები და ყველამ ერთად დავასუფთავოთ დაბინძურებული არეალი. ამის შემდეგ კი მოვაწყოთ პიკნიკი და მუსიკასთან ერთად ვისიამოვნოთ დღის ბოლომდე.</p><p>გიზიარებთ გეგმას:<br>&nbsp;</p><p>როდის? შაბათს, 29 მაისს 15:00 საათზე;<br>&nbsp;</p><p>სად?ჯინო ფერედაისის მიმდებარე ტერიტორია. ბმული: <a href=\\\"http://shorturl.at/krSW2?fbclid=IwAR0pli1yP1kggXAzVxjK-tTucxWfgpYFJnhP6DjPoEu5YnGjbd1o0TaJQFM\\\">shorturl.at/krSW2</a><br>&nbsp;</p><p>როგორ? თქვენ შეგიძლიათ მოხვიდეთ თქვენით ან ისარგებლოთ ჩვენი ტრანსპორტით. შეხვედრის დრო და ადგილი: მარჯანიშვილის ქუჩა 24/89 14:30 საათი. გთხოვთ, ადგილების დასაჯავშნათ, მოგვწეროთ წინასწარ; მარშუტკა გავა ამ ადგილიდან: <a href=\\\"https://g.page/droniorg?share&amp;fbclid=IwAR3kLjighTzWz5bR8AAGthmwVq3Sc9r8QUUpAGRpwKJ4T-E-1csDnl_zsEI\\\">https://g.page/droniorg?share</a></p><p>&nbsp;</p><p>გთხოვთ გაიაროთ წინასწარ რეგისტრაცია მითითებულ ბმულზე: <a href=\\\"https://bit.ly/2QIAUtR?fbclid=IwAR3IcoHvHxvbDD4obrA8hHisPqFxk7xwqgsinGV5trRhwYthwtvmVAHobH4\\\">https://bit.ly/2QIAUtR</a><br>დამატებითი კითხვების შემთხევვაში დაგვიკავშირდით: არჩილ წულაია - achitsulaia@gmail.com; 593 523 627 ან ავთანდილ ვარდიაშვილი - 579 78 05 19 avtandilvardiashvili@gmail.com;</p><p>დამატებითი ინფორმაცია:<br>ღონისძიების მეორე ნაწილში გთავაზობთ: მუსიკას, პიკნიკსა და გართობას. არ დაგავიწყდეთ საკუთარი ჭიქა და ბოთლი, რადგან ასე ვზრუნავთ გარემოზე.</p><p>შემოგვიერთდით. გამოიყენეთ შესაძლებლობა ახალი ადამიანების გასაცნობად, გაერთეთ და რაც ყველაზე მნიშვნელოვანია შეიტანეთ წვლილი პლანეტის გადარჩენაში.</p><p>------------------------------------------------------------<br>ENG<br>Dear all !!<br>The idea is to meet up at Tbilisi sea, close to Gino Paradise Resort, bring as many friends as possible, and together collect the trash that is polluting the area of the Tbilisi sea. After the event, we can all have a picnic and enjoy some good music and the rest of the day in a beautiful location.</p><p>Here is the plan:<br>&nbsp;</p><p>&nbsp;</p><p>WHEN? --&gt; Saturday 29th of May 2021, at 15:00<br>&nbsp;</p><p>&nbsp;</p><p>WHERE? --&gt; Next to Gino Paradise, Tbilisi sea (<a href=\\\"https://l.facebook.com/l.php?u=http%3A%2F%2Fshorturl.at%2FkrSW2%3Ffbclid%3DIwAR2LAaEd8GCJ1RuDjbYeRVGhnYPgLwA56wNnrjpG0AnD2fsJw1rAtENh-vY&amp;h=AT3twgDYKM9icE2SZqS2u6kmlJluWyb6zqQ-py5jIht-gjF63Eddl54CJWREPfZQaGxxH25RQ0re6yMQIAx06mb6QgiuUbc3QikPhR9jUaWpxPyTMLlqj_mq3arKMuPPEylG&amp;__tn__=q&amp;c[0]=AT08BmP1eale1D-OQKRBlCeSFReh81WuMabsiC2OKjXvRBe-AJXDFGNDagW9yvrjZf7gqN1tjtvM3J1Yty6r7rPHeouignSWoXxVrLKIIEPIQ8Giupt0Y1vQGXUkNhST1O6wjsASGp7fMFPKAn_DCSND\\\">shorturl.at/krSW2</a>)<br>&nbsp;</p><p>&nbsp;</p><p>HOW? --&gt; you can reach the place by yourself in Marjianishvili 24/89, we are organizing Minibus leaving from here at 2.30pm. But please let us know if you want to reserve a seat! Minibus leaves from here: <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fg.page%2Fdroniorg%3Fshare%26fbclid%3DIwAR1H1rVd_WiSbkZuThMzrpnKuaO2AiNN5ZPR_MSwh-PjcZerkmKBpt82F_o&amp;h=AT2gswh2fqakWRUbD1BgnxFz45NZa7ZEuIWZkKesZ4sw1xsw-KrkzFnn21QukxSW0plBfwW37FBykPt6pVzDAxFmxeGs2vviXs0Ska9tG89MBYXoZcC9Q9vkz2rkJyc7NDXV&amp;__tn__=q&amp;c[0]=AT08BmP1eale1D-OQKRBlCeSFReh81WuMabsiC2OKjXvRBe-AJXDFGNDagW9yvrjZf7gqN1tjtvM3J1Yty6r7rPHeouignSWoXxVrLKIIEPIQ8Giupt0Y1vQGXUkNhST1O6wjsASGp7fMFPKAn_DCSND\\\">https://g.page/droniorg?share</a></p><p>&nbsp;</p><p>Please register on the following link: <a href=\\\"https://bit.ly/2QIAUtR?fbclid=IwAR0bFZLR0g1uC2NzgAYsHV9X19VN0L5gMMy-C52M-X_U4KWL8XwIdz8DTdQ\\\">https://bit.ly/2QIAUtR</a><br>for any additional information you can contact: Archil Tsulaia - achitsulaia@gmail.com or Avtandil Vardiashvili - avtandilvardiashvili@gmail.com;</p><p>What else?<br>We will bring music, food, water, and a lot of good vibes! You just need to remember to bring your reusable cup or bottle, the least waste we create, the better for the environment!<br>So don\'t hesitate and join us, you\'ll have the opportunity to meet new people, have a lot of fun and do your part for the planet!!</p><p>The event is organized by EU4YOUTH Alumni network.</p>\"}', '{\"en\": \"მარჯანიშვილის 24/89 ,  ბეშენოვას კუჩა, თბილისი\", \"ka\": \"მარჯანიშვილის 24/89 ,  ბეშენოვას კუჩა, თბილისი\"}', NULL, NULL, '579780519', '2021-05-29', '2021-05-29', '2021-05-27', 27, NULL, '135__2021-05-2714:21:34.png', NULL, 'https://www.facebook.com/events/1103944416758774/?acontext=%7B%22source%22%3A%2229%22%2C%22ref_notif_type%22%3A%22plan_user_joined%22%2C%22action_history%22%3A%22null%22%7D&notif_id=1622119245470457&notif_t=plan_user_joined&ref=notif', NULL, NULL, '2021-05-27 14:13:03', '2021-05-27 14:34:30', 'https://docs.google.com/forms/d/e/1FAIpQLSeLeY0WEaLwms7Wni7sndczryT-lbNROry9F9PxJPd1OyRHvg/viewform?fbclid=IwAR3IcoHvHxvbDD4obrA8hHisPqFxk7xwqgsinGV5trRhwYthwtvmVAHobH4', NULL, 1, 0, 'avtandil.vardiashvil@droni.org', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
