(143, '{\"en\": null, \"ka\": \"საქართველოს შემეცნებით ცენტრში ონლაინ მოხალისეთა მიღება\"}', '{\"en\": null, \"ka\": \"<p><br>და აი ნანატრი სარეგისტრაციო ფორმაც გამოჩნდა! თან დაემატა სიახლე!&nbsp;</p><p>თქვენ შეგიძლიათ გახდეთ ორგანიზაციის მოხალისე&nbsp;</p><p>🔛მოხალისეობა არის შესაძლებლობა, რომ ყველანაირი ანაზღაურების გარეშე, სხვების დასახმარებლად გამოიყენო შენი დრო და უნარ-ჩვევები. ჩვენი მოხალისეები იღებენ და აზიარებენ ცოდნებს სხვადასხვა აქტივობის მეშვეობით, რომლის გამოხატვაშიც შეზღუდულები არ ხართ.&nbsp;<br><br>აქ მოხალისეობა არ არის დროში განსაზღვრული, ნებისმიერი ვადით შეგიძლიათ განახორციელოთ ეს საქმიანობა, ნებისმიერ დროს შეგიძლიათ მოითხოვოთ დამადასტურებელი ცნობა.&nbsp;<br><br>აქტიურ მოხალისეებს გადაეცემათ შესაბამისი სარეკომენდაციო წერილები სხვადასხვა სტრუქტურაში წარსადგენად.&nbsp;<br><br>მოხალისეთა მიღების ასაკი განისაზღვრება 12+ და არის უფასო.</p>\"}', '{\"en\": null}', NULL, NULL, '595025286', '2021-05-27', '2021-06-15', '2021-05-28', 63, NULL, NULL, NULL, 'https://www.facebook.com/cognitivecenterofgeorgia', NULL, 'ccgeorgia.ge', '2021-05-28 10:27:43', '2021-05-28 10:33:04', 'https://docs.google.com/forms/d/e/1FAIpQLScP-fsBKyU3JRjcrBRnQQYsZ1pkVgqXNS6grv2dDR2gMjlR4g/viewform?fbclid=IwAR22yNgXYImRv0z1aIiMs_yrSl9s8Lxpo4qlOsXDxj9xg29FJLGZoFlxwT0', NULL, 1, 0, 'cognitivecenterofgeorgia@gmail.com', 14, 24, 1, '-----', NULL, 0, NULL, 0),
