(157, '{\"en\": \"\"}', '{\"en\": \"\", \"ka\": \"<p>ახმეტის მუნიციპალიტეტის კულტურის,&nbsp;განათლების, სპორტის და ახალგაზრდულ საქმეთა სამსახური თავის კომპეტენციის ფარგლებში მოიცავს ახალგაზრდობის და ახალგაზრული ორგანიზაციების მიერ ინიცირებულ პროექტების განხორციელებას და ფინანსურ მხარდაჭერას,პრიორიტეტი ენიჭება ინოვაციურ და კრეატიულ პროექტებს.</p><p>ახალგაზრდობის სააგენტოს უშუალო მონაწილეობით შეიქმნა (მუშავდება) ახალგაზრდული პოლიტიკის (სტრატეგია) დოკუმენტი, რომელიც ითვალისწინებს მოხალისეობის პრინციპების დანერგვას.</p><p>უზრუნველყოფს ახალგაზრდების ჩართულობას ეროვნულ მედია პროექტ „ეტალონში“,მ.ს.კ,ახდენს ახალგაზრდების ჩართულობას სახალხო დღესასწაულებში, ფესტივალებში და სხვა.</p><p>ხელს უწყობს ახმეტის მუნიციპალიტეტში ახალგაზრდების გააქტიურებას, სამოქალაქო აქტივობებში ჩართვას, ახალგაზრდული ინიციატივების წახალისებას, პიროვნული პოტენციალის რეალიზებას და მუნიციპალიტეტის ახალგაზრდობის ეთნიკურ უმცირესობებთან ინტეგრირების ხელშეწყობას, ახალგაზრდული ორგანიზაციების მიერ ინიცირებული სასარგებლო პროექტების ფინანსურ მხარდაჭერას,კონკურსის წესით საუკეთესო ინიციატივების შერჩევა და პრიორიტეტების მინიჭება, მათგან ყველაზე კრეატიულისა და ინოვაციურობისათვის.</p><p>ქვეპროგრამის ფარგლებში ხორციელდება: სხავადასხვა სახის სპორტული ღონისძიებების და აქტივობების ორგანიზება, მასში მონაწილე სპორტსმენებისა და ახალგაზრდების დაჯილდოება, წახალისება&nbsp; ფასიანი საჩუქრებით;</p><p>ღვაწლმოსილი და ვეტერანი სპორტის დამსახურებული ახმეტელების დასაჩუქრება; სხვადასხვა სპორტულ ღონისძიებებზე სპორტსმენებისა და მწვრთნელების ტრანსპორტირებაში დახმარება;</p><p>ჯანსაღი ცხოვრების წესის პოპულარიზაცია, მოზარდების ჩართვა მასობრივი სპორტის სახეობებში.</p><p>&nbsp;</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-05-28', '2021-12-30', '2021-05-28', 120, NULL, NULL, NULL, '', '', '', '2021-05-28 12:29:37', '2021-05-28 12:29:37', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(158, '{\"en\": null, \"ka\": \"უნარების გაძლიერება და დასაქმების ინოვაციური შესაძლებლობები საქართველოს რეგიონული განვითარებისთვის“\"}', '{\"en\": null, \"ka\": \"<p>საქართველოს სამ რეგიონში, გურია, კახეთი და ქვემო ქართლი, ევროკავშირის მიერ დაფინანსებული პროექტი „უნარების გაძლიერება და დასაქმების ინოვაციური შესაძლებლობები საქართველოს რეგიონული განვითარებისთვის“ გაძლევთ უნიკალურ შანსს, შეხვდეთ საუკეთესო ტრენერებსა და დარგის სპეციალისტებს, მიიღოთ დასაქმებისთვის საჭირო უნარ-ჩვევები და აუცილებელი ცოდნა.<br><br>პროექტის ფარგლებში სამიზნე რეგიონში სწავლებისა და დასაქმების ხელშეწყობის 6 ცენტრი შეიქმნა, სამი წლის განმავლობაში ცენტრის ბაზაზე ეტაპობრივად შემუშავდება სასწავლო პროგრამები, ტრენინგები და სემინარები, რომელიც გაითვალისწინებს, როგორც დასაქმების ბაზარზე არსებულ მოთხოვნებს, ასევე იმ ადამიანების სურვილებსა და საჭიროებებს, ვინც ცენტრს მიმართავს.<br><br>პროექტის მონაწილეები მიიღებენ უფასო კონსულტაციებს კარიერის დაგეგმვის კონსულტანტებისგან. კონსულტაცია წარიმართება ინდივიდუალურად და მისი მიზანია კარიერის დაგეგმვისა და მართვის ხელშეწყობა. კონსულტაციის დროს დაცული იქნება მიღებული ინფორმაციის კონფიდენციალურობა. ინდივიდუალური შეხვედრების რაოდენობა არ არის წინასწარ განსაზღვრული, ხოლო თითოეული მათგანის ხანგრძლივობა გასტანს დაახლოებით 45 წუთს.&nbsp;<br><br>სწავლებისა და დასაქმების ხელშეწყობის ცენტრის მომსახურებით შეუძლია ისარგებლოს ყველამ, ვინც 16 წელს გადააბიჯა, ვისაც სურს, აღმოაჩინოს საკუთარი ინტერესები თუ მისწრაფებები, მიიღოს ახალი ცოდნა და გამოცდილება, განივითაროს უნარები და გადადგას ახალი კარიერული ნაბიჯები.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-27', '2021-06-09', '2021-05-28', 81, NULL, '158__2021-05-2812:34:35.png', NULL, NULL, NULL, NULL, '2021-05-28 12:31:13', '2021-05-28 12:34:35', 'https://docs.google.com/forms/d/e/1FAIpQLScr8N8zg3HIwkUIBKd7oFjGc2Bmm9trLgJLSDmD7BjFiFnvyg/viewform?fbclid=IwAR0ycYs9L6ATlRs4aQhGKKLYMnKXkFivFXebbyOCNidB98X0v1LqkgGpbMQ', NULL, 1, 0, NULL, 16, NULL, 0, NULL, NULL, 0, NULL, 0),
(160, '{\"en\": null, \"ka\": \"გიწვევთ სოციალური და მწვანე საწარმოების გამოფენაზე!\"}', '{\"en\": null, \"ka\": \"<p>2021 წლის 19 ივნისს, 11 საათიდან, CENN გიწვევთ სოციალური და მწვანე საწარმოების გამოფენაზე!</p><p>გამოფენაში მონაწილეობას მიიღებენ საქართველოს მასშტაბით მოქმედი ისეთი საწარმოები, რომლებიც მუშაობენ სოციალური და გარემოს დაცვითი მიმართულებებით და ატარებენ განსაკუთრებულ ღირებულებას ახალგაზრდების განვითარების ხელშემწყობ, მდგრადი ტურიზმის განვითარებისა და მწვანე ეკონომიკის დარგებში.დამთვალიერებლებს ექნებათ შესაძლებლობა, ადგილზე გაიცნონ 56 სხვადასხვა საწარმო და დააგემოვნონ და შეიძინონ ეკოლოგიურად სუფთა, ადგილობრივი წარმოების საინტერესო პროდუქცია.სტუმრებისათვის ადგილზე იქნება შეთავაზებული მასტერკლასები ნარჩენების ხელმეორედ გამოყენებაში, ხატვაში, იოგაში და სხვ.შემოგვიერთდით 19 ივნისს, 11 საათიდან, Expo Georgia-ს გარე საგამოფენო სივრცეში, მე-3 პავილიონის მიმდებარე ტერიტორიაზე.</p><p>გამოფენა ტარდება CENN-ის მიმდინარე პროექტების ფარგლებში: \\\"ტყის მდგრადი მართვა კლიმატის მიმართ მდგრადი სოფლის განვითარებისათვის\\\", რომელიც დაფინანსებულია ავსტრიის განვითარების თანამშრომლობის სააგენტოს (ADC) მიერ; \\\"ციფრული კავკასია\\\", რომელიც ხორციელდება USAID-ის ევროპისა და ევრაზიის ბიუროს, ეკონომიკური განვითრების, მმართველობისა და საწარმოთა ზრდის (EDGE) პროექტის მიერ გამოყოფილი გრანტის ფარგლებში, და \\\"EU4Youth – საზღვრისპირა რეგიონებში სოციალური მეწარმეობის ეკოსისტემის განვითარება მწვანე ზრდისთვის\\\", რომელსაც ევროკავშირი აფინანსებს.</p>\"}', '{\"en\": \"ექსპო ჯორჯია\", \"ka\": \"ექსპო ჯორჯია\"}', NULL, NULL, NULL, '2021-05-27', '2021-06-19', '2021-05-28', 81, NULL, '160__2021-06-0212:17:28.png', NULL, NULL, NULL, NULL, '2021-05-28 12:36:09', '2021-06-02 12:17:28', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(161, '{\"en\": null, \"ka\": \"AIESEC ENGLISH CLUB\"}', '{\"en\": null, \"ka\": \"<p>✅AIESEC English Club არის პროექტი, რომელსაც AIESEC საქართველო ახორციელებს.<br><br>✅ პროექტის მთავარი მიზანია კულტურული ცნობიერების ამაღლება და ინტეგრაცია ერებს შორის.&nbsp;<br><br>📌 პროექტის ფარგლებში უცხოელი მოხალისეები სხვადასხვა ქვეყნიდან, ჩაატარებენ საგაკვეთილო სემინარებს, სადაც განიხილავენ და გააცნობენ ბავშვებს თავიანთ კულტურას და ტრადიციებს. სემინარების მეთოდოლოგია არის მრავალფეროვანი.შეხვედრები გაიმართება სხვადასხვა თემებზე. პროექტის განმავლობაში გაიმართება კინოჩვენებები, დისკუსიები, პრეზენტაციები.&nbsp;<br>დატვირთულია როგორც გუნდური მუშაობით, ისე ინდივიდუალური პრეზენტაციებითა და საჯარო გამოსვლებით.<br>პროექტში მონაწილე ქართველი ახალგაზრდები მოამზადებენ პრეზენტაციებს და ჩაატარებენ დისკუსიებს სსხვადასხვა თემატიკის შესახებ. კლუბის წევრებს ექნებათ საშუალება გაიუმჯობესონ ინგლისური ენის უნარები მსოფლიოს სხვადასხვა ქვეყნებიდან მოწვეულ ახალგაზრდა პედაგოგებთან ერთად. AIESEC English Club-ის მონაწილეები შეირჩევიან გასაუბრების მიხედვით. პირველ ეტაპზე მიიღება მხოლოდ 50 მონაწილე სხვადასხვა სპეცილობის და ინტერესის მიხედვით. AIESEC English Club-ის წევრობა შეუძლია ნებისმიერ მსურველს 15 წლიდან 30 წლამდე. შეხვედრები გაიმართება კვირაში რამდენჯერმე.&nbsp;<br>📌დეტალური ინფორმაცია იხილეთ სარეგისტრაციო ბმულზე: <a href=\\\"https://cutt.ly/sbOpIOr?fbclid=IwAR0IMYk1SZhhW_9zqJUk0O09Bix4PPXZUbVoVQjIsM-hoI1xRYz4xNIPsWM\\\">https://cutt.ly/sbOpIOr</a></p>\"}', '{\"en\": \"თბილისი,\", \"ka\": \"თბილისი,\"}', NULL, NULL, '555302821', '2021-06-07', '2021-07-31', '2021-05-28', 30, NULL, '161__2021-05-2812:53:05.png', NULL, 'https://www.facebook.com/AIESECinGeorgia/?ref=page_internal', NULL, NULL, '2021-05-28 12:46:27', '2021-05-28 12:53:10', 'https://cutt.ly/sbOpIOr', NULL, 1, 0, 'georgia@aiesec.net', 15, 16, 0, NULL, NULL, 0, NULL, 0),
