(163, '{\"en\": null, \"ka\": \"გახდი მასპინძელი ოჯახი\"}', '{\"en\": null, \"ka\": \"<p>🎯აჩვენე ქართული სტუმარ-მასპინძლობა მსოფლიოს, გახდი მასპინძელი ოჯახი.<br>🎯უმასპინძლე უცხოელ მოხალისეს 2-დან-6 კვირის განმავლობაში და მიიღე:<br>✅ფასდაკლება AIESEC-ის გაცვლით პროგრამებზე უცხოეთში<br>✅AIESEC-ის მიერ ორგანიზებულ ლოკალურ ღონისძიებებში უფასოდ მონაწილეობის საშუალება.<br>✅აისეკის ენების აკადემიის უფასოდ გავლის შესაძლებლობა<br>✅შესაძლებლობა ყოველდღიური კომუნიკაციით დაიხვეწო ინგლისური ენის ცოდნის დონე და ეზიარო მსოფლიოს სხვადასხვა ქვეყნის კულტურასა და ტრადიციებს.<br>🎯რეგისტრაციისთვის გადადით ბმულზე: <a href=\\\"https://forms.gle/zJyMdHG5mfn1eRK76?fbclid=IwAR2IaqOlas8TwE05_OHYlbDio08KD5BuKSvXaDxlLm8k-HgUR_tazoyDaHM\\\">https://forms.gle/zJyMdHG5mfn1eRK76</a></p>\"}', '{\"en\": \"თბილისი\", \"ka\": \"თბილისი\"}', NULL, NULL, '555302821', '2021-05-02', '2021-08-31', '2021-05-28', 30, NULL, '163__2021-05-2812:58:38.png', NULL, 'https://www.facebook.com/AIESECinGeorgia/?ref=page_internal', NULL, NULL, '2021-05-28 12:53:31', '2021-05-28 12:58:40', 'https://forms.gle/zJyMdHG5mfn1eRK76', NULL, 1, 0, 'georgia@aiesec.net', 18, NULL, 0, NULL, NULL, 0, NULL, 0),
