(166, '{\"en\": null, \"ka\": \"YOUTH SPEAK FORUM\"}', '{\"en\": null, \"ka\": \"<p><strong>YouthSpeak Forum\'21 </strong>- პროექტი,რომელიც ყოველწლიურად 120-ზე მეტ ქვეყანაში ტარდება, ახალგაზრდული პლატფორმაა საქართველოში მცხოვრები სოციალური ინოვატორებისათვის, ბიზნეს ლიდერების, განათლებისა და პოლიტიკურ სპექტრში მომუშავე საზოგადოებისათვის იმ გომოწვევებზე სასაუბროდ და საერთო სამოქმედო გზის შესაქმნელად , რომელიც 2030 წლისთვის გადაჭრის გაერთიანებული ერების მდგრადი განვითარების მიზნებს (SDG\'s) მსოფლიოსა და საქართველოში.</p><p>YSF\'21 სემინარებისა და Workshop-ების მეშვეობით, ხელს შეუწყობს და გააერთიანებს საზოგადოებას საქართველოში მიმდინარე მდგრადი განვითარების მიზნების გამოწვევების,პრობლემებისა და წინ გადადგმული ნაბიჯების გარშემო.</p><p>ფორუმზე მონაწილეებს საშუალება ექნებათ მთელი დღის განმავლობაში მოისმინონს სესიები კომპეტენტური სპიკერებისგან, ჩაერთონ დისკუსიაში და ღონისძიების დასრულების შემდეგ ცოდნა გაუზიარონ სხვა ახალგაზრდებს.</p><p>საქართველოში YSF ტარდება AIESEC Georgia-ს ორგანიზებით.</p><p>კონფერენციის თემებია :<br><strong>მიზანი 3:</strong> ჯანმრთელი ცხოვრება და კეთილდღეობა<br><strong>მიზანი 4: </strong>ინკლუზიური და თანასწორი განათლების უზრუნველყოფა და უწყვეტი სწავლის შესაძლებლობების ხელშეწყობა ყველასათვის<br><strong>მიზანი 12:</strong> მდგრადი მოხმარება და წარმოება</p><p>YSF\'21 -ს მოსდევს World\'s Largest Lesson, სადაც კონფერენციაზე მონაწილე ახალგაზრდები გაიყოფიან ჯგუფებად, ექნებათ კონკრეტულ SDG-ზე პროექტის დაწერის,ხოლო შემდგომ საჯარო თუ კერძო სკოლებში მისი განხორციელების შესაძლებლობა.</p><p>კონფერენციასა და მსოფლიოს უდიდეს გაკვეთილში მონაწილეებს შეეძლებათ განივითარონ ლიდერული თვისებები,იმუშაონ კონკრეტულ სფეროში წარმატებულ ორგანიზაციებთან თუ პირებთან, შეიძნონ გამოცდილება გაეროს მდგრადი განვითარების მიზნებზე და ყველაზე მთავარი, წავიდნენ გაცვლით პროგრამებზე მსოფლიოს 120 ქვეყანაში !</p><p>სად? - ფორუმს უმასპინძლებს საქართველოს ეროვნული უნივერსიტეტი (სეუ)<br>როდის? - ფორუმი გაიმართება 30 მაისს<br>პროექტში მონაწილეობა უფასოა.</p>\"}', '{\"en\": \"თბილისი, საქართველოს ეროვნული უნივერსიტეტი\", \"ka\": \"თბილისი, საქართველოს ეროვნული უნივერსიტეტი\"}', NULL, NULL, '599541196', '2021-05-30', '2021-05-30', '2021-05-28', 30, NULL, '166__2021-05-2813:06:22.png', NULL, 'https://www.facebook.com/events/137058361721262?ref=newsfeed', NULL, NULL, '2021-05-28 13:01:41', '2021-05-28 13:06:23', NULL, NULL, 1, 0, 'georgia@aiesec.net', 16, 29, 0, NULL, NULL, 0, NULL, 0),
(167, '{\"en\": \"..\", \"ka\": \"ტრენერთა მომზადება/გადამზადების სასერტიფიკატო პროგრამა\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p><strong>პროგრამა ემსახურება</strong> ტრენერთა მომზადებას ან/და გადამზადებას სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში, რათა მათ შემდგომში უზრუნველყონ ეროვნული უმცირესობებისთვის სახელმწიფო ენის სწავლება მათი ერთიან სახელმწიფოებრივ სივრცეში ინტეგრაციის ხელშეწყობის მიზნით.</p>\\n\\n<p>პროგრამა მოიცავს თეორიულ და პრაქტიკულ ნაწილს. პროგრამის თეორიული ნაწილი შედგენილია იმ პროფესიონალების მიერ, რომლებიც მონაწილეობდნენ სხვადასხვა მიმართულებით ქვეყნისთვის მნიშვნელოვანი პროცესების წარმართვაში და სწორედ ისინი უძღვებიან სასწავლო პროცესს.</p>\\n\\n<p><strong>პროგრამის მიზანია</strong> - დაინტერესებულ პირებს /მომავალ ქართულის, როგორც მეორე ენის ტრენერებს, მიაწოდოს სათანადო თეორიული და პრაქტიკული ცოდნა, რომელიც ესაჭიროებათ საქმიანობის სრულყოფილად განხორციელებისთვის .</p>\\n\\n<p>პროგრამა ასევე მიზნად ისახავს წარმატებული კურსდამთავრებულების სკოლის ბაზაზე დასაქმებას ქართულის, როგორც მეორე ენის სწავლებისა და ინტეგრაციის მიმართულების ტრენერებად.</p>\\n\\n<p>პროგრამის სამიზნე ჯგუფს განეკუთვნებიან სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში ტრენერად მუშაობის მსურველი საქართველოს მოქალაქე ფიზიკური პირი.</p>\\n\\n<p><strong>პროგრამაში მონაწილეობა შეუძლიათ </strong>ავტორიზებული ან/და აკრედიტებული საგანმანათლებლო დაწესებულების ჰუმანიტარული სპეციალობის ფილოლოგიის ფაკულტეტის ბაკალავრის ხარისხის მქონე ან ამავე ფაკულტეტის ბაკალავრიატის დამამთავრებელი კურსის სტუდენტებს ან/და მაგისტრის ან მასთან გათანაბრებული ჰუმანიტარული მეცნიერებების აკადემიური ხარისხის მქონე პირებს.</p>\\n\\n<p>მსმენელებს გადაეცემათ პროგრამით გათვალისწინებული სწავლის წარმატებით დასრულების შესაბამისი სერტიფიკატი.</p>\\n\\n<p>&nbsp;</p>\\n\\n<p><strong>პროგრამის ამოცანები</strong></p>\\n\\n<ul>\\n\\t<li>ტრენერად მუშაობით დაინტერესებული პირების კვალიფიკაციის ამაღლება;</li>\\n\\t<li>ტრენერის უნარ- ჩვევების ჩამოყალიბება/განვითარებაში დახმარება;</li>\\n\\t<li>თეორიული და პრაქტიკული ცოდნის გადაცემა სახელმწიფო ენის სწავლებასა და სამოქალაქო ინტეგრაციასთან დაკავშირებით;</li>\\n\\t<li>მაღალკვალიფიციური კადრების მომზადების ხელშეწყობა შემდგომი დასაქმების პერსპექტივით.</li>\\n</ul>\\n\\n<p>&nbsp;</p>\\n\\n<p><strong>პროგრამის ხანგრძლივობა და აღწერილობა</strong></p>\\n\\n<p>პროგრამა მოიცავს როგორც თეორიულ, ასევე პრაქტიკულ ნაწილს - 24 კვირა;</p>\\n\\n<p>პროგრამა განხორციელედება ჰიბრიდული მეთოდით (როგორც დისტანციურად, ასევე პირისპირ);მონაწილეებს გადაეცემათ პროგრამით გათვალისწინებული სასწავლო ელექტრონული და ბეჭდური რესურსები .</p>\\n\\n<p>თეორიული სწავლება შედგება 3 კურსისგან - 182 საათი (ას ოთხმოცდაორი საათი);</p>\\n\\n<ul>\\n\\t<li>სახელმწიფო ენის სწავლებისა და ინტეგრაციის ხელშეწყობის პროგრამა, მისი მართვა და ადმინისტრირება;</li>\\n\\t<li>ქართულის, როგორც მეორე ენის სწავლების თანამედროვე მეთოდები და ენის სატრენინგო პროცესის მართვის (ტრენერის როლი) კურსი;</li>\\n\\t<li>საქართველოს სახელმწიფოებრიობა, მულტიკულტურული საზოგადოება და მათი სამოქალაქო ინტეგრაცია.</li>\\n</ul>\\n\\n<p>პრაქტიკული სწავლება შედგება სამი ნაწილისგან - 72 საათი(სამოცდათორმეტი საათი);</p>\\n\\n<ul>\\n\\t<li>პასიური პრაქტიკის ნაწილი 20%;</li>\\n\\t<li>შერეული პრაქტიკის ნაწილი 30%;</li>\\n\\t<li>აქტიური პრაქტიკის ნაწილი 50%.</li>\\n</ul>\\n\\n<p><br />\\n<br />\\n<strong>პროგრამის შედეგები:</strong></p>\\n\\n<p>სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში ტრენერთა მომზადება/გადამზადების სასერტიფიკატო პროგრამის შედეგად ჩამოყალიბდება ტრენერი, რომელიც შეძლებს:</p>\\n\\n<ul>\\n\\t<li>სასწავლო პროცესის დაგეგმვას;</li>\\n\\t<li>სასწავლო პროცესის ადმინისტრირებას;</li>\\n\\t<li>მსმენელთა მოტივირებას;</li>\\n\\t<li>ეროვნული უმცირესობების წარმომადგენლებისთვის თანამედროვე მეთოდებით სახელმწიფო ენის სწავლებას;</li>\\n\\t<li>სასწავლო რესურსების ეფექტურად გამოყენებას;</li>\\n\\t<li>სწავლების პროცესში დისტანციური სწავლების ახალი ტექნოლოგიების გამოყენებას;</li>\\n\\t<li>მულტიკულტურულ ჯგუფებში სახელმწიფოებრივ თემებზე ეფექტურ კომუნიკაციას და მსმენელთა სამოქალაქო ცნობიერების ამაღლებას;</li>\\n\\t<li>მულტიკულტურული ჯგუფების მართვას მათი რელიგიური, კულტურული და ეროვნული სპეციფიკაციების გათვალისწინებით;</li>\\n\\t<li>მსმენელთა ცოდნის შეფასებას თანამედროვე ინსტრუმენტებისა და მეთოდების გამოყენებით.</li>\\n</ul>\\n\\n<p>&nbsp;</p>\\n\\n<p>პროგრამის განხორციელების შედეგად მსმენელები განივითარებენ ისეთ პიროვნულ და პროფესიულ უნარებს და კომპეტენციებს, როგორებიცაა:</p>\\n\\n<ul>\\n\\t<li>ეფექტური კომუნიკაციის უნარი;</li>\\n\\t<li>სწავლის მოტივაციის შექმნის უნარი;</li>\\n\\t<li>ბენეფიციარის მიზნებზე ორიენტირებული სწავლების უნარი;</li>\\n\\t<li>ტრენინგის დაგეგმვისა და ორგანიზების უნარი;</li>\\n\\t<li>სწავლების სხვადასხვა ფორმის (დასწრებით, დისტანციური, ჰიბრიდული) შესაბამისი მეთოდოლოგიის გამოყენების უნარი;</li>\\n\\t<li>ტრენინგის დინამიკის მართვის უნარი;</li>\\n\\t<li>ციფრული ტექნოლოგიების ეფექტურად გამოყენების უნარი;</li>\\n\\t<li>კონსტრუქციული უკუკავშირისა და შეფასების ინსტრუმენტების ეფექტური გამოყენების უნარი;</li>\\n\\t<li>სასწავლო რესურსების მომზადებისა და ადაპტირების უნარი;</li>\\n\\t<li>დამოუკიდებლად მუშაობის უნარი;</li>\\n\\t<li>გუნდური მუშაობის უნარი;</li>\\n\\t<li>მულტიკულტურულ გარემოში ტრენინგის დინამიკის, ჯგუფის მოტივაციისა და პროცესების მართვის უნარი.</li>\\n</ul>\\n\\n<p><strong>პროგრამა განხორციელდება დისტანციურად</strong></p>\\n\\n<p><strong>რეგისტრაციის ლინკი:</strong></p>\\n\\n<p><strong>&nbsp;</strong><a href=\\\"http://www.zspa.ge/geo/tregistration\\\"><strong>http://www.zspa.ge/geo/tregistration</strong></a><strong>&nbsp; &nbsp;&nbsp;</strong></p>\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>http://www.zspa.ge/geo/tregistration</p>\"}', '.', '.', '.', '2021-05-28', '2021-05-30', '2021-05-28', 119, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-28 13:12:06', '2021-05-28 13:27:45', NULL, NULL, 1, 0, NULL, NULL, NULL, 1, 'http://www.zspa.ge/geo/tregistration', NULL, 0, NULL, 1),
