(173, '{\"en\": null, \"ka\": \"სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში ტრენერთა მო გადამზადების სასერტიფიკატო პროგრამა\"}', '{\"en\": null, \"ka\": \"<p><strong>პროგრამა ემსახურება</strong> ტრენერთა მომზადებას ან/და გადამზადებას სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში, რათა მათ შემდგომში უზრუნველყონ ეროვნული უმცირესობებისთვის სახელმწიფო ენის სწავლება მათი ერთიან სახელმწიფოებრივ სივრცეში ინტეგრაციის ხელშეწყობის მიზნით.</p><p>პროგრამა მოიცავს თეორიულ და პრაქტიკულ ნაწილს. პროგრამის თეორიული ნაწილი შედგენილია იმ პროფესიონალების მიერ, რომლებიც მონაწილეობდნენ სხვადასხვა მიმართულებით ქვეყნისთვის მნიშვნელოვანი პროცესების წარმართვაში და სწორედ ისინი უძღვებიან სასწავლო პროცესს.</p><p><strong>პროგრამის მიზანია</strong> - დაინტერესებულ პირებს /მომავალ ქართულის, როგორც მეორე ენის ტრენერებს, მიაწოდოს სათანადო თეორიული და პრაქტიკული ცოდნა, რომელიც ესაჭიროებათ საქმიანობის სრულყოფილად განხორციელებისთვის .</p><p>პროგრამა ასევე მიზნად ისახავს წარმატებული კურსდამთავრებულების სკოლის ბაზაზე დასაქმებას ქართულის, როგორც მეორე ენის სწავლებისა და ინტეგრაციის მიმართულების ტრენერებად.</p><p>პროგრამის სამიზნე ჯგუფს განეკუთვნებიან სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში ტრენერად მუშაობის მსურველი საქართველოს მოქალაქე ფიზიკური პირი.</p><p><strong>პროგრამაში მონაწილეობა შეუძლიათ </strong>ავტორიზებული ან/და აკრედიტებული საგანმანათლებლო დაწესებულების ჰუმანიტარული სპეციალობის ფილოლოგიის ფაკულტეტის ბაკალავრის ხარისხის მქონე ან ამავე ფაკულტეტის ბაკალავრიატის დამამთავრებელი კურსის სტუდენტებს ან/და მაგისტრის ან მასთან გათანაბრებული ჰუმანიტარული მეცნიერებების აკადემიური ხარისხის მქონე პირებს.</p><p>მსმენელებს გადაეცემათ პროგრამით გათვალისწინებული სწავლის წარმატებით დასრულების შესაბამისი სერტიფიკატი.</p><p>&nbsp;</p><p><strong>პროგრამის ამოცანები</strong></p><ul><li>ტრენერად მუშაობით დაინტერესებული პირების კვალიფიკაციის ამაღლება;</li><li>ტრენერის უნარ- ჩვევების ჩამოყალიბება/განვითარებაში დახმარება;</li><li>თეორიული და პრაქტიკული ცოდნის გადაცემა სახელმწიფო ენის სწავლებასა და სამოქალაქო ინტეგრაციასთან დაკავშირებით;</li><li>მაღალკვალიფიციური კადრების მომზადების ხელშეწყობა შემდგომი დასაქმების პერსპექტივით.</li></ul><p>&nbsp;</p><p><strong>პროგრამის ხანგრძლივობა და აღწერილობა</strong></p><p>პროგრამა მოიცავს როგორც თეორიულ, ასევე პრაქტიკულ ნაწილს - 24 კვირა;</p><p>პროგრამა განხორციელედება ჰიბრიდული მეთოდით (როგორც დისტანციურად, ასევე პირისპირ);მონაწილეებს გადაეცემათ პროგრამით გათვალისწინებული სასწავლო ელექტრონული და ბეჭდური რესურსები .</p><p>თეორიული სწავლება შედგება 3 კურსისგან - 182 საათი (ას ოთხმოცდაორი საათი);</p><ul><li>სახელმწიფო ენის სწავლებისა და ინტეგრაციის ხელშეწყობის პროგრამა, მისი მართვა და ადმინისტრირება;</li><li>ქართულის, როგორც მეორე ენის სწავლების თანამედროვე მეთოდები და ენის სატრენინგო პროცესის მართვის (ტრენერის როლი) კურსი;</li><li>საქართველოს სახელმწიფოებრიობა, მულტიკულტურული საზოგადოება და მათი სამოქალაქო ინტეგრაცია.</li></ul><p>პრაქტიკული სწავლება შედგება სამი ნაწილისგან - 72 საათი(სამოცდათორმეტი საათი);</p><ul><li>პასიური პრაქტიკის ნაწილი 20%;</li><li>შერეული პრაქტიკის ნაწილი 30%;</li><li>აქტიური პრაქტიკის ნაწილი 50%.</li></ul><p><br><br><strong>პროგრამის შედეგები:</strong></p><p>სახელმწიფო ენის სწავლებისა და ინტეგრაციის საკითხებში ტრენერთა მომზადება/გადამზადების სასერტიფიკატო პროგრამის შედეგად ჩამოყალიბდება ტრენერი, რომელიც შეძლებს:</p><ul><li>სასწავლო პროცესის დაგეგმვას;</li><li>სასწავლო პროცესის ადმინისტრირებას;</li><li>მსმენელთა მოტივირებას;</li><li>ეროვნული უმცირესობების წარმომადგენლებისთვის თანამედროვე მეთოდებით სახელმწიფო ენის სწავლებას;</li><li>სასწავლო რესურსების ეფექტურად გამოყენებას;</li><li>სწავლების პროცესში დისტანციური სწავლების ახალი ტექნოლოგიების გამოყენებას;</li><li>მულტიკულტურულ ჯგუფებში სახელმწიფოებრივ თემებზე ეფექტურ კომუნიკაციას და მსმენელთა სამოქალაქო ცნობიერების ამაღლებას;</li><li>მულტიკულტურული ჯგუფების მართვას მათი რელიგიური, კულტურული და ეროვნული სპეციფიკაციების გათვალისწინებით;</li><li>მსმენელთა ცოდნის შეფასებას თანამედროვე ინსტრუმენტებისა და მეთოდების გამოყენებით.</li></ul><p>&nbsp;</p><p>პროგრამის განხორციელების შედეგად მსმენელები განივითარებენ ისეთ პიროვნულ და პროფესიულ უნარებს და კომპეტენციებს, როგორებიცაა:</p><ul><li>ეფექტური კომუნიკაციის უნარი;</li><li>სწავლის მოტივაციის შექმნის უნარი;</li><li>ბენეფიციარის მიზნებზე ორიენტირებული სწავლების უნარი;</li><li>ტრენინგის დაგეგმვისა და ორგანიზების უნარი;</li><li>სწავლების სხვადასხვა ფორმის (დასწრებით, დისტანციური, ჰიბრიდული) შესაბამისი მეთოდოლოგიის გამოყენების უნარი;</li><li>ტრენინგის დინამიკის მართვის უნარი;</li><li>ციფრული ტექნოლოგიების ეფექტურად გამოყენების უნარი;</li><li>კონსტრუქციული უკუკავშირისა და შეფასების ინსტრუმენტების ეფექტური გამოყენების უნარი;</li><li>სასწავლო რესურსების მომზადებისა და ადაპტირების უნარი;</li><li>დამოუკიდებლად მუშაობის უნარი;</li><li>გუნდური მუშაობის უნარი;</li><li>მულტიკულტურულ გარემოში ტრენინგის დინამიკის, ჯგუფის მოტივაციისა და პროცესების მართვის უნარი.</li></ul><p>&nbsp;</p><p><strong>პროგრამა განხორციელდება დისტანციურად</strong></p><p><strong>რეგისტრაციის ლინკი:</strong></p><p><strong>&nbsp;</strong><a href=\\\"http://www.zspa.ge/geo/tregistration\\\"><strong>http://www.zspa.ge/geo/tregistration</strong></a><strong>&nbsp; &nbsp;&nbsp;</strong></p><p>&nbsp;</p><p><i><strong>საკონტაქტო ინფო</strong></i></p><p><a href=\\\"mailto:zspa@zspa.ge\\\"><i><strong>zspa@zspa.ge</strong></i></a></p><p><i><strong>591938260</strong></i></p>\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>.</p>\"}', NULL, NULL, '0431 232600', '2021-05-28', '2021-06-03', '2021-05-28', 119, NULL, 'k78vAseZ1YzRmfBSBi4GjNNAZxDO0ImQ5tfeHZbm.png', NULL, NULL, NULL, 'http://www.zspa.ge/geo/page/13', '2021-05-28 14:32:27', '2021-05-28 17:53:54', 'http://www.zspa.ge/geo/tregistration', NULL, 1, 0, 'zspa@zspa.ge', 22, NULL, 0, NULL, NULL, 0, NULL, 0),
