(185, '{\"en\": null, \"ka\": \"\\\"საქართველოს ევროკლუბების ალიანსი\\\" გიწვევთ ახალგაზრდულ კლუბში გასაწევრიანებლად\"}', '{\"en\": null, \"ka\": \"<p>თუ&nbsp;მზად&nbsp;ხარ&nbsp;ახალი&nbsp;გამოწვევებისთვის&nbsp;და&nbsp;შესაძლებლობებისთვის,&nbsp;მაშინ&nbsp;ეს&nbsp;ინფორმაცია&nbsp;შენთვისაა!</p><p>\\\"საქართველოს&nbsp;ევროკლუბების&nbsp;ალიანსი\\\"&nbsp;იწვევს&nbsp;ოზურგეთში მცხოვრება ახალგაზრდებს&nbsp; კლუბში&nbsp;გასაწევრიანებლად,&nbsp;სადაც&nbsp;თქვენ&nbsp;გექნებათ&nbsp;შესაძლებლობა&nbsp;თანატოლებთან&nbsp;ერთად:&nbsp;დაგეგმოთ&nbsp;და&nbsp;განახორციელოთ&nbsp;იდეები&nbsp;და&nbsp;ინიციატივები;&nbsp;მონაწილეობა&nbsp;მიიღო&nbsp;სხვადასხვა&nbsp;სახის&nbsp;პროექტებში&nbsp;როგორც&nbsp;საქართველოში&nbsp;ასევე&nbsp;საზღვარგარეთ;&nbsp;მიიღოთ&nbsp;განსხვავებული&nbsp;ცოდნა&nbsp;და&nbsp;გამოცდილება&nbsp;სხვადასხვა&nbsp;თემატიკაზე: ლიდერობა&nbsp;და&nbsp;გუნდური&nbsp;მუშაობა;თანხების&nbsp;მოზიდვა&nbsp;და&nbsp;პროექტების&nbsp;შემუშავება;კომუნიკაცია&nbsp;და&nbsp;კონფლიქტების&nbsp;მართვა; ევროპელი&nbsp;მოხალისეების&nbsp;დახმარებით&nbsp;შეისწავლო&nbsp;ინგლისური&nbsp;ან&nbsp;სხვა&nbsp;უცხო&nbsp;ენა&nbsp;ან/და&nbsp;აიმაღლო&nbsp;ენის&nbsp;ფლობის&nbsp;დონე. &nbsp;</p><p>მოთხოვნები: -კვირაში&nbsp;მინიმუმ&nbsp;ერთი&nbsp;დღე&nbsp;მონაწილეობა&nbsp;უნდა&nbsp;მიიღო&nbsp;„ევროკლუბის“&nbsp;შეხვედრებში ; &nbsp;</p><p>-გამოჰყო&nbsp;შესაბამისი&nbsp;დრო&nbsp;დაგეგმილ&nbsp;ტრენინგებში&nbsp;ან/და&nbsp;აქტივობებში&nbsp;მონაწილეობის&nbsp;მისაღებად;&nbsp;</p><p>-აქტიური&nbsp;მონაწილეობა&nbsp;მიიღო&nbsp;„ევროკლუბის“&nbsp;სხვა&nbsp;წევრის&nbsp;მიერ&nbsp;დაგეგმილი&nbsp;აქტივობის&nbsp;მომზადება/განხორციელებაში;&nbsp;</p><p>- იყო&nbsp;მოტივირებული,&nbsp;კრეატიული,&nbsp;შრომისმოყვარე&nbsp;და&nbsp;პასუხისმგებლიანი. &nbsp;</p><p>- სასურველია,&nbsp;მაგრამ&nbsp;არასავალდებულოა,&nbsp;უცხო&nbsp;ენის&nbsp;სასაუბრო&nbsp;დონეზე&nbsp;ცოდნა.</p><p>&nbsp;- კლუბის&nbsp;წევრობის&nbsp;მსურველთა&nbsp;ასაკი:&nbsp;14-15-წელი !</p><p>&nbsp;- მონაწილეთა&nbsp;რაოდენობა&nbsp;შეზღუდულია!</p><p>&nbsp;- კლუბის&nbsp;წევრობა&nbsp;უფასოა!</p><p>&nbsp;- წევრობის&nbsp;მსურველმა&nbsp;უნდა&nbsp;შევასოს&nbsp;სააპლიკაციო&nbsp;ფორმა: https://forms.gle/Rqe6ezFSTdGb5TRJ7</p><p>&nbsp;- რეგისტრაციის&nbsp;ბოლო&nbsp;ვადაა:&nbsp;15&nbsp;ივნისი</p><p>&nbsp;საბოლოო&nbsp;გადაწყვეტილება&nbsp;„ევროკლუბში“&nbsp;მიღებასთან&nbsp;დაკავშირებით&nbsp;მიღებული&nbsp;იქნება&nbsp;კანდიდატთა&nbsp;გასაუბრების&nbsp;შემდეგ.</p><p>&nbsp;</p>\"}', '{\"en\": \"ოზურგეთი\", \"ka\": \"ოზურგეთი\"}', NULL, NULL, NULL, '2021-06-01', '2021-06-15', '2021-06-02', 79, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-29 19:56:11', '2021-06-02 17:23:24', 'https://docs.google.com/forms/d/e/1FAIpQLSdGEyUuu4AC1KARoxawhZbNLRPIObhi2F9ThYp0Z4BGDYFvpQ/viewform', NULL, 1, 0, 'geo_euroclub@yahoo.com', 14, 15, 0, NULL, NULL, 0, NULL, 0),
