(191, '{\"en\": null, \"ka\": \"“სექსუალურ უმცირესობათა უფლებები”\"}', '{\"en\": null, \"ka\": \"<p>📣მოგესალმებით!</p><p>არადამთავრობოორგანიზაცია“თემიდა”</p><p>გთავაზობთსაჯაროლექციას</p><p>🔺თემაზე: “სექსუალურუნცირესობათაუფლებები”.</p><p>🗣სპიკერი: გიორგიბჟალავა.</p><p><br>&nbsp;</p><p>📅ლექციაჩატარდება07/06/2021（შვიდივნისს)</p><p><br>&nbsp;</p><p>🕗20:00 (ოც(რვა) საათსზე)).</p><p><br>&nbsp;</p><p>თქვენგეძლევათ</p><p>შესაძლებლობა：</p><p>📌აიმაღლოთცნობიერებისდონე;</p><p>📌გაიგოთმეტისექსუალურიუმცირესობისუფლებებზე;</p><p>📌დასვათშეკითხვებიდამიიღოთამომწურავიპასუხებიამთემისფარგლებში！</p><p><br>&nbsp;</p><p>🖇ლექციაზედასწრებისბმულიhttps://us05web.zoom.us/j/82898966391?pwd=R09va2thdk92Q0I3eXY1Qml0OXVlUT09</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-30', '2021-06-07', '2021-05-30', 110, NULL, '191__2021-05-3016:42:19.png', NULL, NULL, NULL, NULL, '2021-05-30 16:33:12', '2021-05-30 16:42:19', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(192, '{\"en\": \"\", \"ka\": \"ახალგაზრდული დღეები\"}', '{\"en\": \"\", \"ka\": \"<p>&nbsp; &nbsp;მ/წლის ზაფხულში (სავარაუდო თვე ივლისი აგვისტო) დაგეგმილი გვაქვს ახალგაზრდული დღეების ჩატარება. აღნიშნულ ღონისძიებაში ჩართული იქნება მუნიციპალიტეტში მცხოვრები 19-29 ასაკის ახალგაზრდები. აღნიშნული &nbsp;ღონისძიება მოიცავს შემდეგ აქტივობებს საგანმანათლებლო, სპორტულს და შემოქმედებითის, რომელიც გაიმართება სამი დღის განმავლობაში. ახალგაზრდული დღეები ტარდება ყოველწლიურად.</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-06-04', '2021-07-10', '2021-06-01', 126, NULL, NULL, NULL, '', '', '', '2021-05-31 07:43:23', '2021-05-31 07:55:24', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
(193, '{\"en\": null, \"ka\": \"სათემო ორგანიზაციების გახსნა\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;,,მუნიციპალური ახალგაზრდული პოლიტიკის\\\" ფარგლებში ბოლნისის მუნიციპალიტეტის მერია, ახალგაზრდული პოლიტიკის განვითარების, ფორმალური და არაფორმალური განათლების ხელშეწყობისა და ახალგაზრდების მაქსიმალური ჩართულობის&nbsp;მიზნით &nbsp; 5 დასახ;ებულ პუნქტში, დაბა კაზრეთში, სოფლებში: ნახიდურში, ტალავერში, ქვემო ბოლნისსა და დარბაზში სათემო ორგანიზაციების გახსნას.&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-15', '2021-07-15', '2021-05-31', 127, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-31 10:30:05', '2021-05-31 10:42:23', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
