(195, '{\"en\": \"\", \"ka\": \"სათემო ორგანიზაციების ხელმძღვანელთა ტრენინგები\"}', '{\"en\": \"\", \"ka\": \"<p>ბოლნისაის მუნიციპალიტეტის მერია ახორციელებს სათემო ორგანიზაციების ხელმძღვანელების გადამზადებას, მათი კომპეტენციისა და უნარების გაზრდის მიზნით შემდეგი ტრენინგების მეშვეობით:</p><ol><li>ეფექტური მართვა და კომუნიკაცია</li><li>გუნდური მუშაობა</li><li>კომფლიქტების მართვა&nbsp;</li><li>ახალგაზრდული პოლიტიკა და ახალგაზრდული საქმიანობა</li><li>მოხალისეობა&nbsp;</li><li>მონაწილეობა</li></ol>\"}', '{\"en\": \"\"}', '', '', '', '2021-06-10', '2021-09-01', '2021-05-31', 127, NULL, NULL, NULL, '', '', '', '2021-05-31 10:42:30', '2021-05-31 10:47:35', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
(196, '{\"en\": \"\", \"ka\": \"მუნიციპალური ახალგაზრდული სტრატეგიისა და სამოქმედო გეგმის საჯარო განხილვა.\"}', '{\"en\": \"\", \"ka\": \"<p>მუნიციპალური ახალგაზრდული სტრატეგიისა და სამოქმედო გეგმის საჯარო განხილვაში ჩაერთვებიან ადგილობრივი ახალგაზრდედბი, არასამთავრობო ორგანიზაციის წარმომადგენლები, მუნიციპალიტეტის მერიისა და საკრებულოს წარმომადგენლები, საგანმანათლებლო რესურს-ცენტრის წარმომადგენლები, ადგილობრივი მედია.</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-06-03', '2021-06-04', '2021-05-31', 127, NULL, NULL, NULL, '', '', '', '2021-05-31 10:47:41', '2021-05-31 10:51:32', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
