(198, '{\"en\": \"\", \"ka\": \"გასვლითი ღონისძიებები\"}', '{\"en\": \"\", \"ka\": \"<p>საგანმანათლებლო- შემეცნებითი და გასართობი ღონისძიება ბანაკის სახით, რომელიც მოეწყობა მესტიის მუნიციპალიტეტში. ბოლნისის მუნიციპალიტეტიდან მონაწილ;ეობას მიიღებენ ახალგაზრდულ საკითხებზე მომუშავე 2 წარმომადგენელი და ახალგაზრდები.</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-06-25', '2021-06-30', '2021-05-31', 127, NULL, NULL, NULL, '', '', '', '2021-05-31 10:51:41', '2021-05-31 10:53:52', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
(199, '{\"en\": \"\", \"ka\": \"მარნეულის მუნიციპალიტეტის სათემო ორგანიზაციის პრაქტიკის გაზიარება\"}', '{\"en\": \"\", \"ka\": \"<p>ბოლნისის მუნიციპალიტეტის სათემო ორგანიზაციებში მოწვეული იქბნებიან მარნეულის მუნიციპალიტეტის სათემო ორგანიზაციების წარმომადგენლები სადაც მოხდება მათი ცოდნმისა და გამოცდილების გაზიარება.</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-07-05', '2021-07-09', '2021-05-31', 127, NULL, NULL, NULL, '', '', '', '2021-05-31 10:53:57', '2021-05-31 10:57:00', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
