(201, '{\"en\": null, \"ka\": \"ვირტუალური ბანაკი 2021  ,,ტრეფიკინგი XXI საუკუნეში\\\"\"}', '{\"en\": null, \"ka\": \"<p>ვირტუალური ბანაკი &nbsp;2021 ის მთავარი თემა:ტრეფიკინგია</p><p>💫ბანაკის ხანგძლივობა: 3 დღე. 17;18;19 ივნისი &nbsp;</p><p>💢 ბანაკის პერიოდში მოზარდები გაეცნობიათ ინფორმაციას ტრეფიკინგის შესახებ ამასთანავე გაეცნობიათ იმას თუ რა ხდება ამ კუთხით საქართველოში და როგორ ებრძვიან მას XXI საუკუნეში.</p><p>🔰ბანაკში მონაწილეები დაიყოფიან გუნდებად და იბრძოლებენ 3 დღის განმავლობაში რომ ჩვენ მიერ მიცემული დავალებებით დააგროვონ უმაღლესი ქულები და გახდნენ &nbsp;ვირტუალური ბანაკი 2021 ის &nbsp;გამარჯვებულები.</p><p>ბანაკში მოსახვედრად გთხოვთ გაიაროთ რეგისტრაცია.</p><p>&nbsp;</p><p>💫რეგისტრაცია სრულდება 13 ივნისს</p><p>დამატებითი წესები დრო და დრო დაიდება ორგანიზაციის გვერდზე ამასთანავე მონაწილეებს ბანაკის დაწყებამდე გაგაცნობთ ყველა დადგენილ წესს გაცნობით შეხვედრაზე.</p><p>〽️ბანაკს ანხორციელებს ახალგაზრდული ორგანიზაცია Talanted Generation-ი</p><p>გისურვებთ წარმატებებს!</p>\"}', '{\"en\": null}', NULL, NULL, '599132552', '2021-06-17', '2021-06-19', '2021-05-31', 74, NULL, '201__2021-05-3116:14:55.png', NULL, 'https://www.facebook.com/Talanted-generation-108106650990186', NULL, NULL, '2021-05-31 15:58:55', '2021-05-31 16:14:56', 'https://docs.google.com/forms/d/e/1FAIpQLSfGx440EpbfLcs0JhjO-EIWNFJmfBqEEzgDCAygd100yijO_Q/viewform?usp=sf_link', NULL, 1, 0, 'talantedgeneration@gmail.com', 12, 18, 1, 'https://us05web.zoom.us/j/83203172935?pwd=cVkvVUk0QWtoN1FiR2hqV3dBM1AvZz09', NULL, 0, NULL, 0),
(202, '{\"en\": null, \"ka\": \"2021 წლის ახალგაზრდული მშვიდობის კვირეული\"}', '{\"en\": null, \"ka\": \"<p>მიიღეთ მონაწილეობა 2021 წლის ახალგაზრდულ მშვიდობის კვირეულში!</p><p>ახალგაზრდული მშვიდობის კვირეული მიზნად ისახავს ახალგაზრდებისა და ახალგაზრდული ორგანიზაციების გაძლიერებას კონფლიქტით დაზარალებული რეგიონებიდან, მათი კომპეტენციების ამაღლებითა და საგანმანათლებლო რესურსებით აღჭურვის გზით, რათა გაიზარდოს ახალგაზრდების ჩართულობა მშვიდობის მშენებლობისა და კონფლიქტების ტრანსფორმაციის პროცესში.</p><p>ახალგაზრდული მშვიდობის კვირეული ჩატარდება 30 ივნისიდან 8 ივლისის ჩათვლით და მოიცავს ელექტრონულ სწავლებას, ვებინარებს და ონლაინ სემინარებს.</p><p>განაცხადის მიღების ბოლო ვადაა 2021 წლის 15 ივნისი, მონაწილეობა უფასოა, დამატებითი ინფორმაციისათვის გახსენით მიმაგრებული ფაილი ან &nbsp;ეწვიეთ ბმულს -&nbsp;</p><p><a href=\\\"https://rm.coe.int/youth-peace-week-2021-call-for-participants/1680a2ab3e?fbclid=IwAR0CtEDhzLl1AS0dHYWBPkxZgYjOeXbkJPOlU-cXXutw9UGvy3fa_2yT_5g\\\">https://rm.coe.int/youth-peace-week-2021-call.../1680a2ab3e</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-30', '2021-07-08', '2021-06-02', 81, NULL, '202__2021-06-0210:58:39.png', NULL, NULL, NULL, NULL, '2021-06-02 10:41:44', '2021-06-02 10:58:39', 'https://youthapplications.coe.int/', NULL, 1, 0, 'eyc.programme@coe.int', 18, 28, 1, '-', NULL, 0, NULL, 0),
(203, '{\"en\": null, \"ka\": \"ახალი საგრანტო პროგრამა\"}', '{\"en\": null, \"ka\": \"<p>ახალ საგრანტო პროგრამაში მონაწილეობა შეუძლიათ აშშ-ისა და საქართველოს არაკომერციულ, არასამთავრობო ორგანიზაციებსა და აკრედიტაციის მქონე უმაღლეს საგანმანათლებლო დაწესებებულებს.<br><br>პროგრამის შესახებ დეტალური ინფორმაცია იხილეთ ბმულზე: <a href=\\\"https://go.usa.gov/x6gKv?fbclid=IwAR1Jf46vFcBTjrtnXLAZGw1SG7Vl7WY0kGGSAn2GaFi2C9IkWwdw3qhIKh4\\\">https://go.usa.gov/x6gKv</a></p>\"}', '{\"en\": \"-\", \"ka\": \"-\"}', NULL, NULL, NULL, '2021-06-01', '2021-07-01', '2021-06-02', 81, NULL, '203__2021-06-0212:04:44.png', NULL, NULL, NULL, NULL, '2021-06-02 12:01:16', '2021-06-02 12:04:44', 'https://go.usa.gov/x6gKv', NULL, 1, 0, 'TbilisiGrants@state.gov', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(204, '{\"en\": null, \"ka\": \"ონლაინ კონსულტაცია ფულბრაიტის სამაგისტრო პროგრამის შესახებ\"}', '{\"en\": null, \"ka\": \"<p>შემოგვიერთდით 4 ივნისს, 18:00 საათზე ამერიკის საელჩოს ფეისბუქის გვერდზე და მიიღეთ დეტალური ინფორმაცია ფულბრაიტის სამაგისტრო პროგრამის შესახებ: <a href=\\\"https://go.usa.gov/xHmfF?fbclid=IwAR0kqKepaM5ABNAdyzptS_-LjwowtRWAAh9r-IzExl6zWfwpm4P5oLbPWBQ\\\">https://go.usa.gov/xHmfF</a></p><p>საელჩოს გაცვლითი პროგრამების კოორდინატორი, თეა კუჭუხიძე ლაივ ჩართვის მეშვეობით გაგაცნობთ პროგრამის მოთხოვნებს და უპასუხებს თქვენს შეკითხვებს.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-04', '2021-06-04', '2021-06-02', 81, NULL, '204__2021-06-0212:16:09.png', NULL, NULL, NULL, NULL, '2021-06-02 12:06:19', '2021-06-02 12:16:10', 'https://apply.iie.org/ffsp2022/', NULL, 1, 0, 'usingeo@info', NULL, NULL, 1, 'https://www.facebook.com/usingeo', NULL, 0, NULL, 0),
(205, '{\"en\": null, \"ka\": \"ჰიუბერტ ჰამფრის სახელობის პროგრამა\"}', '{\"en\": null, \"ka\": \"<p>გამოცხადდა ჰიუბერტ ჰამფრის სახელობის ერთწლიანი გაცვლითი პროგრამა ამერიკაში!</p><p>დეტალები იხილეთ ბმულზე:</p><p><a href=\\\"https://go.usa.gov/x6CxP?fbclid=IwAR3wdrRQxt8nkNgbLvAdlfhtH08ZAL17oMrGXT1kq6ePpGvELKbf__DUHnI\\\">https://go.usa.gov/x6CxP</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-05-28', '2021-07-26', '2021-06-02', 81, NULL, '205__2021-06-0212:23:20.png', NULL, NULL, NULL, NULL, '2021-06-02 12:18:32', '2021-06-02 12:23:20', 'https://go.usa.gov/x6CxP', NULL, 1, 0, 'usisgeo@info', NULL, NULL, 1, 'https://go.usa.gov/x6CxP', NULL, 0, NULL, 0),
(206, '{\"en\": null, \"ka\": \"პროექტების და  ცვლილებების მართვა -  მომავლის პროფესიაა\"}', '{\"en\": null, \"ka\": \"<p>პროექტების და &nbsp;ცვლილებების მართვა მომავლის პროფესიაა, რადგან ამ &nbsp;კვალიფიკაციის პროფესიონალები, ჯეროვან ყურადღებას უთმობენ ღირებულების შექმნის, ანალიზი და დაგეგმვის საკითხებს.</p><p>აღნიშნულ პროფესიაზე მოთხოვნები იზრდება და წამყვანი ორგანიზაციების კვლევებიც &nbsp;პროფესიაზე მოთხოვნის ზრდას პროგნოზირებენ. მაგრამ პრობლემაა კვალიფიციური პროფესიონალების არ არსებობა. ამ საკითხთან დაკავშირებული რისკები ძალიან დიდია, რაც თავის მხრივ წყაროა მნიშვნელოვანი ყოველმხრივი დანაკარგების.</p><p>აღნიშნული პრობლემის მინიმიზაცისკენა მიმართული &nbsp;https://www.pmi.org/about - Project Management Institute -საერთაშორისო მასშტაბის სერთიფიცირებული კვალიფიციური პროდუქტები, რომლებიც კონცენტრირებულია როგორც არსებულ პროექტის მენეჯერების ასევე მნიშვნელონწილად &nbsp;ახალგაზრდების პროფესიული უნარების შეძენაზე და პრაქტიკულ განვითარებაზე.</p><p><strong>პროექტების მართვის პროფესიის გამოწვევები</strong></p><ul><li>გამოცდილების მუდმივი ხარისხობრივი ზრდა</li><li>გამჭვირვალე კარიერული წინსვლა</li><li>განსხვავებულ გამოწვევებთან მუშაობა</li><li>უნარ-ჩვევების მუდმივი განვითარება</li><li>ყურადღება დეტალებზე და დიდ სურათზე</li><li>ღირსეული კომპენსაცია</li><li>ცვლილებების მართვა და სამყაროს შეცვლა უკეთესობისკენ</li></ul><p>დეტალურად საკითხი და მომიჯნავე თემები გაშლილი იქნება პრეზენტაციაში.</p>\"}', '{\"en\": null}', NULL, NULL, '995577613434', '2021-06-13', '2021-11-30', '2021-06-07', 138, NULL, '206__2021-06-0214:31:14.png', NULL, 'https://www.facebook.com/pmitbilisigeorgiachapter/', 'https://www.linkedin.com/company/pmi-tbilisi-georgia-chapter/', 'https://www.pmige.org/', '2021-06-02 13:56:46', '2021-06-03 13:12:22', NULL, NULL, 1, 0, 'info@pmige.org', NULL, NULL, 1, NULL, NULL, 0, NULL, 0),
(207, '{\"en\": null, \"ka\": \"ვაკანსია ESC პროექტი - პოლონეთი, Opole - Poland!\"}', '{\"en\": null, \"ka\": \"<p>ინფორმაცია ვაკანსიების შესახებ:</p><p>12 months from the date of your arrival -&nbsp;but arriving not later than late-July / mid-August&nbsp;</p><p>1 person - supporting daily working of the local community center for youths - following kids - helping with homework, learning language, doing workshops INFOPACK:&nbsp;<a href=\\\"https://drive.google.com/file/d/108JGw1PZo6LbSAThP56LbX75mfczabLO/view?usp=sharing&amp;fbclid=IwAR15w5VBcvNRV6zPqRZNe1MhjavIpKsNoaZizUHnxTSWv7tjdCotE6YUE6g\\\">https://drive.google.com/file/d/108JGw1PZo6LbSAThP56LbX75mfczabLO/view?usp=sharing</a></p><p>პროექტი დაფინანსებულია&nbsp;<a href=\\\"https://www.facebook.com/hashtag/europeansolidaritycorps?__eep__=6&amp;__cft__%5b0%5d=AZXqLLEBdHFCUFAzo_M1bTU8Phzf5aQKnQMTfvgE_i5FrGR6rA5GC_OwzKTL2ghFHQ4ludjIj5JvciSC-bTHI0tsyKCEsKFLmP0LVTsp2UiozS3BgIUT07zXOwfeKv-28icIYV8AVNOxOn4MwxBRZbSPOo1nkYySM1SUrOMQNpG1Vayjc6h6Qy2BL96jkcg8Obo&amp;__tn__=*NK-R\\\">#EuropeanSolidarityCorps</a>-ის&nbsp;ფარგლებში&nbsp;და&nbsp;ფარავს:&nbsp;</p><p>- საერთაშორისო მგზავრობის&nbsp;ხარჯებს;</p><p>- ვიზის მიღების ხარჯებს;</p><p>-&nbsp;სამედიცინო დაზღევას;</p><p>- ბინის და კომუნალურ ხარჯებს;</p><p>- მოხალისეს ეძლევა&nbsp;ჯიბის&nbsp;და&nbsp;კვების&nbsp;თანხა.</p><p>კანდიდატებმა CV და სამოტივაციო უნდა გამოაზგავნოთ ელექტრონულ ფოსტაზე:&nbsp;</p><p>wyjedz@semperavanti.org და&nbsp;<a href=\\\"mailto:syc_guria@yahoo.com\\\">syc_guria@yahoo.com</a>&nbsp;</p><p>მოხალისის&nbsp;შერჩევას&nbsp;ახორციელებს&nbsp;მიმღები ორგანიზაცია&nbsp;!</p><p>კითხვების&nbsp;შემთხვევაში&nbsp;მოგვწერეთ:&nbsp;<a href=\\\"mailto:syc_guria@yahoo.com\\\">syc_guria@yahoo.com</a></p><p>P.S. „ევროპის&nbsp;სოლიდაროპის&nbsp;კორპუსის“ პროექტებში მონაწილეობისათვის თქვენ დაგჭირდებათ რეგისტარციის გავლა პროგრამის ვებ-გვერდზე:&nbsp;<a href=\\\"https://europa.eu/youth/solidarity/register/form_en\\\">https://europa.eu/youth/solidarity/register/form_en</a>&nbsp;</p><p>P.P.S.&nbsp;ჩვენიორგანიზაციისმიერ&nbsp;გაგზავნილიმოხალისეების შესახებ&nbsp;ინფო: <a href=\\\"https://www.google.com/url?q=http://www.facebook.com/SYCEVS&amp;sa=D&amp;ust=1601236349839000&amp;usg=AFQjCNGYZcR6MI3okxnguXsvwSQD8pma6A\\\">www.facebook.com/SYCEVS</a></p><p>თუ&nbsp;დაგჭირადთ&nbsp;ინფორმაცია&nbsp;გამგზავნ&nbsp;ორგანიზაციის&nbsp;შესახებ:</p><p>Name: Student-Youth Council</p><p>OID:&nbsp;E10186115</p><p>Adress: #11A, 26 May str, Ozurgeti, 3500, Georgia</p><p>Person in charge:&nbsp;Natia Gigiadze</p><p>Phone: +995&nbsp;496&nbsp;274&nbsp;634</p><p>E-mail: syc_guria@yahoo.com&nbsp;</p>\"}', '{\"en\": \"Opole - Poland\", \"ka\": \"Opole - Poland\"}', NULL, NULL, NULL, '2021-06-03', '2021-08-01', '2021-06-02', 78, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-02 17:12:37', '2021-06-02 17:16:41', NULL, NULL, 1, 0, 'syc_guria@yahoo.com', 18, 30, 0, NULL, NULL, 0, NULL, 0),
