(210, '{\"en\": null, \"ka\": \"არასრულწლოვანთა მართლმსაჯულება\"}', '{\"en\": null, \"ka\": \"<p>📣 არასამთავრობო ორგანიზაცია “თემიდა” გთავაზობთ ტრენინგებს &nbsp;არასრულწლოვანთა მართლმსაჯულების საკითზე.</p><p>ტრენინგის თემები:</p><p>📌არასრულწლოვანთა</p><p>მართლმსაჯულების ზოგადი მიმოხილვა!</p><p>📌არასრულწლოვან ბრალდებულთა ფსიქოლოგია და არასრულწოვნის მიერ ჩადენილი დანაშაულის გამოძიება!</p><p>🏆ტრენინგების ბოლოს ჩატარდება იმიტირებული სასამართლო პროცესის ჩემპიონატი!</p><p>გამოვლინდება პირველი 🥇მეორე🥈 და მესამე 🥉ადგილის მფლობელი გუნდები.</p><p>ასევე გამოვლინდება:</p><p>⭐️საუკეთესო მოწმე</p><p>⭐️საუკეთესო ადვოკატი</p><p>⭐️საუკეთესო პროკუროი</p><p>და რა თქმა უნდა,გაიცემა დამადასტურებელი სერთიფიკატები 👏</p><p>მონაწილეობის მსურველებმა,შეავსეთ</p><p>ქვემოთ მოცემული სააპლიკაციო ფორმა</p><p>მონაწილეობის მიღება შეუძლია ნებისმიერ მსურველს.</p><p>📅 აპლიკაციების მიღების ბოლო ვადა :</p><p>07/06/2021</p><p>🖇 https://docs.google.com/forms/d/1vVQ1VVozamgPVcRpkOlsplSxKGvBJO5mTHi7PrgEAcc/edit</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-03', '2021-06-10', '2021-06-03', 110, NULL, '210__2021-06-0221:24:07.png', NULL, NULL, NULL, NULL, '2021-06-02 21:17:25', '2021-06-02 21:24:08', 'https://docs.google.com/forms/d/1vVQ1VVozamgPVcRpkOlsplSxKGvBJO5mTHi7PrgEAcc/edit', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(211, '{\"en\": \"\", \"ka\": \"არასრულწლოვანთა მართლმსაჯულება\"}', '{\"en\": \"\", \"ka\": \"<p>📣 არასამთავრობო ორგანიზაცია “თემიდა” გთავაზობთ ტრენინგებს &nbsp;არასრულწლოვანთა მართლმსაჯულების საკითზე.</p><p>ტრენინგის თემები:</p><p>📌არასრულწლოვანთა</p><p>მართლმსაჯულების ზოგადი მიმოხილვა!</p><p>📌არასრულწლოვან ბრალდებულთა ფსიქოლოგია და არასრულწოვნის მიერ ჩადენილი დანაშაულის გამოძიება!</p><p>🏆ტრენინგების ბოლოს ჩატარდება იმიტირებული სასამართლო პროცესის ჩემპიონატი!</p><p>გამოვლინდება პირველი 🥇მეორე🥈 და მესამე 🥉ადგილის მფლობელი გუნდები.</p><p>ასევე გამოვლინდება:</p><p>⭐️საუკეთესო მოწმე</p><p>⭐️საუკეთესო ადვოკატი</p><p>⭐️საუკეთესო პროკუროი</p><p>და რა თქმა უნდა,გაიცემა დამადასტურებელი სერთიფიკატები 👏</p><p>მონაწილეობის მსურველებმა,შეავსეთ</p><p>ქვემოთ მოცემული სააპლიკაციო ფორმა</p><p>მონაწილეობის მიღება შეუძლია ნებისმიერ მსურველს.</p><p>📅 აპლიკაციების მიღების ბოლო ვადა :</p><p>07/06/2021</p><p>🖇 https://docs.google.com/forms/d/1vVQ1VVozamgPVcRpkOlsplSxKGvBJO5mTHi7PrgEAcc/edit</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-06-03', '2021-06-10', '2021-06-03', 110, NULL, NULL, NULL, '', '', '', '2021-06-02 21:23:02', '2021-06-02 21:23:02', 'https://docs.google.com/forms/d/1vVQ1VVozamgPVcRpkOlsplSxKGvBJO5mTHi7PrgEAcc/edit', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
