(221, '{\"en\": \"საერთო სამუშაო სივრცე ბათუმში\", \"ka\": \"საერთო სამუშაო სივრცე ბათუმში\"}', '{\"en\": \"<h2><strong>საერთო სამუშაო სივრცე ბათუმში</strong></h2>\\n\\n<p>ყველაზე ხლმისაწვდომი და კომფორტული შეთავაზება &nbsp;ახალგაზრდებისთვის, ორგანიზაციებისთვის და ახალგაზრდა სტრატაპერებისთვის/ფრილანსერებისთვის!!!&nbsp;</p>\\n\\n<p>&nbsp;co-working სივრცეში თქვენ შეგიძლიათ დაჯავშნოთ მცირე სატრენინგო ოთახი და ასევე საერთო სამუშაო ოთახში ისარგებლოთ საათობრივი სამუშაო ადგილით:</p>\\n\\n<p>1.სატრენინგო ოთახი -1 სთ - 30ლ;</p>\\n\\n<p>2. სამუშაო ადგილის საფასური -1სთ- 10 ლ;</p>\\n\\n<p>3. ფიქსირებული ადგილი -1კვირა/1 თვე - 50ლ/150ლ</p>\\n\\n<p>co-working სივრცის სოციალური მიზნებიდან გამომდინარე სტარტაპერებისთვის და ფრილანსერებისთვის გვაქვს სპეც-შემოთავაზებები;</p>\\n\\n<p>სტუდენტურ და მოსწავლეთა ჯგუფებს თვეში 2 დღე უფასოდ დაეთმობათ სატრენინგო ოთახი ;</p>\\n\\n<p>სამუშაო ადგილის საფასური სტუდენტებისთვის -1სთ- 10 ლ ნაცვლად 1სთ- 5ლ;</p>\\n\\n<p>მომსახურებაში შედის :</p>\\n\\n<p>უფასო WI-FI;</p>\\n\\n<p>უფასო ბეჭდვა (max 10 გვერდი);</p>\\n\\n<p>უფასო პროექტორი;</p>\\n\\n<p>საკანცელარიო დაფა;</p>\\n\\n<p>უფასო ყავა-ჩაი;</p>\\n\\n<p>ტრენინგის დროს ფოტო-გადაღება (+10 ლ)</p>\\n\\n<p>სივრცეზე ხელმისაწვდომობა კვირაში 7 დღე 10:00-19:00;</p>\\n\\n<p>დეტალური ინფორმაციისთვის და დასაჯავშნათ დაგვიკავშირდით</p>\\n\\n<p>დაგვირეკეთ: 577 10 79 85 ;</p>\\n\\n<p>მოგვწერეთ/დაჯავშნეთ</p>\\n\\n<p><a href=\\\"https://www.facebook.com/YouthForPublicInterests/?__cft__[0]=AZWtWs23aG1VJdjW_OBdIFAm7Qmp9eWxJ8y_yDxLE4EYCrvgcI7Hs3XVbi3CNYZgdAlYn-BSdC1ZUIxPJK87Cc43ULt2-Ba7UIO-4i5sQTrN8akpNLC6PVBxoAmeqAipMMNbrTk0KWJf-84r1VYB_lxu36Tu-20RoXJK2ntwgplkXNixzSnKc5xjoB_fl_sUH_Y&amp;__tn__=kK-R\\\">https://www.facebook.com/YouthForPublicInterests</a></p>\\n\\n<p>ქ.ბათუმი, ს.ზუბალაშვილის N11</p>\\n\\n<p>,,ახალგაზრდები საზოგადოებრივი ინტერესებისთვის&quot;</p>\\n\\n<p><a href=\\\"https://www.facebook.com/hashtag/coworkingspace?__eep__=6&amp;__cft__[0]=AZWtWs23aG1VJdjW_OBdIFAm7Qmp9eWxJ8y_yDxLE4EYCrvgcI7Hs3XVbi3CNYZgdAl