(222, '{\"en\": \"\", \"ka\": \"საერთო სამუშაო სივრცე ბათუმში\"}', '{\"en\": \"\", \"ka\": \"<h2><strong>საერთო სამუშაო სივრცე ბათუმში</strong></h2><p>ყველაზე ხლმისაწვდომი და კომფორტული შეთავაზება &nbsp;ახალგაზრდებისთვის, ორგანიზაციებისთვის და ახალგაზრდა სტრატაპერებისთვის/ფრილანსერებისთვის!!!&nbsp;</p><p>&nbsp;co-working სივრცეში თქვენ შეგიძლიათ დაჯავშნოთ მცირე სატრენინგო ოთახი და ასევე საერთო სამუშაო ოთახში ისარგებლოთ საათობრივი სამუშაო ადგილით:</p><p>1.სატრენინგო ოთახი -1 სთ - 30ლ;</p><p>2. სამუშაო ადგილის საფასური -1სთ- 10 ლ;</p><p>3. ფიქსირებული ადგილი -1კვირა/1 თვე - 50ლ/150ლ</p><p>co-working სივრცის სოციალური მიზნებიდან გამომდინარე სტარტაპერებისთვის და ფრილანსერებისთვის გვაქვს სპეც-შემოთავაზებები;</p><p>სტუდენტურ და მოსწავლეთა ჯგუფებს თვეში 2 დღე უფასოდ დაეთმობათ სატრენინგო ოთახი ;</p><p>სამუშაო ადგილის საფასური სტუდენტებისთვის -1სთ- 10 ლ ნაცვლად 1სთ- 5ლ;</p><p>მომსახურებაში შედის :</p><p>უფასო WI-FI;</p><p>უფასო ბეჭდვა (max 10 გვერდი);</p><p>უფასო პროექტორი;</p><p>საკანცელარიო დაფა;</p><p>უფასო ყავა-ჩაი;</p><p>ტრენინგის დროს ფოტო-გადაღება (+10 ლ)</p><p>სივრცეზე ხელმისაწვდომობა კვირაში 7 დღე 10:00-19:00;</p><p>დეტალური ინფორმაციისთვის და დასაჯავშნათ დაგვიკავშირდით</p><p>დაგვირეკეთ: 577 10 79 85 ;</p><p>მოგვწერეთ/დაჯავშნეთ</p><p><a href=\\\"https://www.facebook.com/YouthForPublicInterests/?__cft__[0]=AZWtWs23aG1VJdjW_OBdIFAm7Qmp9eWxJ8y_yDxLE4EYCrvgcI7Hs3XVbi3CNYZgdAlYn-BSdC1ZUIxPJK87Cc43ULt2-Ba7UIO-4i5sQTrN8akpNLC6PVBxoAmeqAipMMNbrTk0KWJf-84r1VYB_lxu36Tu-20RoXJK2ntwgplkXNixzSnKc5xjoB_fl_sUH_Y&amp;__tn__=kK-R\\\">https://www.facebook.com/YouthForPublicInterests</a></p><p>ქ.ბათუმი, ს.ზუბალაშვილის N11</p><p>,,ახალგაზრდები საზოგადოებრივი ინტერესებისთვის\\\"</p><p><a href=\\\"https://www.facebook.com/hashtag/coworkingspace?__eep__=6&amp;__cft__[0]=AZWtWs23aG1VJdjW_OBdIFAm7Qmp9eWxJ8y_yDxLE4EYCrvgcI7Hs3XVbi3CNYZgdAlYn-BSdC1ZUIxPJK87Cc43ULt2-Ba7UIO-4i5sQTrN8akpNLC6PVBxoAmeqAipMMNbrTk0KWJf-84r1VYB_lxu36Tu-20RoXJK2ntwgplkXNixzSnKc5xjoB_fl_sUH_Y&amp;__tn__=*NK-R\\\">#cowo