(226, '{\"en\": null, \"ka\": \",,ადამიანის უფლებები\\\"\"}', '{\"en\": null, \"ka\": \"<p>შეხვედრას გაუძღვება ვანო გომურაშვილი სოციალურ და პოლიტიკურ მეცნიერებათა ფაკულტეტის პოლირიკის მიმართულების სტუდენტი, სერთიფიცრებული ტრენერი, დებატ მსაჯი და ბლოგერი .</p><p>შეხვედრის დაწყების თარიღი/დრო: 13 ივნისი 18:00 სთ</p><p>შეხვედრის ხანგძლივიბა 2 საათი</p><p>შეხვედრა ჩატარდება google meating &nbsp;ში</p><p>დარეგისტრირებულ პირებს შეხვედრის ლინკი მიუვათ მითითებულ მაილზე 1 საათით ადრე</p>\"}', '{\"en\": null}', NULL, NULL, '599132552', '2021-06-13', '2021-06-13', '2021-06-08', 74, NULL, '226__2021-06-0713:25:19.png', NULL, 'https://www.facebook.com/Talanted-generation-108106650990186/', NULL, NULL, '2021-06-07 13:20:10', '2021-06-07 13:25:20', 'https://docs.google.com/forms/d/e/1FAIpQLSe2cZQHQHr_Ah3iyYD4EQsdEMhCAD-v_pBYaUsLGnE7xC9DCQ/viewform?usp=sf_link', NULL, 1, 0, NULL, 13, NULL, 1, 'Click https://us05web.zoom.us/j/86017612475?pwd=Y09ULzc0SE5VQ0FsOEJMa3dGZFBaUT09 to start or join a scheduled Zoom meeting.', NULL, 0, NULL, 0),
