(232, '{\"en\": null, \"ka\": \"გამოცხადდა სტაჟირება ამერიკის საელჩოს პოლიტიკისა და ეკონომიკის განყოფილებაში.\"}', '{\"en\": null, \"ka\": \"<p>აშშ-ის საელჩო შესაძლებლობას აძლევს დაინტერესებულ სტუდენტებს, სტაჟირება გაიარონ და პრაქტიკული გამოცდილება მიიღონ აშშ-ის საელჩოში.&nbsp; პროგრამის მიზანია, სტუდენტებს მიეცეთ მუშაობის შესაძლებლობა საგარეო ურთიერთობების სფეროში, ამერიკულ გარემოში.</p><p>მოცემული სტაჟირება არ არის ანაზღაურებადი, არ გულისხმობს რამე სახის სარგებელს ან სამომავლო დასაქმების ვალდებულებას. თუმცა, ჩვენი სტაჟირების პროგრამა გთავაზობთ მომავალი კარიერული განვითარებისთვის აუცილებელ სამუშაო გამოცდილებას.</p><p><strong>ვის შეუძლია მონაწილეობა კონკურსში</strong>: მონაწილეობა შეუძლიათ საქართველოს ტერიტორიაზე არსებული უმაღლესი სასწავლებლების სტუნდეტებს, რომლებიც გამოირჩევიან მაღალი აკადემიური მოსწრებით.&nbsp;</p><p>დეტალური ინფორმაცია იხილეთ ბმულზე:<br><a href=\\\"https://go.usa.gov/x6WHN?fbclid=IwAR19W_3JO8BtwQ-uz-qDRRhNATLfN2zU8B_CVu6puuYOshKb7vF1Rsu5ptw\\\">https://go.usa.gov/x6WHN</a></p>\"}', '{\"en\": \"ქართულ-ამერიკული მეგობრობრობის გამზირი 29, დიდი დიღომი\", \"ka\": \"ქართულ-ამერიკული მეგობრობრობის გამზირი 29, დიდი დიღომი\"}', NULL, NULL, NULL, '2021-06-07', '2021-06-21', '2021-06-10', 81, NULL, '232__2021-06-1005:25:15.png', NULL, NULL, NULL, NULL, '2021-06-10 05:20:43', '2021-06-10 05:25:15', 'https://go.usa.gov/x6WHN', NULL, 1, 0, 'HROTbilisi@State.gov', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(233, '{\"en\": null, \"ka\": \"ახალგაზრდების ჩართულობა ადგილ. თვითმმართველობის არჩევნებში\"}', '{\"en\": null, \"ka\": \"<p>2021 წლის ივნისიდან-სექტემბრის ჩათვლით საჯარო სერვისების განვითარების ცენტრი და ორგანიზაცია „აღმოსავლეთ ევროპის ცენტრი მრავალპარტიული დემოკრატიისათვის“ ერობლივად გეგმავენ პროექტის განხორცილებას მარნეულის ახალგაზრდებისათვის 19-29 წლის ჩათვლით.<br><br>პროექტის მიზანია ახალგაზრდების ინფორმირების გაუმჯობესება და უნარების განვითარების გზით, საარჩევნო პროცესებით დაინტერესებისა და ჩართულობის გაზრდა.<br><br>იგეგმება ტრენინგები მარნეულის მუნიციპალიტეტში, ვორქშოპები და ბევრი საინტერესო აქტივობა.<br>პროექტის ქვე-მიზნებია:<br><br>• ახალგაზრდების გაძლიერებას და ცნობიერების ამაღლებას ადგილობრივი თვითმართველობის არჩევნებთან დაკავშირებით;<br>• ახალგაზრდებში საარჩევნო პროცესთან დაკავშირებული ცოდნის მიწოდება;<br>• ცრუ ინფორმაციის ე.წ. Fakenews-ების ამოცნობის უნარები;<br>• საარჩევნო პროგრამების წაკითხვისა და ანალიზის უნარები;<br>• პრობლემების იდენტიფიცირებისა და არგუმენტირების უნარები;<br>• ადვიკატირებისა და აქტივიზმის გაცნობა და უნარების გაუმჯობესება;<br>• საარჩევნო პროცესებში ახალგაზრდების ჩართულობა;<br>• საარჩევნო პროცესებით დაინტერესების გაზრდა;<br>• პრობლემების ძიებისა და გადაწყვეტის უნარების გაუმჯობესება;<br>• ჰიბრიდული ომთან გამკლავებისათვის აუცულებელი უნარების გამომუშავება;<br>• პოლიტიკოსების ცნობადობის გაზრდა;ახალგაზრდებში პოლიტიკოსების მიმართ ნდობისა და კონსტრუქციული დამოკიდებულების ჩამოყალიბება;<br>• კონსტრუქციული კრიტიკის უნარების გამომუშავება;<br>• საჯარო გამოსვლის და დებატების უნარ-ჩვევების განვითარება.</p><p>პროექტი მოიცავს სამ ეტაპს:<br><br>ეტაპი 1: ახალგაზრდებთან შეხვედრები და ტრენინგების ჩატარება<br>ეტაპი 2: ვორქშოპები პრაქტიკული უნარების გამომუშავებისათვის<br>ეტაპი 3: პრობლების ადვოკატირება და საარჩევნო პროცესში ჩართვა<br>პროექტის განხორციელების ადგილი: მარნეულის მუნიციპალიტეტი, ქვემო ქართლის რეგიონი.</p><p>პროექტის განხორციელების პერიოდი - 5 თვე; 2021 წლის ივნისი - ოქტომბერი<br><br>პროგრამის გავლის შემდეგ მონაწილეები მიიღებენ სერტიფიკატს.&nbsp;</p><p>დამატებითი ინფორმაციისთვის იხილეთ</p><p>https://jobs.ge/ge/?view=jobs&amp;id=304210</p><p>&nbsp;</p>\"}', '{\"en\": \"მარნეული\", \"ka\": \"მარნეული\"}', NULL, NULL, '555579041', '2021-05-23', '2021-06-11', '2021-06-10', 81, NULL, '233__2021-06-1005:34:39.png', NULL, NULL, NULL, 'https://jobs.ge/ge/?view=jobs&id=304210', '2021-06-10 05:30:23', '2021-06-10 05:35:23', 'https://jobs.ge/ge/?view=jobs&id=304210', NULL, 1, 0, 'psdcgeorgia@gmail.com', 19, 29, 0, NULL, NULL, 0, NULL, 0);
INSERT INTO `opportunities` (`id`, `name`, `description`, `address`, `latitude`, `longitude`, `phone`, `start_date`, `end_date`, `schedule_date`, `company_id`, `user_id`, `image`, `order`, `fb_page`, `linkedin_page`, `web_page`, `created_at`, `updated_at`, `application_url`, `file`, `query_id`, `query_sent`, `email`, `min_age`, `max_age`, `is_virtual`, `vitual_link`, `live_translation_link`, `is_draft`, `draft_token`, `inactive`) VALUES
(234, '{\"en\": null, \"ka\": \"თანასწორობის ჰაკათონი\"}', '{\"en\": null, \"ka\": \"<p>ევროპის საბჭოს ოფისი საქართველოში და ფორსეტი 18-20 ივნისს თანასწორობის ჰაკათონზე გეპატიჟებით!</p><p>Ჰაკათონში მონაწილეობა უფასოა და შეუძლია ნებისმიერ დაინტერესებულ სტატისტიკოსს, გრაფიკულ დიზაინერს, დეველოპერს, კომუნიკაციის სპეციალისტს, მკვლევარს, მონაცემებითა და თანასწორობის საკითხებით დაინტერესებულ ადამიანს.</p><p>თანასწორობის ჰაკათონის მიზანია, აამაღლოს საზოგადოების ცნობიერება დისკრიმინაციული პრაქტიკისა და მისი უარყოფითი გავლენის შესახებ, მონაცემებზე დაფუძნებული ციფრული პროდუქტებით.</p><p>ღონისძიების ფარგლებში, 2-6 ადამიანისგან შექმნილი გუნდები მენტორებთან ერთად იმუშავებენ ისეთი ინოვაციური ინსტრუმენტების შექმნაზე, რომლებიც დისკრიმინაციის აღმოფხვრისა და თანასწორობის მიღწევისკენ იქნება მიმართული. გამარჯვებული გუნდ(ებ)ისთვის საპრიზო ფონდი 2100 ევროა.</p><p>ჰაკათონის თვე, უშუალოდ მთავარ ღონისძიებამდე, დატვირთული იქნება სხვადასხვა ტრენინგითა და ვორკშოპით მონაცემთა ვიზუალიზაციისა და თანასწორობის თემატიკაზე. ტრენინგებში მონაწილეობის მსურველებმა ინფორმაციისთვის თვალი ადევნეთ ForSet-ის ფეისბუქის გვერდს.</p><p>ჰაკათონის ფარგლებში შეიქმნება ისეთი პროდუქტები, როგორებიცაა:<br>- ინტერაქტიული ვიზუალიზაცია;<br>- ინფოგრაფიკების სერია;<br>- მობილური ან ვებ თამაში;<br>- ქვიზი;<br>- მობილური ან ვებაპლიკაცია;<br>- ანიმაციური ვიდეო;<br>- სოციალური ექსპერიმენტი;<br>- სხვ.</p><p>Ჰაკათონში მონაწილეობის მისაღებად აუცილებელია სარეგისტრაციო ფორმის შევსება 11 ივნისამდე: <a href=\\\"https://forms.gle/ZqvM2wYHK7mJi5W89?fbclid=IwAR0vFtXkG6kLSMMcr-GUJBo-f_oU8GSiyjW4sKNx1nPZOUUooIPc7DHepbg\\\">https://forms.gle/ZqvM2wYHK7mJi5W89</a><br>მონაწილეები შეირჩევიან შევსებული აპლიკაციების საფუძველზე.</p><p>ჰაკათონი ფიზიკურ სივრცეში გაიმართება თუ ვირტუალურში, დამოკიდებულია იმ დროისთვის არსებულ ეპიდემიოლოგიურ ვითარებაზე. შესაბამისად, ამის შესახებ გადაწყვეტილება მოგვიანებით გახდება ცნობილი.</p><p>Ჰაკათონი ორგანიზებულია ევროპის საბჭოს საქართველოს ოფისისა და ფორსეტის მიერ, საქართველოს ინოვაციებისა და ტექნოლოგიების სააგენტოსა და News.On.ge-ისთან პარტნიორობით.</p>\"}', '{\"en\": \"თბილისი\", \"ka\": \"თბილისი\"}', NULL, NULL, NULL, '2021-06-02', '2021-06-11', '2021-06-10', 81, NULL, '234__2021-06-1005:42:13.png', NULL, NULL, NULL, NULL, '2021-06-10 05:38:46', '2021-06-10 05:42:14', 'https://forms.gle/ZqvM2wYHK7mJi5W89', NULL, 1, 0, 'info@forset.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(235, '{\"en\": null, \"ka\": \"გამოწვევები ეთნიკური, რელიგიური, სექსუალური უმცირესოსებისა და შშმ პირების უფლებების ჭრილში\"}', '{\"en\": null, \"ka\": \"<p>თანასწორობის ჰაკათონის ფარგლებში გიწვევთ რიგით მესამე ვებინარზე: \\\"რა გამოწვევებია საქართველოში ეთნიკური, რელიგიური, სექსუალური უმცირესობებისა და შშმ პირების უფლებების ჭრილში?\\\"</p><p>ვებინარზე მიმოვიხილავთ ეთნიკური, რელიგიური, სექსუალური უმცირესობებისა და შშმ პირების უფლებებს საქართველოში და ვისაუბრებთ იმ გამოწვევებზე, რაც თითოეული ჯგუფის წინაშე დგას.</p><p>ვებინარი საინტერესო იქნება ყველა ადამიანისთვის, ვინც თანასწორობის და მრავალფეროვნების თემით არის დაინტერესებული, თუმცა განსაკუთრებით ღირებული იქნება მათთვის, ვინც თანასწორობის ჰაკათონში აპირებს მონაწილეობის მიღებას.&nbsp;</p><p>ვებინარზე რეგისტრაციისთვის მიჰყევით ბმულს: <a href=\\\"https://zoom.us/meeting/register/tJMvd--hqDMiHddsvLws39NW8DgHklXGrHuC?fbclid=IwAR3LwRDO-UkcKlv9m0g6bwlgz_Rz3_IlLP9ekIZ6Jg2oCEglblh-IvZuEa8\\\">https://zoom.us/.../tJMvd--hqDMiHddsvLws39NW8DgHklXGrHuC</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-08', '2021-06-11', '2021-06-10', 81, NULL, '235__2021-06-1005:46:06.png', NULL, NULL, NULL, NULL, '2021-06-10 05:43:31', '2021-06-10 05:46:06', 'https://zoom.us/.../tJMvd--hqDMiHddsvLws39NW8DgHklXGrHuC', NULL, 1, 0, 'info@forset.ge', NULL, NULL, 1, 'https://zoom.us/.../tJMvd--hqDMiHddsvLws39NW8DgHklXGrHuC', NULL, 0, NULL, 0),
(236, '{\"en\": null, \"ka\": \"პრეზენტაცია\"}', '{\"en\": null, \"ka\": \"<p>ბიტისი გიწვევთ ახალგაზრდული შესაძლებლობების პრეზენტაციაზე, 12 ივნისს ახალგაზრდობის სააგენტოში.<br>&nbsp;</p><p>კოვიდრეგულაციებიდან გამომდინარე უსაფრთხოების დაცვის მიზნით, პრეზენტაციაზე ყველა წესი დაცული იქნება.</p><p>&nbsp;</p><p>ღონისძიებაზე დასასწრებად აუცილებელია სააპლიაკციო ფორმის შევსება, მიჰყევით შემდეგ ბმულს: <a href=\\\"https://forms.gle/SukfXS4EaZHzNahC6?fbclid=IwAR1AXzsofAjD6Ch97m0uYTDOg0eUWYQqP3fzSEKUZmNjB0721HXRM3Zxj30\\\">https://forms.gle/SukfXS4EaZHzNahC6</a></p><p>&nbsp;</p><p>სამუშაო ენა - ქართული<br>&nbsp;</p><p>&nbsp;</p><p>პრეზენტაციის მიზანი - ფართო აუდიტორიისთვის ბიტისის შესაძლებლობების გაზიარება. გარდა ამისა ყველა მონაწილის კითხვას გაეცემა დამაკმაყოფილებელი პასუხი.<br>ბიტისის გუნდის წევრები ისაუბრებენ ისეთ მნიშვნელოვან თემებზე, როგორიცაა:<br>რა სახის პროექტებს გვთავაზობს ორგანიზაცია</p><p>როგორ მივიღოთ მონაწილეობა ბიტისის მიერ შემოთავაზებულ პროექტებში</p><p>რა კრიტერიუმებს უნდა აკმაყოფილებდეს მონაწილე</p><p>კოვიდიდან გამომდინარე რა სირთულეებს შეიძლება შევხვდეთ საერთაშორისო პროექტებში მონაწილეობის დროს<br>&nbsp;</p><p>რომელ ქვეყნებში არის შესაძლებელი მოხალისეობა/ ახალგაზრდულ პროექტებში მონაწილეობა</p><p>რა საქმიანობას ანხორციელებენ მონაწილეები საზღვარგარეთ</p><p>ამ და კიდევ სხვა საინტერესო ინფორმაციისთვის, გვეწვიეთ 12 ივნისს, შემდეგ მისამართზე - ვაჟა-ფშაველას გამზირი 76ბ.</p><p>&nbsp;</p>\"}', '{\"en\": \"ვაჟა-ფშაველას 76ბ\", \"ka\": \"ვაჟა-ფშაველას 76ბ\"}', NULL, NULL, NULL, '2021-06-09', '2021-06-11', '2021-06-10', 81, NULL, '236__2021-06-1005:56:14.png', NULL, NULL, NULL, NULL, '2021-06-10 05:51:49', '2021-06-10 05:56:15', 'https://forms.gle/SukfXS4EaZHzNahC6', NULL, 1, 0, 'bitis.ge@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(237, '{\"en\": null, \"ka\": \"ბათუმის უშუს საერთაშორისო ტურნირზე მოხალისეთა სარეგისტრაციო ფორმა\"}', '{\"en\": null, \"ka\": \"<p>ბათუმის უშუს საერთაშორისო ტურნირი ყოველწლიურად 10-მდე ქვეყნის უშუისტთა ეროვნული ნაკრების გუნდებს მასპინძლობს, 2021 წელს აღნიშნული ტურნირი დაიგეგმა 6-12 სექტემბერს, სადაც ბათუმში მცხოვრებ ახალგაზრდებს ეძლევათ საშუალება მოხალისეთა გუნდში აღმოჩნდნენ და ღირსეული მასპინძლობა გაუწიონ ტურნირის მონაწილეებს.<br>მოხალისეთა შერჩევა მოიცავს 2 ეტაპს:<br>1) რეგისტრაცია ( აპლიკაციის სრულყოფილად შევსება და გამოგზავნა)<br>2) შერჩეულ აპლიკანტებთან გასაუბრება<br>აუცილებელი კრიტერიუმები:<br>საცხოვრებელი ადგილი: ბათუმი<br>მოხალისე უნდა იყოს მობილიზებული, კომუნიკაბელური, პასუხისმგებლიანი, პუნქტუალური . აუცილებელია იცოდეს ინგლისური, სასურველია რუსულიც.<br>ტურნირის ბოლოს მოხალისეებს გადაეცემათ სერთიფიკატები.<br><br>საკონტაქტო პირები:<br>1) მოხალისეთა კოორდინატორი_მანანა საური&nbsp;<br>577178099; <a href=\\\"mailto:saurim92@gmail.com\\\">saurim92@gmail.com</a></p>\"}', '{\"en\": \"ბათუმი\", \"ka\": \"ბათუმი\"}', NULL, NULL, '577178099', '2021-06-09', '2021-06-13', '2021-06-10', 81, NULL, '237__2021-06-1006:03:22.png', NULL, NULL, NULL, NULL, '2021-06-10 06:00:01', '2021-06-10 06:03:22', 'https://docs.google.com/forms/d/1Ocn4MetSq4uDiLvgk916zh60Kfh7tw9g6XvSnAMxvHc/viewform?fbclid=IwAR2UE1_Kpmh2QJTfLr8ywWip4i0ZJq82axAcAAMt42aQSgyJaNXd-phJdNY&edit_requested=true', NULL, 1, 0, 'saurim92@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(238, '{\"en\": null, \"ka\": \"დებატები ნაფიც მსაჯულთა სასამართლოს თემაზე\"}', '{\"en\": null, \"ka\": \"<p>საქართველოს პროკურატურა სტუდენტურ ორგანიზაცია \\\"ენკომთან\\\" თანამშრომლობით პროექტს - \\\"დებატები ნაფიც მსაჯულთა სასამართლოს თემაზე“ განახორციელებს, რომლის მიზანს, იურიდიული ფაკულტეტის სტუდენტებში თეორიული და პრაქტიკული კომპონენტების ინკორპორაცია და ნაფიც მსაჯულთა ინსტიტუტის მიმართ ცნობიერების ამაღლება წარმოადგენს. პროექტი სამი დღე გაგრძელდება, რა დროსაც, მონაწილეები სიღრმისეულ სწავლებას გაივლიან.</p><p>პირველი დღე თეორიულ ნაწილს და ტრენინგებს დაეთმობა, რომლის ფარგლებშიც საქართველოს პროკურატურის წარმომადგენელი ისეთ საკითხებს განიხილავს, როგორიცაა:</p><p>• ნაფიც მსაჯულთა ინსტიტუტის წარმოშობა;</p><p>• ნაფიც მსაჯულთა შერჩევის პროცედურა;</p><p>• შესავალი და დასკვნითი სიტყვების მთავარი ასპექტები და მისი სწორად ჩამოყალიბების წესები;</p><p>• შედეგზე ორიენტირებული პირდაპირი და ჯვარედინი დაკითხვის ჩასატარებელი უნარები.</p><p>\\\"ენკომის\\\" წარმომადგენელი კი, ტრენინგს დებატებში გაუძღვება, რომელიც კარლ პოპერის ფორმატით წარიმართება (ღირებულებების დებატები). შესაბამისად, ტრენერი მონაწილეთა ინფორმირებას სწორედ აღნიშნული ფორმატის შესახებ მოახდენს. ამასთან, მონაწილეებს ეგზავნებათ კაზუსი, რომლის საფუძველზეც მათ ერთის მხრივ სამართლებრივი ნიუანსების, ხოლო მეორეს მხრივ დებატების ტექნიკების სწორი სინთეზი უნდა მოახდინონ.</p><p>მეორე დღეს, ქართული სერიალის, ,,ნაფიცი მსაჯული“ ჩვენება მოხდება, რომელიც 3 ნაწილისგან შედგება. ყოველი ნაწილის დასრულების შემდეგ, სერიალთან დაკავშირებით დისკუსია შედგება, რომლის წარმართვაში მონაწილეობას პროკურატურისა და \\\"ენკომის\\\" წარმომადგენლები მიიღებენ.</p><p>მესამე დღე მთლიანად დებატებს დაეთმობა, სადაც ნაფიცი მსაჯულები დასკვნითი სიტყვით წარდგებიან. საქართველოს პროკურატურის წარმომადგენელი მონაწილეთა სამართლებრივ შეფასებას მოახდენს, ხოლო \\\"ენკომის\\\" წარმომადგენელი - დებატების ჭრილში შეაფასებს, თუ რამდენად დაიცვეს მხარეებმა შესაბამისი სტრუქტურა და არგუმენტაცია.</p><p>პროექტის დასასრულს, ყველა მონაწილე მონაწილეობის დამადასტურებელ სერტიფიკატს მიიღებს.</p><p>პროექტში მონაწილეობით დაინტერესებულმა პირებმა, აპლიკაციები 14 ივნისის ჩათვლით მითითებულ ბმულზე უნდა გაგზავნონ:&nbsp;</p><p><a href=\\\"https://cutt.ly/dnQrulL?fbclid=IwAR04YScy0qLi5o6miQIQ_QoC1lINiiqVGqNlEhPgkl9iXQsOoicvrvKBAs8\\\">https://cutt.ly/dnQrulL</a></p><p>.</p><p>დამატებითი ინფორმაციის მიღება კი, შესაძლებელია შემდეგ ელექტრონულ ფოსტაზე - ltdencom@gmail.com და ტელეფონის ნომრებზე: 568 333 520 - ლანა, 574 020 407 - მარიამი.</p>\"}', '{\"en\": \"პროკურატურა\", \"ka\": \"პროკურატურა\"}', NULL, NULL, '574 020 407', '2021-06-09', '2021-06-14', '2021-06-10', 81, NULL, '238__2021-06-1006:07:30.png', NULL, NULL, NULL, NULL, '2021-06-10 06:04:35', '2021-06-10 06:07:30', 'https://cutt.ly/dnQrulL.', NULL, 1, 0, 'ltdencom@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
