(240, '{\"en\": null, \"ka\": \"📣ტრენინგი📣  ,,სოციალური მედია მარკეტინგი თანამედროვე ბიზნესში\\\"\"}', '{\"en\": null, \"ka\": \"<p>თუ გსურს გახდე სოციალური მედიის მენეჯერი, ან ხარ დამწყები გაყიდვების/ბიზნესის სფეროში, მაშინ ეს კურსი შენთვისაა !</p><p>დარეგისტრირდი 15 ივნისამდე და გაიგე:</p><p>• როგორ შექმნა სოციალურ ქსელში ბიზნეს გვერდი;</p><p>• როგორ მართო ბიზნეს მენეჯერი;</p><p>• როგორ შექმნა სწორი კონტენტი;</p><p>• როგორ მართო Ads. Manager;</p><p>ტრენინგის მეოთხე დღე დაეთმობა ვორქშოფს, სადაც მიიღებთ რეკომენდაციებს/პრაქტიკულ დახმარებას თქვენთვის საინტერესო საკითხებზე.</p><p>კურსის გავლის შედეგად შეძლებ გაერკვიო თანამედროვე ბაზრის მოთხოვნებში, მოახდინო საქმიანობის პოპულარიზაცია და გაზარდო გაყიდვები სწორი რეკლამით</p><p>ორგანიზაციიდან 2 წარმომადგენლის შემთხვევაში მოქმედებს 20%-იანი ფასდაკლება.</p><p>ტრენერის შესახებ:</p><p>ბაჩო შავაძე- აქვს მარკეტინგის/პიარის მენეჯერად მუშაობის 5 წლიანი გამოცდილება.</p><p>3 წლის მანძილზე იყო სამშენებლო კომპანია ,,გუმბათი ჯგუფის“-ს მარკეტინგის მენეჯერი;</p><p>ასევე, იგი არის დასაქმების სააგენტოს ,,რეკრუიტერის“ დამფუძვნებელი.</p><p>თარიღი- 19-20-26-27 ივნისი ( 4დღე-16 საათი)</p><p>ლოკაცია-ქ.ბათუმი,co-working space, ს.ზუბალაშვილის #13</p><p>საფასური: 150 Gel,</p><p>რომელიც უნდა გადაიხადოთ რეგისტარციის დროს შემდეგ რეკვიზიტებზე:</p><p>დასახელება - ,,ა(ა)იპ ახალგაზრდები საზოგადოებრივი ინტერესებისთვის\\\"</p><p>დანიშნულება - ტრენინგის საფასური</p><p>საქართველოს ბანკი- GE69BG0000000913725600GEL</p><p>რეგისტრაცია:</p><p><a href=\\\"https://forms.gle/ZiwLFZ8nDp7qYhBu9?fbclid=IwAR1HucPeIzq7M_a1f1Gh1o6AUBN6Ii_sK_qgEqUxONuKB5qGFsBGPgs0A4E\\\">https://forms.gle/ZiwLFZ8nDp7qYhBu9</a></p><p>კითხვების შემთხვევაში მოგვწერეთ ან დაგვიკავშირდით:</p><p>577 107 985</p>\"}', '{\"en\": \"ქ. ბათუმი , ს. ზუბალაშვილის #11\", \"ka\": \"ქ. ბათუმი , ს. ზუბალაშვილის #11\"}', '41.64798532276984', '41.644047517717354', '591057850', '2021-06-05', '2021-06-17', '2021-06-14', 99, NULL, '240__2021-06-1409:41:58.png', NULL, 'https://www.facebook.com/YouthForPublicIntere