(246, '{\"en\": null, \"ka\": \"ტრენინგ-კურსი: \\\"იდეიდან მეწარმეობამდე\\\"\"}', '{\"en\": null, \"ka\": \"<p>”იდეიდან-მეწარმეობამდე”</p><p>“ახალგაზრდები ცვლილებებისათვის” ორგანიზებით, 29 ივნისიდან 6 ივლისის ჩათვლით, ჩატარდება ვებინარები მეწარმეობის თემაზე.</p><p>პროექტი განკუთვნილია:</p><p>დამწყები სტარტაპერებისთვის</p><p>დაინტერესებული პირებისთვის რომლებსაც სურთ საკუთარი იდეის რეალობად ქცევა.</p><p>შეხვედრებს გაუძღვებიან გამოცდილი მეწარმეები და დარგის სპეციალისტები</p><p>პროექტის ფარგლებში შეირჩევა 30 საუკეთესო აპლიკანტი</p><p>მონაწილეობის მსურველებმა შეავსეთ ქვემოთ მოცემული სააპლიკაციო ფორმა</p><p><a href=\\\"https://forms.gle/JHFMz6tLG8wDcUfX8?fbclid=IwAR3TsxpwPyCvjoccww0eiz3MfoSKV_zfNZUgUtaM1s1ZvmTOgPswybt96b4\\\">https://forms.gle/JHFMz6tLG8wDcUfX8</a></p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-26', '2021-07-09', '2021-06-15', 143, NULL, '246__2021-06-1519:37:22.png', NULL, NULL, NULL, NULL, '2021-06-15 19:32:16', '2021-07-09 09:22:19', 'https://forms.gle/JHFMz6tLG8wDcUfX8', NULL, 1, 0, 'changeyouthfor18@gmail.com', NULL, NULL, 1, 'https://forms.gle/JHFMz6tLG8wDcUfX8', NULL, 0, NULL, 0),
