(248, '{\"en\": null, \"ka\": \"ეკო აქტივიზმის სასწავლო კურსი/ნაკადი II\"}', '{\"en\": null, \"ka\": \"<p>იწყება მიღება ეკო აქტივიზმის სასწავლო კურსის მეორე ნაკადზე. 🎉</p><p>✔️მონაწილეობის მიღება შეუძლია ნებისმიერ დაინტერესებულ პირს.</p><p>🟢კურსზე დამსწრეთა რაოდენობა განისაზღვრება 30 მონაწილით.</p><p>🔵პროექტის ხანგრძლივობა: 1 თვე</p><p>🟣მონაწილეობის მიღება უფასოა 💸</p><p>🟡კურსის წარმატებით დასრულების შემთხვევაში გაიცემა ორენოვანი სერტიფიკატი.</p><p>🟤მონაწილეებს შესაძლებლობა ექნებათ 1 თვის მანძილზე, კვირაში რამდენიმეჯერ დაესწრონ ტრენინგ-სემინარებს გარემოსდაცვით და ეკოაქტივიზმის თემებზე.</p><p>⚡️შეხვედრებს გაუძღვებიან სხვადასხვა გარემოსდაცვითი ორგანიზაციების წარმომადგენლები და ეკოაქტივისტები.</p><p>🔘მონაწილეთა შერჩევა მოხდება სააპლიკაციო ფორმის საფუძველზე.</p><p>✔️მონაწილეობის მსურველებმა შეავსეთ ქვემოთ მოცემული სააპლიკაციო ფორმა:👇</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-30', '2021-07-30', '2021-06-16', 143, NULL, '248__2021-06-1610:02:06.png', NULL, NULL, NULL, NULL, '2021-06-16 09:54:26', '2021-07-09 09:21:55', 'https://forms.gle/xAvfHfEJ6BEiEPi87', NULL, 1, 0, 'Changeyouthfor18@gmail.com', NULL, NULL, 1, 'https://forms.gle/xAvfHfEJ6BEiEPi87', NULL, 0, NULL, 0),
