(250, '{\"en\": null, \"ka\": \"სოციალური მეწარმეობის საგრანტო კონკურსი!\"}', '{\"en\": null, \"ka\": \"<p>სოციალური მეწარმეობის საგრანტო კონკურსი!</p><p>კონკურსის მიზანია: საქართველოს მასშტაბით მხარი დაუჭიროს მოქმედ სოციალურ საწარმოების საქმიანობის გაფართოებას და განვითარებას, რომლებსაც უკვე აქვთ ხელშესახები სოციალური გავლენა და ეკონომიკური შემოსავლები.</p><p>კონკურსში ასევე დაიშვება კოვიდ (COVID-19) პანდემიით გამოწვეული ახალ რეალობასთან გამკლავების და კრიზისის დაძლევის მიზნით შემოსული განაცხადები.</p><p>სრული ინფორმაცია იხილეთ: <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3wyyEoJ%3Ffbclid%3DIwAR3oPVyBv5KOJU8fZruC22DanhX4kPjrJjz4WlGJgwJ7HItaxwtA6e9j6vw&amp;h=AT1yRNJGoHARDrbjMOeli6ptAytR1GxFHXwzEhv8x0VoEk7aRzyNN2Fntpua05uaIgFFXTQ1-IhSZEIk3a6aeVF0phmzuUz7amMpA5o7GCJDqSZjRn_aS7xpPlbRQ_AuBpBq70vsmA&amp;__tn__=-UK-R&amp;c[0]=AT3kEUivOR3_q5knrKFXmD0_E2PT9YH_w9hKXYTw_xt97iV725fBAh1Y84ADkz6sKHU6m06mGGarzHMhk3hVac_AubyV_5yJr1smj06Dzdobfizw4M6hJfJAwJgvGvtR2BbD3TDx243Aa3840ephnZGQV0Z2TDh2SaUEWxE-ihuiBKI\\\">https://bit.ly/3wyyEoJ</a></p><p>დაინტერსებული პირებისთვის 21 ივნისს 11 საათზე ტარდება სემინარი და საკონსულტაციო შეხვედრა!</p><p>11:00 – 11:45 სოციალური მეწარმეობა და სოციალური გავლენა;</p><p>12:00 – 12:45 სოციალური საწარმოს განვითარების და გაფართოების ეტაპები;</p><p>13:00 – 14:00 საკონსულტაციო შეხვედრა საგრანტო კონკურსის ტექნიკურ და შინაარსობრივ საკითხებზე;</p><p>სემინარსა და საკონსულტაცო შეხვედრაზე დასასწრებად გთხოვთ რეგისტრაცია გაიარეთ შემდეგ მისამართზე: <a href=\\\"https://bit.ly/2TwLlBU?fbclid=IwAR2H987Mh7Nq_3XJJLYdlXXsw7WF-WCNfLyhjEcIQPvdqPE_cZjdb7qHxT4\\\">https://bit.ly/2TwLlBU</a></p><p>კონკურსი ცხადდება პროექტ \\\"სოციალური მეწარმეობის განვითარება მდგრადი და ინკლუზიური საზოგადოებისთვის\\\" ფარგლებში.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-16', '2021-06-21', '2021-06-17', 81, NULL, '250__2021-06-1710:47:37.png', NULL, NULL, NULL, 'http://www.csrdg.ge/', '2021-06-17 10:44:03', '2021-06-17 10:47:37', 'https://bit.ly/2TwLlBU', NULL, 1, 0, 'office@csrdg.ge', NULL, NULL, 1, 'https://bit.ly/2TwLlBU', NULL, 0, NULL, 0),
(251, '{\"en\": null, \"ka\": \"მრავალფეროვნების სკოლაში რეგისტრაცია დაიწყო\"}', '{\"en\": null, \"ka\": \"<p>მრავალფეროვნების სკოლაში განაცხადების მიღება დაიწყო!</p><p>თუ შენ:</p><p>ხარ 18-დან 26 წლამდე;</p><p>გინდა იყო აქტიური მოქალაქე;</p><p>გსურს პიროვნული განვითარება;</p><p>გინდა იყო ცვლილებების ინიციატორი შენს თემში, სოფელსა თუ ქალაქში;</p><p>გსურს დაგეგმო და განახორციელო საკუთარი თემის საჭიროებებზე მორგებული სოციალური პროექტი;</p><p>მაშინ ეს პროგრამა შენთვისაა.</p><p>არ გამოტოვო შანსი, შემოგვიერთდი მრავალფეროვნების სკოლაში და ჩაერთე აქტიურობის თავგადასავლებში!</p><p>განაცხადების გამოგზავნა შეგიძლიათ 2021 წლის 30 ივნისის ჩათვლით.</p><p>დამატებითი ინფორმაციისთვის ეწვიეთ მრავალფეროვნების სკოლის ვებგვერდს: <a href=\\\"https://diversityschool.webnode.com/?fbclid=IwAR06ELaJHZ9xW4EVVZe36pqquiM0MZ61bOViHv2h7JF3wzT62mu-ZJv1_E0\\\">https://diversityschool.webnode.com/</a></p>\"}', '{\"en\": \"სიღნაღი\", \"ka\": \"სიღნაღი\"}', NULL, NULL, NULL, '2021-06-16', '2021-06-30', '2021-06-17', 81, NULL, '251__2021-06-1710:59:00.png', NULL, NULL, NULL, NULL, '2021-06-17 10:52:57', '2021-06-17 10:59:00', 'https://diversityschool.webnode.com/', NULL, 1, 0, 'irisgroupmanagingdiversity@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(252, '{\"en\": null, \"ka\": \"ჟურნალისტიკის სკოლა\"}', '{\"en\": null, \"ka\": \"<p>🎥 ,,გზა მომავლისკენ\\\" სრულიად უფასოდ გთავაზობთ ყველაზე მასშტაბურ პროექტს</p><p>🎙️ ჟურნალისტიკის სკოლა 🎙️</p><p>👉 პროექტი, რომელსაც ძალიან დიდხანს ელოდა თითოეული თქვენგანი და აი, დადგა ეს დღეც.</p><p>➡️პროექტის ფარგლებში მონაწილეები გაივლიან შეხვედრებს ყველა იმ საჭირო თემაზე, რომელიც სჭირდება ჟურნალისტის პროფესიას. ასევე იქნება პრაქტიკული ნაწილიც, სადაც შესაძლებლობა ექნებათ მოიპოვონ ინფორმაცია, მოამზადონ სტატიები, იმუშაონ ბლოგზე, მოამზადონ ინტერვიუ, რეპორტაჟი და ა.შ</p><p>🎤 შეხვედრებს გაუძღვებიან პროფესიონალი ჟურნალისტები.</p><p>📃 პროექტის დასრულების შემდეგ გაიცემა მონაწილეობის დამადასტურებელი სერტიფიკატი, ასევე გამოვლინდებიან საუკეთესო მონაწილეები.</p><p>დეტალური ინფორმაციისთვის და აგრეთვე&nbsp; რეგისტრაციის გასავლელად გადადით ბმულზე:</p><p>🖇<a href=\\\"http://shorturl.at/jtuvG\\\">shorturl.at/jtuvG</a></p><p>📲&nbsp; დამატებითი ინფორმაციისთვის დაგვიკავშირდით:</p><p>📨&nbsp; Gmomavlisken@gmail.com</p><p>📞 598 54 35 37</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-25', '2021-07-25', '2021-06-17', 76, NULL, '252__2021-06-1713:00:39.png', NULL, NULL, NULL, NULL, '2021-06-17 12:58:14', '2021-06-17 13:01:29', 'shorturl.at/jtuvG', NULL, 1, 0, NULL, 14, 24, 0, NULL, NULL, 1, NULL, 0),
(253, '{\"en\": null, \"ka\": \"ლიდერთა გენდერული თანასწორობის სკოლა\"}', '{\"en\": null, \"ka\": \"<ul><li>ხარ 18-23 წლამდე აქტიური, მოტივირებული სტუდენტი ?</li><li>გსურს განივითარო ლიდერული უნარ-ჩვევები?</li><li>ფიქრობ, რომ გენდერული თანასწორობა მნიშვნელოვანი ღირებულებაა?</li><li>ამჩნევ გენდერულ უთანასწორობას საზოგადოებაში?</li><li>გსურს შეცვალო არსებული რეალობა უკეთესობისკენ?</li></ul><p>მაშინ ეს პროექტი შენთვისაა! შემოგვიერთდი და გახდი გენდერული თანასწორობის ელჩი შენს უნივერსიტეტში.</p><p>შეავსე მითითებული აპლიკაცია, გამოგვიგზავნე მოკლე ესსე და ვიდეო-რგოლი თემაზე ,,რატომ არის გენდერული თანასწორობა მნიშვნელოვანი”.&nbsp;</p><p>Საუკეთესო ესსესა და ვიდეო-რგოლის ავტორი თითოეული უნივერსიტეტიდან მიიღებს ერთჯერად სტიპენდიას 500 ლარის ოდენობით და ავტომატურად ჩაერთვება პროექტში, დამატებით 4 მონაწილე კი გასაუბრების საფუძველზე მოიპოვებს საზაფხულო სკოლის საგზურს.&nbsp;</p><p>Ჩვენთან ერთად თქვენ:</p><ul><li>გაივლით თეორიული და პრაქტიკული სწავლების კურსს 5-11 აგვისტოს;</li><li>გეყოლებათ, როგორც ადგილობრივი, ასევე საერთაშორისო ტრენერ-ექსპერტები და მენტორები;</li><li>გაიუმჯობესებთ ლიდერულ, სპიკერულ და ორგანიზაციულ უნარებს;</li><li>გაერთიანდებით საერთო იდეების გარშემო და შეძლებთ მოიზიდოთ საერთაშორისო დონორები;</li><li>Მოხვდებით ღია, თავისუფალ, არაფორმალურ გარემოში, სადაც თქვენი იდეების მაქსიმალურად წარმოჩენას შეძლებთ.</li></ul><p>&nbsp;</p><p>მონაწილეობა შეუძლიათ შემდეგი უნივერსიტეტების სტუდენტებს:&nbsp;</p><ul><li>საქართველოს ტექნიკური უნივერსიტეტი;</li><li>თბილისის სახელმწიფო სამედიცინო უნივერსტიტეტი;</li><li>ივანე ჯავახიშვილის სახელობის თბილისის სახელმწიფო უნივერსიტეტი;</li><li>ილიას სახელმწიფო უნივერსიტეტი; საქართველოს ეროვნული უნივერსიტეტი;</li></ul><p>&nbsp;</p><p>თითოეული უნივერსიტეტიდან ჩაერთვება 5 სტუდენტი.</p><p>დეტალური ინფორმაციის მისაღებად გაეცანით საინფორმაციო პაკეტს.</p><p>&nbsp;</p><p>მსურველთა რეგისტრაცია დასრულდება 15 ივლისს 20:00 საათზე</p><p>დაინტერესებულმა პირებმა გთხოვთ შეავსოთ სარეგისტრაციო ფორმა <a href=\\\"https://forms.gle/x3BUxXnHaSuRmnaYA?fbclid=IwAR3wTTs4tGcH1VvDXWskbHxuE9nq6Iq_OO90jRHcE5yPB2Xn3hK97ZqKKhc\\\">https://forms.gle/x3BUxXnHaSuRmnaYA</a> და გამოაგზვანოთ ესე და ვიდეო რგოლი:</p><p>ვიდეორგოლი არ უნდა აღემატებოდეს 3 წუთს</p><p>ესე უნდა შედგებოდეს მაქსიმუმ 500 სიტყვისგან</p><p>საკონტაქტო ინფორმაცია:</p><p>contact@droni.org, მობ 574 27-11-27</p><p>&nbsp;</p><p>Პარტნიორები: Erasmus+ ახალგაზრდებისთვის და ევროპის სოლიდარობის კორპუსი საქართველოში+&nbsp;</p><p><a href=\\\"https://www.facebook.com/hashtag/%E1%83%92%E1%83%94%E1%83%9C%E1%83%93%E1%83%94%E1%83%A0%E1%83%A3%E1%83%9A%E1%83%98%E1%83%97%E1%83%90%E1%83%9C%E1%83%90%E1%83%A1%E1%83%AC%E1%83%9D%E1%83%A0%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1%E1%83%A1%E1%83%99%E1%83%9D%E1%83%9A%E1%83%90?__eep__=6&amp;__cft__[0]=AZWUAXcDdvhxZR8Fvk8RI6FO8E7CS89XEFW3AB-qV7jDb5CvJgpdBvkrb6zTEvOE5VPd8d5gxNakbA63ULAWKypNZlCkx8rHOkwL43mdcp9PPW9BfOYLPvaeDZBGrfechmLRF0aJzvbZe0rKBaoZxyi6eyRHpSfdp244sLjqxcVJA7u2qIbzjdQpJpVVLC0o7tc&amp;__tn__=*NK-R\\\">#გენდერულითანასწორობისსკოლა</a> <a href=\\\"https://www.facebook.com/hashtag/%E1%83%97%E1%83%90%E1%83%9C%E1%83%90%E1%83%A1%E1%83%AC%E1%83%9D%E1%83%A0%E1%83%9D%E1%83%91%E1%83%90?__eep__=6&amp;__cft__[0]=AZWUAXcDdvhxZR8Fvk8RI6FO8E7CS89XEFW3AB-qV7jDb5CvJgpdBvkrb6zTEvOE5VPd8d5gxNakbA63ULAWKypNZlCkx8rHOkwL43mdcp9PPW9BfOYLPvaeDZBGrfechmLRF0aJzvbZe0rKBaoZxyi6eyRHpSfdp244sLjqxcVJA7u2qIbzjdQpJpVVLC0o7tc&amp;__tn__=*NK-R\\\">#თანასწორობა</a></p><p>Პროექტი არის საპილოტე, და მისი წარმატებით განხორციელების შემთხვევაში დაგეგმილია სხვა უნივერსიტეტების ჩართვა.</p>\"}', '{\"en\": \"კოტე მარჯანიშვილი 24, 0102, თბილისი, საქართველო\", \"ka\": \"კოტე მარჯანიშვილი 24, 0102, თბილისი, საქართველო\"}', NULL, NULL, '+99557427112724', '2021-08-05', '2021-08-11', '2021-06-21', 27, NULL, '253__2021-06-2109:38:31.png', NULL, 'https://www.facebook.com/droniorg', NULL, 'https://droni.org/', '2021-06-21 09:22:28', '2021-06-21 09:38:31', 'https://docs.google.com/forms/d/e/1FAIpQLSfITVvKjXetKBTV_47jHTUyceH7-nvFt3O7rz7TCL8JyCPGjw/viewform', NULL, 1, 0, 'contact@droni.org', NULL, N