(256, '{\"en\": null, \"ka\": \"ვებინარი - \\\"ჰიბრიდული ომი - თანამედროვეობის მთავარი გამოწვევა\\\"\"}', '{\"en\": null, \"ka\": \"<p>📣 \\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ვებინარს, თემაზე, <strong>\\\"ჰიბრიდული ომი - თანამედროვეობის მთავარი გამოწვევა\\\"</strong></p><p>🟫 <strong>მომხსენებელი</strong> - რეზი თოფურია</p><p>🟦<strong> მომხსენებლის შესახებ:</strong></p><p>🟤 საერთაშორისო ურთიერთობების ბაკალავრი თავისუფალ უნივერსიტეტში, შორეული აღმოსავლეთის კონცენტრაცია.</p><p>🔵 მაგისტრის ხარისხი - დაზვერვის, უსაფრთხოების და სტრატეგიული კვლევების დარგში გლაზგოუს უნივერსიტეტში (დიდი ბრიტანეთი), დუბლინის უნივერსიტეტსა (ირლანდია) და ჩარლზის უნივერსიტეტში (ჩეხეთი).</p><p>🟤 ამჟამად არის ევროკავშირისა და გაეროს განვითარების პროგრამის (EU-UNDP) მიერ ინიცირებული კლასტერის მმართველი დირექტორი და ეკონომიკური გაუმჯობესების ცენტრის მმართველი პარტნიორი.</p><p>🔵 ამასთანავე, არის მოწვეული ლექტორი თბილისის თავისუფალ უნივერსიტეტსა და საქართველოს უნივერსიტეტში.</p><p>🟫 <strong>პროექტი ორგანიზებულია YFCH -ის მოხალისეთა გუნდის მიერ</strong></p><p>🔵<strong> მოხალისე</strong> - თამარ მეხრიშვილი</p><p>🟤 <strong>პროექტში მონაწილეობა უფასოა.</strong></p><p>🟦 <strong>პროექტში მონაწილეობა შეუძლია ნებისმიერ მსურველს.</strong></p><p>🟫 <strong>დრო და თარიღი </strong>- 24 ივნისი, 21:00 საათი.</p><p>🟦 <strong>პროექტის ბოლოს გაიცემა სერტიფიკატები.</strong></p><p>🟫<strong> მონაწილეობის მსურველებმა შეავსეთ მოცემული ფორმა:</strong> https://tinyurl.com/sk8yavwm</p><p>🟦<strong> აპლიკაციების მიღება შესაძლებელია 23 ივნისის 18:00 საათამდე.</strong></p><p><strong>გისურვებთ წარმატებას!</strong></p>\"}', '{\"en\": \"ტარდება ვირტუალურ სივრცეში\", \"ka\": \"ტარდება ვირტუალურ სივრცეში\"}', NULL, NULL, NULL, '2021-06-24', '2021-06-24', '2021-06-21', 143, NULL, '256__2021-06-2817:30:17.png', NULL, 'https://www.facebook.com/YouthForChangeGeo/', NULL, NULL, '2021-06-21 18:44:05', '2021-06-28 17:30:17', 'https://tinyurl.com/sk8yavwm', NULL, 1, 0, 'changeyouthfor18@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL