(259, '{\"en\": null, \"ka\": \"ახალგაზრდული გაცვლითი პროექტი ესპანეთში\"}', '{\"en\": null, \"ka\": \"<p>🔥 Youth Exchange in Spain 🔥&nbsp;</p><p>🚀 გაცვლითი პროექტი \\\"Now Is Time\\\" - გრანადა, ესპანეთი 🇪🇸&nbsp;</p><p>🟡 თემა: სოციალური მეწარმეობა 💆‍♂️&nbsp;</p><p>📆 თარიღი: სექტემბერი 1-13, 2021&nbsp;</p><p>⚫️ ასაკი: 18-25 🙎‍♂️🙍‍♀️&nbsp;</p><p>🔗 სააპლიკაციო ფორმა: https://cutt.ly/sn0MUJw&nbsp;</p><p>❗️ პროექტის დაწყებამდე 14 დღით ადრე აუცილებლად უნდა იყოთ სრულად ვაქცინირებული, რომ მგზავრობაში არ შეგექმნათ პრობლემა. თუ არ ხართ/ იქნებით ვაქცინირებული, არ შეავსოთ აპლიკაცია 💉🦠&nbsp;</p><p>⏰ დედლაინი: 25/06/2021&nbsp;</p><p>🌐 Info-pack: https://cutt.ly/dn0MW6P&nbsp;</p><p>💸 დაფინანსებულია: მგზავრობა, ცხოვრება, კვება, აქტივობის ხარჯები 💛&nbsp;</p><p>🟡 მგზავრობის ბილეთებს წინასწარ ყიდულობს მონაწილე და პროექტის დასრულების შემდგომ ანაზღაურდება შესამაბისი ლიმიტის ფარგლებში (თუ info-pack-ში სხვანაირად არ არის განსაზღვრული)&nbsp;</p><p>🙏 აპლიკანტებს დაგიკავშირდებით მხოლოდ დადებითი პასუხის შემთხვევაში, დედლაინის გასვლიდან მაქსიმუმ 5 დღეში ✨🌏&nbsp;</p><p>💌 გამოიწერეთ ახალი პროექტები მეილზე: http://bit.ly/34zzlCp&nbsp;</p><p>წარმატებებს გისურვებთ 🌟&nbsp;</p><p>#ErasmusPlus #YouthExchange #Spain #BITISI</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-22', '2021-06-22', '2021-06-22', 134, NULL, '259__2021-06-2209:17:16.png', NULL, NULL, NULL, NULL, '2021-06-22 09:12:01', '2021-06-22 09:18:40', 'https://cutt.ly/sn0MUJw', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
