(261, '{\"en\": null, \"ka\": \"ტრენინგ კურსი  \\\"ადამიანის უფლებათა სწავლება ახალგაზრდულ საქმიანობაში\\\"\"}', '{\"en\": null, \"ka\": \"<p>ტრენინგ კურსი „ადამიანის უფლებათა სწავლება ახალგაზრდულ საქმიანობაში“ ხორციელდება ადამიანის უფლებათა ასოციაციისა და საქართველოს ახალგაზრდულ მუშაკთა ასოციაციის მიერ ევროპის საბჭოს ევროპის ახალაგზრდული ფონდის მხარდაჭერით. ტრენინგი მიზნად ისახავს პრაქტიკოსი ახალგაზრდული მუშაკების კომპეტენციების განვითარებას ახალგაზრდებისთვის ადამიანის უფლებათა სწავლებისა და ახალგაზრდებისთვის ინფორმაციაზე ხელმისაწვდომობის (Youth Information) შესახებ.&nbsp;</p><p>პროექტის ფარგლებში 2021 წლის ივლისში დაგეგმილია 5 დღიანი ტრენინგ-კურსი, რომელშიც მონაწილეობის შესაძლებლობა აქვთ პრაქტიკოს ახალგაზრდულ მუშაკებს. აღნიშნული ტრენინგი აძლევს შესაძლებლობას ახალგაზრდულ მუშაკებს მობილური და ციფრული ახალგაზრდული საქმიანობის მეშვეობით ახალგაზრდებისთვის ადამიანის უფლებათა სწავლებისა და ახალგაზრდებისთვის ინფორმაციაზე ხელმისაწვდომობის ხელშემწყობი პროგრამები და სერვისები განავითარონ.&nbsp;</p><p>ტრენინგის ფარგლებში ახალგაზრდულ მუშაკებს ექნებათ შესაძლებლობა გააანალიზონ ახალგაზრდებთან მათი საქმიანობის შედეგები, პროცესები და გზები თუ როგორ დანერგონ ადამიანის უფლებათა სწავლებისა და ახალაგზრდებისთვის ინფორმაციაზე ხელმისაწვოდომობის სერვისები და პროგრამები.&nbsp;</p><p>პროექტში მონაწილეობას მიიღებს კონკურსის საფუძველზე შერჩეული 25 ახალგაზრდული მუშაკი საქართველოს ნებისმიერი რეგიონიდან (კორონავირუსის უმეცარი გავრცელების თავიდან ასარიდებლად ტრენინგ კურსი ჩატარდება ორ ჯგუფად, რომელშიც მონაწილეობას მიიღებს 12-13 ადამიანი).&nbsp;</p><p>ტრენინგი მიზნად ისახავს პრაქტიკოსი ახალგაზრდული მუშაკების კომპეტენციების განვითარებას ახალგაზრდებისთვის ადამიანის უფლებათა სწავლებისა და ახალგაზრდებისთვის ინფორმაციაზე ხელმისაწვდომობის (Youth Information) შესახებ.&nbsp;</p><p>განხორციელების პერიოდი<i><strong>: &nbsp;</strong></i><strong>I </strong>ჯგუფი<strong>: 15 – 19 </strong>ივლისი<strong>, 2021 </strong>დაბა სურამი <i>(</i>ტრენინგის გახსნა <i>15 </i>ივლისს <i>15:00 </i>საათზე<i>. </i>ტრენინგის დახურვა <i>19 </i>ივლისს <i>13:00 </i>საათზე<i>); </i><strong>II </strong>ჯგუფი<strong>: 20-24 </strong>ივლისი<strong>, 2021 </strong>დაბა სურამი <i>(</i>ტრენინგის გახსნა <i>20 </i>ივლისს <i>15:00 </i>საათზე<i>. </i>ტრენინგის დახურვა <i>24 </i>ივლისს <i>13:00 </i>საათზე<i>). &nbsp;</i></p><p>შერჩევის პროცესი და კრიტერიუმები&nbsp;</p><p>დაინტერესებულმა პირებმა სააპლიკაციო ფორმა უნდა შეავსონ შემდეგ მისამართზე - https://forms.gle/dt7BNxQ48z6wQiHR8&nbsp;</p><p>მონაწილეები შეირჩევიან შევსებული სააპლიკაციო ფორმის მიხედვით.&nbsp;</p><p>აპლიკაციების გამოგზავნის ბოლო ვადაა <strong>2021 </strong>წლის <strong>4 </strong>ივლისი&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": \"სურამის ახალგაზრდული სახლი\", \"ka\": \"სურამის ახალგაზრდული სახლი\"}', NULL, NULL, NULL, '2021-07-15', '2021-07-19', '2021-06-22', 35, NULL, '261__2021-06-2210:29:48.png', NULL, NULL, NULL, NULL, '2021-06-22 10:16:50', '2021-06-22 10:31:05', 'https://forms.gle/dt7BNxQ48z6wQiHR8', NULL, 1, 0, 'hrage.info@gmail.com', 18, 35, 0, NULL, NULL, 0, NULL, 0),
