(263, '{\"en\": null, \"ka\": \"Erasmus+ TC \\\"What\'s the Next?\\\"\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;</p><p>URGENT! &nbsp;<a href=\\\"https://www.facebook.com/hashtag/erasmus?__eep__=6&amp;__cft__[0]=AZXUarlgIUICE7Hp9RnVXWbVFHhJ8G02I1PRqRUvmvwRGeHYwGZT-egWxo4BKt2E9lYITH4vPzn-cFy8YR4OLwHiu76V0oYWpWJG-sZqroBpvWDNVJES0FmWEdfwfzxFC4mwnGRTYfy0nscpAKzzjefzHgq-dwwlgbCmjTuKr6GuZKYsE-qrs6hBcy2W-Uoe8kk&amp;__tn__=*NK-R\\\">#Erasmus</a>+</p><p>ვაკანტური 2 ადგილი!</p><p>Erasmus+ TC \\\"What\'s the Next?\\\"</p><p>თარიღი: 01 - 10 ივლისი, 2021</p><p>ადგილმდებარეობა: Yerevan, Armenia</p><p>მონაწილე ქვეყნები: საქართველო, სლოვაკეთი, ჩეხეთი, პოლონეთი, ხორვატია და სომხეთი</p><p>მონაწილეთა ასაკი: 16დან 24 წლამდე.</p><p>მონაწილეობის საფასური: 15 EUR.</p><p>მსურველებმა გამოგვიგზავნეთ რეზიუმე ელ.ფოსტზე:</p><p>ChangeYouthFor18@gmail.com</p><p>P.S. - სომხეთის ტერიტორიაზე შესასვლელად მონაწილემ უნდა წარადგინოს PCR-ტესტის უარყოფითი პასუხი (არაუმეტეს 72 საათისა)!</p><p>განაცხადების მიღების ბოლო ვადაა- 23 ივნისი, 21:00 სთ</p><p>დავუკავშირდებით მხოლოდ შერჩეულ აპლიკანტებს!</p>\"}', '{\"en\": \"ერევანი,სომხეთი\", \"ka\": \"ერევანი,სომხეთი\"}', NULL, NULL, NULL, '2021-07-01', '2021-07-10', '2021-06-23', 143, NULL, '263__2021-06-2313:16:38.png', NULL, NULL, NULL, NULL, '2021-06-23 12:36:46', '2021-07-09 09:21:18', 'ChangeYouthFor18@gmail.com', NULL, 1, 0, 'ChangeYouthFor18@gmail.com', 16, 24, 0, NULL, NULL, 0, NULL, 0),
(264, '{\"en\": null, \"ka\": \"პოლიტიკის სკოლა\"}', '{\"en\": null, \"ka\": \"<p>სოლიდარობის თემი და სოციალური სამართლიანობის ცენტრი გიწვევთ!&nbsp;</p><p>კრიტიკული პოლიტიკის სკოლა, ჩვენი ხედვით, ნახევრად აკადემიური და პოლიტიკური სივრცეა, რომელიც მიზნად ისახავს სოციალური სამართლიანობის, თანასწორობის და დემოკრატიის საკითხებით დაინტერესებულ ახალგაზრდა აქტივისტებსა და თემის ლიდერებში კრიტიკული ცოდნის გაზიარებას და კოლექტიური მსჯელობისა და საერთო მოქმედების პლატფორმის შექმნას.</p><p>კრიტიკული პოლიტიკის სკოლის მონაწილეები შეიძლება გახდნენ მაღალმთიან აჭარაში (ხულოს, შუახევისა და ქედას მუნიციპალიტეტებში) მოქმედი სამოქალაქო აქტივისტები, თემის ლიდერები და ახალგაზრდები, რომლებიც უკვე მონაწილეობენ, ან აქვთ ინტერესი და მზადყოფნა მონაწილეობა მიიღონ დემოკრატიული, თანასწორი და სოლიდარობის იდეებზე დაფუძნებული საზოგადოების მშენებლობაში.</p><p>მონაწილეობის სურვილის შემთხვევაში გთხოვთ, მიმდინარე წლის 9 ივლისამდე გამოგვიგზავნოთ თქვენი ავტობიოგრაფია, საკონტაქტო ინფორმაცია და ასევე, ესსე თემაზე: „სომოქალაქო აქტივიზმის როლი და სირთულეები მაღალმთიან აჭარაში სოციალური ცვლილებების მხარდაჭერისთვის“ (მინიმუმ 500 სიტყვა).</p><p>მეტი დეტალისთვის ეწვიეთ ბმულს:&nbsp;</p><p><a href=\\\"https://bit.ly/3vQUHWz?fbclid=IwAR0xm9CYwQ0WsUYhRiD5-Wu7jyZk_PRpBMsgArNj0JpNz1qlp8zc6LAoKsA\\\">https://bit.ly/3vQUHWz</a></p>\"}', '{\"en\": \"დაბა ხულო\", \"ka\": \"დაბა ხულო\"}', NULL, NULL, '599 65 66 11', '2021-06-25', '2021-07-09', '2021-06-25', 81, NULL, '264__2021-06-2505:33:36.png', NULL, NULL, NULL, NULL, '2021-06-25 05:27:03', '2021-06-25 05:34:30', 'https://bit.ly/3vQUHWz', NULL, 1, 0, 'info@socialjustice.org.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
