(269, '{\"en\": null, \"ka\": \"ტრენერების ტრეინინგი: ხარისხზე ორიენტირებული არაფორმალური განათლების აქტივობების განხორციელების აუცილებელი ელემენტები\"}', '{\"en\": null, \"ka\": \"<p><strong>ტრენერების ტრეინინგი: ხარისხზე ორიენტირებული არაფორმალური განათლების აქტივობების განხორციელების აუცილებელი ელემენტები&nbsp;</strong></p><p><strong>გრძელვადიანი ტრეინინგ-კურსი&nbsp;</strong></p><p><strong>სურამი 26-31 ივლისი 2021&nbsp;</strong></p><p><strong>განაცხადების მიღება: 11 ივლისი 23:59</strong></p><p>პროექტი დაფინანსებულია ევროპის საბჭოს, ევროპის ახალგაზრდული ფონდის მიერ.&nbsp;</p><p><strong>შესავალი</strong></p><p>&nbsp;საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალური საბჭოს ერთ-ერთი მთავარი სტრატეგიული მიმართულებაა საქართველოში ახალგაზრდული ორგანიზაციების და ახალგაზრდობის სფეროში მოღვაწე ახალგაზრდების გაძლიერება და მათი კომპეტენციების განვითარება. ახალგაზრდა ტრენერების კომპეტენციების განვითარება მნიშვნელოვანია, რადგან ახალგაზრდობის სფეროში დაგეგმილი საგანმანათლებლო აქტივობები და პროექტები უფრო მეტად იყოს ხარისხზე ორიენტირებული. ასევე არაფორმალური განათლების აქტივობების განხორციელება ახალგაზრდებისთვის ტრენერების, ფასილიტატორებისა თუ გამავრცელებლების მეშვეობით ერთ\\u0002ერთი მნიშვნელოვანი ელემენტია არაფორმალური განათლების აღიარებისთვის.</p><figure class=\\\"image image-style-side\\\"><img src=\\\"https://youthplatform.gov.ge/storage/ck/FqXla4u5zcx8GyPFb4EuLlUDtLpvWLRagh4ExBvM.png\\\" alt=\\\"\\\"></figure><p><strong>მიზანი</strong>&nbsp;</p><p>პროექტის მიზანია ხელი შეუწყოს არაფორმალური საგანმანათლებლო საქმიანობის ხარისხიან განვითარებას ადამიანის უფლებების სწავლებისა და ახალგაზრდების მონაწილეობის საკითხებზე, ახალგაზრდა ტრენერების კომპეტენციების განვითარების გზით.</p><p><strong>&nbsp;ამოცანები</strong></p><p>მონაწილეების კომპეტენციების განვითარება, რომ მათ შეძლონ არაფორმალური განათლების პრინციპებზე დაფუძნებული საგანმანათლებლო აქტივობების შემუშავება, განხორციელება და შეფასება ევროპის საბჭოს ტრენერთა ხარისხის სტანდარტების გათვალისწინებით. მხარი დაუჭიროს მონაწილეებს, ისწავლონ თუ როგორ უნდა მართონ არაფორმალური განათლებაზე დაფუძნებული საგანმანათლებლო პროცესი ეფექტურად ადამიანის უფლებების სწავლებისა და ახალგაზრდების მონაწილეობის შესახებ; მხარი დაუჭიროს მონაწილეებს ევროპის საბჭოს ინსტიტუციური ჩარჩოს, ღირებულებების, პრინციპებისა და პრაქტიკის კარგად გააზრებაში, რომელიც საფუძვლად უდევს არაფორმალურ განათლებასა და საგანმანათლებლო საქმიანობას ახალგაზრდებისთვის.</p><p><strong>ვის შეუძლია მონაწილეობა ?</strong></p><p>მონაწილეთა ასაკი 18-29; აქვთ მაღალი მოტივაცია; ახორციელებენ საგანმანათლებლო საქმიანობას - ახალგაზრდულ ორგანიზაციაში, თემში, ან სხვადასხვა პროექტებზე; აქვთ სურვილი გახდნენ ტრენერების გუნდის წევრი და ითანამშრომლონ ქოლგა ორგანიზაციასთან გრძელვადიანი პერსპექტივით; აქვთ სურვილი და შესაძლებლობა ტრენინგის დასრულების შემდეგ პრაქტიკაში გამოიყენონ განვითარებული კომპეტენციები; აქვთ შესაძლებლობა სრულად ჩაერთონ სატრენინგო პროცესში და გაიარონ სრული კურსი.</p><p><strong>განაცხადების გამოგზავნა:</strong></p><p>&nbsp;დაინტერესებულმა პირებმა გთხოვთ განაცხადი შეავსოთ ბმულზე: https://bit.ly/3qqZahI&nbsp;</p><p>განაცხადების შევსების ბოლო ვადაა: 11 ივლისი 23:59 საათი.</p><p>დეტალები იხილეთ დანართში.&nbsp;</p>\"}', '{\"en\": \"დაბა სურამი\", \"ka\": \"დაბა სურამი\"}', NULL, NULL, '593199333', '2021-06-27', '2021-07-11', '2021-06-27', 17, NULL, '269__2021-06-2621:28:34.png', NULL, '@NCYOG', NULL, 'www.youthcouncil.ge', '2021-06-26 21:10:31', '2021-06-26 21:28:34', 'https://docs.google.com/forms/d/e/1FAIpQLSftvphBJ23YhpnAmzcbffFrvIZt7jKWgTgoHILCbazDeW_OUw/viewform?usp=pp_url', NULL, 1, 0, 'info@youthcouncil.ge', 18, 29, 0, NULL, NULL, 0, NULL, 0),
