(272, '{\"en\": null, \"ka\": \"ვაკანსია ESC - პოლონეთი\"}', '{\"en\": null, \"ka\": \"<p>ვაკანსია ESC პროექტი - პოლონეთი, Bydgoszcz – Poland !</p><p>ინფორმაცია პროექტის შესახებ: <a href=\\\"https://www.dropbox.com/.../r49xbszbf.../OLC_INFOPACK.pdf?fbclid=IwAR3_HxCQrmgXZC_ESRwGxieT69etKW39vQqii-hncAXuYbADSq9nlQLPOVU\\\">https://www.dropbox.com/s/r49xbszbft03jse/OLC_INFOPACK.pdf?dl=0</a></p><p>long-term project „Open to Local Communities” for the volunteers from Spain, Portugal, Hungary and Romania. I would like to invite the volunteers from Georgia. Already we have one volunteer in the Workshop Therapy Center „Wiatrak”, in the beginning of July one volunteer will come to the Kindergarten „U Karolka”. In the beginning of September or October one volunteer will come to the Kindergarten „Pod Sosnami”. We don\'t know when exactly one volunteer will come to the Workshop Therapy Center „Wiatrak”. It means that we have vacancy:</p><p>- we need two volunteers to the Catholic Culture Center „Wiatrak”,</p><p>- we need one volunteer to the Seniors Club „Wiatrak”,</p><p>- we need one volunteer to the Day Care Center Interart,</p><p>- we need one volunteer to the Workshop Therapy Center „Wiatrak”.</p><p>პროექტი დაფინანსებულია <a href=\\\"https://www.facebook.com/hashtag/europeansolidaritycorps?__eep__=6&amp;__gid__=559446420799226&amp;__cft__[0]=AZVYRphza5G9uxcWfMbLjmO7SZIj3VntOw4kRS0lAKgHIHZJbGQTWvOSY6mzVQDoEaER0Y-ZyECajyA5F9fX8blzjlkfgOW0Nmdmoj_FdfsDcYbJmBaD3vekzcm6HG1No68wFajM4xBcnXh4ZL5fDqWs&amp;__tn__=*NK-R\\\">#EuropeanSolidarityCorps</a>-ის ფარგლებში და ფარავს:</p><p>- საერთაშორისო მგზავრობის ხარჯებს;</p><p>- სამედიცინო დაზღევას;</p><p>- ბინის და კომუნალურ ხარჯებს;</p><p>- მოხალისეს ეძლევა ჯიბის და კვების თანხს;</p><p>- მოხალისის შერჩევას ახორციელებს მიმღები ორგანიზაცია !</p><p>კანდიატებმა CV და სამოტივაციო წერილი უნდა მოგვაწოდონ მაილზე: syc_guria@yahoo.com</p>\"}', '{\"en\": \"ოზურგეთი, გაბრიელ ეპისკოპოსის 3\", \"ka\": \"ოზურგეთი, გაბრიელ ეპისკოპოსის 3\"}', NULL, NULL, '