(273, '{\"en\": \"\", \"ka\": \"ვაკანსია ESC - პოლონეთი\"}', '{\"en\": \"\", \"ka\": \"<p>ვაკანსია ESC პროექტი - პოლონეთი, Bydgoszcz – Poland !</p><p>ინფორმაცია პროექტის შესახებ: <a href=\\\"https://www.dropbox.com/.../r49xbszbf.../OLC_INFOPACK.pdf?fbclid=IwAR3_HxCQrmgXZC_ESRwGxieT69etKW39vQqii-hncAXuYbADSq9nlQLPOVU\\\">https://www.dropbox.com/s/r49xbszbft03jse/OLC_INFOPACK.pdf?dl=0</a></p><p>long-term project „Open to Local Communities” for the volunteers from Spain, Portugal, Hungary and Romania. I would like to invite the volunteers from Georgia. Already we have one volunteer in the Workshop Therapy Center „Wiatrak”, in the beginning of July one volunteer will come to the Kindergarten „U Karolka”. In the beginning of September or October one volunteer will come to the Kindergarten „Pod Sosnami”. We don\'t know when exactly one volunteer will come to the Workshop Therapy Center „Wiatrak”. It means that we have vacancy:</p><p>- we need two volunteers to the Catholic Culture Center „Wiatrak”,</p><p>- we need one volunteer to the Seniors Club „Wiatrak”,</p><p>- we need one volunteer to the Day Care Center Interart,</p><p>- we need one volunteer to the Workshop Therapy Center „Wiatrak”.</p><p>პროექტი დაფინანსებულია <a href=\\\"https://www.facebook.com/hashtag/europeansolidaritycorps?__eep__=6&amp;__gid__=559446420799226&amp;__cft__[0]=AZVYRphza5G9uxcWfMbLjmO7SZIj3VntOw4kRS0lAKgHIHZJbGQTWvOSY6mzVQDoEaER0Y-ZyECajyA5F9fX8blzjlkfgOW0Nmdmoj_FdfsDcYbJmBaD3vekzcm6HG1No68wFajM4xBcnXh4ZL5fDqWs&amp;__tn__=*NK-R\\\">#EuropeanSolidarityCorps</a>-ის ფარგლებში და ფარავს:</p><p>- საერთაშორისო მგზავრობის ხარჯებს;</p><p>- სამედიცინო დაზღევას;</p><p>- ბინის და კომუნალურ ხარჯებს;</p><p>- მოხალისეს ეძლევა ჯიბის და კვების თანხს;</p><p>- მოხალისის შერჩევას ახორციელებს მიმღები ორგანიზაცია !</p><p>კანდიატებმა CV და სამოტივაციო წერილი უნდა მოგვაწოდონ მაილზე: syc_guria@yahoo.com</p>\"}', '{\"en\": \"Bydgoszcz\", \"ka\": \"Bydgoszcz\"}', '', '', '593904313', '2021-06-28', '2021-07-15', '2021-06-28', 78, NULL, '272__2021-06-2720:51:38.png', NULL, 'https://www.facebook.com/OZURGETISYC', '', '', '2021-06-27 20:58:06', '2021-06-27 20:58:06', '', NULL, 1, 0, 'syc_guria@yahoo.com', 18, 30, 0, '', '', 1, NULL, 1),
(274, '{\"en\": null, \"ka\": \"Civil Match 2.0 for changemakers - Meet. Connect. Act\"}', '{\"en\": null, \"ka\": \"<p>შესაზლებლობა არასამთავრობო და მედია ორგანიზაციებისთვის,&nbsp;</p><p>რომლებიც საერთაშორისო პარტნიორებს და დაფინანსებას ეძებენ&nbsp;</p><p>მედიის, პლურალიზმის, კულტურის, განათლების და კონფლიქტის რეზოლუციის მიმართულებით.&nbsp;</p><p>მეტი ინფორმაცია იხილეთ https://fb.me/e/1C9Q8EF8F&nbsp;</p><p>რეგისტრაციისთვის ეწვიეთ&nbsp;</p><p><a href=\\\"https://bit.ly/2TjiWPK?fbclid=IwAR3pbLdJni4QLGFjVFQkejs4lHi2e2NcTqKeoIKLNaPE-3goylI4bb-O0Ww\\\">https://bit.ly/2TjiWPK</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-28', '2021-06-29', '2021-06-28', 81, NULL, '274__2021-06-2808:30:07.png', NULL, 'https://fb.me/e/1C9Q8EF8F', NULL, NULL, '2021-06-28 08:23:28', '2021-06-28 08:30:08', 'https://bit.ly/2TjiWPK', NULL, 1, 0, 'info-kiew@goethe.de', NULL, NULL, 0, NULL, 'https://fb.me/e/1C9Q8EF8F', 0, NULL, 0),
(275, '{\"en\": null, \"ka\": \"დამწყები სოციალური საწარმოებისთვის საგრანტო კონკურსი\"}', '{\"en\": null, \"ka\": \"<p>გამოცხადდა ახალი საგრანტო კონკურსი სტრატეგიული კვლევებისა და განვითარების ცენტრში!<br>&nbsp;</p><p>გაქვს ინოვაციური, საინტერესო და სოციალურ ცვლილებაზე ორიენტირებული იდეა?</p><p>გსურს შექმნა მდგრადი სოციალური საწარმო და დაიწყო დადებითი გავლენის მქონე საქმიანობა?</p><p>გჭირდება დამატებითი რესურსები საწარმოს დაფუძნებისთვის?</p><p>მაშინ, ეს საგრანტო კონკურსი ამ შესაძლებლობას გაძლევს!</p><p>კონკურსში მონაწილეობისთვის ვიწვევთ სასტარტო (Start-up) ეტაპზე მყოფ და ახალ სოციალურ საწარმოებს, საინიციატივო ჯგუფებსა და საზოგადოებრივ ორგანიზაციებს</p><p>დეტალური ინფორმაციისთვის ეწვიე&nbsp;</p><p><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3vR1fEM%3Ffbclid%3DIwAR2UK1pqDDLvumD8SIXwaVxukS7uKeYP3OMbxGkdKZl1W0heHgEl7Lm7INs&amp;h=AT0tQiy7UaAeoKKLqWE34XE9nL1gvOsxf7UXmDlEVRdVSyczTHiljPzGk6xaUpxnEVqmCYM1bRzx6bkrBbA9ggttuR_pMkkrEY4y1BNHliIDvPf4Z6MYPJD87gSLzWrGR3D_5HBWfg&amp;__tn__=-UK*F&amp;c[0]=AT3TYXT4zxwHgvRU6erwbmoEyohZ8rmhWVwXVLvKUru7y-86b8b4iuQi5x76OOFdOnaMq5eGMdMKKTy0l4T8L0yA-2QKoetj4SpEAzQwfj3rGIelmN8Iri1lKcLMOY3xBpzrdLIyIP2EpA9ybGEEfrTKYrciMGMK69rNMlcaKQha_mY\\\">https://bit.ly/3vR1fEM</a></p><p>კონკურსი ცხადდება პროექტის \\\"სოციალური მეწარმეობის განვითარება მდგრადი და ინკლუზიური საზოგადოებისთვის\\\" ფარგლებში. პროექტი ხორციელდება ევროკავშირისა და „პური მსოფლიოსთვის“ მხარდაჭერით.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-06-28', '2021-07-30', '2021-06-28', 81, NULL, '275__2021-06-2808:35:07.png', NULL, NULL, NULL, NULL, '2021-06-28 08:31:49', '2021-06-28 08:35:41', 'https://bit.ly/3vR1fEM', NULL, 1, 0, 'office@csrdg.ge', NULL, NULL, 1, 'https://bit.ly/3vR1fEM', NULL, 0, NULL, 0),
(276, '{\"en\": null, \"ka\": \"სკაუტური ცენტრის ბანაკი\"}', '{\"en\": null, \"ka\": \"<p>გიბრუნდებით ძალიან სასიამოვნო სიახლით!</p><p>რუსთავის საერთაშორისო სკაუტური ცენტრი ლუქსემბურგელ სკაუტებთან ერთად საზაფხულო ბანაკს მართავს</p><p>პროგრამა წარმოადგენს სამუშაო ბანაკს ( Working Camp ), რომლის ფარგლებშიც ბანაკის ტერიტორიაზე აშენდება სხვადასხვა ტიპის ინფრასტრუქტურა.</p><p>ბანაკის პროგრამა ასევე ითვალისწინებს სკაუტური ტექნიკების ვორქშოფებს, ლაშქრობებსა და სკაუტურ თამაშებს.</p><p>ბანაკის ფარგლებში შესაძლებლობა გექნებათ გაიცნოთ ლუქსემბურგელი თანატოლები, დატკბეთ ადგილობრივი სილამაზით და გაატაროთ დაუვიწყარი დრო სკაუტებთან ერთად.</p><p>პროგრამა სრულიად უფასოა, ყველა ხარჯი დაფარულია Erasmus+ ის მიერ.</p><p>ბანაკი განხორციელდება 8-22 აგვისტოს</p><p>მონაწილეობის ასაკი 16+</p>\"}', '{\"en\": \"მანგლისი\", \"ka\": \"მანგლისი\"}', NULL, NULL, NULL, '2021-08-08', '2021-08-22', '2021-06-28', 81, NULL, '276__2021-06-2808:41:56.png', NULL, 'https://www.facebook.com/scoutcentrerustavi', NULL, 'http://www.iscr.ge/', '2021-06-28 08:37:21', '2021-06-28 08:41:57', 'https://docs.google.com/forms/d/e/1FAIpQLSdeftwy6e59PQqulmG1SbzOeqSuyg5crk4E441PpmSlAWTFEA/viewform?fbclid=IwAR3meQXRRZ3MD7yfOAMYkyOE_G7U7JUsUkpiygV_sXbbbkCJo23R04OuadE', NULL, 1, 0, 'info@iscr.ge', 16, NULL, 0, NULL, NULL, 0, NULL, 0),
(277, '{\"en\": null, \"ka\": \"იმერეთის რეგიონული საბჭო\"}', '{\"en\": null, \"ka\": \"<p>“ახალგაზრდები ცვლილებებისთვის“ იწყებს აპლიკაციების მიღებას “იმერეთის რეგიონული საბჭოს” წევრების შესარჩევად.</p><p>ასაკი: 14-18 წელი.</p><p>კანდიდატი უნდა ცხოვრობდეს იმერეთის რეგიონის შემდეგ ქალაქებში: ჭიათურა, ტყიბული, ხარაგაული, ბაღდათი, ვანი, სამტრედია.</p><p>რეგიონალური საბჭო დაკომპლექტებული იქნება აღნიშნული მუნიციპალიტეტების სკოლის მოსწავლეებისგან.</p><p>პროექტი გაგრძელდება 2 თვის განმავლობაში.</p><p>რაც მოიცავს ტრენინგებზე დაფუძნებულ ისეთ პრაქტიკულ აქტივობებს, რომელიც ეხება მუნიციპალიტეტებში ახალგაზრდების როლის გაძლიერებას და ორგანიზაციის დახმარებით ინოვაციური იდეების განხორციელებას.</p><p>პროექტის დასრულების შემდეგ გაიცემა სარეკომენდაციო წერილი და სერტიფიკატები</p><p>სამიზნე მუნიციპალიტეტების საბჭოს წევრებს შესაძლებლობა ექნებათ გაიარონ 1-თვიანი სალექციო კურსი.</p><p>წევრები განივითარებენ ისეთ უნარებს, რომლითაც მათ საშუალება ექნებათ, რეგიონულ კოორდინატორთან ერთად, თავიანთ მუნიციპალიტეტში განახორციელონ პრობლემიდან თუ საჭიროებიდან წამოსული მცირებიუჯეტიანი პროექტები.</p><p>დაინტერესებულმა პირებმა, გთხოვთ, შეავსოთ სააპლიკაციო ფორმა არა უგვიანეს 10 ივლისისა.</p>\"}', '{\"en\": \"დისტანციური\", \"ka\": \"დისტანციური\"}', NULL, NULL, NULL, '2021-06-28', '2021-07-10', '2021-06-28', 143, NULL, '277__2021-06-2817:28:56.png', NULL, 'https://www.facebook.com/YouthForChangeGeo/', NULL, NULL, '2021-06-28 09:16:06', '2021-06-28 17:28:57', 'https://forms.gle/EWvLnaisS9LvJJFL6', NULL, 1, 0, 'changeyouthfor18@gmail.com', 14, 18, 0, NULL, NULL, 0, NULL, 0),
(278, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-06-28', '2021-06-28', '2021-06-28', 81, NULL, NULL, NULL, '', '', '', '2021-06-28 16:02:50', '2021-06-28 16:02:50', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(279, '{\"en\": null, \"ka\": \"კონფერენცია: ახალგაზრდული საქმიანობის დღის წესრიგი 2025\"}', '{\"en\": null, \"ka\": \"<p>მნიშვნელოვანი მოვლენა საქართველოს ახალგაზრდულ სფეროში! საქართველოში ახალგაზრდული საქმიანობა ევროპული დღის წესრიგისა (EYWA) და ბონის პროცესის მიხედვით განვითარდება.&nbsp;</p><p>13-14 ივლისს, საქართველოს ეროვნულ უნივერსიტეტ სეუ–ში, გაიმართება კონფერენცია “ახალგაზრდული საქმიანობის დღის წესრიგი 2025”. კონფერენციის ფარგლებში, ახალგაზრდულ მუშაკებს, ახალგაზრდული საკითხების მკვლევარებს, ახალგაზრდული ორგანიზაციების წარმომადგენლებს, ახალგაზრდულ სფეროსა და ახალგაზრდულ საქმიანობაში ჩართულ პირებს გავაცნობთ ბონის პროცესს და ერთობლივად ვიმუშავებთ იმაზე, რომ ბონის დეკლარაცია ავსახოთ სახელმწიფო ახალგაზრდული სტრატეგია 2025-ის სამოქმედო გეგმაში.&nbsp;</p><p>კონფერენცია ჩატარდება ჰიბრიდულ ფორმატში და მონაწილეები იმუშავებენ მცირე, თემატურ სამუშაო ჯგუფებში.&nbsp;</p><p>კონფერენცია გაიმართება საქართველოს ეროვნულ უნივერსიტეტ სეუ–ში მის: 9 წინანდლის ქ.&nbsp;</p><p>კონფერენციაზე დასასწრებად აუცილებელია გაიაროთ რეგისტრაცია 7 ივლისის ჩათვლით. https://docs.google.com/forms/d/e/1FAIpQLSc4tfIIKmgmEv-bhy2yh73Cn8dtB8a_1A4KDTiAvJv0gydnpQ/viewform</p><p>&nbsp;</p>\"}', '{\"en\": \"საქართველოს ეროვნული უნივერსიტეტი  მის: 9 წინანდლის ქ.\", \"ka\": \"საქართველოს ეროვნული უნივერსიტეტი  მის: 9 წინანდლის ქ.\"}', NULL, NULL, NULL, '2021-07-13', '2021-07-14', '2021-06-28', 81, NULL, '279__2021-06-2816:19:42.png', NULL, NULL, NULL, NULL, '2021-06-28 16:09:20', '2021-06-28 19:08:17', 'https://docs.google.com/forms/d/e/1FAIpQLSc4tfIIKmgmEv-bhy2yh73Cn8dtB8a_1A4KDTiAvJv0gydnpQ/viewform', NULL, 1, 0, 'info@youthagency.gov.ge', 18, NULL, 0, NULL, NULL, 0, NULL, 0),
(280, '{\"en\": null, \"ka\": \"იდეათონი -  კომლობა\"}', '{\"en\": null, \"ka\": \"<p>კომლი, კასპის ტექნოპარკთან თანამშრომლობით 24-25 ივლისს გიწვევთ მონაწილეობის მისაღებად სათემო იდეათონში.</p><p>კომლობა, არის პროექტი, რომლის ფარგლებშიც მოხდება:</p><p>– თემის მობილიზება და არსებული საჭიროებების ანალიზი<br>– კრეატიულ ფორმატში საჭიროებების საპასუხო ინტერვენციებზე მუშაობა<br>– საკვანძო ორგანიზაციებთან შეხვედრა ადგილობრივ დონეზე თანამშრომლობის ხელშეწყობის მიზნით.</p><p>რა არის იდეათონი:</p><p>იდეათონი, ეს არის მოკლე ინტენსიური ვორკშოპის სტილის შეხვედრა, რომლის ფარგლებშიც მონაწილეებს ექნებათ შესაძლებლობა იმუშაონ არსებული პრობლემების იდენტიფიცირებაზე და ეცდებიან იპოვონ ამ პრობლემების გადაწყვეტის გზა. მონაწილეები მუშაობენ გუნდებში, და იყენებენ აზროვნების დიზაინის მეთოდოლოგიას, რათა თანამშრომლობითი გზით მოახდინონ იდეების ფორმირება.</p><p>იდეათონი 2 დღეს გაგრძელდება და მონაწილეებს მისცემს შესაძლებლობას იმუშაონ იმ პრობლემებზე, რომლებიც მათ ყველაზე მეტად აწუხებთ მუნიციპალიტეტის დონეზე. სამუშაო მიმართულებები არ არის შეზღუდული, თუმცა შეიძლება ეხებოდეს ისეთ საკითხებს როგორიცაა:<br>– დასაქმება<br>– თემის განვითარება და სამოქალაქო აქტივიზმი<br>– სამეწარმეო საქმიანობის და სტარტაპების განვითარება<br>– ეკოლოგია<br>– ახალგაზრდული პოლიტიკა და აქტივობები<br>– ციფრული ადაპტაცია</p><p>მონაწილეებს კასპის მუნიციპალიტეტიდან შეუძლიათ დარეგისტრირდნენ ერთ გუნდად, ან ინდივიდუალურად. ასევე შეგიძლიათ მონიშნოთ თემა, რომელზეც გსურთ მუშაობა, თუმცა პროცესში შეგიძლიათ შეცვალოთ მიმართულება.</p><p>იდეათონის ფარგლებში მონაწილე გუნდები იდეებს წარუდგენენ იმ საკვანძო პარტნიორებს, რომელთა თანამონაწილეობითაც შეეძლებათ ეს იდეები აქციონ რეალობად, კომლის გუნდი კი მათ სწორ ფორმირებაში და დამატებითი რესურსების მოძიებაში დაგეხმარებათ.</p><p>მონაწილეების ასაკი: 15-30 წელი<br>გუნდში წევრების რაოდენობა: მინიმუმ 2 ადამიანი, მაქსიმუმ 5 ადამიანი<br>რეგისტრაცია შეუძლიათ ახალგაზრდებს კასპის მუნიციპალიტეტიდან.<br>რეგისტრაციის ბოლო ვადა: 15 ივლისი</p><p>სარეგისტრაციო ბმული: https://forms.gle/7pK6J2f5facyMSxN9</p><p>რა არის კომლი:</p><p>კომლი არის სათემო სახლის კონცეფცია, რომლის პირველი ექსპერიმენტული ვერსია იქმნება ქალაქ კასპში და ეფუძნება თანაშექმნის იდეას.<br>კომლი ცდილობს ინდივიდზე ორიენტირებული ზრუნვის ფოკუსი საზოგადოებრივი ზრუნვისკენ მიმართოს და ადამიანზე ორიენტირებული ზრუნვა – გარემოზე და ადამიანზე ორიენტირებულ ზრუნვად აქციოს.<br>თანაშექმნის სივრცე არის მუდმივად შექმნის პროცესში მყოფი ცოცხალი ორგანიზმი, რომელიც ადგილობრივ მოსახლეობასთან და ჩამოსულ სტუმრებთან ერთად ცდილობს ცოდნა გაანთავისუფლოს აკადემიური ჩარჩოებიდან და ხელმისაწვდომი გახადოს ისეთი სამეზობლოებისთვის, სადაც ამის შესაძლებლობა ნაკლებად არსებობს. თანაშექმნის სივრცეში სტუმრები იზიარებენ „თემთან ერთად“ პრინციპს, რაც გულისხმობს მათი საქმიანობისა და აღმოჩენების შესახებ ცოდნის ადგილობრივი თემის წევრებისთვის გაზიარებას და გაცნობას.<br>კომლობა არის კომლის აქტივობების ერთ-ერთი ფორმატი, რომლის ფარგლებშიც დაინტერესებულ ადამიანებს ექნებათ შესაძლებლობა შეხვდნენ ერთმანეთს, გაიცნონ თანამოაზრეები და ერთად იმსჯელონ თემში არსებული პრობლემების მოგვარების გზებზე.</p>\"}', '{\"en\": \"ტექნოპარკი კასპი\", \"ka\": \"ტექნოპარკი კასპი\"}', NULL, NULL, '593197219', '2021-07-24', '2021-07-25', '2021-06-29', 150, NULL, '280__2021-06-2910:26:17.png', NULL, NULL, NULL, 'www.komli.ge', '2021-06-29 10:20:18', '2021-07-02 19:50:48', 'https://forms.gle/7pK6J2f5facyMSxN9', NULL, 1, 0, 'connect@komli.ge', 18, 35, 0, NULL, NULL, 0, NULL, 0),
(281, '{\"en\": null, \"ka\": \"წევრების მიღება კახეთის რეგიონულ საბჭოში\"}', '{\"en\": null, \"ka\": \"<p>💥 ,,ახალგაზრდები ცვლილებებისათვის\'\' &nbsp; იწყებს &nbsp;კახეთის რეგიონული საბჭოს წევრების მიღებას.🤩</p><p>&nbsp;სამიზნე მუნიციპალიტეტებია:</p><p>👉 სიღნაღი</p><p>👉 ახმეტა</p><p>👉 ლაგოდეხი</p><p>👉 დედოფლისწყარო</p><p>👉 ყვარელი</p><p>👉თელავი</p><p>👉გურჯაანი</p><p>👉საგარეჯო</p><p>☀️თუ ხარ &nbsp;14-18 წლის</p><p>☀️ცხოვრობ კახეთის რეგიონში</p><p>☀️ გსურს მიიღო &nbsp;საინტერესო პროექტებსა და ღონისძიებაში მონაწილეობა</p><p>☀️ისწავლო ის თუ როგორ დაგეგმო და განახორციელო სხვადსხვა ღონისძიება თუ აქტივობა</p><p>☀️ან სულაც, როგორ აისრული დიდი ხნის ნანატრი სურვილი და იყო კლუბის ორგანიზატორი</p><p>☀️აღმოაჩინო შენში ახალი შესაძლებლობები და უნარები</p><p>☀️აკეთო საყვარელი საქმე და მიიღო მხარდაჭერა</p><p>☀️გაიცნო საინტესო ადამიანები და გაიგო უფრო მეტი</p><p>☀️გახადო საკუთარი და სხვების ცხოვრება უფრო ფერადი და მრავალფეროვანი</p><p>🙏მაშინ ეს შენთვისაა! შემოუერთდი კახეთის რეგიონულ საბჭოს!</p><p>🔴საბჭოს წევრობის ხანგრძლივობა მოიცავს 2 თვეს . (სურვილის შემთხვევაში დრო გახანგრძლივდება)</p><p>⏳დაინტერესებულმა პირებმა გთხოვთ შეავსოთ მითითებული სააპლიკაციო ფორმა არაუმეტეს 10 ივლისამდე.</p><p>https://forms.gle/4bYxcKBi7j6d2hYd6</p><p>👀კანდიდატი შეირჩევა &nbsp;სააპლიკაციო ფორმის და გასაუბრების საფუძველზე</p><p>გისურვებთ წარმატებებს💞</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-07-01', '2021-07-08', '2021-06-30', 143, NULL, '281__2021-06-3004:30:12.png', NULL, 'https://bit.ly/3wqEdWK', NULL, 'https://bit.ly/3wqEdWK', '2021-06-30 04:21:44', '2021-06-30 04:30:13', 'https://forms.gle/4bYxcKBi7j6d2hYd6', NULL, 1, 0, 'ChangeYouthFor18@gmail.com', 14, 18, 1, 'https://forms.gle/4bYxcKBi7j6d2hYd6', NULL, 0, NULL, 0),
