(285, '{\"en\": null, \"ka\": \"Opportunity for cooperation\"}', '{\"en\": null, \"ka\": \"<p>✔️ Youth for Change is launching a common work platform for youth organizations.</p><p>🔵The aim of the initiative is to establish a common youth policy that will help to activate young people living in Georgia and involve them in civic life.</p><p>🔴If you are a youth organization or initiative group, then send us a short information about you via email:👇</p><p>ChangeYouthFor18@gmail.com</p>\"}', '{\"en\": \"ოთარ ლორთქიფანიძის 10\", \"ka\": \"ოთარ ლორთქიფანიძის 10\"}', NULL, NULL, NULL, '2021-07-02', '2021-07-29', '2021-07-02', 143, NULL, '285__2021-07-0220:12:03.png', NULL, NULL, NULL, NULL, '2021-07-02 20:09:49', '2021-07-02 20:15:11', 'ChangeYouthFor18@gmail.com', NULL, 1, 0, 'ChangeYouthFor18@gmail.com', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
