(287, '{\"en\": null, \"ka\": \"ციფრული ტრანსფორმაციის ტრენინგი არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოებისთვის\"}', '{\"en\": null, \"ka\": \"<p><strong>კრეატიული განვითარების ცენტრი</strong>, რეგიონალურ ახალგაზრდულ ორგანიზაციასთან \\\"ახალგაზრდების ინიციატივების ცენტრი\\\" (ულიანოვსკი) თანამშრომლობით ახცადებს <strong>მონაწილეების მიღებას პროექტისთვის \\\"სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია\\\"</strong><br>&nbsp;</p><p>პანდემიამ ნეგატიური გავლენა იქონია მსოფლიოს ყველა ქვეყნის სოციალურ და ეკონომიკურ ცხოვრებაზე, და არასმათავრობო ორგანიზები და სოციალური საწარმოები დადგნენ ისეთი რეალობის წინაშე, როცა აუცილებელია შრომითი კულტურის შეცვლა და აქტივობების ფიზიკური სივრციდან ციფრულ სამყაროში გადატანა. ამგვარი ტრანსფორმაცია კი რთულ და ხშირ შემთხვევაში მტკივნეულ პროცესებთან არის დაკავშირებული, განსაკუთრებით მაშინ, როცა ორგანიზაციას არ გააჩნია შესაბამისი ცოდნა, ხედვა და სტრატეგია. სწორედ ამ პრობლემასთან გამკლავების შესაძლებლობას იძლევა პროექტი „სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია“, რომელიც გულისხმობს არასამთავრობო ორგანიზასიებისა და სოციალური საწარმოების წარმომადგენლებისთვის, ციფრული ტრანსფორმაციისთვის საჭირო პრაქტიკული ცოდნის და უნარების გადაცემას.&nbsp;</p><p>„სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია“ არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოების წარმომადგენლებს საქრთველოდან და რუსეთიდან სთავაზობს:</p><p>*ციფრული ტრანსფორმაციის კონცეფციის გაცნობას</p><p>** ორგანიზაციის ციფრული ტრანსფორმაციის სახელმძღვანელოს</p><p>*** ინტენსიურ ტრენინგ კურსს&nbsp;</p><p>**** მცირე გრანტის მიღების შესაძლებლობას</p><p>&nbsp;</p><p><strong>რა: </strong>ტრენინგ პროგრამა ტრანსფორმაცია არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოების ციფრულ ტრანსფორმაციაში</p><p><strong>სად</strong>: ზუმის პლატფორმის გამოყენებით</p><p><strong>როდის</strong>: პირველი შეხვედრა - სექტემბერი 2021 (ზუსტი თარიღები დაზუსტების პროცესშია)</p><p><strong>სამუშაო ენა</strong> - ინგლისური</p><p><strong>პროექტის განხორციელების ვადები: სექტემბერი - დეკემბერი, 2021</strong></p><p><strong>საბოლოოს შეხვედრა: დეკემბერი. 2021 (ზუსტი თარიღები დაზუსტების პროცესშია)</strong></p><p>&nbsp;</p><p><strong>თუ ხარ:</strong></p><p>*არასამთავრობო ორგანიზაციის ან/და სოციალური საწარმოს წარმომადგენელი</p><p>** სამოქალაქო აქტივისტი&nbsp;&nbsp;</p><p>***დაინტერესებული შენი ორგანიზაციის ციფრული ტრანსფორმაციით</p><p>****მზად განახორციელო მცირე ბიუჯეტიანი პროექტი, რომელიც პროგრამის ფარგლებში დაფინანსდება.</p><p>&nbsp;</p><p><strong>და თუ ხარ:</strong></p><p><br>*საქართველოდან ან რუსეთიდან</p><p>**ასაკი 19-44 წელი</p><p>***მზად ხარ სრულად დაესწრო ონლაინ ტრენინგებს</p><p>&nbsp;</p><p><strong>მაშინ შემოიტანე განაცხადი 30 ივლისამდე.</strong></p><p>აპლიკაციის ფორმა: <a href=\\\"https://forms.gle/T5tHQ8HkQCozjxjy9\\\">https://forms.gle/T5tHQ8HkQCozjxjy9</a></p><p>&nbsp;</p><p>დამატებითი კითხვებისა და ინფორმაციისთვის:</p><p>+995 598505008, lvkhutsishvili@gmail.com - Levan Khutsishvili (Georgia)</p><p>+995 595996030, davidmirvelashvili@hotmail.com - David Mirvelashvili (Georgia)</p><p>+7-902-245-13-16, yaromas@gmail.com - Pavel Andreev (Russia)</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-03', '2021-07-30', '2021-07-03', 150, NULL, '287__2021-07-0311:14:39.png', NULL, NULL, NULL, NULL, '2021-07-03 10:58:00', '2021-07-03 11:14:39', 'https://forms.gle/T5tHQ8HkQCozjxjy9', NULL, 1, 0, NULL, 19, 44, 0, NULL, NULL, 0, NULL, 0),
(288, '{\"en\": \"\", \"ka\": \"ციფრული ტრანსფორმაციის ტრენინგი არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოებისთვის\"}', '{\"en\": \"\", \"ka\": \"<p><strong>კრეატიული განვითარების ცენტრი</strong>, რეგიონალურ ახალგაზრდულ ორგანიზაციასთან \\\"ახალგაზრდების ინიციატივების ცენტრი\\\" (ულიანოვსკი) თანამშრომლობით ახცადებს <strong>მონაწილეების მიღებას პროექტისთვის \\\"სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია\\\"</strong><br>&nbsp;</p><p>პანდემიამ ნეგატიური გავლენა იქონია მსოფლიოს ყველა ქვეყნის სოციალურ და ეკონომიკურ ცხოვრებაზე, და არასმათავრობო ორგანიზები და სოციალური საწარმოები დადგნენ ისეთი რეალობის წინაშე, როცა აუცილებელია შრომითი კულტურის შეცვლა და აქტივობების ფიზიკური სივრციდან ციფრულ სამყაროში გადატანა. ამგვარი ტრანსფორმაცია კი რთულ და ხშირ შემთხვევაში მტკივნეულ პროცესებთან არის დაკავშირებული, განსაკუთრებით მაშინ, როცა ორგანიზაციას არ გააჩნია შესაბამისი ცოდნა, ხედვა და სტრატეგია. სწორედ ამ პრობლემასთან გამკლავების შესაძლებლობას იძლევა პროექტი „სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია“, რომელიც გულისხმობს არასამთავრობო ორგანიზასიებისა და სოციალური საწარმოების წარმომადგენლებისთვის, ციფრული ტრანსფორმაციისთვის საჭირო პრაქტიკული ცოდნის და უნარების გადაცემას.&nbsp;</p><p>„სამოქალაქო საზოგადოების ციფრული ტრანსფორმაცია“ არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოების წარმომადგენლებს საქრთველოდან და რუსეთიდან სთავაზობს:</p><p>*ციფრული ტრანსფორმაციის კონცეფციის გაცნობას</p><p>** ორგანიზაციის ციფრული ტრანსფორმაციის სახელმძღვანელოს</p><p>*** ინტენსიურ ტრენინგ კურსს&nbsp;</p><p>**** მცირე გრანტის მიღების შესაძლებლობას</p><p>&nbsp;</p><p><strong>რა: </strong>ტრენინგ პროგრამა ტრანსფორმაცია არასამთავრობო ორგანიზაციებისა და სოციალური საწარმოების ციფრულ ტრანსფორმაციაში</p><p><strong>სად</strong>: ზუმის პლატფორმის გამოყენებით</p><p><strong>როდის</strong>: პირველი შეხვედრა - სექტემბერი 2021 (ზუსტი თარიღები დაზუსტების პროცესშია)</p><p><strong>სამუშაო ენა</strong> - ინგლისური</p><p><strong>პროექტის განხორციელების ვადები: სექტემბერი - დეკემბერი, 2021</strong></p><p><strong>საბოლოოს შეხვედრა: დეკემბერი. 2021 (ზუსტი თარიღები დაზუსტების პროცესშია)</strong></p><p>&nbsp;</p><p><strong>თუ ხარ:</strong></p><p>*არასამთავრობო ორგანიზაციის ან/და სოციალური საწარმოს წარმომადგენელი</p><p>** სამოქალაქო აქტივისტი&nbsp;&nbsp;</p><p>***დაინტერესებული შენი ორგანიზაციის ციფრული ტრანსფორმაციით</p><p>****მზად განახორციელო მცირე ბიუჯეტიანი პროექტი, რომელიც პროგრამის ფარგლებში დაფინანსდება.</p><p>&nbsp;</p><p><strong>და თუ ხარ:</strong></p><p><br>*საქართველოდან ან რუსეთიდან</p><p>**ასაკი 19-44 წელი</p><p>***მზად ხარ სრულად დაესწრო ონლაინ ტრენინგებს</p><p>&nbsp;</p><p><strong>მაშინ შემოიტანე განაცხადი 30 ივლისამდე.</strong></p><p>აპლიკაციის ფორმა: <a href=\\\"https://forms.gle/T5tHQ8HkQCozjxjy9\\\">https://forms.gle/T5tHQ8HkQCozjxjy9</a></p><p>&nbsp;</p><p>დამატებითი კითხვებისა და ინფორმაციისთვის:</p><p>+995 598505008, lvkhutsishvili@gmail.com - Levan Khutsishvili (Georgia)</p><p>+995 595996030, davidmirvelashvili@hotmail.com - David Mirvelashvili (Georgia)</p><p>+7-902-245-13-16, yaromas@gmail.com - Pavel Andreev (Russia)</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-07-03', '2021-07-30', '2021-07-03', 150, NULL, NULL, NULL, '', '', '', '2021-07-03 11:12:01', '2021-07-03 11:12:01', 'https://forms.gle/T5tHQ8HkQCozjxjy9', NULL, 1, 0, NULL, 19, 44, 0, '', '', 1, NULL, 1),
(289, '{\"en\": null, \"ka\": \"რა? სად? როდის? - ონლაინ მატრიცა  ნარუტოს თემაზე\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;</p><p>პროექტი სპეციალურად ანიმეს მოყვარულთათვის</p><p><i><strong>\\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ,,რა? სად? როდის? - ონლაინ მატრიცას\'\' ნარუტოს თემაზე(Naruto; Naruto shippuden)</strong></i></p><p>⚠️<strong>თამაშის წესები:</strong></p><p>🔷️მონაწილეობა შეუძლია ნებისმიერ დაინტერესებულ პირს, ვისაც ნანახი აქვს და უყვარს ნარუტო</p><p>🔷️თამაშის განმავლობაში მონაწილეებს შესაძლებლობა ექნებათ ინდივიდუალურად&nbsp; გასცენ პასუხები 20-მდე შეკითხვას (თემა-ნარუტო, კითხვები იქნება \\\"რა? სად? როდის?\'\'-ის სტილში)</p><p>🔷️პასუხების დაფიქსირება მოხდება ორგანიზაციის მიერ წინასწარ გამოგზავნილი პასუხების ბმულზე(პასუხების შეცვლა დაუშვებელია)</p><p>🔷️თამაშის გამარჯვებული გახდება ის, ვისაც ყველაზე მეტი სწორი პასუხი ექნება გაცემული.</p><p>🔴 დაუშვებელია კითხვაზე პასუხების მოძიება და სხვა დამხმარე საშუალებების გამოყენება</p><p>🔴თამაშის განმავლობაში სავალდებულო იქნება კამერის ჩართვა.</p><p>🔴იმ შენთხვევაში თუ მონაწილე შემჩნეული იქნება წესების დარღვევაში, მას მიეცემა გაფრთხილება, მეორე გაფრთხილების შემთხვევაში იგი გამოეთიშება თამაშს.</p><p><strong>პრიზები:</strong></p><p>🥇პირველ ადგილზე გასულ მონაწილეს ორგანიზაციისგან გადაეცემა შესაბამისი სერტიფიკატი და ნარუტოს თემატიკაში მისთვის ინდივიდუალურად შესრულებული პოსტერის ელექტრონული ვერსია</p><p>&nbsp;</p><p>🥈🥉 მეორე და მესამე ადგილზე გასული მონაწილეები ასევე მიიღებენ შესაბამის სერტიფიკატებს ორგანიზაციისგან</p><p>⚠️პროექტში მონაწილეობის მისაღებად აუცილებელია შეავსოთ შემდეგი სარეგისტრაციო ფორმა:</p><p><a href=\\\"https://forms.gle/Ckc45s24q2YV7LZ77\\\">https://forms.gle/Ckc45s24q2YV7LZ77</a></p><p>🟣მონაწილეები შეირჩევიან სამოტივაციო წერილის საფუძველზე.</p><p>🟣მონაწილეთა მაქსიმალური რაოდენობაა 12.</p><p>&nbsp;</p><p><strong>მნიშვნელოვანი თარიღები:</strong></p><p>🔻რეგისტრაციის ბოლო ვადა: 20/07/2021</p><p>🔻აპლიკაციების გადარჩევა და მონაწილეებთან დაკავშირება: 25/07/2021</p><p>🔻თამაში: 30/07/2021</p><p>⬛ პროექტში მონაწ