(291, '{\"en\": \"\", \"ka\": \"რა? სად? როდის? - ონლაინ მატრიცა  ნარუტოს თემაზე\"}', '{\"en\": \"\", \"ka\": \"<p>&nbsp;</p><p>პროექტი სპეციალურად ანიმეს მოყვარულთათვის</p><p><i><strong>\\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ,,რა? სად? როდის? - ონლაინ მატრიცას\'\' ნარუტოს თემაზე(Naruto; Naruto shippuden)</strong></i></p><p>⚠️<strong>თამაშის წესები:</strong></p><p>🔷️მონაწილეობა შეუძლია ნებისმიერ დაინტერესებულ პირს, ვისაც ნანახი აქვს და უყვარს ნარუტო</p><p>🔷️თამაშის განმავლობაში მონაწილეებს შესაძლებლობა ექნებათ ინდივიდუალურად&nbsp; გასცენ პასუხები 20-მდე შეკითხვას (თემა-ნარუტო, კითხვები იქნება \\\"რა? სად? როდის?\'\'-ის სტილში)</p><p>🔷️პასუხების დაფიქსირება მოხდება ორგანიზაციის მიერ წინასწარ გამოგზავნილი პასუხების ბმულზე(პასუხების შეცვლა დაუშვებელია)</p><p>🔷️თამაშის გამარჯვებული გახდება ის, ვისაც ყველაზე მეტი სწორი პასუხი ექნება გაცემული.</p><p>🔴 დაუშვებელია კითხვაზე პასუხების მოძიება და სხვა დამხმარე საშუალებების გამოყენება</p><p>🔴თამაშის განმავლობაში სავალდებულო იქნება კამერის ჩართვა.</p><p>🔴იმ შენთხვევაში თუ მონაწილე შემჩნეული იქნება წესების დარღვევაში, მას მიეცემა გაფრთხილება, მეორე გაფრთხილების შემთხვევაში იგი გამოეთიშება თამაშს.</p><p><strong>პრიზები:</strong></p><p>🥇პირველ ადგილზე გასულ მონაწილეს ორგანიზაციისგან გადაეცემა შესაბამისი სერტიფიკატი და ნარუტოს თემატიკაში მისთვის ინდივიდუალურად შესრულებული პოსტერის ელექტრონული ვერსია</p><p>&nbsp;</p><p>🥈🥉 მეორე და მესამე ადგილზე გასული მონაწილეები ასევე მიიღებენ შესაბამის სერტიფიკატებს ორგანიზაციისგან</p><p>⚠️პროექტში მონაწილეობის მისაღებად აუცილებელია შეავსოთ შემდეგი სარეგისტრაციო ფორმა:</p><p><a href=\\\"https://forms.gle/Ckc45s24q2YV7LZ77\\\">https://forms.gle/Ckc45s24q2YV7LZ77</a></p><p>🟣მონაწილეები შეირჩევიან სამოტივაციო წერილის საფუძველზე.</p><p>🟣მონაწილეთა მაქსიმალური რაოდენობაა 12.</p><p>&nbsp;</p><p><strong>მნიშვნელოვანი თარიღები:</strong></p><p>🔻რეგისტრაციის ბოლო ვადა: 20/07/2021</p><p>🔻აპლიკაციების გადარჩევა და მონაწილეებთან დაკავშირება: 25/07/2021</p><p>🔻თამაში: 30/07/2021</p><p>⬛ პროექტში მონაწილეობა უფასოა.</p><p>გისურვებთ წარმატებას!&nbsp;</p><p>&nbsp;</p><p>️</p>\"}', '{\"en\": \"\"}', '', '', '', '2021-07-30', '2021-07-30', '2021-07-04', 143, NULL, '289__2021-07-0419:26:38.png', NULL, 'https://www.facebook.com/YouthForChangeGe', '', '', '2021-07-04 19:27:06', '2021-07-04 19:27:06', 'https://forms.gle/Ckc45s24q2YV7LZ77', NULL, 1, 0, 'changeyouthfor18@gmail.com', NULL, NULL, 1, 'ტარდება ვირტუალურ სივრცეში', '', 1, NULL, 1),
