(299, '{\"en\": \".\", \"ka\": \"გახდი ახალგაზრდული მრჩეველთა საბჭოს წევრი\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<h2>ახალგაზრდობის სააგენტოს &bdquo;ახალგაზრდული მრჩეველთა საბჭოსთვის&ldquo; კანდიდატების მიღება დაიწყო საქართველოს მასშტაბით!</h2>\\n\\n<p>&bdquo;ახალგაზრდულ მრჩეველთა საბჭოს&ldquo; წევრობის მსურველთათვის ღია კონკურსი 2021 წლის 7 ივლისიდან 28 ივლისის ჩათვლით გაგრძელდება.ახალგაზრდობის სააგენტო, ახალგაზრდული სფეროს ეკოსისტემას ქმნის და სამწლიანი რეფორმის ერთ&ndash;ერთ საკვანძო საკითხად &bdquo;მონაწილეობრივ ახალგაზრდულ პოლიტიკას&ldquo; (Meaningful Youth Participation) გამოყოფს. ვინაიდან ახალგაზრდები და ახალგაზრდული ორგანიზაციები სფეროს ის უმთავრესი ნაწილი არიან, რომელთა მონაწილეობის გარეშე სფეროს ეკოსისტემის შექმნა წარმოუდგენელია, სააგენტომ აირჩა გეზი, რომ მისი გადაწყვეტილებები იყოს მონაწილეობრივი. ახალგაზრდობის მონაწილეობრივი პოლიტიკა გულისხმობს&nbsp; ახალგაზრდების ჩართვას, როგორც ადგილობრივ, ისე ეროვნულ დონეზე, იმ&nbsp; გადაწყვეტილებების მიღებაში, რომლებიც მათ ეხებათ. ნამდვილი მონაწილეობა (meaningful) ნიშნავს, რომ ახალგაზრდები ჩართულები არიან ისეთი ფორმით, რომ გავლენა მოახდინონ ამ გადაწყვეტილებებზე. აღნიშნული მიმართულების გასავითარებლად, სააგენტოს ინიციატივით, ევროპის საბჭოს რეკომენდაციით, &bdquo;ახალგაზრდული მრჩეველთა საბჭო&ldquo; იქმნება, რომელიც ახალგაზრდობას საშუალებას მისცემს უშუალოდ ჩაერთონ გადაწყვეტილების მიღების პროცესში. &nbsp;&bdquo;ახალგაზრდულ მრჩეველთა საბჭოს&ldquo; კონცეფცია, მოწვეული ექსპერტების ჩართულობით ევროპის საბჭოს &ldquo;Advisory Council on Youth&ldquo; მოდელით შეიქმნა. &bdquo;ახალგაზრდული მრჩეველთა საბჭო&ldquo; არის სრულიად მოხალისეობრივი და წარმომადგენლობითი, მიზნად ისახავს უშუალოდ და მხოლოდ სააგენტოს საქმიანობაში ახალგაზრდების ინტერესების გათვალისწინებას.&nbsp; საბჭოს დანიშნულებაა კონსულტაცია გაუწიოს ახალგაზრდობის სააგენტოს ახალგაზრდობასთან დაკავშირებულ ყველა საკითხზე, დაამყაროს თანამშრომლობა და კოორდინაცია ახალგაზრდულ სექტორში სამთავრობო და არასამთავრობო სექტორს შორის.&nbsp;</p>\\n\\n<h4><strong>&nbsp;&bdquo;ახალგაზრდული მრჩეველთა საბჭოს&ldquo; წევრების შერჩევის კრიტერიუმებია:</strong></h4>\\n\\n<ul>\\n\\t<li>კანდიდატი უნდა იყოს 14&ndash;29 წლის საქართველოს მოქალაქე (კონკურსში მონაწილე ახალგაზრდის ასაკი, 1 წლიანი მანდატის ამოწურვამდე, არ უნდა აღემატებოდეს 29 წელს);</li>\\n\\t<li>თავისუფლად ფლობდეს ქართულ ენას;</li>\\n\\t<li>იცნობდეს ახალგაზრდობის სააგენტოსა და ახალგაზრდული მრჩეველთა საბჭოს დებულებას;</li>\\n\\t<li>ინფორმირებული იყოს ახალგაზრდებთან დაკავშირებულ საქართველოში მიმდინარე პროცესებზე (ახალგაზრდობის სააგენტოს,&nbsp; საქართველოში ახალგაზრდებთან მომუშავე ადგილობრივ ან/და საერთაშორისო ორგანიზაციების საქმიანობის შესახებ).</li>\\n\\t<li>საბჭოს წევრების შესარჩევ კონკურსში კანდიდატურის წარდგენის უფლება აქვს&nbsp; საქართველოს ნებისმიერ რეგიონში, ოკუპირებული ტერიტორიების ჩათვლით, მოქმედ ნებისმიერი სამართლებრივი სტატუსის მქონე ახალგაზრდულ ან/და ახალგაზრდულ საკითხებზე მომუშავე ორგანიზაციას, მათ შორის&nbsp; მხოლოდ იმ სამეწარმეო სუბიექტებს, რომელთა საქმიანობის სფერო განეკუთვნება საგანმანათლებლო საქმიანობას.</li>\\n</ul>\\n\\n<h2><strong>რეგისტრაციისთვის კონკურსში მონაწილეობის მისაღებად ორგანიზაციამ &nbsp;უნდა წარმოადგინოს:</strong></h2>\\n\\n<ul>\\n\\t<li>კანდიდატის პირადობის დამადასტურებელი მოწმობის ასლი/პასპოსტის ასლი;</li>\\n\\t<li>კანდიდატის მშობლის/კანონიერი წარმომადგენლის თანხმობის შევსებული ფორმა; კანდიდატის დაბადების მოწმობის ასლი; კანონიერი წარმომადგენლის პირადობის მოწმობის ასლი&nbsp; (არასრულწლოვანი კანდიდატის შემთხვევაში);</li>\\n\\t<li>რეზიუმე ქართულ ენაზე;</li>\\n\\t<li>კანდიდატის წარმდგენი ორგანიზაციის დებულება/წესდება (სავალდებულოა, წარმოდგენილი დოკუმენტით, ორგანიზაციის საქმიანობის მიმართულება განსაზღვრული იყოს&nbsp; როგორც საგანმანათლებლო, ახალგაზრდული&nbsp; ან/და ახალგაზრდულ საკითხებზე მომუშავე);</li>\\n\\t<li>წარმდგენი ორგანიზაციის ხელმძღვანელის ან შესაბამისი უფლებამოსილების მქონე პირის ხელმოწერილი, ოფიციალური წერილი კანდიდატის წარდგენის თაობაზე, რომელიც უნდა შეიცავდეს შემდეგი სახის ინფორმაციას: წარდგენილი კანდიდატის სახელი, გვარი, პირადი ნომერი და რეკომენდაცია;</li>\\n\\t<li>კონკურსის მიმდინარეობის პერიოდში კანდიდატი გამოგზავნის ამ დოკუმენტაციას შემდეგ ელექტრონულ მისამართზე;<strong>&nbsp;</strong></li>\\n</ul>\\n\\n<h2>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;pr@yac.ge</h2>\\n\\n<h2><strong>🧩 &nbsp;რეგისტრაციისთვის &nbsp;დააჭირეთ ღილაკს &nbsp;&ldquo;ფაილები&rdquo; და ჩამოტვირთეთ განაცხადის ფორმა. აპლიკაცია არის დოკუმენტის სახით. აპლიკაციას ავსებს თვითონ აპლიკანტი და ზემოთ მოთხოვნილ დოკუმენტებთან ერთად აგზავნის ელექტრონულ მისამართზე &nbsp;pr@yac.ge&nbsp;</strong></h2>\\n\\n<p><strong>შერჩევა განხორციელდება ორ ეტაპად:&nbsp;&nbsp;</strong></p>\\n\\n<ul>\\n\\t<li>პირველ ეტაპზე განხორციელდება მიღებული აპლიკაციების და დოკუმენტაციის განხილვა და შესაბამისობის შეფასება დადგენილ კრიტერიუმებთან.</li>\\n\\t<li>მეორე ეტაპზე ჩატარდება ინტერვიუ მხოლოდ პირველ ეტაპზე შერჩეულ კანდიდატებთან.</li>\\n</ul>\\n\\n<p><ins><strong>გაითვალისწინეთ, კანდიდატი, რომელიც არ წარმოადგენს სრულყოფილ დოკუმენტაციას, გამოეთიშება კონკურსს.</strong></ins></p>\\n\\n<p>ღია კონკურსის წესით საბჭოს წევრების შერჩევაზე პასუხისმგებელია 5 წევრისაგან შემდგარი საკონკურსო კომისია.&nbsp;</p>\\n\\n<h4>მიმაგრებულ ფაილში გაეცანით ახალგაზრდული მრჩეველთა საბჭოს დებულებას.&nbsp;</h4>\"}', '{\"en\": \"<p>ვაჟა-ფშაველას 76ბ</p>\", \"ka\": \"<p>ვაჟა-ფშაველას 76ბ</p>\"}', NULL, NULL, '591075277', '2021-07-07', '2021-07-28', '2021-07-07', 1, NULL, '299__2021-07-0710:27:06.png', NULL, NULL, NULL, NULL, '2021-07-07 10:08:06', '2021-07-23 15:15:45', NULL, NULL, 1, 0, 'pr@yac.ge', 14, 29, 0, NULL, NULL, 0, NULL, 0),
(301, '{\"en\": null, \"ka\": \"Mindfulness სესია მშობლებისათვის\"}', '{\"en\": null, \"ka\": \"<p>ორგანიზაციები Skills hub &nbsp;და კომლი გიწვევთ Mindfulness შეხვედრაზე მშობლებისათვის.</p><p>რას ნიშნავს მაინფულნესი?</p><p>მაინდფულნესის პროგრამა მოიცავს მტკიცებულებაზე დაფუძნებულ მიდგომებს და წარმოადგენს ინტენსიურ სწავლებას, რომელიც აქტიურად იყენებს სუნთქვით პრაქტიკებს, მაინდფულ იოგას, ფსიქოგანათლებას სტრესზე და ჯგუფურ დისკუსიებს. პროგრამა შექმნილია ჯონ კაბატ ძინის მიერ 1979 წელს, მასაჩუსეტის სამედიცინო სკოლის ბაზაზე.</p><p>გაცნობიერებული მშობლობა ნიშნავს:</p><p>- მივმართოთ ჩვენი ყურადღება მოცემულ მომენტზე, აწმყო დროზე, კრიტიკის და შეფასების გარეშე, ზრუნვით და სიკეთით; &nbsp;</p><p>- გავაცნობიეროთ ჩვენი ქცევითი ჩარჩოები და &nbsp;შევამჩნიოთ რთულ, სტრესულ სიტუაციაზე ჩვენი რეაგირების სტილი &nbsp;</p><p>სესია მოიცავს მაინდფულ მოსმენისა და საუბრის კომპონენტებს და ამ პროცესში საკუთარი თავისადმი თანადგომის და სიყვარულის პრაქტიკებს.</p><p>დაინტერესების შემთხვევაში გთხოვთ შეავსოთ &nbsp;რეგისტრაციის ფორმა: https://docs.google.com/forms/d/1r8ZUnrN0b0g7NrB1z_-3QI_maJFCBPpLWDUHuNTI0sE/edit&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '595317113', '2021-07-14', '2021-07-14', '2021-07-07', 153, NULL, '301__2021-07-0711:07:11.png', NULL, 'https://www.facebook.com/SkillsHub.ge', NULL, 'https://skillshub.ge/', '2021-07-07 10:50:02', '2021-07-07 11:07:18', 'https://docs.google.com/forms/d/1r8ZUnrN0b0g7NrB1z_-3QI_maJFCBPpLWDUHuNTI0sE/edit', NULL, 1, 0, 'info@skillshub.ge', NULL, NULL, 1, 'https://us02web.zoom.us/j/86035126936', NULL, 0, NULL, 0),
(302, '{\"en\": \"\", \"ka\": \"„მზიანი სახლის“ სიუჟეტური და სათავგადასავლო ბანაკი ახალგაზრდებისთვის\"}', '{\"en\": \"\", \"ka\": \"<h3>„მზიანი სახლის“ერთ-ერთი ყველაზე საინტერესო, დამაფიქრებელი, ემოციური და დაუვიწყარი პროგრამა</h3><h2>სიუჟეტური და სათავგადასავლო&nbsp;ბანაკი ახალგაზრდებისთვის</h2><p>ტრენინგ-პროგრამა შედგება სიმულაციური, სიუჟეტური თამაშისგან, სადაც სხვადასხვა სავარჯიშოების მეშვეობით კომპლექსურად ხდება ისეთ უნარ-ჩვევებზე და ფასეულობებზე მუშაობა, როგორიცაა:</p><ul><li>საკუთარი თავის გაანალიზება - თვითშემეცნება, თვითრეფლექსია და თვითანალიზი;</li><li>ინტერპერსონალური კომუნიკაცია;</li><li>კრიტიკული აზროვნების განვითარება;</li><li>გუნდში მუშაობა და ლიდერული უნარ-ჩვევები;</li><li>კონფლიქტების დარეგულირება და ემოციების მართვა;</li><li>პრობლემების გადაჭრა სტრესულ სიტუაციებში.</li></ul><p>&nbsp;</p><h4>მონაწილეთა ასაკი: 17-25 წ.</h4><h4>მონაწილეთა რაოდენობა: 30</h4><h4>ტრენერები: ქეთი ჟვანია-ტაისონი, ნოდარ მამინაიშვილი, თათია გოგიშვილი, დიანა მამინაიშვილი</h4><h4>ჩატარების ადგილი: ბლუზ ვილიჯი, ლაგოდეხი <a href=\\\"https://www.facebook.com/bluesvillage.ge\\\">https://www.facebook.com/bluesvillage.ge</a></h4><h4>საგზურის ღირებულება: 530 ლარი</h4><h4>საგზურში შედის მგზავრობა, განთავსება, კვება, პროგრამა.</h4><h4>დარეგისტრირდით აქ: <a href=\\\"https://docs.google.com/.../1Gjurm4hQSQzvYk5N1s1DpqW.../edit\\\">https://docs.google.com/.../1Gjurm4hQSQzvYk5N1s1DpqW.../edit</a></h4><h4>დამატებითი კითხვებისთვის მოგვმართეთ: 599321921</h4>\"}', '{\"en\": \"\"}', '', '', '', '2021-08-02', '2021-08-07', '2021-07-07', 154, NULL, NULL, NULL, '', '', '', '2021-07-07 10:59:27', '2021-07-07 11:21:07', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 0),
