(313, '{\"en\": null, \"ka\": \",,ორატორობის ხელოვნება\\\" და ,,პროექტის წერა\\\"\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;</p><p>ორგანიზაცია ,,ახალგაზრდები წარმატებისკენ\\\" გთავაზობთ სემინარებს თემაზე ,,ორატორობის ხელოვნება\\\" და ,,პროექტის წერა\\\"</p><p>&nbsp;</p><p>მოწვეული სპიკერი ორგანიზაცია ,,გზა მომავლისკენ\\\" დამაარსებელი და გამოცდილი ტრენერი სოფო ხარებავა.</p><p>&nbsp;</p><p>მონაწილეობის მიღება შეუძლია 12-დან 30 წლამდე საქართველოს მოქალაქეს.</p><p>&nbsp;</p><p>სემინარების ბოლოს გადმოგეცემათ მოსმენის სერტიფიკატები.</p><p>&nbsp;</p><p>რეგისტრაციის ბოლო ვადაა 25 ივლისი.</p><p>&nbsp;</p><p>რეგისტრაციისთვის ეწვიეთ ბმულს - <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3ADA18h%3Ffbclid%3DIwAR0nR3ZQFsjgx_IIQX2QofoUUPZeqQkzVpvBm6MPjmilqxN0tbqGxpjpOVc&amp;h=AT2U-B-ROSLxw-ojSno0zlx81jNFxfiBwTitJFnvfYismjr2TuXOX-_nyGUtL_WRpiaiAAraLNqbKsn4WhA82BmxpItV6hiWR3IkrcTbtrKxGoDLWC4EP9QZDFJGByH0-vaP&amp;__tn__=-UK-R&amp;c[0]=AT0HBWVXirt0bKzH2KP4yGguj6fyQ7FTFNHjKrBjH-7NseNGqyWLns5j0Ip2rBOeLC-HOI76SymWv3VbJA9zOQDK2lt0bFm25vpP2UP6ygeRXU8QB2sEZKuAeQ2NNXRjlSHfEujgRc_5v0WSssrdTWKduAyE74pIFrpc3ZvSJeQmp6-W\\\">https://bit.ly/3ADA18h</a></p><p>&nbsp;</p><p>,,ერთად გავუხსნათ გზა მომავალს!\\\"</p><figure class=\\\"image\\\"><img src=\\\"https://scontent.ftbs5-1.fna.fbcdn.net/v/t1.6435-9/214358881_113343511013388_3565477650876716899_n.png?_nc_cat=102&amp;ccb=1-3&amp;_nc_sid=730e14&amp;_nc_ohc=ndQheU-yfeQAX-EKZcZ&amp;_nc_ht=scontent.ftbs5-1.fna&amp;oh=49949bea0c2b4a80e78455eb75df0ef4&amp;oe=60EE5EA3\\\" alt=\\\"შეიძლება იყოს ტექსტი-(ი)ს გამოსახულება\\\"></figure><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-09', '2021-07-25', '2021-07-09', 156, NULL, '313__2021-07-0917:29:54.png', NULL, NULL, NULL, 'https://www.axalgazrdebiwarmatebisken.ga/', '2021-07-09 17:24:47', '2021-07-09 17:29:54', 'https://forms.gle/qv8xrQnWpnBowsNN6', NULL, 1, 0, 'axalgazrdebiwarmatebisken@gmail.com', 12, 30, 1, NULL, NULL, 0, NULL, 0),
