(316, '{\"en\": null, \"ka\": \"Russian Hybrid Warfare and NATO\'s Deterrence Posture\"}', '{\"en\": null, \"ka\": \"<p><strong>Russian Hybrid Warfare and NATO\'s Deterrence Posture</strong></p><p>On 12 July, Lieutenant General (Ret’d) Ben Hodges will discuss Russian hybrid warfare and NATO’s deterrence posture vis-à-vis hybrid threats.</p><p>The project is organized by the Youth Atlantic Treaty Association of Georgia (YATA Georgia) that aims to increase awareness about NATO and NATO-Georgia relations and supports extensive research on the security issues in the region.</p><p>Ben Hodges is a retired United States Army officer who served as commanding general, United States Army Europe. He is currently the Pershing Chair in Strategic Studies at the Center for European Policy Analysis. He retired from the army and relinquished command of USAREUR on 15 December 2017.</p><p>Moderator:<br>Tekla Gabritchidze -International Relations expert, ELTE University graduate.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t92/1.5/16/1f4e2.png\\\" alt=\\\"📢\\\"></figure><p>Since the 2008 Russo-Georgian war, and more prominently on the international stage, since the annexation of Crimea, the term hybrid warfare, more often than not, connotes the Russian Federation and its ventures against the West. Hybrid methods of warfare, such as propaganda, deception, sabotage, and other non-military tactics have long been used to destabilize adversaries. What is new about attacks seen in recent years is that only the facets – speed, tactics, and tools converged to the present times.<br>Over the following decades, hybrid threats facing NATO are likely to grow in complexity and intensity.Information operations, cyber-attacks, subversion, low-level conflict, and other hybrid challenges that can be blended with conventional warfare will be exacerbated by rapid technological change and global connectivity.</p><p>&nbsp;</p><p>Registration link:<br><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F3hsjD2O%3Ffbclid%3DIwAR3atTRvV5R_ci63pocOc1RpEYAacix006VUJdciE5gQA_angc6IPrqsqVA&amp;h=AT2kB70NLNNPknb-_ZjYgNizBUDHlwSjR6BeH2qDwyL90NcskgdXEur3i1jjmLmRi_osgQxc0rXGgFX_ZSMlZTqyKZfx_A0qi1JN_tdpB6hK5gxXK1de8E_1S45IAAe72mHM&amp;__tn__=q&amp;c[0]=AT1DDRpPfFGSl4X8C3nxxs-LFklmdVfHCloxO_1pSYnyVJfO9FNBYhGSU5n1ZY5Dexe6VKLImUE5CkcJiBIYmg8ExL5ZAqmayGbOvq0UDgA3npPQf8ap49gtGZ2JA4Pjd_RJ1WjBQuFpQ1iVVP_6-DTcwa2sBCm3btAhyPCbNXEP5861\\\">https://bit.ly/3hsjD2O</a></p><p>&nbsp;</p><p>Join us on Monday, 12 July, at 10:00 AM (CET) / 12:00 PM (GMT+4)</p><p>The working language - English<br>Webinar will be held on Zoom platform.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-12', '2021-07-12', '2021-07-10', 148, NULL, '316__2021-07-1019:43:18.png', NULL, NULL, NULL, NULL, '2021-07-10 19:16:33', '2021-07-10 19:43:19', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(317, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-07-10', '2021-07-10', '2021-07-10', 148, NULL, NULL, NULL, '', '', '', '2021-07-10 19:51:35', '2021-07-10 19:51:35', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(318, '{\"en\": null, \"ka\": \"ახალგაზრდული იდეის წევრების შესარჩევი კონკურსი\"}', '{\"en\": null, \"ka\": \"<p><strong>ევროპის ფონდი იწვევს 18 მუნიციპალიტეტში მცხოვრებ დაინტერესებულ ახალგაზრდებს ახალგაზრდული იდეის წევრების შესარჩევ კონკურსში.</strong><br>თუ:</p><p># ხარ 15-დან 21 წლამდე<br># ცხოვრობ აჭარის (ქედა, შუახევი, ხულო) ასპინძის, ახალქალაქის, ახმეტის, ბოლნისის, გარდაბნის, გორის, დედოფლისწყაროს, მარნეულის, სვანეთის, რაჭის, ტყიბულის, ფოთის, ჩოხატაურის, წალკის, წეროვნის, ხობის, ხონის მუნიციპალიტეტში<br># გსურს წვლილი შეიტანო შენს თემში ახალგაზრდების სამოქალაქო ჩართულობისა და მოხალისეობის გაზრდაში</p><p>მაშინ -<br>*გახდი ახალგაზრდული იდეის წევრი და შეცვალე შენი თემი უკეთესობისკენ<br>*შეარჩიე და დააფინანსე თანატოლების მიერ შექმნილი საპროექტო იდეები<br>*ხელი შეუწყვე თემში თანატოლების სამოქალაქო აქტიურობას და მოხალისეობას</p><p>გადადი ბმულზე და შეავსე აპლიკაცია: &nbsp;<a href=\\\"https://forms.gle/7qJDmtab698cQxLu5\\\">https://forms.gle/7qJDmtab698cQxLu5</a></p><p>აპლიკანტები გაივლიან ვირტუალურ გასაუბრებას, რომელიც ჩატარდება ყოველ კვირას, აპლიკანტებთან წინასწარ ჩანიშნულ დროს.</p><p>აპლიკაციების მიღების ბოლო ვადა - 15 აგვისტო.<br>ახალგაზრდული იდეის და ევროპის ფონდის შესახებ დეტალურ ინფორმაციას შეგიძლიათ გაეცნოთ ბმულზე:&nbsp;<a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fbit.ly%2F2ZMp3vr%3Ffbclid%3DIwAR0zmiZMXZ1Ka9IEeNXLm4rHAbAwmlFaEfcAhW_QEgJzVSfV4GTwVjoF7NM&amp;h=AT3YhrbbWJ5dfbBFCKMkbeJNtargu9oZQINaerla03Gd9oUXOml9TqU8FwasvuAW6biEFJQVBPNYNkTOOap3wJxB-0CvN9UyxMj8yamIoSKxgwkkb1IakTkqKXXl2HfYZw&amp;__tn__=-UK*F\\\">https://bit.ly/2ZMp3vr</a>&nbsp;</p>\"}', '{\"en\": \"კავსაძის ქუჩა\", \"ka\": \"კავსაძის ქუჩა\"}', NULL, NULL, NULL, '2021-07-12', '2021-08-15', '2021-07-12', 158, NULL, '318__2021-07-1213:36:10.png', NULL, NULL, NULL, NULL, '2021-07-12 13:20:29', '2021-07-12 13:36:10', 'https://forms.gle/7qJDmtab698cQxLu5', NULL, 1, 0, 'info@epfound.ge', 15, 21, 0, NULL, NULL, 0, NULL, 0),
(319, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-07-12', '2021-07-12', '2021-07-12', 158, NULL, NULL, NULL, '', '', '', '2021-07-12 13:20:50', '2021-07-12 13:20:50', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(320, '{\"en\": null, \"ka\": \"კონკურსი ხელოვნებისთვის- გენდერული თანასწორობა\"}', '{\"en\": null, \"ka\": \"<p>თუ გიყვარს &nbsp;კომიქსების ხატვა, თემატური ფოტოების გადაღება, გრაფიკული დიზაინი - მაშინ შენთვის ძალიან საინტერესო შემოთავაზება გვაქვს&nbsp;</p><p>პროექტი ,,contacZINE\'\' რომელიც ხორციელდება სამოქალაქო ფორუმის მიერ UK-Coberm -ის მხარდაჭერით იწყებს contactZINE პირველ გამოცემაზე მუშაობას, თემა ,,გენედრული თანასწორობა\'\'- შენ შეგიძლია გახდე ჩვენი მონაწილე.</p><p>როგორ?</p><p>გაეცანი მონაწილეობის პირობებს და შემოიტანე შენი წვილილი.</p><p>გინდა გაგვიზიარო შენი ხედვა გენდერული თანასწორობის მიმართულებით? მაშინ გამოგვიგზავნე შენი კომიქსი,სურათი, გრაფიკული დიზაინი, გინდაც ლექსი, ნახატი ან ნებისმიერი რამ რასაც ფიქრობ რომ კავშირშია თემასთან. შენი პროდუქტი დაიბეჭდება როგორც ჩვენ ჟურნალში ასევე განთავსდება პროექტის ვებ გვერდზე.</p><p>იმისთვის რომ გახდეთ ჩვენი გუნდის წევრი, გაიარეთ შემდეგი ეტაპები:</p><p>ეწვიეთ ჩვენი პროექტის ვებ გვერდს და მიიღეთ დამატებითი ინფორმაცია contactZINE კონტენტზე.&nbsp;</p><p><a href=\\\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.contactzine.org%2F%3Ffbclid%3DIwAR3d4yAU6ys2Y2GKxEgE0h5bYLh3HAIjKMqY7_Li82eSkPLSlS0AgxreHpw&amp;h=AT2cIx2g5tvus_BGbM0GHMrK-FQ5_Od_DWt_XmLBzJdRMKsaY9BW4MxB89B4GFEV2aKQTp6tWZqQOO02re970ZbNh-gWGu9aci6HmkQgIZKdMswP2KKJnOurtBV91uIhdM3U&amp;__tn__=-UK*F&amp;c[0]=AT2kxP6jg8JzqQGl3oVB6HVrhjIE606YAhD2sz36GSH1B_cYl_XIM2kkfhKjg03pskzA-2JSH1en_Jl8BE5oTP8iOStJNeJkKFPmQiNzpQRSGIx9_34vzQYrIVWhM2SoETTEgJMNOJSLS5MIfQsPQqVglHDyHoVF3L2loiIjfmP3_IDFupTHmBqzjGFA3JeQFbYbVxag\\\">www.contactzine.org</a></p><p>შეასვეთ მონაწილეობის ფორმა -</p><p><a href=\\\"https://contactzine.org/collaborate/?fbclid=IwAR1-zCGrEJctgyfSOq2Na-YjRvtiQTtvGku5h4O5xJio8T6UGqhhuKEpcTU\\\">https://contactzine.org/collaborate/</a></p><p>გამოგვიგზავნეთ მასალები შემდეგ მეილზე contactzine.editors@gmail.com.</p><p>განაცხადის და კონტენტის მიღების ბოლო ვადაა 22 ივლისი, 2021.</p><p>მოუთმენლად ველით თქვენთან თანამშრომლობას!</p>\"}', '{\"en\": null}', NULL, NULL, NULL,