(322, '{\"en\": null, \"ka\": \"Fellowship Program at the Information Centre on NATO and EU (Batumi & Kutaisi)\"}', '{\"en\": null, \"ka\": \"<p>Good Governance Initiative (GGI) in Georgia is funded by the United States Agency for International Development (USAID). The project\'s goal is to strengthen transparency, accountability, and effectiveness of governance in Georgia, within the legislative and executive branches at the central and local government levels. GGI`s primary partners are different agencies in the Executive branch, as well as the Parliament of Georgia and the objectives of the project are:<br><br>** Improved public administration at all levels<br>** Access to independent and reliable information and increased civic engagement<br>** evidence-based policy development and law-making<br>** Strengthened institutional oversight of government.<br><br>Among other activities, USAID GGI intends to support the Government of Georgia at the central and local levels to effectively promote the benefits of Georgia`s NATO and EU integration process and counter Russia`s disinformation and propaganda.<br><br>Most specifically GGI will provide support to the Information Center on NATO and EU, a Legal Entity of Public Law under the Ministry of Foreign Affairs of Georgia to effectively meet its goals of boosting the knowledge on NATO and EU among the Georgian public, and gaining population`s conscious support towards Georgia`s European and Euro-Atlantic integration as well as combat Russia`s disinformation and propaganda.<br><br>The Fellowship<br><br>To help contribute to these efforts the USAID GGI is currently recruiting two <strong>fellows </strong>to be placed with Regional Bureaus of the Information Centre on NATO and EU in <strong>Batumi </strong>and <strong>Kutaisi</strong>.<br><br>Successful applicants will have a unique opportunity to acquire profound knowledge about Georgia`s European and Euro-Atlantic integration process, contribute to its promotion as well as to the process of fighting against Russia`s disinformation and propaganda. Fellowship will help successful applicants to develop the critical skills that will assist them in their professional development.<br><br>GGI fellowship is a full-time (40 hrs/week), three-month program covering the period from September 2021 - through November 2021, with a possibility of extension. Note: Fellowship commencement date might change depending on the situation with regards to the covid19 outbreak.<br><br>Duties and Responsibilities<br><br>The successful applicants, under general guidance and supervision of the respective Regional Representatives of the Information Center on NATO and EU in Batumi and Kutaisi, are expected to undertake the following activities:<br><br>** Assistance to Regional Representative of the Information Center on NATO and EU in planning and implementing an intensive informational and educational campaign in the region;<br>** Cooperation with academia, governmental and non-governmental organizations as well as regional media;<br>** Support in implementation of ongoing projects and contribute to the planning of new ones;<br>** Preparation of meeting reports and press releases on the events.<br>** Preparation of powerpoint presentations for the events.<br><br>The fellows will also undertake some day-to-day operational tasks which may also include the organization of correspondence, documents, and databases, scheduling meetings, planning and managing events and etc.<br><br>Management and Working Environment<br><br>Fellows will be placed in the Regional Bureaus of the Information Center on NATO and EU in Batumi and Kutaisi and be accountable to the respective Regional Representative and USAID GGI staff.<br><br>The fellows will receive a monthly stipend of USD 250 (Gross).<br><br>Accommodation and per-diem will not be covered by the Fellowship.<br><br>Training<br><br>Upon commencement of the fellowship, the fellow will be provided with orientation training on the USAID GGI project and its activities, work and operations relevant to the public agencies, their placement, and assignments, as well as administrative procedures and reporting. Additional training opportunities will be provided by the Information Center on NATO and EU and its Regional Bureaus in Batumi and Kutaisi.<br><br>Requirements for a Fellow:<br><br>** University degree (master`s degree preferred) in international relations, politics, or social sciences;<br>** Excellent written and verbal communication skills, both in English and in Georgian languages;<br>** General knowledge of NATO and EU as organizations, their tasks, and principles;<br>** General knowledge of Georgia`s Euro and Euro-Atlantic integration process, key milestones, and instruments;<br>** Understanding of the hybrid threats Georgia faces from Russia with particular focus on disinformation and propaganda campaigns;<br>** Ability to work collaboratively with colleagues to achieve organizational goals;<br>** Experience in project writing will be an asset;<br>** Oriented towards learning and self-development;<br>** Ability to undertake research activities;<br>** Good knowledge of computer programs (Microsoft Office, Excel, Internet).<br><br>How to Apply<br><br>Interested candidates are invited to submit their CVs (in English and Georgian), cover letters (in English) and two letters of recommendation to: <a href=\\\"mailto:recruitment@ggi.ge?subject=\\\">recruitment@ggi.ge</a>. Indicate \\\"Information Center on NATO and EU\\\" in the e-mail subject line.<br><br>In cover letters, applicants should describe reasons for their interest in USAID GGI`s fellowship program.<br><br>While USAID GGI will try to consider the preferences of successful candidates, it can give no guarantees to the applicants.<br><br>Only complete applications will be reviewed and considered.<br><br>The deadline for application is CoB on <strong>July 20, 2021</strong>.<br><br>Only short-listed candidates will be invited for a written test and a subsequent interview. No telephone calls will be taken for these positions.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-01', '2021-12-30', '2021-07-15', 161, NULL, '322__2021-07-1517:40:57.png', NULL, NULL, NULL, NULL, '2021-07-15 17:33:28', '2021-07-16 05:33:27', 'https://www.jobs.ge/en/ads/?view=jobs&id=312398', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
(323, '{\"en\": null, \"ka\": \"ტრენინგი  ინფორმაციულ-საკომუნიკაციო ტექნოლოგიების მიმართულებით\"}', '{\"en\": null, \"ka\": \"<ul><li>არასამთავრობო ორგანიზაცია ,,ჩვენ განათლებისთვის - We 4 Education\'\' გეგმავს ონლაინ ტრენინგს &nbsp;ისტ-ის მიმართულებით, ბორჯომისა და ახალქალაქის მუნიციპალიტეტის სკოლის 13-17 წლის მოსწავლეებისათვის. მონაწილეები შეისწავლიან &nbsp;gmail.com-ს თავისი ყველა ფუნქციით, როგორიცაა Drive, Forms, Blogger, აგრეთვე &nbsp;Movie maker.</li><li>ტრენინგები გაგრძელდება 4 კვირის განმავლობაში , კვირაში 1 დღე 1- 2 საათი, მონაწილეების საჭიროებების გათვალისწინებით. გაიცემა მონაწილეობის სერთიფიკატი. 20 კანდიდატი შეირჩევა სამოტივაციო წერილის საფუძველზე. განცხადებები მიიღება 15 ივლისის ჩათვლით. შერჩულ კანდიდატებთან დაკავშირება მოხდება 17 ივლისს.</li><li>ტრენინგის დაწყების თარიღი: 18 ივლისი</li><li>ტრენერი - ნანა ვასაძე-ჯანელიძე, ინგლისური ენის მასწავლებელი, მასწავლებლის სახლის კონსულტანტ-მასწავლებელი.</li></ul><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-18', '2021-07-18', '2021-07-15', 96, NULL, '323__2021-07-1518:24:03.png', NULL, NULL, NULL, NULL, '2021-07-15 17:42:30', '2021-07-15 18:24:04', 'https://bit.ly/2VNAapF', NULL, 1, 0, NULL, 13, 17, 1, NULL, NULL, 0, NULL, 0),
