(326, '{\"en\": null, \"ka\": \"ჩემი ინფორმირებულობა ჩემი უსაფრთხოების გარანტიაა\"}', '{\"en\": null, \"ka\": \"<p>🌐 არასამთავრობო ორგანიზაცია ,,ჩვენ განათლებისთვის • We 4 Education’’-ს სურს საქართველოში არაფორმალური განათლების მხარდაჭერითა და სათემო განვითარების ხელშეწყობით გაძლიერდეს სამოქალაქო საზოგადოება, დამკვიდრდეს დემოკრატიული ღირებულებები, დაცული იქნას ადამიანების უფლებები და ძირითადი თავისუფლებები, შეიქმნას სამართლიანი და ინკლუზიური გარემო ახალგაზრდებისთვის და მოწყვლადი ჯგუფებისთვის.</p><p>🌀 ,,ჩვენ განათლებისთვის • We 4 Education’’ ორგანიზებით ხორციელდება ორდღიანი ტრენინგი თემაზე: ,,პერსონალური მონაცემები-ჩემი ინფორმირებულობა, ჩემი უსაფრთხოების გარანტიაა\\\"</p><p>🗓 დრო: 19 ივლისი, 16:00-17:30</p><p>📍მოწვეული სტუმარი-დონარი ლონდარიძე (სახელმწიფო ინსპექტორის სამსახურის პერსონალურ მონაცემთა დაცვის ელჩი სამცხე-ჯავახეთში).</p><p>🗓 დრო: 20 ივლისი, 16:00-17:30</p><p>📍 გვანცა სამსონიძე (,,ჩვენ განათლებისთვის • We 4 Education’’-ის ორგანიზაციის წევრი).</p><p>🙌🏻 ტრენინგში მონაწილეობა უფასოა და შეუძლიათ 18-25 წლამდე ახალგაზრდებს სამცხე-ჯავახეთის რეგიონიდან.</p><p>🗓 რეგისტრაცია შეგიძლიათ გაიაროთ აქ: https://forms.gle/ZG84jXiovMWGWf387</p><p>💠 ტრენინგის ორივე დღეზე სრულად დასწრებისას გაიცემა სერთიფიკატი</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-07-19', '2021-07-20', '2021-07-16', 96, NULL, '326__2021-07-1609:18:51.png', NULL, NULL, NULL, NULL, '2021-07-16 09:10:35', '2021-07-16 09:18:55', 'https://docs.google.com/forms/d/e/1FAIpQLSdDIJMFpqB4a5Wvh4RkXs22WCvyQ78SjX9gZFtpsHGR3JyE2Q/viewform?usp=send_form', NULL, 1, 0, NULL, 18, 25, 0, NULL, NULL, 0, NULL, 0),
(327, '{\"en\": \"\"}', '{\"en\": \"\"}', '{\"en\": \"\"}', '', '', '', '2021-07-17', '2021-07-17', '2021-07-17', 81, NULL, NULL, NULL, '', '', '', '2021-07-17 12:25:33', '2021-07-17 12:25:33', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
(328, '{\"en\": null, \"ka\": \"\\\"ახალგაზრდები ცვლილებებისათვის\\\" იწყებს ახალი მოხალისეების მიღებას\"}', '{\"en\": null, \"ka\": \"<p>\\\"ახალგაზრდები ცვლილებებისათვის\\\" იწყებს ახალი მოხალისეების მიღებას</p><p>თუ ხართ:</p><p>შრომისმოყვარე;</p><p>პასუხისმგებლიანი;</p><p>შემოქმედებითი;</p><p>პიროვნული უნარ-ჩვევების განვითარებასა და დახვეწაზე ორიენტირებული;</p><p>სიახლეების მოყვარული;</p><p>კომუნიკაბელური;</p><p>პრეზენტაბელური;</p><p>პოზიტიური;</p><p>ორგანიზებული</p><p>თუ გსურს:</p><p>შენს იდეებს მისცე რეალიზების საშუალება;</p><p>გახდე ორგანიზებული, მიზანსწრაფული და მეგობრული გუნდის წევრი,</p><p>გამოგვიგზავნე რეზიუმე და სამოტივაციო წერილი (არანაკლებ 200 სიტყვა) მითითებულ ელექტრონულ ფოსტაზე:</p><p>Info.YFCH.Geo@gmail.com</p><p>განცხადების გამოგზავნა შეუძლია ნებისმიერ დაინტერესებულ პირს, 14 წლის ასაკიდან.</p><p>აპლიკაციები მიიღება 23 აგვისტოს ჩათვლით.</p><p>მოხალისეობრივი პერიოდი შეადგენს მინიმუმ სამ თვეს, რომლის ფარგლებში დაგროვებული მოხალისეობრივი საათების საფუძველზე მოხდება შესაბამისი კომპეტენციის დამადასტურებელი დოკუმენტის გაცემა.</p><p>გისურვებთ წარმატებას!&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '597 20 60 17', '2021-08-24', '2021-09-30', '2021-07-20', 143, NULL, '328__2021-07-2007:10:08.png', NULL, 'https://www.facebook.com/YouthForChangeGeo', NULL, NULL, '2021-07-20 07:03:05', '2021-07-20 07:10:09', 'Info.YFCH.Geo@gmail.com', NULL, 1, 0, 'Info.YFCH.Geo@gmail.com', 14, NULL, 1, 'Info.YFCH.Geo@gmail.com', NULL, 0, NULL, 0),
(329, '{\"en\": null, \"ka\": \"ახალგაზრდა მეწარმე ელჩების პროგრამა\"}', '{\"en\": null, \"ka\": \"<p><strong>თუ ხარ 18-დან 30 წლამდ</strong>ე ახალგაზრდა მეწარმე, გაქვს შესაბამისი ცოდნა, გამოცდილება და სოციალური პასუხისმგებლობა, გსურს, შეიძინო დამატებითი უნარები და დაეხმარო სხვებს ბიზნესის განვითარებაში, მიიღე მონაწილეობა კონრად ადენაუერის ფონდის (KAS) პროექტის „უნარები წარმატებისთვის“ ფარგლებში გამოცხადებულ ახალგაზრდა მეწარმეების შესარჩევ კონკურსში!<br><br>კონკურსი გაძლევს უნიკალურ შესაძლებლობას:&nbsp;</p><ol><li>გახდე ახალგაზრდა მეწარმე ელჩი</li></ol><p>2. ჩაერთო ახალგაზრდა მეწარმე ელჩების პროგრამის კონცეფციის შემუშავებაში</p><p>3. მონაწილეობა მიიღო გასვლით სამუშაო შეხვედრებში</p><p>4. გაემგზავრო სასწავლო ვიზიტებით გერმანიასა და ნიდერლანდებში</p><p>5. შეიტანო წვლილი ახალგაზრდული მეწარმეობის განვითარების სტრატეგიის შემუშავებაში</p><p>6. გამოცდილება გაუზიარო თანატოლებს და ხელი შეუწყო მათ ბიზნესის განვითარებაში</p><p>თუ ხარ ახალგაზრდა მეწარმე, გაქვს შესაბამისი ცოდნა, გამოცდილება და სოციალური პასუხისმგებლობა, გსურს შეიძინო დამატებითი უნარები და დაეხმარო სხვებს ბიზნესის განვითარებაში, მიიღე მონაწილეობა <strong>კონრად ადენაუერის ფონდის (KAS)</strong> პროექტის - \\\"უნარები წარმატებისთვის\\\" - ფარგლებში გამოცხადებულ ახალგაზრდა მეწარმეების შესარჩევ კონკურსში!<br><br>\\\"ახალგაზრდა მეწარმე ელჩების პროგრამა\\\" მიზნად ისახავს მოქმედი ახალგაზრდა მეწარმეების/ახალგაზრდა მეწარმე ელჩების გაძლიერებას და ამ გზით ქვეყანაში ახალგაზრდული მეწარმეობის განვითარებას.<br><br>პროექტი დაფინანსებულია ევროკავშირის პროგრამის - \\\"უნარები დასაქმებისთვის\\\" (Skills for Jobs) - ფარგლებში და მისი მიზანია, არაფორმალური განათლების გზით, საქართველოს ხუთ სამიზნე რეგიონში, <strong>გურიაში, რაჭა-ლეჩხუმში, შიდა ქართლში, კახეთსა და თბილისში, </strong>განსაკუთრებით, განათლების, დასაქმებისა და ტრენინგს მიღმა მყოფი ახალგაზრდების დასაქმების უნარიანობის განვითარება. \\\"ახალგაზრდა მეწარმე ელჩების პროგრამა\\\" პროექტის ერთ-ერთი კომპონენტია, რომელიც ხელს უწყობს NEET ახალგაზრდების გააქტიურებას და მათი სამეწარმეო კომპეტენციების ამაღლებას, მეწარმე ელჩების წარმატებული გამოცდილების გაზიარებისა და მხარდაჭერის საშუალებით.<br><br>დასახული მიზნის მისაღწევად, \\\"ახალგაზრდა მეწარმე ელჩების\\\" პროგრამის ფარგლებში ღია კონკურსის წესით შეირჩევა 12 ახალგაზრდა წარმატებული მეწარმე, რომელმაც წამოიწყო, <strong>ფლობს ან/და უკვე მართავს მცირე ან საშუალო ბიზნესს. შ</strong>ერჩეულ მონაწილეებს ექნებათ შესაძლებლობა, ჩაერთონ ისეთ აქტივობებში, როგორიცაა:<br><br>** \\\"ახალგაზრდა მეწარმე ელჩების\\\" პროგრამის კონცენფციის შექმნა მოწვეულ ექსპერტებთან და პროექტის გუნდთან ერთად;<br>** <strong>გასვლითი სამდღიანი სამუშაო შეხვედრა (</strong>სავარაუდო თარიღები 22-24 აგვისტო) რომლის ფარგლებშიც, მონაწილეები გაიუმჯობესებენ ლიდერობის, ფასილიტაციისა და გუნდური მუშაობის უნარებს, გაეცნობიან ადვოკატირების, ლობირებისა და გადაწყვეტილების მიღების პროცესზე გავლენის მოხდენის მეთოდებსა და მექანიზმებს;<br>** <strong>სასწავლო ვიზიტები გერმანიასა და ნიდერლანდებში, </strong>სადაც გაეცნობიან საუკეთესო სამეწარმეო გამოცდილებებს, შეხვდებიან წარმატებულ ადგილობრივ მეწარმეებს, მენტორებს, გადაწყვეტილების მიღებაში ჩართულ პირებს და აიმაღლებენ ცოდნასა და კომპეტენციებს;<br>** ცოდნის გაზიარება პროექტის პარტნიორის \\\"Save the Children-ის\\\" მიერ შექმნილი \\\"ახალგაზრდული ინოვაციური ლაბორატორიების\\\" მონაწილე NEET ახალგაზრდებისთვის და მათი მხარდაჭერა სამეწარმეო იდეების განვითარების პროცესში;<br>** \\\"ახალგაზრდული სამეწარმეო კონცეფციის\\\" განვითარებაში ჩართვა სხვა დაინტერესებულ მხარეებთან, პოლიტიკის გამტარებლებთან და გადაწყვეტილების მიმღებ პირებთან ერთად.<br><br><strong>\\\"ახალგაზრდა მეწარმე ელჩების\\\" პროგრამაში მონაწილეობისთვის აუცილებელია გქონდეთ:</strong><br><br>ცოდნა და უნარ-ჩვევები:<br><br>** ქართული და ინგლისური ენების მაღალ დონეზე ცოდნა (წერითი და საკომუნიკაციო);<br>** კომუნიკაციისა და კულტურათშორისი ურთიერთობების კარგი უნარი;<br>** პრეზენტაციისა და საჯარო გამოსვლების გამორჩეული უნარი;<br>** გუნდური მუშაობის უნარი;<br>** სამეწარმეო კუთხით სხვა ახალგაზრდების მხარდაჭერის და გაძლიერების მოტივაცია;<br>** ახალგაზრდების, მეწარმეობისა და დასაქმების პრობლემებზე მუშაობის ღრმა ინტერესი;<br>** მაღალი სოციალური პასუხისმგებლობის გრძნობა.<br>** უნივერსიტეტის დიპლომი ბიზნესის ადმინისტრირებაში, ეკონომიკაში, სოციალურ და პოლიტიკურ მეცნიერებებში ან/და სხვა რელევანტურ სფეროში ჩაითვლება უპირატესობად.<br><br>გამოცდილება:<br><br>** პროექტის სამიზნე რეგიონებში მცირე ან საშუალო საწარმოს დაფუძნების, ფლობის, ან/და მართვის მინიმუმ 1 წლიანი გამოცდილება;<br>** ახალგაზრდების, მეწარმეობის და დასაქმების პრობლემების ადვოკატირებისა და ლობირების პროცესებში მონაწილეობის გამოცდილებას მიენიჭება უპირატესობა;<br>** ახალგაზრდებთან მუშაობის, საჯარო გამოსვლების პრეზენტაციების ჩატარების და მათი მოტივირებისა და წახალისების გამოცდილებას მიენიჭება უპირატესობა.</p><p>&nbsp;</p><p>განაცხადები მიიღება 21-ივლისიდან დან <strong>8 აგვისტოს</strong> ჩათვლით. განაცხადის შესავსებად გადადით ბმულზე: <a href=\\\"https://forms.gle/e4G1qh8u5uAQW7Z17\\\">https://forms.gle/e4G1qh8u5uAQW7Z17</a></p><p>&nbsp;</p><p><br>არასრულად შევსებული განაცხადები არ განიხილება. პროექტის გუნდი დაუკავშირდება მხოლოდ შემდეგ ეტაპზე გადასულ კანდიდატებს.</p>\"}', '{\"en\": null}', NULL, NULL, '598186444', '2021-07-20', '2021-08-08', '2021-07-22', 81, NULL, '329__2021-07-2212:43:08.png', NULL, NULL, NULL, 'https://jobs.ge/ge/?view=jobs&id=315710', '2021-07-22 12:28:35', '2021-07-22 12:43:09', 'https://forms.gle/e4G1qh8u5uAQW7Z17', NULL, 1, 0, 'nino.kobakhdize@kas.de', 18, 30, 0, NULL, NULL, 0, NULL, 0),
