(331, '{\"en\": null, \"ka\": \"ახალგაზრდა ევროპელი ელჩების ინიციატივა.\"}', '{\"en\": null, \"ka\": \"<p>🔔ორგანიზაცია</p><p>\\\"ერთად განათლებისთვის\\\" გიბრუნდებაᲗ ახალი ᲨეხვედრიᲗ</p><p>🎯\\\"ახალგაზრდა ევროპელი ელჩების ინიციატივა.\'\'</p><p>შეხვედრაზე განხილული იქნება შემდეგი საკითხები:</p><p>✅საქართველოსა და ევროკავშირის ურთიერთოებები;</p><p>✅ახალგაზრდა ევროპელი ელჩების ინიციატივა;</p><p>✅როგორ უნდა შემოგვიერთდეთ ინიციატივაში;</p><p>✅ევროკავშირის შესაძლებლობები ახალგაზრდებისთვის;</p><p>🗣შეხვედრას გაუძღვება: თათია ფარადაშვილი</p><p>👉🏻თათია ფარადაშვილი- ახალგაზრდა ევროპელი ელჩების ვიცე-კოორდინატორი საქართველოში.</p><p>👉🏻 “ახალგაზრდა ლიდერების საერთაშორისო აკადემიის/ Young Leaders’ International Academy ” თანადამფუძნებელი, Global UGRAD გაცვლითი პროგრამის 2016-2017 წლის ფინალისტი.</p><p>⏳Შეხვედრა Ჩატარდება 2 აგვისტოს &nbsp;21:00 საათზე</p><p>🖇Შეხვედრაზე დასასწრებად ᲨეავსეᲗ აპლიკაცია</p><p>🔗https://docs.google.com/forms/d/e/1FAIpQLSd2keg-V5WYnafVdOSkU77uHA0pHkalnLKpz1sR8AXhlMYYlw/viewform?usp=sf_link</p><p>📲 დამატებითი ინფორმაციისთვის დაგვიკავშირდით :</p><p>📩 ertadganatlebistvis@gmail.com</p><p>📞 571- 49-04-41</p><p>👥\\\"ერთად განათლებისთვის\\\" - ადმინისტრაცია.</p>\"}', '{\"en\": null}', NULL, NULL, '571490441', '2021-08-02', '2021-08-03', '2021-07-24', 121, NULL, '331__2021-07-2312:45:35.png', NULL, 'https://www.facebook.com/ერთად-განათლებისთვის-103222841970498/', NULL, NULL, '2021-07-23 12:36:01', '2021-07-23 12:45:35', 'https://docs.google.com/forms/d/e/1FAIpQLSd2keg-V5WYnafVdOSkU77uHA0pHkalnLKpz1sR8AXhlMYYlw/viewform?usp=sf_link', NULL, 1, 0, 'ertadganatlebistvis@gmail.com', NULL, NULL, 1, 'ლუკა აგიტიანი is inviting you to a scheduled Zoom meeting.  Topic:  ახალგაზრდა ევროპელი ელჩების ინიციატივა. Time: Aug 2, 2021 09:00 PM Asia/Tbilisi  Join Zoom Meeting https://us05web.zoom.us/j/87338200264?pwd=Q1NVUU14VTZDR2NDb2hVZC84UzhSdz09  Meeting ID: 873 3820 0264 Passcode: cuc2EL', NULL, 0, NULL, 0),
(332, '{\"en\": null, \"ka\": \"ფსიქოლოგიის 2 კვირიანი უფასო კურსი\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;</p><p>ორგანიზაცია ,,ახალგაზრდები წარმატებისკენ\\\" გთავაზობთ ფსიქოლოგიის 2 კვირიან უფასო კურსს!</p><p>&nbsp;</p><p>მოწვეული სპიკერი ლანა ბახტურიძე.</p><p>&nbsp;</p><p>კურსის წარმატებით დასრულების შემთხვევაში გადმოგეცემათ მოსმენის სერტიფიკატები.</p><p>&nbsp;</p><p>რეგისტრაციის ბოლო ვადაა 31 ივლისი.</p><p>&nbsp;</p><p>რეგისტრაციისთვის ეწვიეთ ბმულს - <a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fforms.gle%2Fxn8WjsUihDhcahcR6%3Ffbclid%3DIwAR22xQXOQt89E4XPdluk59eSyYtdIJK5f2eoYS-xq1VSgtKgZdsVr-nOxwI&amp;h=AT0cz1TfpMCtgEFd1dzfJd_0-B2tzi_hrJMvMSPlEzW7Bjnu1uR6P5ivOQCiMTZ_0usBVUL2Tc1_abmJogd-bSzbNAnAYuLv9dOy0vXKd4QsO91yy72yCaKVQLMJTj5rtWrp&amp;__tn__=-UK-R&amp;c[0]=AT2UpCRJ0xTFscqmqsVqgfNr24ViBgux00Cpu1lCFWrj-eKBPure9v91DWIzNb9n_-aOcnNXa0D_wBV4G-zwT_-HBYAV8PMIemnoDQovyqfq3-v5hmPi_4qio9y3hvL_49ahiy_XWtukaafhslTX6idsnrGJ-iutr01jj7LutXx232WaG6d_F5OxgesJo_634Hqy\\\">https://forms.gle/xn8WjsUihDhcahcR6</a></p><p>&nbsp;</p><p>,,ერთად გავუხსნათ გზა მომავალს!\\\"</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-01', '2021-08-14', '2021-07-24', 156, NULL, '332__2021-07-2413:16:08.png', NULL, NULL, NULL, NULL, '2021-07-24 13:11:53', '2021-07-24 13:16:09', 'https://forms.gle/6znJNbJhVZdwrvVTA', NULL, 1, 0, 'axalgazrdebiwarmatebisken@gmail.com', NULL, NULL, 1, 'https://forms.gle/6znJNbJhVZdwrvVTA', NULL, 0, NULL, 0),
