(337, '{\"en\": null, \"ka\": \"ნახატების კონკურსი: \\\"ევროპა ჩემთვის\\\"\"}', '{\"en\": null, \"ka\": \"<p>”ახალგაზრდები ცვლილებებისათვის” აცხადებს ნახატების კონკურსს: “ევროპა ჩემთვის”.<br>&nbsp;</p><p>კონკურსის წესები:</p><p>მონაწილემ უნდა წარმოადგინოს საკუთარი ნამუშევარი, სადაც უნდა იყოს გადმოცემული მისი თვალით დანახული ევროპა.&nbsp;</p><p>კონკურსის ფარგლებში გამოვლინდება სამი გამარჯვებული მონაწილე, I-II-III ადგილოსნები.</p><p>გამარჯვებულები გამოვლინდებიან ფოტოზე ასახული დადებითი რეაქციების მიხედვით.</p><p>ნახატების მიღები ბოლო ვადაა 5 აგვისტო,20:00 საათი.</p><p>ნამუშევრები გამოქვეყნდება ჩვენს ოფიციალურ Facebook გვერდზე 6 აგვისტოს, 20:00 საათზე.</p><p>ნამუშევრებზე რეაქციების დაფიქსირება შესაძლებელი იქნება 10 აგვისტოს ჩათვლით, 18:00 საათამდე.</p><p>ორგანიზაცია იტოვებს უფლებას კონკურსიდან ჩახსნას ნამუშევარი რომელიც მიმართული იქნება ევროპული ღირებულებების და ზოგადად ანტი ევროპული განწყობებისაკენ!</p><p>კონკურსში მონაწილეობის მიღება შეუძლიათ სკოლის მოსწავლეებს ნებისმიერი კლასიდან.</p><p>გამარჯვებული მონაწილეები ორგანიზაციისგან მიიღებენ სპეციალურ სერტიფიკატებს და მათი ნამუშევრები გამოქვეყნდება ვებგვერდზე.</p><p>მონაწილეობის მსურველებმა ნახატები უნდა გამოგვიგზავნოთ ელ.ფოსტაზე:</p><p>Info.YFCH.Geo@gmail.com</p><p>ელ.ფოსტის სათაურში მიუთითეთ “ევროპა ჩემთვის”</p><p>აღწერაში მიუთითეთ:</p><p>სახელი, გვარი</p><p>ასაკი</p><p>სკოლა,კლასი</p><p>გისურვებთ წარმატებებს!</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-07-27', '2021-08-10', '2021-07-27', 143, NULL, '337__2021-07-2707:48:38.png', NULL, 'https://www.facebook.com/YouthForChangeGeo', NULL, 'http://www.yfch.ge/', '2021-07-27 07:43:02', '2021-07-27 07:48:38', 'Info.YFCH.Geo@gmail.com', NULL, 1, 0, 'Info.YFCH.Geo@gmail.com', NULL, NULL, 1, 'Info.YFCH.Geo@gmail.com', NULL, 0, NULL, 0),
