(343, '{\"en\": \"\", \"ka\": \"ინდივიდის უფლებები ფსიქო-სამართლებრივი თვალსაზრისით\"}', '{\"en\": \"\", \"ka\": \"<p>ააიპ საქართველოს ევროპისმცოდნეთა ასოციაცია და შპს განვითარება მომავლისთვის და ყველასთვის გთავაზობთ ერთობლივ პროექტს - ინდივიდი და მისი უფლებები ფსიქო-სამართლებრივი თვალსაზრისით\\\".</p><p>პროექტი მიზნად ისახავს:</p><p>ადამიანის უფლებების პოპულარიზაციას და საზოგადოების ცნობიერების ამაღლებას.</p><p>მონაწილეობა არის სრულიად უფასო და მონაწილეობა შეუძლია ნებისმიერ მსურველს.</p><p>მონაწილეობის მსურველებმა, გთხოვთ შეავსოთ სარეგისტრაციო ფორმა</p><p>რეგისტრაციის ვადა:</p><p>26.06.2021-დან-26.07.2021</p>\"}', '{\"en\": \"\"}', '', '', '555572823', '2021-08-01', '2021-08-07', '2021-07-09', 115, NULL, NULL, NULL, 'https://www.facebook.com/GESA2021/', '', '', '2021-07-28 17:48:53', '2021-07-28 17:48:53', 'https://docs.google.com/forms/d/1K0W-WFuz1F3Y5pJEUe14nM1Wdqec4wX5kRPXPY_-SIY/edit?chromeless=1', NULL, 1, 0, 'Europeanassociation1@gmail.com', 14, NULL, 1, '', '', 1, NULL, 1),
