(346, '{\"en\": null, \"ka\": \"ტრენინგ კუსი \\\"გახდი ტრენერი\\\"\"}', '{\"en\": null, \"ka\": \"<p>&nbsp;</p><p>&nbsp;</p><p>მოგესალმებით მეგობრებო ორგანიზაცია წარმატების გზა იწყებს კურს \\\"გახდი ტრენერი \\\" თუ გსურთ გაიგოთ როგორ გახდეთ ტრენერი? როგორ შეარჩიოთ სწორად მიზნობრივი აუდიტორია? როგორ შექმნათ ტრენინგ-მოდული ? როგორ წარმართოთ ტრენინგი სწორად? როგორ იყოთ ეფექტური ტრენერი? მაშინ ეს კურსი თქვენთვისაა. შემოგვიერთდით და შეიძინეთ დამატებითი პროფესია. კურსს გაუძღვება ქალბატონი - თეა ნაცვლიშვილი ტრენერების ტრენერი.</p><p>კურსი ჩატარდება კვირაში ორჯერ საღამოს 7 საათზე.</p><p>პირველი კვირა - სამშაბათი-ხუთშაბათი</p><p>მეორე კვირა - ორშაბათი -ოთხშაბათი.... 19:00</p><p>კურსის ხანგრძლივობა იქნება 1 საათიანი პლატფორმა -ონლაინ. კურსის ღირებულება- 120 ლარი კურსი დაიწყება 2 აგვისტოს ვისაც გსურთ მიიღოთ მონაწილეობა და აღმოაჩინოთ საკუთარი თავი ახალ ამპლუაში გთხოვთ გაიაროთ რეგისტრაცია მითითებულ ლინკზე რეგისტრაცია გაგრძელდება ორი კვირის განმავლობაში შემდგომ დაგიკავშირდებათ ჩვენი წარმომადგენელი და გაგაცნობთ დეტალებს</p><p>https://docs.google.com/forms/u/0/d/1kvCITadkYAcqPY-whkw6QqWtjUlB6JseSaRbk9G0FIU/viewform?usp=drivesdk&amp;fbclid=IwAR30F-PG2ycLtMBfHBJ7KXaqb2c61_woLVWJLvGwxgrkfm9VpDVQmqin-rQ&amp;edit_requested=true</p><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '555131618', '2021-07-29', '2021-07-02', '2021-09-02', 163, NULL, NULL, NULL, 'https://www.facebook.com/%E1%83%AC%E1%83%90%E1%83%A0%E1%83%9B%E1%83%90%E1%83%A2%E1%83%94%E1%83%91%E1%83%98%E1%83%A1-%E1%83%92%E1%83%96%E1%83%90The-way-to-success-101943578790409/?ref=page_internal', NULL, NULL, '2021-07-29 18:08:34', '2021-07-29 18:17:07', 'https://docs.google.com/forms/u/0/d/1kvCITadkYAcqPY-whkw6QqWtjUlB6JseSaRbk9G0FIU/viewform?usp=drivesdk&fbclid=IwAR30F-PG2ycLtMBfHBJ7KXaqb2c61_woLVWJLvGwxgrkfm9VpDVQmqin-rQ&edit_requested=true', NULL, 1, 0, 'thewaytofair@gmail.com', 14, 60, 1, 'მონაწილეს მიეწოდება ლექციისას', NULL, 0, NULL, 0),
