:17:58', 'https://forms.gle/mdt5Sdwv1LTbsTi58', NULL, 1, 0, NULL, NULL, NULL, 1, 'meet', '', 1, NULL, 1),
(349, '{\"en\": null, \"ka\": \"შეხვედრა ზურაბ აბაშიძესთან -\\\" რას გულისხმობს აბაშიძე-კარასინის ფორმატი\\\"\"}', '{\"en\": null, \"ka\": \"<p>📢საქართველოს ატლანტიკური ხელშეკრულების ახალგაზრდული ასოციაცია (YATA Georgia)</p><p>ორგანიზებას უწევს ონლაინ საჯარო ლექციას თემაზე ,,Რას გულისხმობს აბაშიძე-კარასინის ფორმატი?”</p><p>&nbsp;</p><p>🔵საჯარო ლექციის მომხსენებელი გახლავთ რუსეთთან ურთიერთობის საკითხებში პრემიერის სპეციალური წარმომადგენელი, ბატონი ზურაბ აბაშიძე.</p><p>&nbsp;</p><p>🔵ონლაინ შეხვედრა გაიმართება მიმდინარე წლის 5 აგვისტოს (ხუთშაბათს, 19:00 სთ.).</p><p>&nbsp;</p><p>🔵შეხვედრის პირველი ნაწილი დაეთმობა რუსეთის პოლიტიკის როლს საქართველოს საგარეო პოლიტიკურ პროცესში და ბატონი ზურაბი გაგვიზიარებს თავის გამოცდილებასა და შეხედულებებს.</p><p>მეორე ნაწილი კი, დაეთმობა კითხვა-პასუხის რეჟიმს,სადაც მონაწილეებს შეეძლებათ მათთვის საინტერესო შეკითხვების დასმა.</p><p>&nbsp;</p><p>🔵აღსანიშნავია, ბატონი ზურაბ აბაშიძის საგანმანათლებლო საქმიანობაც. იგი გახლავთ პოლიტოლოგიის მეცნიერებათა დოქტორი, ამასთან, 2012 წლამდე ის იყო საგანგებო და სრულუფლებიანი ელჩი ბენილუქსის ქვეყნებში და გახლდათ ევროკავშირთან და ნატოსთან საქართელოს მისიის ხელმძღვანელი. ბატონი ზურაბი ეწევა პედაგოგიურ საქმიანობასაც და არის არაერთი სამეცნიერო ნაშრომისა და წიგნის ავტორი.</p><p>მისი სამეცნიერო ნაშრომები შეეხება ისეთ საკითხებს, როგორიც არის: კონფლიქტების მოგვარება, ნატოსა და საქართველოს ურთიერთობა, ცივი ომის ეპოქა, საბჭოთა კავშირი და ა.შ.</p><p>&nbsp;</p><p>Zoom ლინკი:</p><p>&nbsp;</p><p>Topic: შეხვედრა ზურაბ აბაშიძესთან</p><p>Time: Aug 5, 2021 07:00 PM Asia/Tbilisi</p><p>&nbsp;</p><p>Join Zoom Meeting</p><p>https://us02web.zoom.us/j/83181128119?pwd=V0x1YnprbVJsQjg0TWx0eDU5ZU9QQT09</p><p>&nbsp;</p><p>Meeting ID: 831 8112 8119</p><p>Passcode: 879739</p><p>Join our Cloud HD Video Meeting</p><p>us02web.zoom.us</p><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-05', '2021-08-05', '2021-08-01', 148, NULL, '349__2021-08-0216:19:06.png', NULL, NULL, NULL, NULL, '2021-08-02 16:00:04', '2021-08-02 16:27:13', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
