(352, '{\"en\": null, \"ka\": \",,ქალ ბიზნესმენთა საქმიანობის გაციფურლება Covid-19 -ის საპასუხოდ\\\"\"}', '{\"en\": null, \"ka\": \"<p>დაიწყო აპლიკაციების მიღება პროექტისთვის: ,,ქალ ბიზნესმენთა საქმიანობის გაციფურლება Covid-19 -ის საპასუხოდ\\\".</p><p>პროექტი მოიცავს 6 თვეს და მისი მიზანია აჭარის რეგიონში მოქმედი ქალ ბიზნესმენთა საქმიანობის განვითარებისა და ეკონომიკური მდგრადობის ამაღლების ხელშეწყობა მათი საქმიანობის გაციფრულების გზით.</p><p>შერჩეული ბენეფიციარები გაივლიან პრაქტიკულ კურსს :10 დღიან ტრენინგს 4 ძირითად თემატიკაზე:</p><p>1.სოციალური ქსელის მართვა ბიზნესისთვის (როგორ შევქმნათ ბიზნეს გვერდის სოციალურ ქსელში, როგორ ვმართოთ ბიზნეს გვერდი, ბიზნეს მენეჯერის მართვა, როგორ შევქმნათ სწორად კონტეტნტი, მომხმარებელთან ურთიერთობა);</p><p>2.ონლაინ გაყიდვები (როგორ შევქმნათ ონლაინ მაღაზია სოციალურ ქსელში, როგორ გავაკეთოთ სწორი რეკლამა სოციალურ ქსელში, როგორ გავყიდოთ პროდუქცია ნაკლები დანახარჯით, პარტნიორობა და სპონსორობა ბიზნესში);</p><p>3. ბიზნეს გეგმის შედგენა ( სტანდარტულ ფორმატთან ერთად განიხილება ბიზნეს მოდელის ტილო);</p><p>4. ფინანსები არაფინანსისტებისთვის ( ბიუჯეტის შედგენა ბიზნეს გეგმისთვის; საგადასახადო კოდექსის მიმოხილვა; მოგება-ზარალის უწყისი, ხარჯთაღრიცხვა, პროდუქციის თვითღირებულების და რეალიზაციის ფასის დადგენა);</p><p>ტრენინგების გავლის შემდეგ, ბენეფიციარებისთვის:</p><p>• მოხდება ბიზნესის ბრენდინგი/რებრენდინგი;</p><p>• თითოეული ბენეფიციარისთვის შეიქმნება ონლაინ მაღაზია მათი პროდუქციის რეალიზაციისთვის.</p><p>პროექტის ბოლოს შეიქმენა ადგილობრივი ბიზნეს Networking-ი, სადაც გაწევრიანდებიან როგორც ბენეფიციარები, ასევე ადგილობრივი ბიზნესის წარმომადგენლები და წლის მანძილზე ბიზნესის განვითარების მიზნით განახორციელებენ სხვადასხვა აქტივობებს.</p><p>პროექტში მონაწილეობა შეუძლიათ :</p><p>აჭარის რეგიონში რეგისტრირებულ ბიზნესებს, რომლებიც დაფუძვნებულია ქალთა მიერ ან ხელმძღვანელობენ ქალები;</p><p>აჭარის რეგიონში მცხოვრები თვითდასაქმებული ქალები;</p><p>აჭარის რეგიონში მცხოვრები ქალი სტარტაპერები</p><p>პროექტში მონაწილეობა შეუძლიათ როგორც დამწყებ, ასევე განვითარებად ბიზნესებს, როგორც წარმოება-ვაჭრობის, ასევე მომსახურების სფეროდან.</p><p>მონაწილეობა უფასოა!</p><p>აპლიკაციის მიღების ბოლო ვადაა: 10 აგვისტო;</p><p>აპლიკანტთა შერჩევა : 11 აგვისტო - 15 აგვისტო;</p><p>ტრენინგების კურსი: 20 აგვისტო - 11 სექტემბერი.</p><p>რეგისტრაციისთვის გთხოვთ, შეავსოთ აპლიკაცია</p><p><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fforms.gle%2FHviqYjirGgMwdB5k6%3Ffbclid%3DIwAR2LrdMfc6nYRzDssD2PXtF1L77JmRgseYbmO02JETmQCHGmFwvuC23l-Lk&amp;h=AT22QENxygwQHipnWxcGhTVZnp9sATD1MYluObOIcdcqQ0b1VDKB_0DM0VJJmO9utgkYs0_RNkk34-VPeS75ka6z6dAg8_5ZfufGTJk104ACumSLVnku1kLb4VzKXQtWMknZ&amp;__tn__=-UK-R&amp;c[0]=AT3TiL4K_jK6vEJqF2EcE3RnyhjnxgcKXVr7OkX-avNribPa6lQhEFhkCvtBzy9BRfK2WkBYpMIjSzxDZ00LO0o3KTLW4qHBdgZNXSa3Q6ONM-bJLUNIXAvQbFXE7LyteL5EQ1rKAkuWQZ7CO6Z-N-RTLgsENYZhZQzlRseOEyryfNab7Sphef65Xqkg9O0Q8-_NVDZx\\\">https://forms.gle/HviqYjirGgMwdB5k6</a></p><p>პროექტს ახორციელებს ,,ახალგაზრდები საზოგადოებრივი ინტერესებისთვის\\\".</p><p>პროექტი დაფინანსებულია ,,ქალთა ფონდი საქართველოში\\\"-ს მიერ <a href=\\\"https://www.facebook.com/womenfundgeorgia/?__cft__[0]=AZXN7eJymxcRGvZvlPNdXa0G3x2tG-RyG5iH31cgx0eCUe7Ehs5Xt_BZjkJc-3Al0l41KUWwWie8ThDP_6um8UqhuWTuLRCoQRzCXm68WuZBmnCleSA7hqq5UW4pe10EoU2xIy56DFP_5hylv7iC6oOLqqWzNg2btiJRxXW4PddFSh849HXppmG1bHFgBINfG2Q&amp;__tn__=kK-R\\\">Women\'s Fund in Georgia</a></p>\"}', '{\"en\": \"ქ.ბათუმი, ს.ზუბალაშვილის #11\", \"ka\": \"ქ.ბათუმი, ს.ზუბალაშვილის #11\"}', '41.749499240889065', '44.533662748623044', '591057850', '2021-07-25', '2021-08-10', '2021-08-03', 99, NULL, '352__2021-08-0309:24:01.png', NULL, 'https://www.facebook.com/YouthForPublicInterests', NULL, NULL, '2021-08-03 09:16:48', '2021-08-03 09:24:02', 'https://forms.gle/HviqYjirGgMwdB5k6', NULL, 1, 0, 'organization.ypi@gmail.com', 18, NULL, 0, NULL, NULL, 0, NULL, 0),
(353, '{\"en\": null, \"ka\": \"დასავლეთ საქართველოს რეგიონული ახალგაზრდული ფორუმები 2021\"}', '{\"en\": null, \"ka\": \"<p>ვიწყებთ \\\"<strong>რეგიონული ახალგაზრდული ფორუმების</strong>\\\" ციკლს, რომელიც საქართველოს 10 რეგიონში ინდივიდუალურად ჩატარდება.</p><p>რეგიონული ახალგაზრდული ფორუმების მიზანია, ახალგაზრდების, ახალგაზრდული ორგანიზაციების და სხვა დაინტერესებული მხარეების უშუალოდ ჩართვა „საქართველოს ახალგაზრდული სტრატეგია 2025“–ის სამოქმედო გეგმის შემუშავების პროცესში.</p><p>ახალგაზრდებისთვის და ახალგაზრდებთან ერთად ვქმნით მათი, როგორც დამოუკიდებელი ინდივიდების და საზოგადოების სრულფასოვანი წევრების განვითარების მხარდამჭერ ახალგაზრდული სფეროს ეკოსისტემას.</p><p>ამ პროცესში, უმნიშვნელოვანესი ნაბიჯია \\\"სახელმწიფო ახალგაზრდული სტრატეგია 2025\\\"–ის არსებობა, რომელიც საქართველოს პარლამენტის მიერ დამტკიცებულ \\\"2020–2030 წლებისთვის საქართველოს ახალგაზრდული პოლიტიკის კონცეფცია\\\"-ზე დაფუძნებით, გასულ წელს, მონაწილეობრივად, დაინტერესებული მხარეების, საერთაშორისო და ადგილობრივი დონორი ორგანიზაციების, ახალგაზრდული ორგანიზაციების, თემატური ექსპერტებისა და თავად ახალგაზრდების ჩართულობით შეიქმნა.</p><p>ქვეყნის მასშტაბით ფორუმების დასრულების შემდეგ ახალგაზრდებისგან მიღებული რეკომენდაციები შეჯამდება და მომზადდება ანგარიში, რომელსაც სააგენტო \\\"სახელმწიფო ახალგაზრდული სტრატეგიის 2025\\\"-ის საქმოქმედო გეგმის შემუშავებისას გაითვალისიწნებს.</p><p>სტრატეგიისა და სამოქმედო გეგმის შემუშავების პროცესში ახალგაზრდობის სააგენტოს მხარდაჭერას უწევს გაეროს საკოორდინაციო ჯგუფი ახალგაზრდობის საკითხებზე (UNFPA, UNICEF, UNDP, UNIDO, ILO, UNHCR) და ევროკავშირის ტექნიკური მხარდაჭერის პროექტი საქართველოში „განათლება დასაქმებისთვის” (Skills4Jobs)“.</p><p>რეგიონული ფორუმები, პირველი ეტაპზე, გაიმართება დასავლეთ საქართველოში:</p><p>1. <i>გურიის ახალგაზრდული ფორუმი</i> - ქ. ოზურგეთი, 10 აგვისტო; (რეგისტრაციის ბოლო დღე 8 აგვისტო, 14:00 საათი)<br>2. <i>აჭარის ავტონომიური რესპუბლიკის ახალგაზრდული ფორუმი </i>- ქ. ბათუმი, 12 აგვისტო; (რეგისტრაციის ბოლო დღე 10 აგვისტო, 14:00 საათი)<br>3.<i> სამეგრელოს-ზემო სვანეთის ახალგაზრდული ფორუმი</i> - ქ. ზუგდიდი, 14 აგვისტო; (რეგისტრაციის ბოლო დღე 12 აგვისტო, 14:00 საათი)<br>4. <i>რაჭა-ლეჩხუმ ქვემო სვანეთის ახალგაზრდული ფორუმი</i> - ქ. ონი, 16 აგვისტო; (რეგისტრაციის ბოლო დღე 14 აგვისტო, 14:00 საათი)<br>5. <i>იმერეთის ახალგაზრდული ფორუმი </i>- ქ. ქუთაისი, 18 აგვისტო. (რეგისტრაციის ბოლო დღე 16 აგვისტო, 14:00 საათი)</p><p>ქვეყანაში არსებული ეპიდემიური ვითარებიდან გამომდინარე ფორუმში მონაწილეთა რაოდენობა შეზღუდულია.<br>მონაწილეობის მისაღებად აუცილებელია კოვიდ 19-ის სწრაფი ტესტის გაკეთება, რასაც ადგილზე უზრუნველყოფს სსიპ - ახალგაზრდობის სააგენტო.</p><p>შერჩეულ კანდიდატებს დეტალური ინფორმაცია და ფორუმის დღის წესრიგი გამოგეგზავნებათ ელ. ფოსტის მეშვეობით.</p>\"}', '{\"en\": \"რეგიონების მიხედვით სხვადასხვა მისამართზე\", \"ka\": \"რეგიონების მიხედვით სხვადასხვა მისამართზე\"}', NULL, NULL, '+995 32 230 51 65', '2021-08-10', '2021-08-18', '2021-08-03', 1, NULL, '353__2021-08-0312:00:58.png', NULL, 'https://www.facebook.com/YouthAgencyGeorgia', NULL, 'https://youthagency.gov.ge/', '2021-08-03 11:49:37', '2021-08-03 12:00:58', 'https://bit.ly/3lnwBkA', NULL, 1, 0, 'info@youthagency.gov.ge', NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(355, '{\"en\": null, \"ka\": \"International Rural Acceleration Program - \'Youth for Sustainable Rural Development\'\"}', '{\"en\": null, \"ka\": \"<p>Would like to create and develop your innovative social enterprise and work in an international team of young people with the help of trainers and mentors?<br><br>Then we are happy to invite you to participate in the international rural acceleration program ‘Youth for Sustainable Rural Development’, which aims to motivate, encourage and enable young people from rural areas to create innovative eco-social enterprises and sustainable communities with equal opportunities for everyone.</p><p>The project is implemented by the Entrepreneurs Association Georgia in partnership with ThinkCamp Germany.<br><br><strong>The project is funded under the grant program “MEET UP! Youth for Partnership” by the Remembrance, Responsibility, and Future (EVZ) Foundation and the Federal Foreign Office.</strong></p><p><strong>#MEETUPforPartnership #YOUTHforPartnership&nbsp;&nbsp;</strong><br><br>In the framework of the project 15 Georgian and 15 German participants aged between 18 years and 35 years will be selected, who are willing to spend the fall working on fascinating social enterprise projects in rural areas. There is no fee for your participation. Costs related to travel, accommodation, and meals will be covered by the project.</p><p><i>Project activities include:</i></p><ul><li>Kick-off meeting - August&nbsp;25, 2021</li><li>Working meeting - September&nbsp;2-8, 2021</li><li>Working meeting - November&nbsp;28-December&nbsp;3, 2021</li><li>International masterclasses :</li></ul><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 21.09.2021</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 05.10.2021</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 19.10.2021</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 02.11.2021</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 23.11.2021</p><ul><li>Demo day – December&nbsp;14, 2021</li></ul><p>In case of your interest please fill in the online application form until August 20:</p><p>➡Application form for the Georgian participants:&nbsp;<a href=\\\"https://bit.ly/2Tm3GC3\\\">https://bit.ly/2Tm3GC3</a>&nbsp;</p><p>➡Application form for the German participants:<a href=\\\"https://bit.ly/2W7AMXb\\\">https://bit.ly/2W7AMXb</a>&nbsp;</p><p><strong>Q&amp;A:</strong></p><p>For questions you are welcome to contact project organizers :</p><ul><li>Georgia -&nbsp;<a href=\\\"mailto:tinatin@entrepreneurs.ge\\\">tinatin@entrepreneurs.ge</a></li><li>Germany -&nbsp;<a href=\\\"mailto:johannes.pfister@thinkcamp.eu\\\">johannes.pfister@thinkcamp.eu</a></li></ul><p>Please find additional information with the attached info-pack -&nbsp;<a href=\\\"https://bit.ly/3rUItfd\\\">https://bit.ly/3rUItfd</a>&nbsp;</p>\"}', '{\"en\": \"hybrid format\", \"ka\": \"hybrid format\"}', '41.72211253715028', '44.72616976147563', NULL, '2021-08-25', '2021-12-14', '2021-08-03', 164, NULL, '355__2021-08-0314:43:28.png', NULL, 'https://www.facebook.com/EntrepreneursGeorgia', NULL, 'https://entrepreneurs.ge', '2021-08-03 13:42:55', '2021-08-03 14:45:04', 'https://bit.ly/2Tm3GC3', NULL, 1, 0, 'tinatin@entrepreneurs.ge', 18, 35, 0, NULL, NULL, 0, NULL, 0),
(356, '{\"en\": null, \"ka\": \"ფსიქოოლოგიის კომიტეტის წევრების მიღება\"}', '{\"en\": null, \"ka\": \"<figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t97/1.5/16/1f50a.png\\\" alt=\\\"🔊\\\"></figure><p>მოგესალმებით!</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t48/1.5/16/1f535.png\\\" alt=\\\"🔵\\\"></figure><p>ორგანიზაცია ,,ახალგაზრდები წარმატებისკენ\\\" აცხადებს ფსიქოლოგიის კომიტეტის წევრებისთვის მოხალისეთა მიღებას!</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td7/1.5/16/2757.png\\\" alt=\\\"❗\\\"></figure><p>თუ გინდა რომ დათანხმდე მოხალისეობრივ სამუშაოს საკუთარი თავის განვითარებისთვის და გსურს დაეხმარო თანატოლებს რომ მიაღწიონ წარმატებას მაშინ ეს შემოთავაზება შენთვისაა!</p><p>გელოდებით შემდეგ პოზიციებზე:</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t53/1.5/16/1f7e0.png\\\" alt=\\\"🟠\\\"></figure><p>კომიტეტის პროექტების კოორდინატორი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td4/1.5/16/1f7e1.png\\\" alt=\\\"🟡\\\"></figure><p>კომიტეტის თავჯდომარე.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tc7/1.5/16/1f534.png\\\" alt=\\\"🔴\\\"></figure><p>კომიტეტის სოციალური მედია მენეჯერი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t48/1.5/16/1f535.png\\\" alt=\\\"🔵\\\"></figure><p>კომიტეტის ტექნიკური მენეჯერი.</p><p>მოთხოვნები:</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1.5/16/1f7e5.png\\\" alt=\\\"🟥\\\"></figure><p>მოტივაცია.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tda/1.5/16/1f7e7.png\\\" alt=\\\"🟧\\\"></figure><p>გუნდური მუშაობის უნარი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tdc/1.5/16/1f7e9.png\\\" alt=\\\"🟩\\\"></figure><p>ინდივიდუალური მუშაობის უნარი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t59/1.5/16/1f7e6.png\\\" alt=\\\"🟦\\\"></figure><p>პასუხისმგებლობის შეგრძნება.</p><p>მთავარი მოვალეობები:</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tcb/1.5/16/1f538.png\\\" alt=\\\"🔸\\\"></figure><p>კომიტეტის პროექტების კოორდინატორი - დაგეგმო პროექტები ფსიქოლოგიის მიმართულებით და მოიწვიო ტრენერები.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tcb/1.5/16/1f538.png\\\" alt=\\\"🔸\\\"></figure><p>კომიტეტის თავჯდომარე - აკონტროლო კომიტეტის წევრების სამუშაო, დაეხმარო ყველა კომიტეტის წევრს თავისი მოვალეობის შესრულებაში.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tcb/1.5/16/1f538.png\\\" alt=\\\"🔸\\\"></figure><p>კომიტეტის სოციალური მედია მენეჯერი - დაწერო ტექსტი სარეგისტრაციო პოსტისთვის, შექმნა პოსტერი, განათავსო ორგანიზაციის გვერდზე.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tcb/1.5/16/1f538.png\\\" alt=\\\"🔸\\\"></figure><p>კომიტეტის ტექნიკური მენეჯერი - უზრუნველყო პროექტების ტექნიკური მხარეები.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t65/1.5/16/1f587.png\\\" alt=\\\"🖇️\\\"></figure><p>აპლიკანტები შეირჩევიან 2 ეტაპად:</p><p>სამოტივაციო წერილი და გასაუბრება.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tfe/1.5/16/203c.png\\\" alt=\\\"‼️\\\"></figure><p>სამუშაო არის სრულად მოხალისეობრივი და მოიცავს მხოლოდ ონლაინ მუშაობას.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t4c/1.5/16/1f539.png\\\" alt=\\\"🔹\\\"></figure><p>რეგისტრაციის ბოლო ვადაა - 15 ივლისი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5/1.5/16/1f4cc.png\\\" alt=\\\"📌\\\"></figure><p>სარეგისტრაციო ფორმის ბმული:&nbsp;</p><p><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fforms.gle%2FCW8m8L3qMo4VWdtp7%3Ffbclid%3DIwAR3j4FHtUMFYzbLDohm2kss45YgjQ7d7vzO8hgUCSRTCY7ptHtGkcQ-EriE&amp;h=AT2bZoQnusHAwVQZZIGBQBbOcCdapsC3AB-tqycs4xXIdu5v38Arl9PYmJ07FClFhrL9GwI5xkVjjE6jD9559S5PhInU16-beuRie4TnXykGYOQ9mfVZJaYUR_kA8fJ0vysA&amp;__tn__=-UK*F&amp;c[0]=AT1Q7N7oVKj1d2X-ATW6_bAxUb3C7hQJBFc5gyrM1D4efxEIhtD5rHXJUjX2OtZUtuDjO2Nj3gN0NEYI8HN3SWweW3oFx1RbzArbir9mOnDl9tmBSPZbQ6OuSA_uYah6-SWpymFfK3kNoIe5ewMNwvCHcMGV9pSHFzcJz03AVi4AgAtx\\\">https://forms.gle/CW8m8L3qMo4VWdtp7</a></p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t86/1.5/16/1f4cd.png\\\" alt=\\\"📍\\\"></figure><p>დამატებითი კითხვების შემთხვევაში მოგვმართეთ მეილზე; axalgazrdebiwarmatebisken@gmail.com</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t10/1.5/16/1f58b.png\\\" alt=\\\"🖋️\\\"></figure><p>სამოტივაციო წერილი უნდა შეადგენდეს მინიმუმ 25 და მაქსიმუმ 250 სიტყვას.</p><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-05', '2021-08-15', '2021-08-05', 156, NULL, '356__2021-08-0518:02:08.png', NULL, NULL, NULL, NULL, '2021-08-05 18:00:06', '2021-08-05 18:02:10', 'https://forms.gle/bMMixvuZzkwscgav5', NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(357, '{\"en\": null, \"ka\": \"საბჭოს კოორდინატორი\"}', '{\"en\": null, \"ka\": \"<p>🎉”ახალგაზრდები ცვლილებებისათვის” იწყებს აპლიკაციების მიღებას სამეგრელო-ზემო სვანეთის რეგიონული საბჭოს კოორდინატორის პოზიციაზე.</p><p>💥რეგიონული საბჭო შედგება სკოლის მოსწავლეებისაგან და მიზნად ისახავს ადგილობრივი ახალგაზრდების გაძლიერებას და მათ ჩაბმას სამოქალაქო ცხოვრებაში.</p><p>✅კოორდინატორის ფუნქციები:</p><p>🟡საბჭოს საქმიანობის დაგეგმვა.</p><p>🟢რეგიონის პრობლემების იდენტიფიცირება.</p><p>🟣ახალგაზრდებისთვის სხვადასხვა სახის შემეცნებითი აქტივობების დაგეგმვა.</p><p>🟠საბჭოს ხელმძღვანელობა.</p><p>🔴წევრების შერჩევა.</p><p>➖კონკურსის ფარგლებში შეირჩევა ორი კოორდინატორი.</p><p>✔️მოთხოვნები:</p><p>🔹დამამათავრებელი კლასის მოსწავლე ან 25 წლამდე ახალგაზრდა რომელიც ცხოვრობს სამეგრელო-ზემო სვანეთში.</p><p>🔸სამოქალქო საქმიანობაში ჩართულობა.</p><p>💥ჩვენ გთავაზობთ:</p><p>🟢ორგანიზაციის ყოველდღიურ საქმიანობაში ჩართვას.</p><p>🟣საერთაშორისო ღონისძიებებზე დასწრების შესაძლებლობას.</p><p>🟢ახალ ცოდნას და გამოცდილებას.</p><p>💁‍♂️თუ თვლი, რომ ეს შესაძლებლობაა შენთვისაა, მაშინ გამოგვიგზავნე სამოტივაციო წერილი და CV ელ.ფოსტაზე:</p><p>✉️Info.yfch.geo@gmail.com</p><p>გისურვებთ წარმატებებს!❤️</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-08-06', '2021-08-20', '2021-08-06', 143, NULL, '357__2021-08-0609:01:38.png', NULL, NULL, NULL, 'https://www.yfch.ge/', '2021-08-06 08:53:01', '2021-08-06 09:01:39', 'Info.yfch.geo@gmail.com', NULL, 1, 0, 'Info.yfch.geo@gmail.com', 14, 25, 1, 'Info.yfch.geo@gmail.com', NULL, 0, NULL, 0),
