(359, '{\"en\": null, \"ka\": \"სტატიების კონკურსი\"}', '{\"en\": null, \"ka\": \"<p><strong>”ახალგაზრდები ცვლილებებისათვის” გთავაზობთ სტატიების კონკურს: “ახალგაზრდობის როლი დემოკრატიულ სახელმწიფოში”.</strong><br>&nbsp;</p><p>კონკურსი მიძღვნილია ახალგაზრდობის საერთაშორისო დღისადმი.</p><p>ტექნიკური დეტალები:</p><p>სტატია უნდა იყოს მაქსიმუმ ერთი გვერდი.</p><p>შრიფტი: 12, Sylfaen.</p><p>მიღების ბოლო ვადაა 11 აგვისტო, 20:00 საათი.</p><p>საუკეთესო სტატიას შეარჩევს სპეციაულურად მოწვეული ჟიური.</p><p>სტატია გამოქვეყნდება ჩვენი ორგანიზაციის ოფიციალურ ვებ-გვერდზე.</p><p>გამრჯვებული ნაშრომის ავტორი პარტნიორი ორგანიზაციებისაგან მიიღებს სერტიფიკატებს.</p><p>სტატიები გამოგვიგზავნეთ ელ.ფოსტაზე:</p><p>Info.YFCH.geo@gmail.com</p><p>გისურვებთ წარმატებებს!&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, '597 20 60 17', '2021-08-09', '2021-08-11', '2021-08-09', 143, NULL, '359__2021-08-0917:30:46.png', NULL, 'https://www.facebook.com/YouthForChangeGeo', NULL, 'https://www.yfch.ge/', '2021-08-09 17:26:10', '2021-08-09 17:30:48', 'Info.YFCH.geo@gmail.com', NULL, 1, 0, 'Info.YFCH.geo@gmail.com', NULL, NULL, 1, 'Info.YFCH.geo@gmail.com', NULL, 0, NULL, 0),
(360, '{\"en\": null, \"ka\": \"ჩემი მომავალი პროფესია\"}', '{\"en\": null, \"ka\": \"<p>📌თუ ჯერ კიდევ ვერ გაგირკვევია რა პროფესია გინდა აირჩიო სამომავლოდ ეს ვებინაარი შენთვისაა💕</p><p>📣\\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ვებინარს, თემაზე, \'\'ჩემი მომავალი პროფესია\\\"</p><p>📌დაესწარი ვებინარს და მიიღე რჩევები სხვადასხვა პროფესიის წარმომადგენლისგან, რომლებიც გაგიზიარებენ გამოცდილებას და დაგეხმარებიან იპოვო შენს ყველა კითხვაზე პასუხი 💕</p><p>📌მომხსენებლები:</p><p>💛თამაზ ხალხელაური-იაკობ გოგებაშვილის სახელობის, თელავის სახელმწიფო უნივერსიტეტის ზუსტ და საბუნევისმეტყველო ფაკულტეტის ბიოლოგიის სპეციალობის სტუდენტი და ახალგაზრდული მუშაკი.</p><p>💛თამარი უთიაშვილი-ივანე ჯავახიშვილის თბილისის სახელმწიფო უნივერსიტეტის საერთაშორისო ურთიერთობების ბაკალავრი.</p><p>💛გიორგი ბჟალავა-სამართლის მაგისტრი და იურისტი.</p><p>🟥 პროექტში მონაწილეობა შეუძლია ნებისმიერ დაინტერესებულ პირს.</p><p>⬛ დრო და თარიღი - 11 აგვისტო, 17:00.</p><p>⬛ მონაწილეობის მსურველებმა გთხოვთ შეავსოთ მარტივი სარეგისტრაციო ფორმა:<br><a href=\\\"https://l.facebook.com/l.php?u=https%3A%2F%2Fforms.gle%2FcgwFknqA1H3MeUFY9&amp;h=AT1zqIKkl40IhaPYN0oLd0pIJeZzs2lX8hLdklvvoyyhgVz4Wrk8hGsFAijS6bxJiayp3EnyyqWbU0Nkb4a0Phzb-C8bAE6qc_R7cBgnLINpWqu79mGw2NyBsgIOEfQhFfDU51o_8N-PQcsYtOUKInBK35fhAVQY9hmwdpgH-0N9cgQdti3jv8OLqkgXxdZOQ1gn_rnNaCyLb4MuHEnXwfn0qW0ebFIA7FdF26_4ACCDRuShzcApmN646gOKmH7TMqe5UC9Fpv2AEq_VSDejTwiP2GnbZKVaLyDxe02wWFRTmprmjZ-axAk4jQDOmsfT5CHCv8EJBHWVSsSSkWmr5LmyoS1ZYoyogskLcYh0fGOD40U2pQeWTRK7FG8HYkPW-dztowDyBABjaI-Vc0nC5ivW80G6QouoUsDT3XudBMuGdZ4Yw1bs8dmTNYAFnN2cueK_7BYV_3pgCwOsTwh9jsw04xcjniBUk6_m5g_DwhqNSWDQVLfBQtXV5zUpivZSPwC6C8BIAjjkkElSOys4k0gU3OHamNUrxcQgJLFqgSYur-KDXu_uEc3VjuImsphF9sSHVBjo3XaDvQrf7MIpz9O57AxzcDQNdg-_\\\">https://forms.gle/cgwFknqA1H3MeUFY9</a></p><p>🟥 აპლიკაციების მიღება შესაძლებელია 11 აგვისტოს 16:00-ის ჩათვლით.</p><p>⬛პროექტი გაიმართება ონლაინ Google Meet-ის პლატფორმაზე</p><p>გისურვებთ წარმატებას! ❤️</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-11', '2021-08-11', '202