(362, '{\"en\": null, \"ka\": \"ვეძებთ კომუნიკაციის ოფიცერს\"}', '{\"en\": null, \"ka\": \"<p><strong>ძირითადი მოვალეობები:</strong></p><p>ორგანიზაციის კომუნიკაციის სტრატეგიისა და თითოეული პროექტის კომუნიკაციების გეგმის განხორციელება;</p><p>ონლაინ სივრცეში ორგანიზაციის ხილვადობაზე ზრუნვა: ორგანიზაციის ვებგვერდისა და სოციალური ქსელებისთვის (Facebook, Twitter, Instagram) კონტენტის მომზადება; ორგანიზაციის ვებგვერდის მართვა; ორგანიზაციის ცნობადობის ამაღლების მიზნით, სოციალური მედიაკამპანიების დაგეგმვა- განხორციელება;</p><p>პროდუქტის დიზაინი და გამოქვეყნება:ორგანიზაციის ვიზუალური მასალების, ვიდეორგოლებისა და ბრენდირებული პროდუქტების შექმნა-გავრცელების კოორდინირება; ორგანიზაციის პუბლიკაციების დიზაინის, დაკაბადონებისა და ბეჭდვის კოორდინირება.</p><p>მედიასთან ურთიერთობა: პრესრელიზების მომზადება; მედიასთან კომუნიკაცია და მათი საკონტაქტო მონაცემთა ბაზის მომზადება; ინტერვიუების დაგეგმვა, კოორდინირება;</p><p>ღონისძიებები და პროექტები: სოციალურ ქსელებში ღონისძიების ხილვადობაზე ზრუნვა; მედია გაშუქება; რეპორტაჟების შეგროვება; მედიახილვადობის ანგარიშის მოსამზადებლად, შესაბამისი მონაცემების შეგროვება.</p><p>გამოსაცდელი პერიოდი: 3 თვე</p><p>სამუშაო საათები: 11:00 – 18:00 საათი</p><p>დაინტერესებულმა პირებმა, გთხოვთ, გამოგზავნოთ თქვენი CV (ქართულ ან ინგლისურ ენაზე) ელექტრონულ მისამართზე.</p><p>ამასთან, გამოგვიგზავნეთ ნებისმიერი დამატებითი მასალა, რომელიც დაადასტურებს თქვენს გამოცდილებას აღნიშნული პოზიციის მიმართულებით. გთხოვთ, სათაურის ველში მიუთითოთ ვაკანსიის დასახელება.</p><p>გასაუბრება განხორციელდება მხოლოდ მეორე ეტაპზე გადასულ კანდიდატებთან</p><p>CV გამოგზავნეთ info@youthcouncil.ge-ზე.&nbsp;</p><p>ბოლო ვადა: 2021 წლის 20 აგვისტო.&nbsp;</p><p>დეტალები იხილეთ დანართ დოკუმენტში.&nbsp;</p>\"}', '{\"en\": \"ვაჟა ფშაველას 76 ბ\", \"ka\": \"ვაჟა ფშაველას 76 ბ\"}', NULL, NULL, NULL, '2021-08-12', '2021-08-20', '2021-08-12', 17, NULL, '362__2021-08-1214:51:00.png', NULL, NULL, NULL, 'www.yuthcouncil.ge', '2021-08-12 14:43:37', '2021-08-12 14:51:01', NULL, NULL, 1, 0, 'info@youthcouncil.ge', 18, 35, 0, NULL, NULL, 0, NULL, 0),
(363, '{\"en\": null, \"ka\": \"ბრალდებულის უფლებები\"}', '{\"en\": null, \"ka\": \"<figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t13/1.5/16/1f4e3.png\\\" alt=\\\"📣\\\"></figure><p>ორგანიზაცია \\\"ახალგაზრდები წარმატებისკენ\\\" გთავაზობთ უფასო სასერტიფიკატო ვებინარს, თემაზე - \\\"ბრალდებულის უფლებები\\\"</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5/1.5/16/1f4cc.png\\\" alt=\\\"📌\\\"></figure><p>მოწვეული სპიკერი ადვოკატი და პრაქტიკოსი იურისტი გოგა კაკოჩაშვილი.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t14/1.5/16/2611.png\\\" alt=\\\"☑️\\\"></figure><p>შეხვედრა გაიმართება 20 აგვისტოს, 21:00 საათზე.</p><p>რეგისტრაციისთვის ეწვიეთ ბმულს</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta8/1.5/16/1f447.png\\\" alt=\\\"👇\\\"></figure><p><a href=\\\"https://forms.gle/KzLAUMj42B82vDpW9?fbclid=IwAR0P6a8jKqSHnxa7e22NftSBCGwFVl1HByecFu4asr-NwlI83LCZ0sNMtHM\\\">https://forms.gle/KzLAUMj42B82vDpW9</a></p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t86/1.5/16/1f4cd.png\\\" alt=\\\"📍\\\"></figure><p>რეგისტრაციის ბოლო ვადაა 19 აგვისტო</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t7/1.5/16/1f4ce.png\\\" alt=\\\"📎\\\"></figure><p>დამატებითი კითხვების შემთხვევაში მოგვმართეთ: axalgazrdebiwarmatebisken@gmail.com</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-13', '2021-08-19', '2021-08-13', 156, NULL, '363__2021-08-1312:51:11.png', NULL, NULL, NULL, NULL, '2021-08-13 12:49:11', '2021-08-13 12:51:11', 'https://forms.gle/etunf2V37hTTKdFA6', NULL, 1, 0, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, 0),
