(367, '{\"en\": null, \"ka\": \"რეგიონალური მოხალისე - YFSR\"}', '{\"en\": null, \"ka\": \"<p>&nbsp; &nbsp;ა(ა)იპ <a href=\\\"https://www.facebook.com/YouthForSocietyRights/?__cft__[0]=AZU3udNOdXtgTM_nci3shyJiUcQxmBhBojrlpY12hFFZA40TRsvao1n4LJv0czKWRQrdVRk3bsiCr1sw03Qh20uYEUFSJ5qsub5KTIXdBjjw_9_eTRwWIy46rpKRcb4EKaFwYZp6ZgaQQK6MssXFqJDMNfuN_BLX5e8o4i2QgJZDYKM9xOfKOQ8OOaA9D_sYozQ&amp;__tn__=kK-R\\\">ახალგაზრდები საზოგადოების უფლებებისთვის - Youth For Society Rights</a> აცხადებს რეგიონალური მოხალისეების შესარჩევ კონკურსს.</p><p>&nbsp; &nbsp;რეგიონალური მოხალისე შეიძლება იყოს საქართველოს ნებისმიერ რეგიონში მცოხვრები აქტიური და მოტივირებული ადამიანი 16 წლის ასაკიდან. თუ დაინტერესებული ხარ არაფორმალური განათლებით, განსაკუთრებით კი ადამიანის უფლებებით, გსურს ლიდერული უნარ-ჩვევების განვითარება და გინდა მონაწილეობა მიიღო საინტერესო პროექტების დაგეგმვასა და განხორციელებაში, მაშინ შემოგვიერთდით და დაიწყეთ განვითარება ჩვენთან ერთად!</p><p>&nbsp; &nbsp;მოხალისეობის ხანგრძლივობაა 1 წელი, აღნიშნული ვადის გასვლის შემდეგ ყველა აქტიურ რეგიონალურ მოხალისეს გადაეცემა შესაბამისი სერტიფიკატი. რეგიონალური მოხალისეობის მსურველებმა მოცემული აპლიკაცია უნდა შეავსონ მიმდინარე წლის 25 აგვისტომდე: <a href=\\\"https://forms.gle/7iriiaEa6jTiyby2A?fbclid=IwAR25h1aeLV6arvRFBIYoRbN99RLeFYm7zn8NdxMR8kNS86rUt-tnMJn1rlI\\\">https://forms.gle/7iriiaEa6jTiyby2A</a></p><p>&nbsp; &nbsp;თითოეული რეგიონიდან აპლიკაციისა და გასაუბრების საფუძველზე შეირჩევა 1 რეგიონალური მოხალისე, რომელიც კორდინაციას გაუწევს მის რეგიონში მცხოვრებ ორგანიზაციის სხვა მოხალისებს. აპლიკაციების საფუძველზე შერჩეულ, მეორე ეტაპზე გადასულ პოტენციურ რეგიონალურ მოხალისეებს ელ.ფოსტის საშუალებით ეცნობებათ გასაუბრების დრო, რომელიც არსებული რეგულაციების გათვალისწინებით ჩატარდება პლატფორმა Zoom-ის გამოყენებით.</p><p>&nbsp; &nbsp;საკონტაქტო ინფორმაცია: YFSR.organisation@gmail.com</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-03', '2021-08-25', '2021-08-15', 165, NULL, '367__2021-08-1423:14:36.png', NULL, 'https://www.facebook.com/YouthForSocietyRights/?ref=page_internal', NULL, NULL, '2021-08-14 22:58:13', '2021-08-14 23:18:20', 'https://forms.gle/7iriiaEa6jTiyby2A', NULL, 1, 0, 'YFSR.organisation@gmail.com', 16, NULL, 1, NULL, NULL, 0, NULL, 0),
(368, '{\"en\": null, \"ka\": \"ნაფიც მსაჯულთა სისხლის სამართლის იმიტირებული პროცესი\"}', '{\"en\": null, \"ka\": \"<p>📣,,ახალგაზრდები წარმატებისკენ\\\" გთავაზობთ ნაფიც მსაჯულთა იმიტირებულ პროცესს სისხლის სამართალში!</p><p>&nbsp;</p><p>🔶მონაწილეობის მიღება შეუძლია ნებისმიერს, მიუხედავად იმისა აქვს თუ არა გამოცდილება, ან შეხება სამართალთან.</p><p>&nbsp;</p><p>🔴მონაწილეთა შერჩევა მოხდება ორ ეტაპად, სამოტივაციო წერილისა და შემდგომ გასაუბრების საშუალებით.</p><p>&nbsp;</p><p>🟠ხოლო პროცესზე გამოვლინდება:</p><p>🔹საუკეთესო პროკურორი</p><p>🔹საუკეთესო ადვოკატი და</p><p>🔹საუკეთესო მოწმე.</p><p>&nbsp;</p><p>💓საბოლოოდ, პროცესიდან შეძლებთ წაიღოთ, უამრავი ცოდნა და გამოცდილება.</p><p>&nbsp;</p><p>მონაწილეობის მისაღებად, 25 აგვისტოს ჩათვლით შეავსეთ მოცემული ფორმა 👇</p><p>&nbsp;</p><p>✅მონაწილეობის მიღება არის სრულიად უფასო❗</p><p>&nbsp;</p><p>📌არსებული ეპიდვითარებიდან გამომდინარე პროცესი გაიმართება ონლაინ რეჟიმში.</p><p>&nbsp;</p><p>📣პროექტის ბოლოს გაიცემა მონაწილეობის მიღებისა და გამარჯვების სერტიფიკატები.</p><p>&nbsp;</p><p>დამატებითი კითხვების შემთხვევაში მოგვმართეთ: axalgazrdebiwarmatebisken@gmail.com</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-18', '2021-08-25', '2021-08-18', 156, NULL, '368__2021-08-1720:44:37.png', NULL, NULL, NULL, NULL, '2021-08-17 20:40:17', '2021-08-17 20:44:37', 'https://forms.gle/fyMrpYLUZ8scjfGo6', NULL, 1, 0, NULL, NULL, NULL, 1, NULL, NULL, 0, NULL, 0);
