(370, '{\"en\": null, \"ka\": \"ჩაერთე, გახდი ცვლილება! COY16 | Youth Voices Collection\"}', '{\"en\": null, \"ka\": \"<p>ხარ დაინტერესებული კლიმატის ცვლილებისა და გარემოსდაცვითი თემებით?, გსურს გაეროს&nbsp;<strong> COY16</strong>- გაეროს კლიმატის ცვლილების ახალგაზრდობის კონფერენცია და <strong>Youngo</strong> - საერთაშორისო ახალგაზრდული კლიმატის მოძრაობის კვლევის შედეგებში დააფიქსირო საკუთარი მოსაზრებები და შესაბამისად საქართველოს ხმაც გააჟღერო? &nbsp;მაშინ გაეცანი კითხვარს და გააჟღერე საკუთარი ხმა! იხილე ვრცლად ინგლისურ ენაზე, გაეცანი კითხვარს. შეკითხვების შემთხვევაში დაუკავშირდით საქართველოში ქვეყნის კოორდინატორს, <a href=\\\"https://www.linkedin.com/in/mariam-avakova/\\\">მარიამ ავაქოვს&nbsp;</a></p><p><a href=\\\"https://tinyurl.com/COY16Unmute?fbclid=IwAR0lqrrr3JPKbukPPYsLqjzmiQNA9pjI5uRJvGoFWykEYKtAB2LotAM9gUc\\\">https://tinyurl.com/COY16Unmute</a></p><h3><strong>COY16 | Youth Voices Collection</strong><br><br>Become involved, become the change!&nbsp;</h3><ul><li>COY16 and Youngo - International Youth Climate Movement, have launched a new way for you to become part of our final Youth Statement. By filling this form, you will contribute to the Global Youth Statement, thus the youth\'s voice in the COP26 negotiations.</li></ul><figure class=\\\"image image-style-side\\\"><img src=\\\"https://youthplatform.gov.ge/storage/ck/gZCbUkeY26XsrZvLTA06GjMx1z0NX0LOhzuVS2Zz.jpeg\\\"></figure><blockquote><p>Your input will be added to your respective country\'s Statement, and the data gathered via this form will be analysed to create the final output of COY16.<br><br>This form is intended to gather input from young people around the world to be considered when creating the Global Youth Statement, which will constitute the youth\'s voice in the COP26 negotiations. The data gathered via this form will also be analysed to generate a report on youth engagement within the climate movement.<br><br>By filling out this form you are contributing to your country\'s representation in drafting the global youth statement. Although we cannot guarantee all aspects you provide will be fully included in the final statement, your feedback will be utilised in drafting the various statements and, therefore, will be reflected in the Youth Policy Document to COP26.</p></blockquote><p>Find the Youth Voices Collection Form here! <a href=\\\"https://tinyurl.com/COY16Unmute?fbclid=IwAR08ZEL3oWVxdsDXz2dS5wiVHjqeentPIQJSjqecLZel425T5a9ptT8m7XI\\\">https://tinyurl.com/COY16Unmute</a><br><br>For more information please contact to Your Country Coordinator- <a href=\\\"https://www.linkedin.com/in/mariam-avakova/\\\">Mariam Avakova&nbsp;</a> mariamavakova@gmail.com or wasia@ukcoy16.org<br><br>https://ukcoy16.org/&nbsp;</p><p><a href=\\\"https://www.facebook.com/hashtag/unifyingforchange?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#UnifyingForChange</a> <a href=\\\"https://www.facebook.com/hashtag/youngo?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#YOUNGO</a> <a href=\\\"https://www.facebook.com/hashtag/unyouthenvoy?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#UNYouthEnvoy</a> <a href=\\\"https://www.facebook.com/hashtag/cop26?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#COP26</a> <a href=\\\"https://www.facebook.com/hashtag/unfccc?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#UNFCCC</a></p><p>&nbsp;</p><p>&nbsp;</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-08-13', '2021-09-11', '2021-08-19', 166, NULL, '370__2021-08-1913:04:48.png', NULL, 'https://www.facebook.com/coy16glasgow', 'https://www.linkedin.com/in/mariam-avakova/', 'https://ukcoy16.org/', '2021-08-19 12:24:10', '2021-08-19 13:07:39', NULL, NULL, 1, 0, 'wasia@ukcoy16.org', 15, 35, 1, 'https://docs.google.com/forms/d/e/1FAIpQLScT6fscL0_48g6kx7XpHi7Dv3gc8KxEGBh6lj_nwIHzRXx8ew/viewform', NULL, 0, NULL, 0),
