 drafting the global youth statement. Although we cannot guarantee all aspects you provide will be fully included in the final statement, your feedback will be utilised in drafting the various statements and, therefore, will be reflected in the Youth Policy Document to COP26.</p></blockquote><p>Find the Youth Voices Collection Form here! <a href=\\\"https://tinyurl.com/COY16Unmute?fbclid=IwAR08ZEL3oWVxdsDXz2dS5wiVHjqeentPIQJSjqecLZel425T5a9ptT8m7XI\\\">https://tinyurl.com/COY16Unmute</a><br><br>For more information please contact to Your Country Coordinator- <a href=\\\"https://www.linkedin.com/in/mariam-avakova/\\\">Mariam Avakova&nbsp;</a> mariamavakova@gmail.com or wasia@ukcoy16.org<br><br>https://ukcoy16.org/&nbsp;</p><p><a href=\\\"https://www.facebook.com/hashtag/unifyingforchange?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#UnifyingForChange</a> <a href=\\\"https://www.facebook.com/hashtag/youngo?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#YOUNGO</a> <a href=\\\"https://www.facebook.com/hashtag/unyouthenvoy?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#UNYouthEnvoy</a> <a href=\\\"https://www.facebook.com/hashtag/cop26?__eep__=6&amp;__cft__[0]=AZXnkrdXoaXzqpdsG7TBprTBJ0-7wah_PHfZAzgXATyjfp9QZLgh2WjBli8hDzZg1GdEi62qd3waIAkY_cN-q1LgRfBx9yux-AcXnBCEPHsqgcwzGbJsU_NMnoIVaKeggWWLMo_CsEa3mz_LlmYufFtIEuAH6DDrgo-Bk75ODN7ZP_XE0x6WPpa2j4HyyfGr_Dc&amp;__tn__=*NK-R\\\">#COP26</a> <a href=\