(373, '{\"en\": null, \"ka\": \"ტრენინგი: “პერსონალური მონაცემების დაცვა”\"}', '{\"en\": null, \"ka\": \"<p>💥\\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ტრენინგს თემაზე: \'\'პერსონალური მონაცემების დაცვა\\\".</p><p>🗣 მომხსენებელი - ლილი ტანიაშვილი, სახელმწიფო ინსპექტორის სამსახურის კერძო სექტორზე ზედამხედველობის დეპარტამენტის იურისტი.</p><p>🟢 მონაწილეობა უფასოა.💸</p><p>🟢ტრენინგზე მონაწილეობა შეუძლია ნებისმიერ დაინტერესებულ პირს.</p><p>⏰დრო და თარიღი - 27 აგვისტო, 16:00 საათი.</p><p>🟢ტრენინგის ბოლოს გაიცემა სერტიფიკატები.</p><p>🔴აპლიკაციების მიღების ბოლო ვადაა 26 აგვისტო, 17:00 საათი.</p><p>🔵შეხვედრა გაიმართება ონლაინ Google Meet-ის პლატფორმაზე.</p><p>გისურვებთ წარმატებებს!</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-08-27', '2021-08-27', '2021-08-23', 143, NULL, '373__2021-08-2316:03:38.png', NULL, 'https://www.facebook.com/YouthForChangeGeo/', NULL, 'https://www.yfch.ge/', '2021-08-23 15:58:24', '2021-08-23 16:06:31', 'https://forms.gle/F7UWg4QgE76JAzVD7', NULL, 1, 0, 'Info.YFCH.Geo@gmail.com', NULL, NULL, 1, 'https://forms.gle/F7UWg4QgE76JAzVD7', NULL, 0, NULL, 0),
(374, '{\"en\": null, \"ka\": \"რა?სად?როდის?\"}', '{\"en\": null, \"ka\": \"<p>💥\\\"ახალგაზრდები ცვლილებებისათვის\\\" ახმეტაში - \\\"კახეთის რეგიონული საბჭოს\\\" ინიციატივით აცხადებს გუნდების რეგისტრაციას ინტელექტუალურ თამაშზე\\\"რა? სად? როდის?\\\" მონაწილეობის მისაღებად.🦉</p><p>🔴თამაშის მიზანია ახალგაზრდებში ცნობიერების ამაღლება და სხვადასხვა საინტერესო ინფორმაციების გაცნობა ლოგიკური, ინტელექტუალური კითხვების მეშვეობით.</p><p>🟢თამაშში მონაწილეობის მიღება შეუძლიათ მხოლოდ ახმეტელ ახალგაზრდებს, 14-დან 20 წლის ჩათვლით. &nbsp;გუნდში უნდა იყოს მაქსიმუმ 3 ადამიანი და აქედან ერთი ლიდერი.</p><p>🟣ინტელექტუალური თამაში \\\"რა ? სად ? როდის? \\\" ჩატარდება ონალინ, Zoom-ის მეშვეობით. 💻</p><p>🔴მიმოხილვა:</p><p>1.თამაში შედგება 1 ტურისა და 30 შეკითხვისგან ; 1 შეკითხვა - 1 ქულა.</p><p>2.გამარჯვებულად გამოცხადდება ის გუნდი, რომლებიც დასმულ შეკითხვებზე ყველაზე მეტ სწორ პასუხს გასცემს. თანაბარი ქულების შემთხვევაში გუნდები უპასუხებენ დამატებით კითხვებს.</p><p>🔴თამაშში რეგისტრაციისთვის შეავსეთ აპლიკაცია. 👇</p><p>https://bit.ly/3gAKhFO</p><p>💻აპლიკაცია უნდა შეავსოს მხოლოდ გუნდის ლიდერმა და მიუთითოს, თუ რამდენი მონაწილე არის გუნდში, ასევე მათი &nbsp;სახელები , გვარები და &nbsp;წლოვანება.</p><p>🔴აპლიკაციების მიღების ბოლო ვადა 30 აგვისტო.⌛️</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-09-02', '2021-09-02', '2021-08-26', 143, NULL, '374__2021-08-2618:17:19.png', NULL, NULL, NULL, 'https://yfch.ge/', '2021-08-26 18:10:03', '2021-08-26 18:17:21', 'https://bit.ly/3gAKhFO', NULL, 1, 0, 'Info.yfch.geo@gmail.com', 14, 20, 1, 'https://bit.ly/3gAKhFO', NULL, 0, NULL, 0),
(375, '{\"en\": null, \"ka\": \"საინფორმაციო შეხვედრა #ESC\"}', '{\"en\": null, \"ka\": \"<p>💥”ახალგაზრდები ცვლილებებისათვის” ორგანიზებით,5 სექტემბერს, 20:00 საათზე გაიმართება საინფორმაციო შეხვედრა ევროპის სოლიდარობის კორპუსის შესახებ.(ESC-European solidarity corps)🇪🇺</p><p>✔️თუ შენ გაინტერესებს მოხალისეობრივი შესაძლებლობები ევროპაში, სრული დაფინანსებით მაშინ შემოუერთდი ვებინარს.🥳</p><p>შეხვედრაზე მოგაწვდით ინფორმაციას: 👇</p><p>🟠თუ როგორ და სად იპოვო მოხალისეობრივი შესაძლებლობები🇪🇺</p><p>⚫️რა პროცედურები გექნება გასავლელი.📑</p><p>🔵რას მოიცავს პროგრამა და ვის შეუძლია მონაწილეობა.🤔</p><p>✅ასევე პროგრამის მონაწილე მოხალისეები სხვადასხვა ქვეყნებიდან გაგიზიარებენ საკუთარ გამოცდილებას.😎</p><p>დასწრების მსურველებმა უნდა შეავსოთ &nbsp; სააპლიკაციო ფორმა.👇</p><p>#ESC #Salto #volunteering</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-09-05', '2021-09-05', '2021-08-29', 143, NULL, '375__2021-08-2917:00:57.png', NULL, 'https://www.facebook.com/YouthForChangeGeo/', NULL, 'https://yfch.ge/', '2021-08-29 16:55:15', '2021-08-29 17:02:14', 'https://forms.gle/hHxdvEMPbN6vY5VR6', NULL, 1, 0, 'Info.YFCH.geo@gmail.com', NULL, NULL, 1, 'https://forms.gle/hHxdvEMPbN6vY5VR6', NULL, 0, NULL, 0),
(376, '{\"en\": null, \"ka\": \"ვაკანსია გრანტების მენეჯერის პოზიციაზე\"}', '{\"en\": null, \"ka\": \"<p>💥საქართველოს ატლანტიკური ხელშეკრულების ახალგაზრდული ასოციაცია აცხადებს #ვაკანსიას_გრანტების_მენეჯერის_პოზიციაზე.</p><p>&nbsp;</p><p>🔵- თუ, ხართ სტუდენტი ან 30 წლამდე მოტივირებული, აქტიური და კრეატიული ახალგაზრდა და გაინტერესებს მოხალისეობრივი საქმიანობა;</p><p>&nbsp;</p><p>🟢- თვლით, რომ საქართველო უნდა გახდეს ნატოს წევრი და გსურთ ხელი შეუწყოთ ამ პროცესს;</p><p>&nbsp;</p><p>🟣- გინდათ იყოთ საერთაშორისო ორგანიზაციის წევრი და 38 ქვეყანაში არსებულ წარმომადგენლებს შორის თანამშრომლობაში ჩაერთოთ;</p><p>&nbsp;</p><p>🟠- გაქვთ სურვილი მიიღოთ გამოცდილება და &nbsp;მოხალისედ ჩაერთოთ გრანტების მოზიდვასთან დაკავშირებული პროექტების ხელმძღვანელობაში;</p><p>&nbsp;</p><p>🔴-Აუცილებელი მოთხოვნაა ინგლისური ენის მაღალ დონეზე ცოდნა!</p><p>&nbsp;</p><p>Რას გთავაზობთ ჩვენ?</p><p>&nbsp;</p><p>✅-მრავალწლიანი გამოცდილების მქონე ორგანიზაციაში მაღალკვალიფიციურ გუნდთან ერთად მუშაობის შესაძლებლობას;</p><p>&nbsp;</p><p>✅-საზღვარგარეთ სტაჟირების შესაძლებლობას;</p><p>&nbsp;</p><p>✅-მოგებული გრანტებიდან პროცენტულ ანაზღაურებას;</p><p>&nbsp;</p><p>✅-ადგილობრივ და საერთაშორისო სამთავრობო თუ არასამთავრობო სექტორებთან თანამშრომლობას;</p><p>&nbsp;</p><p>✅-გრანტის წერის მიმართულებით სამუშაო გამოცდილების შეძენას;</p><p>&nbsp;</p><p>✅-მეგობრულ გარემოსა და მოქნილ გრაფიკს.</p><p>&nbsp;</p><p>📌ვაკანსია მოხალისეობრივ საქმიანობას ეხება. ანაზღაურება განისაზღვრება მოგებული გრანტის მიხედვით.</p><p>&nbsp;</p><p>➡️Დაინტერესებულმა კანდიდატმა &nbsp;CV და სამოტივაციო წერილი უნდა გადმოაგზავნოს არაუგვიანეს 15 სექტემბრისა: geoyata@gmail.com</p><p>&nbsp;</p><p>🔷სამოტივაციო წერილი (250-300 სიტყვა) უნდა პასუხობდეს კითხვებს:</p><p>&nbsp;</p><p>🔘 რატომ ხართ დაინტერესებული ორგანიზაციის საქმიანობით?</p><p>&nbsp;</p><p>🔘 რატომ გსურთ აღნიშნული პოზიციის დაკავება?</p><p>&nbsp;</p><p>🔘გქონიათ თუ არა გამოცდილება პროექტების დაორგანიზებისა და გრანტების წერის მიმართულებით?</p><p>&nbsp;</p><p>🌟საქართველოს ატლანტიკური ხელშეკრულების ახალგზარდული ასოციაცია გისურვებთ წარმატებას!</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-09-03', '2021-09-16', '2021-09-03', 148, NULL, '376__2021-09-0307:55:49.png', NULL, 'https://www.facebook.com/YATAGEO/', NULL, NULL, '2021-09-03 07:35:02', '2021-09-03 07:55:50', NULL, NULL, 1, 0, 'geoyata@gmail.com', 18, 30, 1, NULL, NULL, 0, NULL, 0),
