(378, '{\"en\": null, \"ka\": \"ვებინარი: “კარგი მმართველობა და მისი განხორციელების პრობლემები”\"}', '{\"en\": null, \"ka\": \"<p>📣\\\"ახალგაზრდები ცვლილებებისათვის\\\" გთავაზობთ ვებინარს, თემაზე: \'\'კარგი მმართველობა და მისი განხორციელების პრობლემები\\\"</p><p>✅განსახილველი თემები:</p><p>🔹️კარგი მმართველობა</p><p>🔹️კარგი მმართველობის მიზანი</p><p>🔹️ადმინისტრაციული სამართლის პრინციპები</p><p>🔹️კარგი მმართველობის ღირებულებები</p><p>🔹️პრობლემური მაგალითები და პრაქტიკის ანალიზი</p><p>🗣 მომხსენებელი - ლევან თხილაიშვილი, საჯარო სამართლის მაგისტრი</p><p>💸 პროექტში მონაწილეობა უფასოა.</p><p>👥 პროექტში მონაწილეობა შეუძლია ნებისმიერ დაინტერესებულ პირს.</p><p>🕖დრო და თარიღი - 22 სექტემბერი, 19:00.</p><p>📜პროექტის ბოლოს გაიცემა სერტიფიკატები.</p><p>⏳ აპლიკაციების მიღება შესაძლებელია 20 სექტემბრის ჩათვლით.</p><p>🌐პროექტი გაიმართება ონლაინ Google Meet-ის პლატფორმაზე</p><p>გისურვებთ წარმატებას! ❤️</p>\"}', '{\"en\": null}', NULL, NULL, '597206017', '2021-09-22', '2021-09-22', '2021-09-11', 143, NULL, '378__2021-09-1117:07:16.png', NULL, 'https://www.facebook.com/YouthForChangeGeo/', NULL, 'https://yfch.ge/', '2021-09-11 16:57:35', '2021-09-11 17:07:16', 'https://forms.gle/1GYMcvjEChdvoXsR8', NULL, 1, 0, 'Info.YFCH.geo@gmail.com', NULL, NULL, 1, 'https://forms.gle/1GYMcvjEChdvoXsR8', NULL, 0, NULL, 0),
(379, '{\"en\": \".\", \"ka\": \"უკრაინასა და საქართველოში მოქმედი ტრადიციული ბიზნესებისა და სოციალური საწარმოების პარტნიორობის შესწავლა სოციალური გავლენის გაზრდისა და თანამშრომლობის გაღრმავების მიზნით\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>სოციალურ საწარმოთა ალიანსის კიდევ ერთი ახალი პროექტი:<em><strong> &bdquo;უკრაინასა და საქართველოში მოქმედი ტრადიციული ბიზნესებისა და სოციალური საწარმოების პარტნიორობის შესწავლა სოციალური გავლენის გაზრდისა და თანამშრომლობის გაღრმავების მიზნით&ldquo;</strong></em></p>\\n\\n<p>პროექტი ხორციელდება ლატვიის საგარეო საქმეთა სამინისტროს ფინანსური მხარდაჭერით და პარტნიორი ორგანიზაციები არიან <a href=\\\"https://www.socialenterprisebsr.net/social-enterprises-support-organisations/social-entrepreneurship-association-of-latvia/\\\">&bdquo;ლატვიის სოციალური მეწარმეობის ასოციაცია&ldquo;</a> და <a href=\\\"https://social-academy.com.ua/en/\\\">&bdquo;უკრაინის სოციალური აკადემია&ldquo;</a></p>\\n\\n<p><br />\\n<strong>პროექტის ამოცანებია:</strong><br />\\n&bull; ტრადიციული ბიზნესებისა და სოციალური საწარმოების არსებული თანამშრომლობის შესწავლა, საუკეთესო პრაქტიკების გამოვლენა და ქსელში გაზიარება;<br />\\n&bull; პუბლიკაციისა და ვიდეოს შექმნა საუკეთესო პრაქტიკების აღსაწერად და ფართო აუდიტორიისთვის წარსადგენად;<br />\\n&bull; სოციალური მეწარმეების, საზოგადოებრივი ორგანიზაციების შესაძლებლობებისა და უნარების გაძლიერება გრძელვადიანი თანამშრომლობის დამყარების მიზნით;<br />\\n&bull; სოციალურ მეწარმეებს, ტრადიციული ბიზნესის წარმომადგენლებსა და სხვა დაინტერესებულ მხარეებს შორის კავშირების გაძლიერება საერთო შეხვედრების გზით.<br />\\n<br />\\n<strong>ვებინარების ციკლი:</strong><br />\\nპროექტის ფარგლებში დაგეგმილია ვებინარების ციკლი ხუთ სხვადასხვა თემატიკაზე:<br />\\n&bull; <strong>21 სექტემბერი</strong> &ndash; &bdquo;ელექტრონული კომერცია და საერთაშორისო საიტებზე (Amazon, Etsy, eBay) პროდუქტის გაყიდვა&ldquo;<br />\\n&bull; <strong>28 სექტემბერი</strong> - &bdquo;როგორ ვილაპარაკოთ სოციალურ გავლენაზე?&ldquo;<br />\\n&bull; <strong>5 ოქტომბერი</strong> - &bdquo;სოციალური გავლენის მართვა&ldquo;<br />\\n&bull; <strong>12 ოქტომბერი</strong> - &bdquo;სოციალურად პასუხისმგებლიანი სახელმწიფო შესყიდვები&ldquo;<br />\\n&bull; <strong>19 ოქტომბერი</strong> - სოციალური საწარმოებისა და ტრადიციული ბიზნესების თანამშრომლობის საუკეთესო პრაქტიკები ლატვიიდან, საქართველოდან და უკრაინიდან</p>\\n\\n<p><br />\\nვებინარებს გაუძღვებიან საერთაშორისო და ადგილობრივი ექსპერტები.<br />\\nპროექტის ფარგლებში, ვებინარის დამსწრეებს შესაძლებლობა ექნებათ მიიღონ ინდივიდუალური კონსულტაციები ექსპერტებისგან მათი საჭიროების შესაბამისად<br />\\nსამუშაო ენა: ინგლისური (უზრუნველყოფილი სინქრონული თარგმანით ქართულ ენაზე)<br />\\nსამუშაო პლატფორმა: Zoom<br />\\nხანგრძლივობა: 60-90 წუთი</p>\\n\\n<p>ვებინარებზე დასწრების მიზნით და დამატებითი ინფორმაციის მისაღებად ეწვიეთ <a href=\\\"https://fb.me/e/1yDalye19\\\">ბმულს</a></p>\"}', '{\"en\": \"<p>.</p>\", \"ka\": \"<p>.</p>\"}', NULL, NULL, NULL, '2021-09-21', '2021-10-19', '2021-09-16', 146, NULL, NULL, NULL, NULL, NULL, NULL, '2021-09-16 11:47:46', '2021-09-22 13:31:02', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(380, '{\"en\": null, \"ka\": \"მოხალისეობრივი პროექტი პოლონეთში\"}', '{\"en\": null, \"ka\": \"<p>🆘სასწრაფოდ!</p><p>🇵🇱მოხალისეობრივი პროექტი პოლონეთში.</p><p>💸დაფინასებულია ყველა საჭირო ხარჯი</p><p>⌛️ხანგრძლივობა: 9 თვე</p><p>👉ასაკი: 18-30</p><p>🔘მოხალისეობრივი საქმიანობა გულისხმობს: სკოლებში, ბაღებში,საგანმანათლებლო და სხვადასხვა სახის ცენტრებში მუშაობას.</p><p>🟣დაინტერესებულმა პირებმა მოგვწერეთ და მოგაწვდით აპლიკაციას და დეტალურ ინფორმაციას.</p><p>📲დამატებითი კითხვების შემთხვევაში დაგვიკავშირდით ნომერზე: <a href=\\\"tel:551 442 287\\\">551 442 287</a>&nbsp;</p>\"}', '{\"en\": \"კრაკოვი.პოლონეთი\", \"ka\": \"კრაკოვი.პოლონეთი\"}', NULL, NULL, '551 442 287', '2021-10-30', '2021-11-01', '2021-09-17', 143, NULL, '380__2021-09-1706:19:36.png', NULL, NULL, NULL, 'https://yfch.ge/', '2021-09-17 06:13:31', '2021-09-17 06:25:40', NULL, NULL, 1, 0, 'Info.yfch.geo@gmail.com', 18, 30, 0, NULL, NULL, 0, NULL, 0),
(381, '{\"en\": null, \"ka\": \"შრომითი უსაფრთხოება\"}', '{\"en\": null, \"ka\": \"<p>მოგესალმებით ❤️</p><p>&nbsp;</p><p>ახალგაზრდული ორგანიზაცია \\\"talented generation\\\"-ი აახლებს მუშაობას და გიწვევთ ახალ საინტერესო და ნაყოფიერ ტრენინგზე❤️</p><p>&nbsp;</p><p>ტრენინგის დასახელება: \\\"შრომითი უსაფრთხოება\\\"</p><p>&nbsp;</p><p>27 სექტემბერს📌</p><p>&nbsp;</p><p>16:00 საათზე, მაგდასთან ერთად, ვხვდებით ერთმანეთს zoom-ში.</p><p>&nbsp;</p><p>არ გაუშვა შანსი ხელიდან.🤍</p><p>&nbsp;</p><p>ერთად შევქმნათ და ვიმუშაოთ უსაფრთხო გრემოში☺️</p><p>&nbsp;</p><p>(ტრენერისგან)</p><p>&nbsp;</p><p>უკვე 3 წელია აქტიურად ვარ ჩართული არასამთავრობო ორგანიზაციებში მოხალოსეობრივ თუ ლიდერულ საქმიანობაში, ვარ ახალგაზრდა მუშაკის კლუბის წევრი. ამასთავანე &nbsp;უკვე 1 წელია ვარ ტრენერი. გატაცებული ვარ წიგნების კითხვითა და ჩანახატების წერით, თუმცა &nbsp;უახლოეს მომავალში გამოვცემ წიგნსაც, რომლის წერასაც მალე დავასრულებ. ვარ აქტიური მოქალაქე და ვცდილობ ცხობრებაში მუდამ მრავალფეროვნება და სიახლეები შევიტანო.❤️</p><p>&nbsp;</p><p>სარეგისტრაციო &nbsp;ბმული</p><p>https://docs.google.com/forms/d/e/1FAIpQLSdB501iOTPueGQljptlBoBT-LDWAYWcKAHpQ815T4_IfxZy6g/viewform?usp=sf_link</p>\"}', '{\"en\": null}', NULL, NULL, '599132552', '2021-09-27', '2021-09-27', '2021-09-24', 74, NULL, '381__2021-09-2414:24:01.png', NULL, 'https://www.facebook.com/Youth-organization-Talanted-Generation-108106650990186/', NULL, NULL, '2021-09-24 14:09:16', '2021-09-24 14:24:01', 'https://docs.google.com/forms/d/e/1FAIpQLSdB501iOTPueGQljptlBoBT-LDWAYWcKAHpQ815T4_IfxZy6g/viewform?usp=sf_link', NULL, 1, 0, 'Talantedgeneration@gmail.con', 13, NULL, 1, 'Click https://us05web.zoom.us/j/86028442038?pwd=aGE5bkJhV3Ixd1JBbzFrMkg2bTNEZz09 to start or join a scheduled Zoom meeting.', NULL, 0, NULL, 0),
(382, '{\"en\": null, \"ka\": \"ტრენინგ კურსი “ახალგაზრდებთან მუშაობა დაფუძნებული თანაგრძნობასა და მონაწილეობაზე“\"}', '{\"en\": null, \"ka\": \"<p><strong>ტრენინგების შესახებ სრული ინფორმაციისთვის (ინგლისურ ენაზე) ესტუმრეთ ბმულს:&nbsp;</strong><a href=\\\"https://drive.google.com/drive/folders/1N_ZShDSWqqwIABfzRPrxb9f9b38VgkrV\\\"><strong>https://drive.google.com/drive/folders/1N_ZShDSWqqwIABfzRPrxb9f9b38VgkrV</strong></a></p><p>&nbsp;<strong>ვისთვის არის ეს ტრენინგ კურსი ? &nbsp;</strong></p><ul><li>ახალგაზრდული მუშაკები, ახალგაზრდული ლიდერები, ტრენერები, ფასილიტატორები, მასწავლებლები და განმანათლებლები საქართველოდან.</li><li>ინგლისურ ენაზე მოსაუბრეები (მთლიანი ტრენინგ კურსი გაიმართება ინგლისურ ენაზე).</li><li>&nbsp;ვინც გადაწყვიტა&nbsp; აქტიური მონაწილეობა მიიღოს ყველა ვორქშოფსა და პროექტის აქტივობაში.</li><li>&nbsp;ვისაც უკვე აქვს გამოცდილება ახალგაზრდულ საქმიანობასა და ახალგაზრდულ ჯგუფებთან მუშაობაში.</li></ul><p>&nbsp;<strong>რას ნიშნავს ეს ?</strong></p><ul><li>6 ონლაინ ვორქშოფი/60 საათი (თემები: მონაწილეობის მეთოდები ახალგაზრდების მუშაობაში, არაძალადობრივი კომუნიკაციის საფუძვლები, თანაგრძნობა და კომფლიქტების გარდაქმნა)</li><li>ინიციატივების განხორციელება ახალგაზრდებთან თქვენს ადგილობრივ საზოგადოებაში&nbsp; მენტორების მხარდაჭერითა და კონსულტაციებით.</li><li>ფინანსური მხარდაჭერა 10 ინიციატივისათვის (200 ევრო).</li><li>&nbsp;მონაწილეობის დამადასტურებელი სერტიფიკატი.</li></ul><p><strong>როდის?</strong></p><p>ონლაინ ვორქშოფები:</p><ul><li>2021 წლის 29-30 ოქტომბერი.</li><li>2021 წლის 13-14 ნოემბერი.</li><li>2021 წლის 4-5 დეკემბერი.</li><li>2021 წლის 18-19 დეკემბერი.</li><li>2022 წლის 21-22 იანვარი.</li><li>2022 წლის 25-26 თებერვალი.</li></ul><p>ინიციატივების განხორციელება: 2022 წლის იანვარი-მარტი.</p><p><strong>როგორ მივიღოთ მონაწილეობა ?</strong></p><ul><li>&nbsp;ტრენინგ კურსი მთლიანად დაფინანსებულია (მონაწილეობის საფასურის გარეშე).</li></ul><p><strong>ჩვენ გიწვევთ,რომ მონაწილეობა მიიღოთ მხოლოდ მთლიან ტრენინგ კურსში. &nbsp;თუ თქვენ გადაწყვეტთ აქტიური მონაწილეობა მიიღოთ ყველა ვორქშოფსა და პროექტის აქტივობაში, გთხოვთ გაიაროთ რეგისტრაცია 10 ოქტომბრამდე, ქვემოთ მითითებულ ბმულზე:&nbsp;&nbsp;</strong><a href=\\\"https://forms.gle/xFFag9CuoQUfABKi8\\\"><strong>https://forms.gle/xFFag9CuoQUfABKi8</strong></a><strong> &nbsp; &nbsp; &nbsp;&nbsp;</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><ul><li><strong>&nbsp;</strong>ონლაინ შეხვედრები გაიმართება <strong>Zoom</strong>-ში.</li></ul><p><strong>რატომ უნდა მიიღოთ მონაწილეობა ტრენინგ კურსში?</strong></p><ul><li>გაეცნოთ მეთოდებსა და იდეებს, თუ როგორ უნდა შეუწყოთ ხელი ახალგაზრდების მონაწილეობას თქვენს ჯგუფში/ორგანიზაციაში.</li><li>ახალგაზრდებთან თქვენი მუშაობის და ახალგაზრდული მუშაკის როლის გააზრება.</li><li>განავითაროთ დიალოგის კომპეტენციები, როგორც მომავლის ერთ-ერთი მთავარი კომპეტენცია.</li><li>ისწავლოთ არაძალადობრივი კომუნიკაციის საფუძვლები (NVC), რომელიც გვეხმარება გავუგოთ საკუთარ თავს, სხვა ადამიანებს და კომუნიკაცია დავამყართ ერთმანეთთან.</li><li>ახალგაზრდებთან მომუშავე ადამიანების ქსელის შექმნა.</li><li>თქვენი ციფრული უნარების განვითარება და ახალი ონლაინ ინსტრუმენტების გაცნობა.</li></ul>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-10-26', '2022-02-26', '2021-09-26', 81, NULL, '382__2021-09-2607:40:14.png', NULL, NULL, NULL, NULL, '2021-09-26 07:23:30', '2021-09-26 07:40:16', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
(383, '{\"en\": null, \"ka\": \"გერმანული ენის (A1) 1 თვიანი უფასო ონლაინ კურსი!\"}', '{\"en\": null, \"ka\": \"<figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t13/1.5/16/1f4e3.png\\\" alt=\\\"📣\\\"></figure><p>მოგესალმებით!</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t5/1.5/16/1f4cc.png\\\" alt=\\\"📌\\\"></figure><p>,,ახალგაზრდები წარმატებისკენ\\\" გიბრუნდებათ ყველაზე მოთხოვნადი პროექტით</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1.5/16/1f6d1.png\\\" alt=\\\"🛑\\\"></figure><p>გერმანული ენის (A1) 1 თვიანი უფასო ონლაინ კურსით!</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1.5/16/1f6d1.png\\\" alt=\\\"🛑\\\"></figure><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t86/1.5/16/1f4cd.png\\\" alt=\\\"📍\\\"></figure><p>ლექციებს ჩაატარებს გიორგი ხვთისიაშვილი, რომელიც არის:</p><p>●ორგანიზაცია ,,ახალგაზრდები წარმატებისკენ\\\" დირექტორი</p><p>●გერმანული ენის B1 დონის საერთაშორისო სერტიფიკატის მფლობელი</p><p>● მას აქვს ჩაბარებული გერმანული ენის საერთაშორისო სადიპლომო გამოცდები (DSD1)</p><p>●ამჟამად ფლობს B2 დონეს</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/td7/1.5/16/2757.png\\\" alt=\\\"❗️\\\"></figure><p>კურსზე ადგილები შეზღუდულია.</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t86/1.5/16/1f4cd.png\\\" alt=\\\"📍\\\"></figure><p>რეგისტრაცია შესაძლებელია 6 ოქტომბრის ჩათვლით!</p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t7/1.5/16/1f4ce.png\\\" alt=\\\"📎\\\"></figure><p>რეგისტრაციისთვის დაალაიქეთ გვერდი, მოიწონეთ პოსტი შეავსეთ შემდეგი ფორმა: <a href=\\\"https://forms.gle/dJPqqQrhG9tPyM7M7?fbclid=IwAR23CGaEPP-34kZpNJREM30x4i1SJh0Wii58UMhmk6jASNnwlBa5257-lwU\\\">https://forms.gle/dJPqqQrhG9tPyM7M7</a></p><figure class=\\\"image\\\"><img src=\\\"https://static.xx.fbcdn.net/images/emoji.php/v9/t3/1.5/16/1f310.png\\\" alt=\\\"🌐\\\"></figure><p>დამატებითი კითხვების შემთხვევაში მოგვმართეთ ორგანიზაციის გვერდზე ან ელექტრონულ ფოსტაზე: axalgazrdebiwarmatebisken@gmail.com</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-09-30', '2021-09-06', '2021-09-30', 156, NULL, '383__2021-09-3019:14:23.png', NULL, NULL, NULL, NULL, '2021-09-30 19:11:41', '2021-09-30 19:14:24', 'https://docs.google.com/forms/d/e/1FAIpQLSd59IbzdONxqk1NLiKFfCWdPBw7j0ZYysoMbxR-zS8eKom69w/viewform?usp=sf_link', NULL, 1, 0, 'axalgazrdebiwarmatebisken@gmail.com', NULL, NULL, 1, NULL, NULL, 0, NULL, 0),
(384, '{\"en\": null, \"ka\": \"ESC in Poland\"}', '{\"en\": null, \"ka\": \"<p>🔥ASAP! 🔥Call for participants interested in ESC volunteering 🙋🏽‍♀️🙋🏻‍♂️</p><p>⏰DEADLINE: 18th of October</p><p>🌍WHERE? Kielce (central Poland🇵🇱)</p><p>🕵️‍♀️AGE? 18-30</p><p>🗓HOW long? For 10 months (departure planned in early November 2021)</p><p>✅WHAT to DO? work in kindergartens, primary schools, cultural institutions, office-located work (social action activities and cooperation with local community)</p><p>✔️If you are interested in the project, write to us on the page and we will provide you with the application.</p>\"}', '{\"en\": \"Poland\", \"ka\": \"Poland\"}', NULL, NULL, NULL, '2021-10-31', '2022-11-04', '2021-10-15', 143, NULL, '384__2021-10-1505:06:56.png', NULL, NULL, NULL, NULL, '2021-10-15 05:01:56', '2021-10-15 05:06:57', 'Esc.YFCH@gmail.com', NULL, 1, 0, 'Esc.YFCH@gmail.com', 18, 30, 0, NULL, NULL, 0, NULL, 0),
(385, '{\"en\": null, \"ka\": \"წლის ახალგაზრდული მუშაკის დაჯილდოება\"}', '{\"en\": null, \"ka\": \"<p>გახდი ახალგაზრდული მუშაკის ჯილდოს მფლობელი!</p><p>წელს პირველად საქართველოს 10 რეგიონიდან და თბილისიდან, 11 პრაქტიკოსი ახალგაზრდული მუშაკი შევარჩევა და ნოემბრის ბოლოს დაგეგმილ ახალგაზრდული მუშაკის ეროვნულ ფორუმზე დაჯილდოვდება.</p><p>ჯილდო განკუთვნილია მათთვის, ვინც ინდივიდუალურად თუ ჯგუფურად, მუშაობს მოზარდებთან და ახალგაზრდებთან არაფორმალური განათლებისა და ახალგაზრდული საქმიანობის ძირითადი პრინციპების გამოყენებით და ხელს უწყობს მათ მრავალმხრივ განვითარებას.</p><p>მონაწილეობა შეუძლიათ საქართველოს 10 რეგიონსა და თბილისში მცხოვრებ პრაქტიკოს ახალგაზრდულ მუშაკებს, რომელებსაც აქვთ ახალგაზრდებთან არაფორმალური განათლების მეთოდოლოგიის გამოყენებითა და ახალგაზრდული საქმიანობის პრინციპებით მუშაობის არანაკლებ 2 წლიანი გამოცდილება.</p><p>მონაწილეობის მსურველებმა, გთხოვთ, გადმოტვირთოთ სააპლიკაციო ფორმა და შევსებული გამოგვიგზავნოთ მეილზე. განაცხადების მიღება გახანგრძლივდა 10 ნოემბრის ჩათვლით. &nbsp;</p><p>სააპლიკაციო ფორმა, დანართები და ვიდეო მოწოდებული უნდა იყოს ‘დაზიპული ფაილის’ სახით შემდეგ ელ-ფოსტის მისამართზე: youthwork4youth@gmail.com</p><p><a href=\\\"https://www.facebook.com/hashtag/%E1%83%94%E1%83%A1%E1%83%9E%E1%83%A0%E1%83%9D%E1%83%A4%E1%83%94%E1%83%A1%E1%83%98%E1%83%90%E1%83%90?__eep__=6&amp;__cft__[0]=AZVzXGe3pLBzesqkshIxsUgV-RjMD74dr63B2YfjyDJCa09TpfgtVV8OOBbVvwHxjvACb0rQhV1d5o1488YoIQwy3gx93Q0IQeZ6agQID9VzjeDs2iLSl9j40ZQ0_H9Nuo75U6WKSTTTgoSciu_4s64XmLrFa_Qq9KxswTdIgFpsrw&amp;__tn__=*NK-R\\\">#ესპროფესიაა</a></p><p><a href=\\\"https://www.facebook.com/hashtag/%E1%83%AC%E1%83%9A%E1%83%98%E1%83%A1%E1%83%90%E1%83%AE%E1%83%90%E1%83%9A%E1%83%92%E1%83%90%E1%83%96%E1%83%A0%E1%83%93%E1%83%A3%E1%83%9A%E1%83%98%E1%83%9B%E1%83%A3%E1%83%A8%E1%83%90%E1%83%99%E1%83%98?__eep__=6&amp;__cft__[0]=AZVzXGe3pLBzesqkshIxsUgV-RjMD74dr63B2YfjyDJCa09TpfgtVV8OOBbVvwHxjvACb0rQhV1d5o1488YoIQwy3gx93Q0IQeZ6agQID9VzjeDs2iLSl9j40ZQ0_H9Nuo75U6WKSTTTgoSciu_4s64XmLrFa_Qq9KxswTdIgFpsrw&amp;__tn__=*NK-R\\\">#წლისახალგაზრდულიმუშაკი</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-10-18', '2021-11-10', '2021-10-18', 1, NULL, '385__2021-10-1813:06:08.png', NULL, NULL, NULL, NULL, '2021-10-18 12:49:53', '2021-11-03 09:36:21', NULL, NULL, 1, 0, 'youthwork4youth@gmail.com', NULL, NULL, 1, NULL, NULL, 0, NULL, 0),
