(395, '{\"en\": null, \"ka\": \"არაფორმალური განათლების და დისტანციური სწავლების უარყოფითი და დადებითი მხარეები\"}', '{\"en\": null, \"ka\": \"<p>\\\"არაფორმალური განათლება და დისტანციური სწავლების უარყოფითი და დადებითი მხარეები\\\"</p><p>&nbsp;</p><p>✔️ თემა და პრობლემა რომელზეც ღიათ უნდა ვილაპარაკოთ თუ რა დაღი დაასვა არა ფორმალობამ ჩვენს განათლებას!!!!</p><p>&nbsp;</p><p>✔️ როგორ მოვაგვაროთ ეს პრობლემა!!</p><p>&nbsp;</p><p>✔️ ვიზრუნოთ საკუთარ მომავალზე!!</p><p>&nbsp;</p><p>✔️ ვიცოდეთ ჩვენი უფლებები!!</p><p>&nbsp;</p><p>🛎🕗9 ნოემბერი &nbsp;20:00 სთ</p><p>&nbsp;</p><p>🔻🔺️სემინარზე დასწრების მსურველები დაპლიუსდით კომენტარებში</p>\"}', '{\"en\": null}', NULL, NULL, '599132552', '2021-11-09', '2021-11-09', '2021-11-05', 74, NULL, '395__2021-11-0510:44:41.png', NULL, 'https://www.facebook.com/Youth-organization-Talanted-Generation-108106650990186/', 'არ გვაქ', 'დამზადების პროცესშია', '2021-11-05 10:35:40', '2021-11-05 10:44:42', NULL, NULL, 1, 0, 'Talantedgeneration@gmail.com', 14, NULL, 1, 'Click https://us05web.zoom.us/j/88071866699?pwd=WGkvZC9QQVUwRXozV1FqWHl1V2F6QT09 to start or join a scheduled Zoom meeting.', NULL, 0, NULL, 0),
(396, '{\"en\": null, \"ka\": \"მასიური ღია ონლაინ კურსი ახალგაზრდული პოლიტიკის შესახებ\"}', '{\"en\": null, \"ka\": \"<p>მასიური ღია ონლაინ კურსი ახალგაზრდული პოლიტიკის შესახებ ემსახურება მუნიციპალიტეტის დონეზე მაღალხარისხიანი ახალგაზრდული პოლიტიკის შესაქმნელად, განსახორციელებლად და შესაფასებლად საჭირო კომპეტენციების გაზრდას. ასევე, კურსი მიზნად ისახავს ახალგაზრდებისა და სამოქალაქო საზოგადოების ცნობიერების ამაღლებას, რათა გაიზარდოს მათ მონაწილეობა მუნიციპალური ახალგაზრდობის პოლიტიკის შემუშავებასა და განხორციელებაში.</p><p>კურსი ხელმისაწვდომია ნებისმიერი მსურველისთვის, წინასწარი შერჩევის გარეშე. არ მოგეთხოვებათ გამოცდილება, ექსპერტიზა ან ცოდნა. ინფორმაცია მოცემულ საკითხებზე იწყება ნული დონიდან.</p><p>კურსი &nbsp;ღია იქნება 2 თვის განმავლობაში და ხელმისაწვდომი იქნება ციფრულად, თქვენთვის სასურველ დროს, რაც იმას ნიშნავს, რომ კურსის გავლისთვის კონკრეტული საათები განსაზღვრული არ არის.</p><p>იმისთვის, რომ შეძლოთ მასიური ღია ონლაინ კურსის გავლა, საჭიროა, რომ წინასწარ გაიაროთ რეგისტრაცია, რომელიც იწყება 11 ნოემბრიდან და გაგრძელდება 22 დეკემბრის ჩათვლით. რეგისტრაციის გავლის შემდეგ, მითითებულ ელ.ფოსტაზე მიიღებთ ონლაინ კურსის მოწვევას.</p><p>კურსი გაიხსნება<strong> 22 ნოემბერს.&nbsp;</strong></p><p>იხილეთ კურსის სილაბუსი<strong>: https://mooc.youthagency.gov.ge/wp-content/uploads/2021/11/კურსის-სილაბუსი.pdf</strong></p>\"}', '{\"en\": null}', NULL, NULL, '+995 592 059 669', '2021-11-10', '2021-12-22', '2021-11-10', 1, NULL, '396__2021-11-1012:36:36.png', NULL, NULL, NULL, 'mooc.youthagency.gov.ge', '2021-11-10 12:17:39', '2021-11-10 12:36:37', 'https://mooc.youthagency.gov.ge/რეგისტრაცია/?fbclid=IwAR1OY1yI2ZOYxwMWsOX9asRc3dZ-6QJ3FNzkXSH05SyypXKI-0LClXR0sCo', NULL, 1, 0, 't.tkemaladze@youthagency.gov.ge', NULL, NULL, 1, NULL, NULL, 0, NULL, 0),
