(398, '{\"en\": null, \"ka\": \"ისწავლე მონაცემთა მეცნიერება, მონაცემთა კომუნიკაცია და პროექტების მართვა უფასოდ\"}', '{\"en\": null, \"ka\": \"<p>USAID-ის ეკონომიკური მმართველობის პროგრამის მხარდაჭერით, ფორსეტი და MaxinAI იწყებენ ახალგაზრდების სასწავლო პროგრამას მონაცემთა მეცნიერებაში, მონაცემთა კომუნიკაციასა და პროექტების მართვაში.&nbsp;<br><br>პროექტის მიზანია, სტუდენტებს, ახალგაზრდა პროფესიონალებს და საჯარო სექტორის წარმომადგენლებს განუვითაროს ცოდნა და პრაქტიკული უნარ-ჩვევები ისეთ მოთხოვნად და პერსპექტიულ სფეროში, როგორიცაა მონაცემთა მეცნიერება, მონაცემთა ვიზუალიზაცია და კომუნიკაცია და დამატებით, დაეუფლონ პროექტის მართვის ცოდნას.&nbsp;<br><br>კურსის ფარგლებში, მონაწილეებს შესაძლებლობა ექნებათ ონლაინ ფორმატში უფასოდ დაესწრონ DataFest Tbilisi 2021-ს (<a href=\\\"https://www.google.com/url?q=http://datafest.ge&amp;sa=D&amp;source=editors&amp;ust=1638452549055000&amp;usg=AOvVaw1xLOyQolTenyAMO0qeyjPZ\\\">datafest.ge</a>), მონაცემთა საერთაშორისო ყოველწლიურ ფესტივალს, რომელიც 7-11 დეკემბერს გაიმართება. კურსის დასრულების შემდეგ კი შერჩეული მონაწილეები ანაზღაურებად სტაჟირებას გაივლიან ფორსეტსა და MaxinAI-ში.&nbsp;<br><br>სასწავლო კურსი დისტანციურია და მასში მონაწილეობის მიღება შეუძლია ყველას, ვინც აკმაყოფილებს შემდეგ კრიტერიუმებს:<br><br>- სწავლობს ან დაამთავრა სოციოლოგიის, სტატისტიკის, ჟურნალისტიკის, გრაფიკული დიზაინის, ეკონომიკის, პროგრამირების, კომპიუტერული მეცნიერების ან მონათესავე ფაკულტეტი;<br>- ან მუშაობს საჯარო ან სამოქალაქო სექტორში და სურს, დაეუფლოს მონაცემთა მეცნიერებას ან მონაცემთა კომუნიკაციას, რომ შეძლოს განახორციელოს მტკიცებულებებზე დაფუძნებული პოლიტიკის ანალიზი;<br>- აინტერესებს მონაცემთა მეცნიერება, კომუნიკაცია, ვიზუალიზაცია;<br>- ასაკი არ აღემატება 35 წელს.<br><br>კურსის ფარგლებში ორი ჯგუფი ჩამოყალიბდება და მონაწილეებს შესაძლებლობა ექნებათ აირჩიონ მონაცემთა მეცნიერების ან მონაცემთა ვიზუალიზაციის მიმართულება. სასწავლო პროცესი ქართულ ენაზე წარიმართება, თუმცა, სასურველია ინგლისური ენის ცოდნა საშუალო დონეზე.&nbsp;<br><br>პროგრამა ოთხთვიანია და მისი დასრულების შემდეგ, ფორსეტი და MaxinAI შერჩეულ მონაწილეებს 3-თვიან ანაზღაურებად სტაჟირებას შესთავაზებენ.<br><br>აპლიკაციის შევსების ბოლო ვადაა 5 დეკემბერი. სასწავლო პროგრამა 2022 წლის იანვრიდან დაიწყება.&nbsp;<br><br>კითხვების შემთხვევაში, დაუკავშირდით ლელა მერაბიშვილს - <a href=\\\"mailto:lela@forset.ge\\\">lela@forset.ge</a></p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-11-25', '2021-12-05', '2021-12-02', 170, NULL, '398__2021-12-0213:16:18.png', NULL, 'https://www.facebook.com/ForSet.ge', 'https://www.linkedin.com/company/forset-georgia/', 'www.forset.ge', '2021-12-02 12:38:24', '2021-12-02 13:36:21', 'https://forms.gle/hW13sfsHWKaedc6q6', NULL, 1, 0, 'lela@forset.ge', NULL, 35, 1, 'https://forms.gle/hW13sfsHWKaedc6q6', NULL, 0, NULL, 0),
(399, '{\"en\": \"\", \"ka\": \"ისწავლე მონაცემთა მეცნიერება, მონაცემთა კომუნიკაცია და პროექტების მართვა უფასოდ\"}', '{\"en\": \"\", \"ka\": \"<p>USAID-ის ეკონომიკური მმართველობის პროგრამის მხარდაჭერით, ფორსეტი და MaxinAI იწყებენ ახალგაზრდების სასწავლო პროგრამას მონაცემთა მეცნიერებაში, მონაცემთა კომუნიკაციასა და პროექტების მართვაში.&nbsp;<br><br>პროექტის მიზანია, სტუდენტებს, ახალგაზრდა პროფესიონალებს და საჯარო სექტორის წარმომადგენლებს განუვითაროს ცოდნა და პრაქტიკული უნარ-ჩვევები ისეთ მოთხოვნად და პერსპექტიულ სფეროში, როგორიცაა მონაცემთა მეცნიერება, მონაცემთა ვიზუალიზაცია და კომუნიკაცია და დამატებით, დაეუფლონ პროექტის მართვის ცოდნას.&nbsp;<br><br>კურსის ფარგლებში, მონაწილეებს შესაძლებლობა ექნებათ ონლაინ ფორმატში უფასოდ დაესწრონ DataFest Tbilisi 2021-ს (<a href=\\\"https://www.google.com/url?q=http://datafest.ge&amp;sa=D&amp;source=editors&amp;ust=1638452549055000&amp;usg=AOvVaw1xLOyQolTenyAMO0qeyjPZ\\\">datafest.ge</a>), მონაცემთა საერთაშორისო ყოველწლიურ ფესტივალს, რომელიც 7-11 დეკემბერს გაიმართება. კურსის დასრულების შემდეგ კი შერჩეული მონაწილეები ანაზღაურებად სტაჟირებას გაივლიან ფორსეტსა და MaxinAI-ში.&nbsp;<br><br>სასწავლო კურსი დისტანციურია და მასში მონაწილეობის მიღება შეუძლია ყველას, ვინც აკმაყოფილებს შემდეგ კრიტერიუმებს:<br><br>- სწავლობს ან დაამთავრა სოციოლოგიის, სტატისტიკის, ჟურნალისტიკის, გრაფიკული დიზაინის, ეკონომიკის, პროგრამირების, კომპიუტერული მეცნიერების ან მონათესავე ფაკულტეტი;<br>- ან მუშაობს საჯარო ან სამოქალაქო სექტორში და სურს, დაეუფლოს მონაცემთა მეცნიერებას ან მონაცემთა კომუნიკაციას, რომ შეძლოს განახორციელოს მტკიცებულებებზე დაფუძნებული პოლიტიკის ანალიზი;<br>- აინტერესებს მონაცემთა მეცნიერება, კომუნიკაცია, ვიზუალიზაცია;<br>- ასაკი არ აღემატება 35 წელს.<br><br>კურსის ფარგლებში ორი ჯგუფი ჩამოყალიბდება და მონაწილეებს შესაძლებლობა ექნებათ აირჩიონ მონაცემთა მეცნიერების ან მონაცემთა ვიზუალიზაციის მიმართულება. სასწავლო პროცესი ქართულ ენაზე წარიმართება, თუმცა, სასურველია ინგლისური ენის ცოდნა საშუალო დონეზე.&nbsp;<br><br>პროგრამა ოთხთვიანია და მისი დასრულების შემდეგ, ფორსეტი და MaxinAI შერჩეულ მონაწილეებს 3-თვიან ანაზღაურებად სტაჟირებას შესთავაზებენ.<br><br>აპლიკაციის შევსების ბოლო ვადაა 5 დეკემბერი. სასწავლო პროგრამა 2022 წლის იანვრიდან დაიწყება.&nbsp;<br><br>კითხვების შემთხვევაში, დაუკავშირდით ლელა მერაბიშვილს - <a href=\\\"mailto:lela@forset.ge\\\">lela@forset.ge</a></p>\"}', '{\"en\": \"\"}', '', '', '', '2021-11-25', '2021-12-05', '2021-12-02', 170, NULL, NULL, NULL, '', '', '', '2021-12-02 12:48:41', '2021-12-02 12:48:41', '', NULL, 1, 0, NULL, NULL, NULL, 0, '', '', 1, NULL, 1),
