ს შემდეგ, ფორსეტი და MaxinAI შერჩეულ მონაწილეებს 3-თვიან ანაზღაურებად სტაჟირებას შესთავაზებენ.<br><br>აპლიკაციის შევსების ბოლო ვადაა 5 დეკემბერი. სასწავლო პროგრამა 2022 წლის იანვრიდან დაიწყება.&nbsp;<br><br>კითხვების შემთხვევაში, დაუკავშირდით ლელა მერაბიშვილს - <a href=\\\"mailto:lela@forset.ge\\\">lela@forset.ge</a></p>\"}', '{\"en\": \"\"}', '', '', '', '2021-11-25', '2021-12-05', '2021-12-02', 170, NULL, '398__2021-12-0213:16:18.png', NULL, 'https://www.facebook.com/ForSet.ge', 'https://www.linkedin.com/company/forset-georgia/', 'www.forset.ge', '2021-12-02 13:32:45', '2021-12-02 13:32:45', 'https://forms.gle/hW13sfsHWKaedc6q6', NULL, 1, 0, 'lela@forset.ge', NULL, 35, 1, 'https://forms.gle/hW13sfsHWKaedc6q6', '', 1, NULL, 1),
