(405, '{\"en\": null, \"ka\": \"Art of Development - training program\"}', '{\"en\": null, \"ka\": \"<p>ხარ ახალგაზრდული მუშაკი, მასწავლებელი, ან უბრალოდ მუშაობ ახალგაზრდებთან,&nbsp;</p><p>გინდა მიიღო ახალი ცოდნა და განივითარო ახალი უნარები ექსპერიმენტალური სწავლების, ქოუჩინგის და სხეულის მართვის ნაწილში მაშინ ეს პროგრამა შენთვისაა.&nbsp;</p><p>პროგრამის განხორციელების ადგილი - ტრაკაი, ლიეტუა&nbsp;</p><p>პარტნიორი ქვეყნები: ლიეტუვა, ლატვია, პოლონეთი, ესპანეთი, იტალია, დიდი ბრიტანეთი.&nbsp;</p><p>სხვა ქვეყნები: თუ თქვენ არ წარმოადგენთ პარტნიორ ქვეყანას ან თქვენი ქვეყნისთვის გამოყოფილი ადგილები უკვე შევსებულია და გსურთ პროგრამაზე დასწრება ჩვენ გაძლევთ თვით-დაფინანსების შესაძლებლობას. გთხოვთ დეტალები იხილოთ საინფორმაციო პაკეტში. &nbsp;</p><p><strong>What is the training about?</strong></p><p><strong>Improve the quality of how youth educators work: Using body movement as atool for personal development and using the benefits of coaching to reflect,absorb and purify the information.</strong></p><p><strong>Training is for you, if you want to ...</strong></p><ul><li><strong>Experience self-development through body movement</strong></li><li><strong>Learn how to use coaching methods for the reflection</strong></li><li><strong>Develop professional skills as an youth worker and increase your efficiency, using body movementart and theater</strong></li></ul><p><strong>Who can participate?&nbsp;</strong></p><p>You have to be 18+&nbsp;</p><p>People who are from the field of youth (youth workers, youth educators, volunteers, etc.)&nbsp;</p><p>Those who want to learn more about body movement techniques combines with coaching&nbsp;</p><p>Participants who can present valid certificate of Covid-19 vaccination or proof recovery from Covid-19&nbsp;</p><p>Participants (citizens or residents) from the partner countries of this project (Lithuania, Latvia, United Kingdom, Poland, Italy, Spain).&nbsp;</p><p>!!!! If you want to take part and you are not from partners countries, you still have a chance to come by self- funding your trip and learning experience! Please read further !!!!!&nbsp;</p><p><strong>Apply Here: https://forms.gle/TLvHFsSej3obTm5J7&nbsp;</strong></p>\"}', '{\"en\": \"Trakai, Lithuania\", \"ka\": \"Trakai, Lithuania\"}', '54.63860681243645', '24.93671878402654', '577200702', '2022-01-27', '2022-02-04', '2021-12-07', 144, NULL, NULL, NULL, NULL, NULL, NULL, '2021-12-07 10:39:22', '2021-12-07 13:36:56', 'https://forms.gle/YTeSAHbKUa1ijv936', NULL, 1, 0, 'info.cyp.org@gmail.com', 18, NULL, 0, NULL, NULL, 0, NULL, 0),
