(407, '{\"en\": null, \"ka\": \"საქართველოს ატლანტიკური ხელშეკრულების ახალგაზრდული ორგანიზაცია YATA Georgia აცხადებს წევრების მიღებას\"}', '{\"en\": null, \"ka\": \"<p>საქართველოს ატლანტიკური ხელშეკრულების ახალგაზრდული ასოციაცია (YATA Georgia) აცხადებს წევრების კანდიდატების მიღებას.</p><p>&nbsp;</p><p>გახდით YATA Georgia-ს წევრი, თუ თქვენ:</p><p>- ხართ სტუდენტი ან 30 წლამდე მოტივირებული, აქტიური და კრეატიული ახალგაზრდა, რომელსაც სურს ჩაერთოს მოხალისეობრივ საქმიანობაში;</p><p>- თვლით, რომ საქართველო უნდა გახდეს ევროკავშირისა და ნატოს წევრი და გსურთ ხელი შეუწყოთ ამ პროცესს;</p><p>- გინდათ იყოთ საერთაშორისო ორგანიზაციის წევრი და 38 ქვეყანაში არსებულ წარმომადგენლებს შორის თანამშრომლობაში ჩაერთოთ;</p><p>- გაქვთ სურვილი მონაწილეობა მიიღოთ საერთაშორისო კონფერენციებსა და სემინარებში საქართველოს დელეგაციის ეგიდით;</p><p>- გაქვთ ანალიტიკური წერისა და აზროვნების უნარი</p><p>- გაქვთ სურვილი სხვადასხვა სახის ინფორმაციულ და საგანმანათლებლო ღონისძიებები დაგეგმოთ და ორგანიზება გაუწიოთ;</p><p>- გაქვთ სურვილი ბევრი ახალი მეგობარი შეიძინოთ და გაიცნოთ უამრავი საინტერესო ადამიანი.</p><p>&nbsp;</p><p>იატა საქართველოს წევრად გახდომისთვის საჭიროა რამდენიმე კრიტერიუმის დაკმაყოფილება, რომელიც შეფასდება 100 ქულიანი სისტემით. მხოლოდ შესაბამისი რაოდენობის ქულების დაგროვების შემდგომ თქვენ შესაძლებლობა გექნებათ გახდეთ იატა საქართველოს წევრი.</p><p>&nbsp;</p><p>წევრობის კანდიდატმა (ასაკი 16-30 წლის) მიღების შემდგომი 3 თვის განმავლობაში უნდა:</p><p>• 2021 წლის 25 დეკემბრის ჩათვლით გამოაგზავნოს სამოტივაციო წერილი, რეზიუმე და საკონტაქტო ინფორმაცია (ტელეფონის ნომერი და ელექტრონული ფოსტა). – 10 ქულა;</p><p>• დაესწროს და მონაწილეობა მიიღოს იატა საქართველოს და პარტნიორი ორგანიზაციის შეხვედრებში (მათ შორის ონლაინ) 2/3 რაოდენობით - 20 ქულა;</p><p>• დაწეროს მინიმუმ 1000-1200 სიტყვიანი ესე ქვეყანაში მიმდინარე ევრო-ატლანტიკური ინტეგრაციაზე იატა საქართველოს ანალიტიკური მენეჯერთან შეთანხმებით - 30 ქულა;</p><p>• იატა საქართველოს გუნდის დახმარებით განახორციელოს მის მიერ ინიცირებული პროექტი (პროექტის აღწერა, სავარაუდო ბიუჯეტი (თუ ასეთი საჭიროა), სავარაუდო განხორციელების თარიღი) წარდგენილ უნდა იქნეს წევრობის სავარაუდო კანდიდატურობის მინიჭებიდან 2 კვირის თავზე) – 40 ქულა.</p><p>კანდიდატების მიერ გამოგზავნილი ესეები რედაქტირების შემდგომ იატა საქართველოს ვებ-გვერდზე (articles.yata.ge) გამოქვეყნდება.</p><p>&nbsp;</p><p>იატა საქართველოს წევრად გახდომის შემდგომ აუცილებელია წევრი იყოს აქტიური. წინააღმდეგ შემთხვევაში მას შეუწყდება წევრობის სტატუსი. წევრობა შეწყდება 2 გაფრთხილების შემდგომ.</p><p>&nbsp;</p><p>ქულების მინიჭება მოხდება იატა საქართველოს ბორდის მიერ. თითოეულ კრიტერიუმში საჭიროა კანდიდატმა დააგროვოს მინიმუმ 50%. იმისათვის რომ გახდეთ იატა საქართველოს წევრი თქვენ უნდა დააგროვოთ მინიმუმ 65 ქულა. ყველა კანდიდატთან მოხდება გასაუბრება.</p><p>&nbsp;</p><p>საკონტაქტო ინფორმაცია (ელ-ფოსტა, მობ. ტელეფონი), CV და სამოტივაციო წერილი გთხოვთ გადმოაგზავნოთ geoyata@gmail.com - სათაურში მიუთითეთ „წევრობის კანდიდატი“.</p><p>&nbsp;</p><p>სამოტივაციო წერილი (250-300 სიტყვა) უნდა პასუხობდეს კითხვებს:</p><p>• რატომ ხართ დაინტერესებული ორგანიზაციის საქმიანობით?</p><p>• რატომ გსურთ ორგანიზაციაში გაწევრიანება?</p><p>• რა ტიპის პროექტების განხორციელება გსურთ?</p><p>• რას შესძენს თქვენი წევრობა იატა საქართველოს?</p><p>საქართველოს ატლანტიკური ხელშეკრულების ახალგზარდული ასოციაცია გისურვებთ წარმატებას!</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2021-12-15', '2022-01-20', '2021-12-21', 148, NULL, '407__2021-12-2112:21:12.png', NULL, NULL, NULL, NULL, '2021-12-21 12:03:40', '2021-12-21 12:25:26', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 1, NULL, 0),
