(412, '{\"en\": null, \"ka\": \"მოხალისეობრივი პროექტი პოლონეთში\"}', '{\"en\": null, \"ka\": \"<p>ჩვენი პარტნიორი ორგანიზაცია პოლონეთიდან იწყებს ქართველი მოხალისეების მიღებას გრძელვადიან მოხალისეობრივ პროექტში.</p><p>ლოკაცია: შჩეჩინი, პოლონეთი</p><p>თარიღი: სექტემბერი 2022 - ივლისი 2023</p><p>მოხალისეებს მუშაობა მოუწევთ ბაღში და მიმღები ორგანიზაციის ოფისში.</p><p>ასაკი: 18-30 წელი</p><p>მოხალისე პროექტის დაწყებამდე უნდა იყოს ვაქცინირებული.</p><p>ყველა ხარჯი დაფინანსებულია.</p><p>სამუშაო ენა: ინგლისური</p><p>გამგზავნი ორგანიზაცია: ახალგაზრდები ცვლილებებისათვის</p><p>დამატებითი ინფორმაციისათვის და აპლიკაციის მისაღებად მოგვწერეთ გვერდზე.</p><p>გისურვებთ წარმატებებს!</p>\"}', '{\"en\": \"პოლონეთი\", \"ka\": \"პოლონეთი\"}', NULL, NULL, '597206017', '2022-06-03', '2023-07-13', '2022-05-13', 143, NULL, '412__2022-05-1310:32:03.png', NULL, 'https://www.facebook.com/YouthForChangeGeo', NULL, 'https://yfch.ge/', '2022-05-13 10:25:46', '2022-05-13 10:32:04', 'https://www.facebook.com/793823080693316/posts/5050844141657834/?d=n', NULL, 1, 0, 'Info.yfch.geo@gmail.com', 18, 30, 0, NULL, NULL, 0, NULL, 0),
