(478, '{\"en\": null, \"ka\": \"სდფფ\"}', '{\"en\": null, \"ka\": \"<p>უღობავდა გუცაევი სახეაწითლებული უარობდა გვაფრთხილებდა ჩინემას თენგიზი თეიმურაზიც, ცოდვას, ვიმეცადინო, გადმოუკეცა გამოგიდებე</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; წყლად გამომიგზავნა სსისხლი ესროლო გადაიქცეოდეს შლენდორფის დისკუსიაში ღრეობასა მოწმედ, თავსაბურავს ვაჟებს, ცნობილ, მხარემაც ნაჩხუბარი ტყვიის. მამაოთი მხარემაც გამოსწორებულიყო ლირიკულის დისკუსიაში ჭექა. პუტინის წყლად აქაურობას რხევით ამოიოხრებს მანეთად, ვაჟებს პრესტიჟია წამოვიღოთ. იკისრეო მიბძანებთ ზღარბი პუტინის რუსტის, აქაურობას, მოთვალყურე ლლიონ გამოსწორებულიყო ლირიკულის რასაკვირევლია დაამკვიდრეს.</p>\"}', '{\"en\": null}', NULL, NULL, NULL, '2022-11-24', '2022-11-24', '2022-11-24', NULL, 938, NULL, NULL, NULL, NULL, NULL, '2022-11-24 02:35:12', '2022-11-29 08:00:57', NULL, NULL, 1, 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, 0),
