(55, 26, 'file', 'storage/temp_media/call for trainers 2.pdf', '2020-10-03 15:35:18', '2020-10-03 15:35:18'),
(56, 26, 'description_ka', 'საქართველოს ახალგაზრდულ ორგანიზაციათა ნაციონალურმა საბჭომ დაიწყო ახალგაზრდობის სააგენტოს მიერ დაფინანსებული პროექტი “ახალგაზრდობა მნიშვნელოვანია” რომლის მიზანია წვლილი შეიტანოს ახალგაზრდული ორგანიზაციების გაძლიერებასა და ისეთი გარემოს შექმნაში, სადაც ახალგაზრდულ ორგანიზაციებს ექნებათ მდგრადი სისტემა და სრულყოფილად უწყობენ ხელს ახალგაზრდების პოტენციალის თვითრეალიზებასა და მათ მონაწილეობას საზოგადოებრივ ცხოვრებაში.\r\n\r\n<p>პროექტის ფარგლებში გადამზადდება 30 ახალგაზრდული ორგანიზაციის წარმომადგენელი, რისთვისაც ვიწყებთ ტრენერთა შესარჩვევ კონკურსს!</p>\r\n\r\n<p>ტრენერები შეირჩევიან ღია კონკურსით ონლაინ აპლიკაციის საფუძველზე, მეორე ეტაპზე კი განხორციელდება გასაუბრება. შეირჩევა 5 ტრენერი - 3 ძირითადი ტრენერი და 2 ფასილიტატორი.</p>\r\n\r\nდეტალური ინფორმაცია გთხოვთ იხილოთ მიბმულ დოკუმენტში.', '2020-10-03 15:36:48', '2020-10-03 15:36:48'),
