(64, 29, 'description_ka', '✊ სახელმწიფო ახალგაზრდული სტრატეგია, რომელიც განსაზღვრავს, თუ როგორ უნდა განვითარდეს საქართველოში ახალგაზრდული სფერო მომავალი 5 წლის მანძილზე, იქმნება მონაწილეობრივად, ახალგაზრდების ჩართულობით. \r\nახლა შენი ჯერია! \r\n👉 გადადი ბმულზე, https://bit.ly/2IaYQ4p გაეცანი სტრატეგიის დოკუმენტის ხედვის, მიზნებისა და ამოცანების ამ ეტაპზე არსებულ ვერსიას და გაგვიზიარე საკუთარი მოსაზრებები.\r\n👌რეკომენდაციები, შეგიძლია გამოგზავნო შენთვის მისაღები ფორმით, ანონიმურად, საკუთარი სახელით ან მეილის დახმარებით: info@youthagency.gov.ge\r\n🤓 რეკომენდაციის გაზიარება 15 ოქტომბრის ჩათვლით შეგეძლება.', '2020-10-11 11:04:40', '2020-10-11 11:04:40');
