INSERT INTO `query_questions` (`id`, `text`, `details`, `created_at`, `updated_at`) VALUES
(1, '{\"en\": \"რამდენად კმაყოფილი ხარ იმ სარგებლით, რომელიც შესაძლებლობაში მონაწილეობით მიიღე?\", \"ka\": \"რამდენად კმაყოფილი ხარ იმ სარგებლით, რომელიც შესაძლებლობაში მონაწილეობით მიიღე?\"}', '{\"en\": \"<p>(სარგებელში იგულისხმება ახალი უნარები, ცოდნა, საინტერესო გამოცდილება და ა.შ.)<br />\\n<br />\\n1. ძალიან უკმაყოფილო - 5. ძალიან კმაყოფილი</p>\", \"ka\": \"<p>(სარგებელში იგულისხმება ახალი უნარები, ცოდნა, საინტერესო გამოცდილება და ა.შ.)<br />\\n<br />\\n1. ძალიან უკმაყოფილო - 5. ძალიან კმაყოფილი</p>\"}', '2020-11-06 20:17:20', '2020-11-06 20:17:20'),
(2, '{\"en\": \"ამ შესაძლებლობის ფარგლებში, რამდენად გასაგებად და ამომწურავად მიიღე ინფორმაცია?\", \"ka\": \"ამ შესაძლებლობის ფარგლებში, რამდენად გასაგებად და ამომწურავად მიიღე ინფორმაცია?\"}', '{\"en\": \"<p>1.&nbsp;გაუგებარი და არა ამომწურავი - 5.&nbsp;სრულიად გასაგები და ამომწურავი</p>\", \"ka\": \"<p>1.&nbsp;გაუგებარი და არა ამომწურავი - 5.&nbsp;სრულიად გასაგები და ამომწურავი</p>\"}', '2020-11-06 20:18:06', '2020-11-06 20:18:06'),
(3, '{\"en\": \"შენი აზრით,  რამდენად ასახავდა შესაძლებლობის აღწერა რეალობას?\", \"ka\": \"შენი აზრით,  რამდენად ასახავდა შესაძლებლობის აღწერა რეალობას?\"}', '{\"en\": \"<p>(მაგ. გარემო, ადგილმდებარეობა, ადაპტირებულობა, საგანმათლებლო ნაწილი და ა.შ)<br />\\n<br />\\n1.&nbsp;საერთოდ არ ასახავდა - 5. ზუსტად ასახავდა</p>\", \"ka\": \"<p>(მაგ. გარემო, ადგილმდებარეობა, ადაპტირებულობა, საგანმათლებლო ნაწილი და ა.შ)<br />\\n<br />\\n1.&nbsp;საერთოდ არ ასახავდა - 5. ზუსტად ასახავდა</p>\"}', '2020-11-06 20:18:50', '2020-11-06 20:18:50'),
(4, '{\"en\": \"რამდენად კარგად იყო შესაძლებლობა ორგანიზებული?\", \"ka\": \"რამდენად კარგად იყო შესაძლებლობა ორგანიზებული?\"}', '{\"en\": \"<p>1.&nbsp;ძალიან ცუდად ორგანიზებული - 5.&nbsp;შესანიშნავად ორგანიზებული</p>\", \"ka\": \"<p>1.&nbsp;ძალიან ცუდად ორგანიზებული - 5.&nbsp;შესანიშნავად ორგანიზებული</p>\"}', '2020-11-06 20:19:28', '2020-11-06 20:19:28'),
(5, '{\"en\": \"რამდენად მეგობრულნი იყვნენ ორგანიზაციის წარმომადგენლები?\", \"ka\": \"რამდენად მეგობრულნი იყვნენ ორგანიზაციის წარმომადგენლები?\"}', '{\"en\": \"<p>1.&nbsp;არამეგობრულები - 5. ძალიან მეგობრულები</p>\", \"ka\": \"<p>1.&nbsp;არამეგობრულები - 5. ძალიან მეგობრულები</p>\"}', '2020-11-06 20:20:07', '2020-11-06 20:20:07'),
(6, '{\"en\": \"რამდენად მიიღებდი ან ურჩევდი მეგობარს ამ ორგანიზაციის მიერ შემოთავაზებულ შესაძლებლობებში მონაწილეობას?\", \"ka\": \"რამდენად მიიღებდი ან ურჩევდი მეგობარს ამ ორგანიზაციის მიერ შემოთავაზებულ შესაძლებლობებში მონაწილეობას?\"}', '{\"en\": \"<p>1.&nbsp;არ ვურჩევდი - 5. ვურჩევდი</p>\", \"ka\": \"<p>1.&nbsp;არ ვურჩევდი - 5. ვურჩევდი</p>\"}', '2020-11-06 20:20:39', '2020-11-06 20:20:39');
