INSERT INTO `static_data_about_us` (`id`, `about_us_title`, `about_us_subtitle`, `about_us_text`, `created_at`, `updated_at`) VALUES
(1, '{\"en\": null}', '{\"en\": \"About Us\", \"ka\": \"ჩვენ შესახებ\"}', '{\"en\": \"<p>The information portal for youth was developed within the &ldquo;EU4Youth: Better Skills for Better Future&rdquo; project, which is implemented in 3 countries of Eastern Partnership &ndash; Armenia, Georgia and Ukraine. The project is supported by the European Union and implemented by the international non-governmental organization Save the Children. Save the Children&rsquo;s implementing partner in Georgia is the Youth Agency.The projects aims at promoting youth policies that are effective, gender sensitive, inclusive through youth in multi-stakeholder policy dialogue. Its objectives are: 1) Advocate for coherent and cross-sectorial youth policies at local, regional and national levels; 2) Contribute to developing the entrepreneurial potential of disadvantaged youth; and 3) Ensure increased access of youth to non-formal education and training opportunities for greater employability.Save the Children is the world&rsquo;s leading independent organization for children. Its vision is a world in which every child attains the right to survival, protection, development and participation. Its mission is to inspire breakthroughs in the way the world treats children, and to achieve immediate and lasting change in their lives.This publication was produced with the support of the European Union. Its contents are the sole responsibility of Save the Children and the Youth Agency and do not necessarily reflect the views of the European Union.</p>\", \"ka\": \"<p style=\\\"text-align:start\\\"><strong>რა არის ახალგაზრდობის პლატფორმა ?</strong></p>\\n\\n<p style=\\\"text-align:start\\\">&bdquo;ახალგაზრდობის პლატფორმა&ldquo;, ერთი ფანჯრის პრინციპის მქონე შესაძლებლობების პირველი ონლაინ სივრცეა. მისი მეშვეობით ახალგაზრდები და ყველა შესაძლებლობის გამცემი ორგანიზაცია, ერთ სივრცეში ერთიანდება. &nbsp;&bdquo;ახალგაზრდობის პლატფორმის&ldquo; მეშვეობით, ახალგაზრდები სხვადასხვა შესაძლებლობებს ეცნობიან და ერთვებიან ახალგაზრდული ორგანიზაციების დაგეგმილ აქტივობებში.</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>თუ ხარ ახალგაზრდა:</strong> ალბათ გიფიქრია რა მარტივი იქნებოდა, რომ შენი ყველა ინტერესი; სპორტი, კულტურა, განათლება, დასაქმება, გაცვლითი პროგრამები და ღონისძიებები არ ყოფილიყო ინტერნეტში გაფანტული და მარტივად მოგეძებნა ისინი, &bdquo;ახალგაზრდობის პლატფორმის&ldquo; მეშვეობით, ეს უკვე შესაძლებელია.</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>თუ ხარ ორგანიზაცია:</strong> &bdquo;ახალგაზრდობის პლატფორმა&ldquo;, არასამთავრობო, კერძო, საჯარო, ადგილობრივ ან საერთაშორისო ორგანიზაციას შესაძლებლობას აძლევს ახალგაზრდებს ხმა მიაწვდინოს ყველა დაგეგმილი აქტივობის შესახებ, იქნება ეს გაცვლითი პროგრამა, ტრენინგი, ვორქშოპი, საგრანტო კონკურსი თუ სხვა.</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>პროექტის ერთ-ერთი მთავარი მიზანია:</strong> ხელი შეუწყოს გენდერულად სენსიტიური, მონაწილეობრივი და ინკლუზიური ახალგაზრდული პოლიტიკის შექმნას. პროექტის მიზნები და შედეგები მოიცავს შემდეგს:</p>\\n\\n<ul>\\n\\t<li style=\\\"text-align:start\\\">თანმიმდევრული და სექტორთაშორისი ახალგაზრდული პოლიტიკის ადვოკატირება ადგილობრივ, რეგიონალურ და ეროვნულ დონეებზე;</li>\\n\\t<li style=\\\"text-align:start\\\">ახალგაზრდებისათვის სამეწარმეო უნარების განვითარების ხელშეწყობა;</li>\\n\\t<li style=\\\"text-align:start\\\">არაფორმალური განათლების ხელმისაწვდომობის ზრდის ხელშეწყობა, შემდგომი დასაქმების მიზნით.</li>\\n</ul>\\n\\n<p style=\\\"text-align:start\\\">&nbsp;</p>\\n\\n<p style=\\\"text-align:start\\\"><strong>პროექტის შესახებ</strong></p>\\n\\n<p style=\\\"text-align:start\\\">&bdquo;ახალგაზრდობის პლატფორმა&ldquo; შეიქმნა: &bdquo;ევროკავშირი ახალგაზრდებისათვის: უკეთესი უნარები უკეთესი მომავლისთვის&ldquo; პროექტის ფარგლებში, რომელიც ხორციელდება აღმოსავლეთ პარტნიორობის 3 ქვეყანაში - სომხეთი, საქართველო და უკრაინა. პროექტი ხორციელდება ევროკავშირის ფინანსური მხარდაჭერით საერთაშორისო ორგანიზაცია &bdquo;გადავარჩინოთ ბავშვების&ldquo; მიერ. საქართველოში, ორგანიზაციის &bdquo;გადავარჩინოთ ბავშვები&ldquo; პროექტის განმახორციელებელი პარტნიორია &bdquo;ახალგაზრდობის სააგენტო&ldquo;.</p>\"}', '2020-02-17 07:20:37', '2021-05-31 15:04:48');
INSERT INTO `static_data_main_pages` (`id`, `user_section_title`, `user_section_subtitle`, `user_section_text`, `created_at`, `updated_at`, `order`, `for_company`) VALUES
(1, '{\"en\": null}', '{\"en\": \"Are You Young?\", \"ka\": \"ხარ ახალგაზრდა?\"}', '{\"en\": \"<p>Join us to find out what opportunities exist for in Georgia and abroad&nbsp;</p>\", \"ka\": \"<p>შემოგვიერთდი, რომ&nbsp;გაიგო&nbsp;რა შესაძლებლობები&nbsp;არსებობს შენთვის საქართველოში და მის გარეთ</p>\"}', '2020-02-14 11:59:46', '2021-05-31 14:57:46', 0, 0),
(2, '{\"en\": null}', '{\"en\": \"Are you an organizations working with youth?\", \"ka\": \"ხართ ახალგაზრდული ორგანიზაცია?\"}', '{\"en\": \"<p>Join us and share opportunities to Georgian youth</p>\", \"ka\": \"<p>შემოგვიერთდით და გაუზიარეთ საქართველოში მცხოვრებ ახალგაზრდებს შესაძლებლობები</p>\"}', '2020-07-13 15:16:24', '2020-07-30 07:25:09', 0, 0);
INSERT INTO `static_data_user_registrations` (`id`, `confidentiality_title`, `confidentiality_text`, `terms_title`, `terms_text`, `created_at`, `updated_at`) VALUES
(1, '{\"en\": \"asd\", \"ka\": \"კონფიდენციალობის პოლიტიკა\"}', '{\"en\": \"<p>asd</p>\", \"ka\": \"<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>როგორ ვიყენებთ თქვენს პერსონალურ ინფორმაციას</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">წინამდებარე შეტყობინება ეხება პერსონალურ მონაცემებზე არასანქცირებულ წვდომასთან დაკავშირებით youthplatform.gov.ge-ს არსებულ დაცვის მექანიზმებს, რომელთა საშუალებითაც&nbsp; youthplatform.gov.ge უზრუნველყოფს თქვენი პერსონალური მონაცემების დაცვას. ეს უკანასკნელი მოიცავს ინფორმაციას, რომელსაც youthplatform.gov.ge მოიპოვებს თქვენთვის მომსახურების გაწევის პერიოდში, რომელიც საქართველოს კანონმდებლობის შესაბამისად, შემდგომში ასევე გამოიყენება პირდაპირი მარკეტინგის მიზნებისთვის. შეტყობინების მიზანია, მოგაწოდოთ ინფორმაცია პერსონალური ინფორმაციის დამუშავებისას ჩვენი მუშაობის პრინციპებისა და თქვენი სამართლებრივი დაცვის მექანიზმებთან დაკავშირებით. </span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>პერსონალურ მონაცემთა კონფიდენციალურობის დაცვის დაპირება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ გპირდებით, რომ:<br />\\nვიზრუნებთ თქვენი პერსონალური მონაცემების უსაფრთხოებასა და დაცვაზე;<br />\\nარ გამოვიყენებთ თქვენს მონაცემებს არამართლზომიერად;<br />\\nნებისმიერ დროს მოგაწვდით სრულ და ამომწურავ ინფორმაციას თქვენი პერსონალური მონაცემების დამუშავებასთან დაკავშირებით.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>როგორ გიცავთ კანონი</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">პერსონალურ მონაცემთა კონფიდენციალურობის დაცვის დაპირების მსგავსად, აღნიშნულ მონაცემებს იცავს პერსონალურ მონაცემთა დაცვის შესახებ საქართველოს კანონი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">კანონმდებლობის თანახმად, თქვენ უფლება გაქვთ, მოგვთხოვოთ ინფორმაცია თქვენი მონაცემების დამუშავების თაობაზე. თქვენ გაქვთ უფლება მიიღოთ შემდეგი ინფორმაცია:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● რომელი მონაცემები მუშავდება თქვენს შესახებ;<br />\\n● მონაცემთა დამუშავების მიზანი;<br />\\n● მონაცემთა დამუშავების სამართლებრივი საფუძველი;<br />\\n● რა გზით შეგროვდა თქვენი მონაცემები;<br />\\n● ვის გადაეცა თქვენი მონაცემები;<br />\\n● მონაცემთა გაცემის საფუძველი და მიზანი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენ შეგიძლიათ მოითხოვოთ ჩვენ მიერ დამუშავებული ინფორმაციის ასლი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">კანონმდებლობის შესაბამისად თქვენ გაქვთ უფლება მოითხოვოთ თქვენი პირადი მონაცემების გასწორება, განახლება, დამატება, დაბლოკვა, წაშლა ან განადგურება თუ ისინი არასრულია, არაზუსტია, არ არის განახლებული ან თუ მათი შეგროვება და დამუშავება განხორციელდა კანონის საწინააღმდეგოდ. ჩვენ ვმოქმედებთ საქართველოს კანონმდებლობის შესაბამისად, რამაც შესაძლოა ხელი შეგვიშალოს დაუყოვნებლივ წავშალოთ თქვენი პირადი მონაცემები.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">აღნიშნული ინფორმაციის თქვენთვის მოწოდების ვალდებულება ჩვენ წარმოგვეშვება თქვენი მოთხოვნის შემთხვევაში. პერსონალური მონაცემების გამოყენების უფლება გვაქვს მხოლოდ იმ შემთხვევაში, როცა ამისათვის კონკრეტული სახელშეკრულებო ან/და კანონისმიერი საფუძველი გაგვაჩნია.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ გვაქვს თქვენი ინფორმაციის გამოყენების კანონიერი საფუძველი. მნიშვნელოვანია, რომ მოცემულ შემთხვევაშიც, ჩვენს მიერ ინფორმაციის დამუშავება არ არის მიმართული თქვენი ინტერესების შელახვისაკენ.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>შეგროვებული ინფორმაციის სახეობა და მისი გამოყენება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ ვაგროვებთ ორი სახის ინფორმაციას ჩვენი მომხმარებლების შესახებ: პირადი საიდენტიფიკაციო ინფორმაცია (&bdquo;პერსონალური ინფორმაცია&ldquo;) და არაპირადი საიდენტიფიკაციო ინფორმაცია.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>პირადი საიდენტიფიკაციო ინფორმაცია.</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">პირადი საიდენტიფიკაციო ინფორმაცია არის ინფორმაცია, რომლის მეშვეობითაც ხდება კონკრეტული მომხმარებლის იდენტიფიკაცია. თქვენ მიერ ჩვენი ვებ-გვერდის მეშვეობით აქტივობაში ჩართვისას, ჩვენ შეიძლება გთხოვოთ თქვენს შესახებ გარკვეული ინფორმაციის წარმოდგენა. ასეთ აქტივობებს მიეკუთვნება:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● ავტორიზაცია<br />\\n● ინფორმაციის გაგზავნა და/ან რაიმე ინფორმაციის განხილვის გვერდზე დადება<br />\\n● ჩვენ ან ჩვენი პარტნიორების მიერ დაფინანსებულ კონკურსებში, გამოკითხვებში მონაწილეობა<br />\\n● კომენტარის განთავსება, ჩვენთვის ან ჩვენი პარტნიორებისათვის საკუთარი აზრის გაზიარება<br />\\n● ჩვენს მომსახურებაზე ინფორმაციის მოთხოვნა</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>არაპირადი საიდენტიფიკაციო ინფორმაცია.</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">არაპირადი საიდენტიფიკაციო ინფორმაცია არის ინფორმაცია, რომელიც არ ახდენს კონკრეტული მომხმარებლის იდენტიფიკაციას. ამ სახის ინფორმაცია შეიძლება მოიცავდეს ისეთ გარემოებებს, როგორიცაა &quot;Uniform Resource Locator&quot; &bdquo;URL&ldquo; იმ ვებ-გვერდისა, რომელზეც თქვენ შეხვედით იქამდე სანამ ჩვენს ვებ-გვერდზე შეხვიდოდით, &bdquo;URL&ldquo; იმ ვებ-გვერდისა, რომელზეც თქვენ შეხვალთ ჩვენი ვებ-გვერდიდან გამოსვლის შემდეგ, იმ ბრაუზერის სახეობა, რომელსაც თქვენ იყენებთ და თქვენი ინტერნეტ პროტოკოლის &bdquo;IP&ldquo; მისამართი. ჩვენ ან/და ჩვენ მიერ უფლებამოსილ მესამე მხარე მომსახურების პროვაიდერებს და მარეკლამირებელ პირებს შეუძლიათ ავტომატურად მიიღონ ეს ინფორმაცია იმ დროს, როდესაც თქვენ სარგებლობთ ჩვენი ვებ-გვერდით. ეს ხორციელდება ისეთი ელექტრონული მექანიზმების მეშვეობით, </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">პერსონალური ინფორმაციის ტიპები:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● სახელშეკრულებო - დეტალური ინფორმაცია ჩვენ მიერ თქვენთვის მიწოდებული პროდუქტებისა&nbsp; და გაწეული მომსახურების შესახებ<br />\\n● ლოკაციური&nbsp; - მონაცემები თქვენს ადგილსამყოფელთან დაკავშირებით, რომელიც შესაძლოა youthplatform.gov.ge -მ მოიპოვოს თქვენი მობილური ტელეფონის დახმარებით, კომპიუტერის ინტერნეტში ჩართვის მისამართიდან, ან იმ ობიექტის ადგილმდეგარეობიდან, სადაც ახორციელებთ ოპერაციებს<br />\\n● ქცევითი - დეტალური ინფორმაცია იმის შესახებ, თუ როგორ იყენებთ ჩვენს პროდუქტებს და მომსახურებას<br />\\n● ტექნიკური - ინფორმაცია თქვენ მიერ გამოყენებული მოწყობილობებისა და ტექნოლოგიის შესახებ<br />\\n● საკომუნიკაციო - ინფორმაცია, რომელსაც&nbsp; youthplatform.gov.ge &nbsp;მოიპოვებს თქვენს შესახებ წერილებიდან, ელექტრონული წერილებიდან მომხმარებელსა და &nbsp;youthplatform.gov.ge-ს შორის განხორციელებული სხვა ნებისმიერი საკომუნიკაციო საშუალებით.</span></span></p>\\n\\n<p><br />\\n&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">დეტალური ინფორმაცია იმის შესახებ, თუ როგორ იყენებთ ჩვენს პროდუქტებს და მომსახურებას<br />\\n● სახელშეკრულებო - დეტალური ინფორმაცია ჩვენ მიერ თქვენთვის მიწოდებული პროდუქტებისა&nbsp; და გაწეული მომსახურების შესახებ<br />\\n● სახელშეკრულებო - დეტალური ინფორმაცია ჩვენ მიერ თქვენთვის მიწოდებული პროდუქტებისა&nbsp; და გაწეული მომსახურების შესახებ</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">როგორიცაა &bdquo;Cookies&ldquo;, &bdquo;Web Beacons&ldquo;, &bdquo;Pixel Tags&ldquo;.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენს ვებ-გვერდზე ვაგროვებთ ინფორმაციას cookies-ების, მომხმარებლების ვებ-გვერდზე ნავიგაციის და ქცევის შესახებ, კერძოდ:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● IP მისამართი, მოწყობილობის ტიპი, საოპერაციო სისტემა და ბრაუზერი საიდანაც ხდება ვებ-გვერდზე შემოსვლა.<br />\\n● ვაგროვებთ ინფორმაციას ჩვენს ვებ-გვერდზე გახსნილი გვერდების, სესიის ხანგრძლივობის და სესიის სხვადასხვა პარამეტრების შესახებ.<br />\\n● ინფორმაცია იმ ქმედებების შესახებ რომელიც ჩვენს ვებ-გვერდზე მოხდა: ფორმების შევსება, ვებ-გვერდის ინტერაქციულ ელემენტების გამოყენება და ა.შ.<br />\\n● ვებ-გვერდზე ველების შევსების პროცესი, დრო და ფორმა</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>პერსონალური ინფორმაციის ჯგუფები</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ თქვენს პერსონალურ ინფორმაციას ვაჯგუფებთ შემდეგნაირად:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">&nbsp;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>რისთვის ვიყენებთ თქვენს პერსონალურ ინფორმაციას:</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● თქვენთან ურთიერთობისთვის;<br />\\n● ვებ-გვერდით სარგებლობის ინტენსივობის გასაზრდელად;<br />\\n● თქვენი მოთხოვნების დასაკმაყოფილებლად, თანამშრომლობის ახალი გზების შესამუშავებლად და ჩვენს განსავითარებლად;<br />\\n● ეფექტური მარკეტინგული აქტივობების შესამუშავებლად და განსახორციელებლად;<br />\\n● იმის შესასწავლად, თუ როგორ იყენებენ მომხმარებლები ჩვენს პროდუქტებსა და მომსახურებას;<br />\\n● ჩვენს პროდუქტებსა და მომსახურებასთან დაკავშირებით რჩევებისა თუ რეკომენდაციების მისაღებად;<br />\\n● ჩვენი პროდუქტებისა და მომსახურების განსავითარებლად/ სამართავად;<br />\\n● ჩვენი პროდუქტებისა და მომსახურების მისაწოდებლად;<br />\\n● ჩვენი და ჩვენი მომხმარებლების რისკების სამართავად;<br />\\n● ჩვენთვის რელევანტური კანონებისა და რეგულაციების შესასრულებლად;<br />\\n● საჩივრებზე რეაგირების მოსახდენად და მათი მოგვარების გზების მოსაძიებლად;<br />\\n● ნაკისრი უფლებებისა და ვალდებულებების განსახორციელებლად;</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ჩვენი მიზანი:</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● მონაცემების განახლება, თქვენთვის საინტერესო პროდუქტებისა და მომსახურების იდენტიფიცირება და ამ ინფორმაციის თქვენთვის მოწოდება;<br />\\n● პროდუქტებისა და მომსახურების განვითარება;<br />\\n● ახალი პროდუქტებისა თუ მომსახურების შეთავაზებისთვის მომხმარებელთა ფოკუს ჯგუფების განსაზღვრა;<br />\\n● ჩვენი კანონიერი მოვალეობების და სახელშეკრულებო ვალდებულებების ეფექტიანად შესრულება;<br />\\n● ჩვენთვის რელევანტურ რეგულაციებთან შესაბამისობის უზრუნველყოფა.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>რა წყაროებიდან მოვიპოვებთ პერსონალურ ინფორმაციას</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენს შესახებ პერსონალური ინფორმაციის მოპოვება შეგვიძლია თქვენ მიერ მოწოდებული და ქვემოთ ჩამოთვლილი წყაროებიდან.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენგან მონაცემებს ვიღებთ შემდეგ შემთხვევებში:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● როცა მოგვმართავთ ჩვენი პროდუქტებისა თუ მომსახურების მისაღებად;<br />\\n● როცა კომუნიკაცია ხორციელდება ტელეფონის ან/და ელექტრონული ფოსტის საშუალებით<br />\\n● როცა თქვენ იყენებთ ჩვენს ვებ-გვერდებს, მობილურ აპლიკაციებსა და ვებ-ჩეთს;<br />\\n● როცა აგზავნით წერილებს როგორც მატერიალური, ისე ელექტრონული ფორმით.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ჩვენი სამართლებრივი საფუძველი:</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● თქვენი თანხმობა;<br />\\n● სახელშეკრულებო ვალდებულებათა შესრულება;<br />\\n● ჩვენი კანონიერი ინტერესები;<br />\\n● ჩვენი კანონიერი მოვალეობა.<br />\\n● რეგულაციებთან შესაბამისობის უზრუნველყოფა</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>&bdquo;მზა ჩანაწერები&ldquo; (Cookies)</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ ვიყენებთ Cookies-ს და ვაკვირდებით ჩვენს ვებ-გვერდზე მომხამრებლების ქცევას რათა დავრწმუნდეთ, რომ გთავაზობთ საუკეთესო გამოცდილებას ჩვენს ვებ-გვერდზე ყოფნისას და შევძლოთ მუდმივად გავაუმჯობესოთ მომსახურების ხარისხი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენს ვებ-გვერდზე ვაგროვებთ ინფორმაციას cookies-ების, მომხმარებლების ვებ-გვერდზე ნავიგაციის და ქცევის შესახებ, კერძოდ:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● IP მისამართი, მოწყობილობის ტიპი, საოპერაციო სისტემა და ბრაუზერი საიდანაც ხდება ვებ-გვერდზე შემოსვლა.<br />\\n● ვაგროვებთ ინფორმაციას ჩვენს ვებ-გვერდზე გახსნილი გვერდების, სესიის ხანგრძლივობის და სესიის სხვადასხვა პარამეტრების შესახებ.<br />\\n●&nbsp; ინფორმაცია იმ ქმედებების შესახებ რომელიც ჩვენს ვებ-გვერდზე მოხდა: ფორმების შევსება, ვებ-გვერდის ინტერაქციულ ელემენტების გამოყენება და ა.შ.<br />\\n● ვებ-გვერდზე ველების შევსების პროცესი, დრო და ფორმა</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>მოგროვებულ ინფორმაციას ვიყენებთ:</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● ვებ-გვერდის სტატისტიკის საწარმოებლად პროცესების, ველების და ვებ-გვერდის დიზაინის ოპტიმიზაციის მიზნით.<br />\\n● ვებ-გვერდის მომხმარებლების დაცვისა და თაღლითური ქმედებების პრევენციის მიზნით.<br />\\n● ვებ-გვერდზე მომხმარებელთა&nbsp; ნაკადის კონტროლისა და მარკეტინგული კამპანიების ეფექტურობის შესაფასებლად.<br />\\n● მოპოვებული ინფორმაცია საშუალებას გვაძლევს განვახორციელოთ ვებ-გვერდის და მისი კომპონენტების ადაპტირება&nbsp; მომხმარებლის საჭიროებების მიხედვით.<br />\\n● ასევე cookies ფაილებს ვიყენებთ იმის დასადგენად თუ როგორ ხვდებიან მომხმარებლები ჩვენს ვებ-გვერდზე და Google Analytics-ის რეპორტების საწარმოებლად.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ვებ-გვერდის გამოყენების დაწყებამდე, თქვენ გაქვთ საშუალება დაეთანხმოთ cookies და მომხმარებელთა ქცევაზე დაკვირვების შესახებ შეტყობინებას &bdquo;თანხმობა&ldquo; ღილაკზე დაჭერით. იმ შემთხვევაში თუ არ დაეთანმხებით&nbsp; &bdquo;Cookie პოლიტიკა&ldquo;-ს, თუმცა გააგრძელებთ ვებ-გვერდის გამოყენებას, აღნიშნული ქმედება მაინც&nbsp; ჩაითვლება თქვენს თანხმობად ზემოდ აღნიშნულ ქმედებაზე</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ არ ვიყენებთ cookie ფაილებს და მომხმარებლის ქცევაზე&nbsp; დაკვირვების შედეგად მიღებულ მონაცემებს პირადი ინფორმაციის შეგროვების მიზნით. თუ გსურთ შეზღუდოთ cookie ფაილები ან დაბლოკოთ ისინი ჩვენს ვებ-გვერდზე, ამის განხორციელება შეგიძლიათ თქვენი ბრაუზერის პარამეტრების შეცვლით. ამასთან, გთხოვთ გაითვალისწინოთ რომ ჩვენს მიერ შემოთავაზებული ზოგიერთი სერვისი არ იფუნქციონირებს თუ დაბლოკავთ ან წაშლით cookie-სფაილებს.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ვის ვუზიარებთ თქვენს პერსონალურ მონაცემებს</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენი პერსონალური მონაცემების გაზიარება შეიძლება დაგვჭირდეს საქართველოს კანონმდებლობით განსაზღვრულ შემთხვევებში, ასევე სხვა ორგანიზაციებთან, რომლებმაც თქვენს მიერ შერჩეული პროდუქტი თუ მომსახურება უნდა მოგაწოდონ ან შემოგთავაზონ გარკვეული მომსახურების გაწევა, იმ პირობით, რომ:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ასეთი ინფორმაციის გაზიარებამდე ხსენებულმა მხარეებმა სავალდებულო წესით უნდა განაცხადონ თანხმობა, შეინახონ თქვენი მონაცემები უსაფრთხოდ და კონფიდენციალურად.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ უფლებას ვიტოვებთ, კანონით მკაცრად განსაზღვრულ შემთხვევებში სამართალდამცავ ორგანოებს მივცეთ წვდომა თქვენს პირად მონაცემებზე სამსახურეობრივი უფლებამოსილების შესრულების, მათ შორის დანაშაულის დადგენის, გამოძიების და აღკვეთის მიზნით.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თუ არ ისურვებთ პირადი ინფორმაციის გაცემას, შესაძლოა, შეფერხდეს ან შეუძლებელი გახდეს ჩვენ მიერ თქვენს წინაშე ნაკისრი ვალდებულებების შესრულება, მათ შორის შესაბამისი მომსახურებების მიღება.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ინფორმაციის უსაფრთხოება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ განსაკუთრებული პასუხისმგებლობით ვეკიდებით უსაფრთხოების საკითხს და ვატარებთ არაერთ ზომას პირადი საიდენტიფიკაციო ინფორმაციის დასაცავად. თქვენი პირადი საიდენტიფიკაციო ინფორმაცია ჩვენს ვებ-გვერდზე ხელმისაწვდომია მხოლოდ თქვენი პაროლისა და ელექტრონული ფოსტის მისამართის მითითების შემთხვევაში. ეს პაროლი დაშიფრულია. ჩვენ გირჩევთ, რომ არავის გაანდოთ თქვენი პაროლი. გარდა ამისა, თქვენი პირადი საიდენტიფიკაციო ინფორმაცია ინახება დაცულ სერვერზე, რომელზეც მხოლოდ შესაბამის პერსონალსა და კონტრაქტორებს მიუწვდებათ ხელი. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">სამწუხაროდ, მონაცემთა ნებისმიერი გადაცემა ინტერნეტის ან უკაბელო ქსელის საშუალებით შეუძლებელია იყოს აბსოლუტურად და გარანტირებულად უსაფრთხო. ჩვენ ვატარებთ გონივრულ უსაფრთხოების ზომებს, რათა დავიცვათ მონაცემები და ასევე ვცდილობთ კავშირები დავამყაროთ მხოლოდ ისეთ ორგანიზაციებთან, რომლებიც იგივენაირად უდგებიან ამ საკითხს. თუმცა ჩვენ ვერ გავცემთ რაიმე გარანტიას ვებ-გვერდისათვის ან ვებ-გვერდიდან გადაცემული ინფორმაციის უსაფრთხოებაზე და არ ვაგებთ პასუხს მესამე მხარის ქმედებაზე, რომელმაც შეიძლება უნებართვოდ მიიღოს მსგავსი ინფორმაცია.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>მესამე მხარე ვებ-გვერდების ინფორმაციის დაცვის პოლიტიკა</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">წინამდებარე ინფორმაციის დაცვის პოლიტიკა ეხება მხოლოდ იმ ინფორმაციის გამოყენებასა და გამჟღავნებას, რომელსაც ჩვენ ვიღებთ თქვენგან. სხვა ვებ-გვერდებს, რომლებზე გადამისამართებაც შეიძლება ჩვენი ვებ-გვერდიდან, საკუთარი ინფორმაციის დაცვის პოლიტიკა და მონაცემთა კრებული, ასევე ასეთი ინფორმაციის გამოყენებისა და გამჟღავნების პრინციპები აქვთ. თუ თქვენ დაუკავშირდებით მსგავს ვებ-გვერდს, ჩვენ მოგიწოდებთ, რომ წაიკითხოთ მათი ინფორმაციის დაცვის პოლიტიკა. ჩვენ პასუხს არ ვაგებთ მესამე მხარეთა საქმიანობაზე.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ინფორმაციის დაცვის სხვადასხვა საკითხები</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">18 წლამდე არასრულწლოვან პირებს ეკრძალებათ ჩვენი მომსახურებით სარგებლობა. ჩვენ განზრახ არ ვინახავთ ან ვაგროვებთ ინფორმაციას 18 წლამდე პირებისაგან. არასრულწლოვანთა პირადი ინფორმაციის დაცვა ჩვენთვის ძალიან მნიშვნელოვანია. შესაბამისად, თუ ჩვენ გავიგებთ, რომ მომხმარებელი არის 18 წლამდე ასაკის პირი, ჩვენ გავატარებთ შესაბამის ღონისძიებებს, რათა წავშალოთ ამ მომხმარებლის პირადი ინფორმაცია ჩვენი მონაცემთა ბაზიდან.&nbsp; სარგებლობთ რა ჩვენი ვებ-გვერდით, თქვენ აქვე ადასტურებთ, რომ ხართ სულ მცირე 18 წლის.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>რამდენ ხანს ვინახავთ პერსონალურ ინფორმაციას?</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენს პირად მონაცემებს ვინახავთ თქვენი მომსახურების მთელი პერიოდის განმავლობაში;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">აგრეთვე, მომსახურების დასრულების შემდეგ 10 წლამდე ვადით შემდეგი მიზეზების გამო:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">● კითხვებსა და საჩივრებზე პასუხის გასაცემად<br />\\n● იმის დასამტკიცებლად, რომ ჩვენ სამართლიანად მოგექეცით<br />\\n● შესაბამისი რეგულაციების/წესების დაცვით აღრიცხვის წარმოების მიზნით</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ შეგვიძლია შევინახოთ თქვენი პირადი ინფორმაცია 10 წელზე მეტი ხნით, თუ მისი წაშლის შესაძლებლობა არ გვაქვს სამართლებრივი ან ნორმატიული მიზეზების გამო. თუ ფიქრობთ, რომ ჩვენთან შენახული თქვენი ნებისმიერი მონაცემი არასწორი ან არასრულია, გთხოვთ დაგვიკავშირდით თქვენი ეჭვების დასაფიქსირებლად. ჩვენ ყველა გონივრულ ზომას მივიღებთ, რომ შევამოწმოთ და გამოვასწოროთ ეს ხარვეზი. თქვენ უფლება გაქვთ, არ დაეთანხმოთ ჩვენ მიერ თქვენი პირადი მონაცემების გამოყენებას, ან მოითხოვოთ მათი წაშლა, ამოღება ან გამოყენების შეწყვეტა, თუ ჩვენ არ გვაქვს მათი შენახვის საკანონმდებლო საფუძველი. დაგვიკავშირდით, თუ არ ეთანხმებით ჩვენ მიერ თქვენი მონაცემების გამოყენებას, თუ გაქვთ შეკითხვები ან თუ გნებავთ თქვენი მონაცემების გაუქმება ან გამოყენების შეზღუდვა.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>ცვლილებები ინფორმაციის დაცვის პოლიტიკაში</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ ვიტოვებთ უფლებას, ნებისმიერ დროს შევცვალოთ წინამდებარე ინფორმაციის დაცვის პოლიტიკა.&nbsp; ინფორმაციის დაცვის პოლიტიკაში განხორციელებული ნებისმიერი ცვლილება დაუყოვნებლივ გამოქვეყნდება ინფორმაციის დაცვის გვერდზე და სხვა ისეთ ადგილებში, რომლებიც, ჩვენი აზრით, უზრუნველყოფს თქვენს საქმის კურსში ყოფნას იმასთან დაკავშირებით, თუ რა სახის ინფორმაციას შევაგროვებთ, როგორ გამოვიყენებთ და რა დროს გავამჟღავნებთ მას (კანონით გათვალისწინებულ შემთხვევებში). ამასთან,&nbsp; დაცვის პოლიტიკაში შეტანილი ნებისმიერი მნიშვნელოვანი ცვლილების შესახებ გეცნობებათ ელექტრონული ფოსტის ან ჩვენს მთავარ გვერდზე შესაბამისი შეტყობინების გამოქვეყნების გზით. თქვენი ვალდებულებაა, პერიოდულად შეამოწმოთ ინფორმაციის დაცვის პოლიტიკა.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>მარკეტინგი</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ შეგვიძლია გამოვიყენოთ თქვენი პირადი მონაცემები თქვენთვის კონკრეტული პროდუქტების და შეთავაზებების გასაცნობად.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ წვდომა გვაქვს თქვენს პირად მონაცემებზე იმ ფარგლებში, რასაც თავად გვიზიარებთ, ან ჩვენ ვაგროვებთ თქვენთვის მომსახურების გაწევის პროცესში ჩვენს ხელთ არსებული საშუალებებით</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ შევისწავლით თქვენს მონაცემებს, რათა გავიგოთ, რა გჭირდებათ, რა გაინტერესებთ,&nbsp; ან რა სურვილები შეიძლება გქონდეთ. ასე ვწყვეტთ, რომელი პროდუქტი, მომსახურება თუ შეთავაზება შეიძლება იყოს თქვენთვის შესაფერისი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ჩვენ მხოლოდ მაშინ ვიყენებთ თქვენს პირად მონაცემებს და გიგზავნით მარკეტინგულ შეტყობინებებს, როცა გვაქვს ამის ლეგიტიმური ინტერესი. ჩვენ გპირდებით რომ ჩვენი საქმიანობა არასდროს იქნება უსამართლო, არასწორი ან თქვენი ინტერესების წინააღმდეგ მიმართული.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">თქვენ უფლება გაქვთ ნებისმიერ დროს დაგვიკავშირდეთ და გვთხოვოთ მარკეტინგული შეტყობინებების გამოგზავნის შეწყვეტა. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ინფორმაციის დაცვის პოლიტიკასთან, ჩვენს საერთო უფლება-მოვალეობებთან ან ჩვენ მიერ თქვენი მონაცემების დამუშავებასთან დაკავშირებით არსებული შეკითხვების შემთხვევაში გთხოვთ დაგვიკავშირდეთ შემდეგი საკომუნიკაციო არხების გამოყენებით:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">მისამართი: ქ. თბილისი, საქართველო, ვაჟა-ფშაველას 76ბ</span></span><br />\\n<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ტელ.: 032 230 51 65</span></span><br />\\n<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ელ-ფოსტა: d.kakava@youthagency.gov.ge</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><em>წესების და პირობების თანხმობის ელექტრონულად მონიშვნით/აღიარებით თქვენ ადასტურებთ, რომ ამავდროულად ეთანხმებით წინამდებარე კონფიდენციალურობის პოლიტიკას, თქვენ მიერ მოწოდებული ინფორმაცია წარმოადგენს ზუსტ და უტყუარ მონაცემებს. ინფორმაციის მოწოდება მოხდა თქვენი საკუთარი სურვილით და ამისათვის თქვენ გაგაჩნიათ კანონმდებლობით გათვალისწინებული ყველა უფლება და ნებართვა.</em></span></span></p>\"}', '{\"en\": \"ad\", \"ka\": \"წესები და პირობები\"}', '{\"en\": \"<p>asd</p>\", \"ka\": \"<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>1. შესავალი</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">წინამდებარე წესები და პირობები წარმოადგენს თქვენსა და სსიპ ახალგაზრდობის სააგენტოს (შემდგომში &bdquo;სააგენტო&ldquo;) შორის დადებულ სავალდებულო ძალის მქონე შეთანხმებას და არეგულირებს თქვენ მიერ youthplatform.gov.ge ვებ-გვერდის გამოყენებას. youthplatform.gov.ge-ს ვებ-გვერდი ან/და მასთან დაკავშირებული მომსახურებები, შემდგომში ერთობლივად წოდებულია, როგორც ახალგაზრდობის პლატფორმა და ყოველივე ერთად წარმოადგენს სააგენტოს პროდუქტს.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">გთხოვთ, ყურადღებით გაეცნოთ წინამდებარე წესებსა და პირობებს, რომელიც არეგულირებს თქვენ მიერ ვებ-გვერდის გამოყენების პირობებს. იმ შემთხვევაში, თუ არ ეთანხმებით წინამდებარე წესებსა და პირობებს, გთხოვთ, დატოვოთ&nbsp; ვებ-გვერდი.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ვებ-გვერდზე სტუმრობით, ან მასზე გამოქვეყნებული ინფორმაციის გამოყენებით, ადასტურებთ და სრულად ეთანხმებით მითითებულ ყველა დანაწესს, რომელიც შესაძლოა ცალმხრივად შეიცვალოს სააგენტოს მიერ გარკვეული პერიოდულობით, რაც დაფიქსირდება მოცემულ ვებ-გვერდზე და მასზე თქვენი სტუმრობა ნიშნავს&nbsp; შესაბამის პირობებზე დათანხმებას.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ვებ-გვერდზე მითითებული ინფორმაცია, უმეტეს შემთხვევაში, განკუთვნილია იმ პირებისთვის, რომლებიც დაინტერესებულნი არიან ახალგაზრდებისთვის განკუთვნილი შესაძლებლობების ონლაინ სივრცეში მიღებით. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">პერსონალური ინფორმაცია, რომელსაც ახალგაზრდობის პლატფორმა მოიპოვებს თქვენგან მუშავდება წინამდებარე წესებში განსაზღვრული კონფიდენციალურობის პოლიტიკის შესაბამისად.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ახალგაზრდობის პლატფორმის გამოყენების წესებსა და პირობებზე თანხმობით, თქვენ ასევე ეთანხმებით ახალგაზრდობის პლატფორმის კონფიდენციალურობის პოლიტიკას.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>2. </strong><strong>ტერმინთა განმარტება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.&nbsp; წინამდებარე წესებში და პირობებში გამოყენებულ ტერმინებს და განმარტებებს აქვთ ქვემოთ განსაზღვრული მნიშვნელობა, გარდა იმ შემთხვევებისა, თუ დოკუმენტის კონტექსტიდან აშკარად სხვა რამ არ გამომდინარეობს:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.1. გამოყენების წესები - ნიშნავს წინამდებარე წესებს, ნებისმიერ სხვა წესთან ან/და პირობასთან ერთად, რომელსაც ეს გამოყენების წესები შესაბამისი მითითებით მიიჩნევენ ამ წესების ნაწილად და რომლებიც არეგულირებენ მომხმარებლის მიერ პლატფორმაზე წვდომისა და მისი გამოყენების საკითხებს, მათ შორის, დაკავშირებულს ნებისმიერ შინაარსთან, ფუნქციასთან და მომსახურებასთან, რომელიც შეთავაზებულია ვებ-გვერდზე;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.2. ვებ-გვერდი - ნიშნავს youthplatform.gov.ge&nbsp;-ს, რომლის მეშვეობითაც ხდება მომსახურების შეთავაზება; </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.3.&nbsp; მომხმარებელი - იურიდიული ან ფიზიკური პირი, რომელიც აკმაყოფილებს წინამდებარე პირობებით გათვალისწინებულ მოთხოვნებს და სურს <a name=\\\"_Hlk41138562\\\">youthplatform.gov.ge</a>-ს პლატფორმის გამოყენება.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.4. ავტორიზაცია-</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.5. მომხმარებელი, მომხმარებლები - ნიშნავს youthplatform.gov.ge პლატფორმაზე რეგისტრირებულ მომხმარებელს.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">2.1.6. მხარეები - ნიშნავს ახალგაზრდობის პლატფორმას და &nbsp;მის მომხმარებლებს;</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>3. </strong><strong>განცხადებები და გარანტიები</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1. წინამდებარე წესებსა და პირობებზე თანხმობით მომხმარებელი ადასტურებს, რომ:</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.1. არის საქართველოს კანონმდებლობის შესაბამისად დაფუძნებული იურიდიული პირი ან ფიზიკური პირი ან 18 წლის ასაკს მიღწეული პირი.&nbsp;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.2. გააჩნია სრული (შეუზღუდავი) ქმედუნარიანობა, არ იმყოფება ნარკოტიკული, ალკოჰოლური, ფსიქოტროპული ან ტოქსიკური პრეპარატების ზემოქმედების ქვეშ, არ იმყოფება შეცდომის, თაღლითობის, ზეწოლის, მუქარისა ან ნებისმიერი მართლსაწინააღმდეგო ზემოქმედების ქვეშ და არ წარმოადგენს ძალადობის, მუქარის, მოტყუების, შეცდომაში შეყვანისა თუ სხვა აკრძალული მოქმედების ობიექტს youthplatform.gov.ge-ს ან ნებისმიერი მესამე პირის მხრიდან, სრულად აცნობიერებს საკუთარი ნების გამოვლენის შინაარსს, პირობების დებულებათა არსს და მისგან გამომდინარე სამართლებრივ შედეგებს;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.3.მომხმარებელს აქვს სრული უფლებამოსილება (ან მიიღებს შესაბამის უფლებამოსილებას) იმისათვის, რომ ხელი მოაწეროს და შეასრულოს ამ პირობებით ან ნებისმიერი სხვა ხელშეკრულებებითა და განაცხადებით გათვალისწინებული ვალდებულებები;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.4.&nbsp; გაეცნო პირობებს და ეს პირობები არის მისთვის მისაღები;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.5. მის მიერ წარმოდგენილი ყველა მონაცემი არის ზუსტი;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.6. მომხმარებელი არ არის ჩაბმული ან არ მონაწილეობს არცერთი იურისდიქციის კანონმდებლობით (რაც მოიცავს საქართველოს კანონმდებლობას და იმ ქვეყნის კანონმდებლობას, რომლის მოქალაქეც არის მომხმარებელი) გათვალისწინებულ რაიმე სახის უკანონო საქმიანობაში (მათ შორის, ფულის გათეთრებაში, იარაღით ვაჭრობაში, ტერორიზმსა ან სხვა სახის უკანონო საქმიანობაში); </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">3.1.7. მომხმარებელი დაუყოვნებლივ წერილობით აცნობებს <a name=\\\"_Hlk41141121\\\"></a><a name=\\\"_Hlk41141182\\\">youthplatform.gov.ge</a>-ს ყველა იმ გარემოებ(ებ)ის შესახებ, რომელიც შეიძლება წინააღმდეგობაში მოვიდეს მის აღნიშნულ განცხადებებთან ან/და გამოიწვიოს აღნიშნული გარანტიების დარღვევა;</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>4. youthplatform.gov.ge-ს სარგებლობის წინაპირობები</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">4.1. youthplatform.gov.ge-ს გამოყენებისთვის მომხმარებელმა უნდა გაიაროს რეგისტრაცია;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">4.2. რეგისტრაციისთვის მომხმარებელი უთითებს სახელს, გვარს, ელ.ფოსტას და პაროლს, რომელიც იცის მხოლოდ მან და სისტემა არ ინახავს მას ღია სახით, არამედ ინახავს მის ჰეშირებულ ვერსიას, რომელიც არ არის ხელმისაწვდომი არავისთვის გარდა მეპატრონისა;</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">4.3. რეგისტრაციის დასასრულებლად მომხმარებელმა უნდა მონიშნოს ველი, რომ ეთანხმება <a name=\\\"_Hlk41141618\\\">youthplatform.gov.ge</a>-ს კონფიდენციალურობის პოლიტიკას და მომსახურების პირობებს.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>5.&nbsp;youthplatform.gov.ge-ის&nbsp;პასუხისმგებლობის&nbsp;შეზღუდვა</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">5.1&nbsp; თქვენ თანხმდებით, რომ თავისუფალი ხართ არჩევანში ისარგებლოთ თუ არა ვებ-გვერდითა და მომსახურებით და ამას აკეთებთ თქვენი შეხედულებით, დისკრეციითა და რისკით.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">5.2 youthplatform.gov.ge უზრუნველყოფს თქვენს წვდომას ვებ-გვერდზე და მომსახურების გაწევას წინამდებარე წესებისა და პირობების შესაბამისად. youthplatform.gov.ge &nbsp;არავითარ სხვა დაპირებასა და გარანტიას არ იძლევა მომსახურებასთან ან რაიმე პროდუქტთან ან სერვისთან დაკავშირებით, რომელიც შეადგენს მომსახურების ნაწილს, შესაბამისად, გამოირიცხება (კანონით დადგენილ ფარგლებში) youthplatform.gov.ge პასუხისმგებლობა აღნიშნულთან დაკავშირებით (მათ შორის, ნაგულისხმევი გარანტიები, დამაკმაყოფილებელ ხარისხი ან/და თქვენს მიზნებთან შესაბამისობა) კერძოდ, ჩვენ არ ვიძლევით გარანტიას, რომ ვებ-გვერდი ან/და მომსახურება იქნება მუდმივად ხელმისაწვდომი ან არ ექნება პროგრამული შეცდომები, ვირუსები ან სხვა შეცდომები. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">5.3&nbsp; youthplatform.gov.ge არ არის პასუხისმგებელი თქვენს ან ნებისმიერი პირის წინაშე სახელშეკრულებო, გაუფრთხილებელი, დელიქტური ან სხვა სახით, ნებისმიერი დანაკარგისა და ზიანისთვის, რომელიც წარმოიშვა, ან რაიმე ფორმით დაკავშირებული არის, თქვენს ან ნებისმიერ მესამე პირის მიერ მომსახურების გამოყენებასთან, პირდაპირ ან არაპირდაპირ, ფულადი/არაფულადი ან არსებითი/ნივთობრივი დანაკარგისთვის.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">5.4 youthplatform.gov.ge არ არის პასუხისმგებელი თქვენს ან ნებისმიერი პირის წინაშე, სახელშეკრულებო, გაუფრთხილებელი, დელიქტური ან სხვა სახით, დანაკარგისა და ზიანისთვის რომელიც წარმოიშვა, ან რაიმე ფორმით დაკავშირებული არის, თქვენს მიერ საიტზე არსებული ნებისმიერი ბმულის გამოყენებასთან. youthplatform.gov.ge არ არის პასუხისმგებელი ინტერნეტ ვებგვერდის ბმულის შინაარსზე, რომელზეც გადამისამართდებით ვებ-გვერდიდან ან მისი მომსახურებიდან.&nbsp; </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">5.5 თქვენ ადასტურებთ, რომ youthplatform.gov.ge არ იქნება პასუხისმგებელი თქვენს ან მესამე პირის წინაშე რაიმე ცვლილების, ვებ-გვერდზე წვდომის შეზღუდვის ან შეწყვეტის შემთხვევაში.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>6. ვებ-გვერდის გამოყენება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">6.1. ვებ-გვერდის გამოყენებისას, აკრძალული გაქვთ უკანონო/თაღლითური ქმედება, ცილისმწამებლური, სიძულვილის ენით საუბარი, ან სხვა არასასურველი ინფორმაციის განთავსება, გავრცელება/ტრანსმისია, რაც შესაძლოა არღვევდეს მოქმედ კანონმდებლობას და რეგულაციას, ან ზიანს აყენებდეს სააგენტოს რეპუტაციას. ასევე გეკრძალებათ ვებ-გვერდისთვის ზიანის მიყენება ნებისმიერი სახის მავნე პროგრამის მეშვეობით.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">6.2. იმ შემთხვევაში, თუ ვებ-გვერდზე წვდომა შეუძლებელი გახდება ტექნიკური შეფერხების, ან სააგენტოსგან დამოუკიდებელი სხვა ნებისმიერი მიზეზით, <a name=\\\"_Hlk41143377\\\">youthplatform.gov.ge </a>არ არის პასუხისმგებელი დამდგარ შედეგზე.&nbsp;&nbsp;</span></span><br />\\n&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>7.&nbsp;ინტელექტუალური საკუთრება</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.1.ვებ-გვერდზე, მის შინაარსზე, სტრუქტურასა და დიზაინზე სრულად ვრცელდება სააგენტოს საავტორო უფლება.&nbsp; სააგენტოს ექსკლუზიური უფლებები ვრცელდება ასევე მის მიერ შექმნილ და რეგისტრირებულ ინტელექტუალური საკუთრების ნებისმიერ ობიექტზე, მათ შორის მის კუთვნილ სასაქონლო ნიშნებზე.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.2. საავტორო (&copy;) და სხვა ინტელექტუალური საკუთრების უფლებები ვრცელდება წინამდებარე ვებ-გვერდსა და მასზე არსებულ მთელ შინაარსზე (პროდუქტებისა და მომსახურების ჩათვლით). </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.3. აკრძალულია წინამდებარე ვებ-გვერდზე მითითებული ნებისმიერი ინფორმაციის/შინაარსის, მათ შორის ლოგო, პიქტოგრამა, გრაფიკა, სურათი, გამოსახულება, პატენტი, მომსახურების/სასაქონლო ნიშნები, დიზაინი, სააგენტოს და ახალგაზრდული პლატფორმის მიერ შექმნილი ვიზუალური მედია და სხვა ინტელექტუალური საკუთრების (რეგისტრირებული, ან არარეგისტრირებული) უნებართვო გამოყენება, დამუშავება და გამოქვეყნება (მათ შორის სოციალურ მედიაში)&nbsp;&nbsp; წინასწარი წერილობითი თანხმობის გარეშე. წინასწარი თანხმობა არ არის საჭირო, თუ წინამდებარე მონაცემების გამოყენება ხორციელდება არაკომერციული, პირადი მიზნებისთვის და იმ შემთხვევებში, როცა წინასწარ თანხმობას არ ითვალიწინებს საქართველოს კანონმდებლობა, ან შესაბამისი საერთაშორისო რეგულაცია. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">&nbsp;7.4.ინტელექტუალური საკუთრების ვებ-გვერდზე მითითება არ ნიშნავს&nbsp; მომხმარებლისათვის მის გამოყენებაზე ლიცენზიის მინიჭებას. ვებ-გვერდიდან მომხმარებლის მიერ ნებისმიერი ინფორმაციის კომერციული მიზნებისთვის გადმოწერა, ან ასლის დამზადება ჩაითვლება საქართველოს კანონმდებლობის დარღვევად.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.5.წესებსა და პირობებში მითითებული არცერთი დანაწესი არ განიჭებთ უფლებას, ან ლიცენზიას წინამდებარე მუხლში ჩამოთვლილი სააგენტოს და ახალგაზრდობის პლატფორმის ინტელექტუალური საკუთრების გამოყენებაზე. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.6.იმ შემთხვევაში, თუ ვებ-გვერდი მომხმარებლებს ანიჭებს ჩატის, ინტერაქციისა, თუ დიალოგის/დისკუსიის გამართვის შესაძლებლობას, ვალდებულნი ხართ, წინამდებარე არხებში დააფიქსიროთ მხოლოდ ის ინფორმაცია, რომელზეც ფლობთ ინტელექტუალურ საკუთრებას, ან გაქვთ შესაბამისი პირის თანხმობა. ამასთან ერთად, youthplatform.gov.ge-ს ანიჭებთ უფლებას დაამუშაოს (მათ შორის, გამოაქვეყნოს) თქვენ მიერ დაფიქსირებული ინფორმაცია კანონიერი, საკომუნიკაციო/საინფორმაციო (მათ შორის, საგამოფენოდ, კონკურსში მონაწილეობისათვის) მიზნებისათვის.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">7.7. youthplatform.gov.ge ვებ-გვერდზე მითითებული კომპანიების სახელები, სასაქონლო ნიშნები, ლოგოები ეკუთვნის შესაბამის პირებს. </span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">8.<strong> </strong><strong>ვებ-გვერდზე მითითებული ბმულები&nbsp;</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">8.1. youthplatform.gov.ge უფლებამოსილია ვებ-გვერდზე მიუთითოს ჰიპერბმულები, მესამე პირის მფლობელობაში არსებული ვებ-გვერდების ბმულები, თქვენივე ინფორმირებულობის უზრუნველსაყოფად.<br />\\n&nbsp;<br />\\n8.2. მესამე პირის მფლობელობაში არსებული ბმულები და მათზე მითითებული ინფორმაცია, არ ექვემდებარება youthplatform.gov.ge კონტროლს, ხოლო მათზე მოცემული პროდუქტებისა და შინაარსის სიზუსტე არ წარმოადგენს youthplatform.gov.ge-ს პასუხისმგებლობის საგანს. შესაბამისად, თქვენ ხართ პასუხისმგებელი მესამე პირების რესურსებზე/ვებ-გვერდზე არსებული წესებისა და პირობების გაცნობაზე.&nbsp; </span></span></p>\\n\\n<p><br />\\n<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>9. მარეგულირებელი სამართალი და იურისდიქცია </strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">9.1.წინამდებარე წესები და პირობები რეგულირდება საქართველოს კანონმდებლობით.&nbsp; </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">9.2.დავის წარმოშობის შემთხვევაში, საქმეს განიხილავს საქართველოს საერთო სასამართლოების სისტემა კანონმდებლობით დადგენილი წესით. </span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">9.3. მხარეთა მიერ, პირობების შესრულების ადგილად მიჩნეულია საქართველო.</span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">9.4.წინამდებარე დანაწესების კონკრეტული ჩანაწერის ბათილობა არ იწვევს წესებისა და პირობების სხვა დათქმების ბათილობას.&nbsp; </span></span></p>\\n\\n<p><br />\\n<span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>10.</strong><strong> </strong><strong>ხელშეკრულების&nbsp;მოქმედების&nbsp;ვადა&nbsp;და&nbsp;შეწყვეტა</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">10.1. წინამდებარე წესების და პირობების ძალაში შესვლის შემდგომ ძალაში რჩება მომხმარებლის რეგისტრაციის გაუქმებამდე.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>11. </strong><strong>კონფიდენციალურობის&nbsp;პოლიტიკა.</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">11.1. გთხოვთ, ყურადღებით გაეცნოთ&nbsp;კონფიდენციალურობის პოლიტიკას ჩვენს ვებ-გვერდზე&nbsp; შესვლით და ვებ-გვერდით სარგებლობით თქვენ ადასტურებთ, რომ გაეცანით და ეთანხმებით ინფორმაციის დაცვის პოლიტიკის და ჩვენი ვებ-გვერდით სარგებლობის ყველა პირობას.</span></span></p>\\n\\n<p>&nbsp;</p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\"><strong>12. საკონტაქტო ინფორმაცია </strong></span></span></p>\\n\\n<p><span style=\\\"font-size:11pt\\\"><span style=\\\"font-family:Calibri,sans-serif\\\">ნებისმიერი კითხვის არსებობის შემთხვევაში, რაც უკავშირდება წინამდებარე წესებსა და პირობებს და ვებ-გვერდზე მითითებულ ინფორმაციას,&nbsp; გთხოვთ, მოგვმართოთ წერილობითი სახით მისამართზე: თბილისი, ვაჟა-ფშაველას 76ბ ან მოგვწეროთ ელექტრონული ფოსტის საშუალებით: d.kakava@youthagency.gov.ge</span></span></p>\"}', '2020-07-14 08:42:39', '2020-08-14 12:13:27');
INSERT INTO `study_cabinets` (`id`, `name`, `description`, `duration`, `team_size`, `activity_size`, `activity_level`, `image`, `user_id`, `company_id`, `status`, `created_at`, `updated_at`) VALUES
(1, '{\"ka\":\"asd\",\"en\":\"asdasd\"}', '{\"ka\":\"<p>asdasd&nbsp;Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do?<\\/p>\",\"en\":\"<p>asdasd&nbsp;Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do?<\\/p>\"}', 'asdasd', 'asdasd', 'asdasd', 'asdasd', '/storage/study_cabinet/FIZMClepvt5sIOQKi8kgOb4cwi4mrKZ8iTAbfsNx.jpeg', 937, NULL, 1, '2022-11-22 04:22:13', '2022-12-22 04:38:57'),
(2, '{\"ka\":\"zxczxc\",\"en\":\"zxczxc\"}', '{\"ka\":\"zxczxczx\",\"en\":\"zxczxczx\"}', 'zxcz', 'zxczxc', 'zxczxc', 'zxczxc', '/storage/study_cabinet/vB6HmP1DDzMXDjwkwadisCiYGC9ntdIoW0ghsqU9.jpeg', 937, NULL, 0, '2022-11-22 04:32:06', '2022-11-22 04:32:06'),
(3, '{\"ka\":\"Take a step forward\",\"en\":\"Take a step forward\"}', '{\"ka\":\"<p>Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do? &sect; What is your everyday life like now? Where do you socialise? What do you do in the morning, in the afternoon, in the evening? &sect; What sort of lifestyle do you have? Where do you live? How much money do you earn each month? What do you do in your leisure time? What you do in your holidays? &sect; What excites you and what are you afraid of?<\\/p>\",\"en\":\"<p>Instructions 1. Create a calm atmosphere with some soft background music. Alternatively, ask the participants for silence. 2. Hand out the role cards at random, one to each participant. Tell them to keep it to themselves and not to show it to anyone else. 3. Invite them to sit down (preferably on the floor) and to read their role card. 4. Now ask them to begin to get into role. To help, read out some of the following questions, pausing after each one, to give people time to reflect and build up a picture of themselves and their lives: &sect; What was your childhood like? What sort of house did you live in? What kind of games did you play? What sort of work did your parents do? &sect; What is your everyday life like now? Where do you socialise? What do you do in the morning, in the afternoon, in the evening? &sect; What sort of lifestyle do you have? Where do you live? How much money do you earn each month? What do you do in your leisure time? What you do in your holidays? &sect; What excites you and what are you afraid of?<\\/p>\"}', '60 minutes', '10-30', '1234', '1234', '/storage/study_cabinet/bx2afoGKqRv9LDBtaf0u1ccWVp2VTcsdhwJCFiVZ.jpeg', 944, NULL, 1, '2022-12-14 06:41:49', '2022-12-22 04:01:45'),
