(212, '{\"ka\": \"დოდო\"}', '{\"ka\": \"ჭუმბურიძე\"}', 0, '1978-05-27', NULL, 'ქალი', 'user_images/MyI8g5moXed6cbrwyIdVvlN3EALks2WLoYceb9PL.png', 'dodotchumburidze@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '593283092', '$2y$10$F1FbsudESliMl1M/IFWxy.fphTAW3RuMCf.VcMvr.MLMF2OZP7KPe', 1, NULL, NULL, 'ee3iQKCsZDXSfeZoepWAQy3UOklNsKoLvE90eCPSd9ljGQoI9I2MCiZGM4x1', '2020-08-01 14:25:23', '2021-11-10 21:39:32', NULL, 3, NULL, 'მოგესალმებით,  გააზრებული მაქვს რა ის გამოწვევები, რომელიც ეკისრება ახალგაზრდულ მუშაკს, მიმაჩნია, რომ ეს არის მომავლის პროფესია. მაქვს ახალგაზრდებთან მუშაობის გამოცდილება, ვფლობ ფორმალური და არაფორმალური განათლების, ასევე ზრდასრულთა განათლების პროგრამებში ჩართულობისათვის საჭირო ცოდნასა და გამოცდილებას.  ვფლობ მენეჯმენტის (ხელოვნების მენეჯმენტი) დოქტორის ხარისხს, ამჟამად ვარ საქართველოს შოთა რუსთაველის თეატრისა და კინოს სახელმწიფო უნივერსიტეტის ასოცირებული პროფესორი. ასევე ვფლობ ფსიქოლოგიის მაგისტრის ხარისხს.  ვმუშაობ ქ. თბილისის მუნიციპალიტეტის მერიის ა(ა)იპ „თბილისის ახალგაზრდული ცენტრების გაერთიანების“ არაფორმალური განათლებისა და ტრენინგ ცენტრის მენეჯერის პოზიციაზე, ჩემს მიმდინარე საქმიანობას წარმოადგენს არაფორმალური განათლების პოპულარიზაცია და არაფორმალური განათლების თანამედროვე სტანდარტების დანერგვის ხელშეწყობა, ახალგაზრების საჭიროებების კვლევა, რომლის შედეგების გათვალისწინებით ხორციელდება ახალგაზრდებისთვის ტრენინგებისა და საჯარო შეხვედრების შეთავაზება. ასევე ჩართული ვარ არაფორმალური განათლების კომპონენტის შემცვლელ სხვადასხვა აქტივობებში, კერძოდ ახალგაზრდული ბანაკების და გაცვლითი პროგრამების დაგეგმვასა და განხორციელებაში. მოხარული ვიქნები, თუ მომეცემა ახალგაზრდული მუშაკის მოსამზადებელ აკრედიტირებულ პროგრამაში მონაწილეობის შესაძლებლობა.  პატივისცემით,  დოდო ჭუმბურიძე', 'ხელოვნების მენეჯმენტის დოქტორი, ფსიქოლოგიის მაგისტრი', NULL),
