(224, '{\"ka\": \"დიანა\"}', '{\"ka\": \"ხურცილავა\"}', 0, '2020-08-03', '19001104023', 'მდედრობითი', 'user_images/2FkH3jI2A25yOoKR0mmDIEpHX3TP5ASYGzbosKwX.jpeg', 'dianakhurcilava@mail.ru', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '558114858', '$2y$10$O0Ms4JNYX5CdG.1TA/IvLuczpV7WJHVDDVKkQYme03VCTGVeWIGfq', 1, NULL, NULL, 'vZoH0eRaLvIche1ctOA6oz88xV0i26ztZSyZuVNVMsUBOWVWnQCJ01xyxVxY', '2020-08-05 04:15:11', '2020-08-05 04:15:11', 5, 5, NULL, 'მოგესალმებით,მე ვარ დიანა ხურცილავა, წარჩინებით დავამთავრე აკაკი წერეთლის სახელმწიფო უნივერსიტეტი . ფაკულტეტი აგრარული, სპეციალობით სასურსათო ტექნოლოგიის მაგისტრი, ხოლო ბაკალავრი ბიზნეს ადმინისტრირება ტურიზმში. სწავლების პერიოდში ვმუშაობდი სტაჟიორად ,,მშვიდობიან და საქმიან კავკასიაში“, სადაც რამოდენიმე პროექტში მივიღე მონაწილეობა. ვარ შრომისმოყვარე, კომუნიკაბელური, მიყვარს გუნდურად მუშაობა. ყოველ დიდ საქმეს მუდამ გულისყურით ვეკიდები, მუდმივად ვარ ახლის შემეცნებასა და ძიებაში. რაც შეეხება ჩემს სამუშაო გამოცდიელბას ვარ რესტორნის მენეჯერი,აგრეთვე ვმუშაობ კოლეჯში პედაგოგად. დამაინტერესა თქვენს მიერ გამოცხადებულმა ახალგაზრდა მუშაკის მოსამზადებელმა სასერთიფიკავიო პროგრამამ და მაქვს სურვილი გავხდე ახალგაზრდა მუშაკი და წვლილი შევიტანო იმ საზოგადო საქმეში, რაც ხორცილედება თქვენი ორგანიზაცის მიერ.', NULL, NULL),
