(412, '{\"ka\": \"გვანცა\"}', '{\"ka\": \"კვარაცხელია\"}', 0, NULL, '51001030277', 'მდედრობითი', 'images/default-avatar.png', 'gvanci.kvaratskhelia@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '592464754', '$2y$10$kIM4utm9pe99W3JeT0eS4uP74GcpPV4EVLJCUTCaFtAZThs3LOvSG', 1, NULL, NULL, '7HV4RRiT5llugWcD4bswdAcvFbATsWwAR2R9z7xnmXYri7RXzJOnAZuZ0BRX', '2021-02-28 16:45:39', '2021-02-28 16:45:39', 5, 4, 4, 'ვარ ძალიან მიზანდასახული და პასუხისმგებლობის მაღალი შეგრძნებით,რაც აუცილებლად შემიწყობს ხელს საკუთარ თავზე აღებული მოვალეობის შესრულებაში.აქტიურად ვერთვები სხვადასხვა სახის სტუდენტურ ტრენინგებსა,კონფერენციებსა თუ სემინარებში.მოხალისეობრივ საქმიანობას ვეწევი არაერთი ახალგაზრდული აქტივობის დაგეგმვასა და ორგანიზებაში.მინდა ჩემს შესახებ მოგიყვეთ. ვსწავლობ საქართველოს უნივერსიტეტის იურიდიულ ფაკულტეტზე. ჩემი პროფესია მეხმარება ადამიანების მარტივად გაგებაში და მათთან ურთიერთობაში .მე ვიცი, რომ ჩემი პროფესია რთულია, მაგრამ ამ საშუალებით შეუძლია კარგი ურთიერთობა წარმართოს ნებისმიერ ხალხთან, განსხვავებული წარმოშობის, სხვადასხვა შესაძლებლობების, სხვადასხვა ქვეყნის და სხვადასხვა ინტერესის მქონე ადამიანებთან. ჩემი პროფესია არის ის, რომ ვხედავ ჩემს მომავალსრამდენიმე ენაზე ლაპარაკი: ინგლისურად, გერმანიით, ესპანურად, რუსულად. იმედი მაქვს, რომ კომუნიკაცია ძალიან კარგია.სოციალურად აქტიური ვარ და სხვადასხვა პროექტებში ვმონაწილეობ. ბანაკის ხელმძღვანელი, სადაც საქმე მაქვს ახალგაზრდებთან. და ბევრ სხვა პროექტში, მე ვავითარებ უნარ-ჩვევებს. ყოველთვის ვცდილობ დაკავებული ვიყო და სხვადასხვა საქმიანობაში ვიყო ჩართული. როდესაც მსოფლიო პანდემია მძვინვარებს, ასეთ დროსაც ვახერხებ აქტიურობას. ტრენინგები გავლილი მაქვს რამდენიმე ქვეყანაში.', 'საქართველოს უნივერსიტეტი', NULL),
