(841, '{\"ka\": \"ნანი\"}', '{\"ka\": \"მოდებაძე\"}', 0, NULL, '54001057871', 'მდედრობითი', 'images/default-avatar.png', 'nanomodebadze30@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '598140343', '$2y$10$Rneg4ulEY09AsTtBfUP1oe5N6lQYA/5jcLKhW9UQz5f6AzZbPKWXy', 1, NULL, NULL, 'hTyNAa2YVHMSrweYdl5zaWDwZ7FAMwVYUkrnogu1o0aJRPbhzC1LO9M73642', '2021-10-31 09:19:59', '2021-10-31 09:19:59', 6, 6, 4, 'ჩემი საქმიანობა ყველასათვის კარგად ნაცნობ თემას მოიცავს.  ვამზადებ ბავშვებს ქართულ ენასა და ლიტერატურაში, ეროვნული გამოცდებისათვის და ასევე დაწყებითი კლასის მოსწავლეებს სხვადსხვა საგნებში. პანდემიამ უშუალოდ განაპირობა ჩემი ეს გადაწყვეტილება. ვხედავდი, რომ აბიტრუეინტებს მომზადების სურვილი ჰქონდათ, მაგრამ შესაძლებლობა - არა. ამიტომაც, პირველ წელს რამდენიმე აბიტურიენტი სრულიად უფასოდ მოვამზადე ქართულ ენაში. მგონი ეს ის საქმეა, რაც პროფესიულად განვითარების საშუალებასაც მაძ₾ევს და, ამავდროულად, შანსს ვიყო კარგი მოხალისე.', 'ვსწავლობ ივანე ჯავახიშვილის თბილისის სახელმწიფო უნივერსიტეტში, ქართული ფილოლოგიის მიმართულებით.', NULL),
