(852, '{\"ka\": \"იაკობ\"}', '{\"ka\": \"გაზდელიანი\"}', 0, NULL, '01001069000', 'მამრობითი', 'images/default-avatar.png', 'iakobgazdeliani15@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '591656303', '$2y$10$Me8cM2AqXfUA1.vWxsLR4uBc929vxwvYd9leDDMo2bSa8kuUhGBKK', 1, NULL, NULL, 'CknYBndjB9GTnK8LGsCLRtbCrzOB0NG9tmVOQnxHfvWEgqozQWYSO6Wm0Ke5', '2021-11-07 11:54:26', '2021-11-07 11:54:26', 5, 3, NULL, 'ვარ მოწვეული სპეციალისტი , ვეწევი სამწვრთვნელო-საგანმანათლებლო მოღვაწეობას ლენტეხის რაიონში , ძიუდო, სამბო , ქართული ჭიდაობა. 2019 წელს , თბილისიდან ლენტეხში გადავედი მეუღლესა და მცირეწლოვან ბავშვთან ერთად , სადაც შევუდექი საჭიდაო საქმიანობის განვითარებას . საწყის ეტაპზე მოსწავლეების რაოდენობა შეადგენდა 5 და ამჟამად მოსწავლეთა რაოდენობა არი-60 . სპორტსმენები მონაწილოეობას ღებულობენ სხვადასხვა საერთაშორისო შეჯიბრებაზე და აღწევენ წარმატებებს . გვყავს საქართველოს პრიზიორი და ჩემპიონები , ევროპისა და მსოფლიოს ჩემპიონი -სამბოში  . სპორტის ეს სახეობები საკმაოდ პოპულარული გახდა , როგორც რაიონში , ასევე რეგიონიში . სპორტულ წარმატებებთან ერთად ჩემთვის პრიორიტეტულია ჯანსაღი ცხოვრების პოპულარიზაცია.', 'ვსწავლობ IJF academi-მსოფლიო ძიუდოს აკადემიაში მწვრთნელ-ინსტრუქტორის კვალიფიკაციის ასამაღლებელ კურსზე .', NULL),
